INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19, 'ESPINOLA, Francisco "Paco" ', 'Nacido en San José, Uruguay, el 4 de octubre de 1901 y fallecido en Montevideo, Uruguay el 26 de junio de 1973. Escritor, periodista y docente perteneciente a la "Generación del Centenario" ó "Generación del 30". Dentro de sus obras se destacan: "Raza ciega" (cuentos, 1926), "Saltoncito" (novela, 1930), "Sombras sobre la tierra" (novela, 1933), "El rapto y otros cuentos" (cuentos, 1950), "Don Juan el Zorro" (novela, 1984), "Las veladas del fogón" (1985), "Qué lástima" y "Los cinco" (pertenecen a "El rapto").\r\nRecibe el Premio Nacional de Literatura en el año 1961.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34, 'GARCIA MARQUEZ, Gabriel ', 'Nombre propio y forma no usada: GARCIA MARQUEZ, Gabriel José de la Concordia. Nacido en Aracataca (Colombia) el 6 de marzo de 1927 y fallecido en México el 17 de abril de 2014. Escritor, novelista, cuentista, guionista, periodista y editor. Entre los numerosos galardones que obtuvo en vida se encuentra el Premio Nobel de Literatura. Su novela más conocida es "Cien años de soledad", obra representativa de su estilo literario.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45, 'PORTILLO, Alvaro ', 'Nacido en Montevideo, Uruguay, en 1948. Responsable de la Cátedra de Sociología en la Facultad de Arquitectura. Director Ejecutivo del Instituto de Teoría y Urbanismo de la Facultad de Arquitectura. Fue Director de Programas Sociales en el gobierno departamental de Montevideo de Tabaré Vazquez. Ex Director de Asuntos Consulares y Vinculación del Ministerio de Relaciones Exteriores. Miembro del Partido Socialista del Uruguay. Forma no usada: PORTILLO, Alvaro José.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (48, 'SANGUINETTI, Julio María ', 'Nacido en Montevideo en 1936. Abogado, historiador, periodista y político uruguayo. Desempeñó diversos cargos gubernamentales. Fue tres veces diputado, dos veces ministro, senador y Presidente de la República en dos períodos, 1985-1990 y 1995-2000. Miembro del sector "Foro Batllista" del Partido Colorado, del cual fue Secretario General de 1983 a 1985 y de 2004 a 2009.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65, 'ABELENDA, Aquiles ', 'Nacido en Salto, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77, 'CORREA FREITAS, Ruben ', 'Nacido el 12 de marzo de 1949 en Paso de los Toros, Departamento de Tacuarembó, Uruguay. Doctor en Derecho y Ciencias Sociales. Senador de la República por el Partido Colorado en el período 2000-2005. Profesor de la Cátedra de Derecho Constitucional en la Facultad de Derecho y Ciencias Sociales de la Universidad de la República. Director de la ONSC (Oficina Nacional del Servicio Civil). Presidente del Centro Latinoamericano de Administración para el Desarrollo (CLAD), con sede en Caracas, Venezuela.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78, 'MARTINS, Daniel Hugo ', 'Nacido en Montevideo, Uruguay.Abogado egresado de la Universidad de la República, Udelar. Profesor de Derecho Administrativo en la Facultad de Derecho de la Universidad de la República. Ex Ministro de Hacienda y de Defensa Nacional y Ex Presidente del Banco Central y del Banco de la República Oriental del Uruguay. Ex Miembro de la Comisión Internacional de Derecho que redactó el proyecto de la Convención Interamericana (Pacto de San José de Costa Rica). Ex Miembro del Tribunal Arbitral Internacional de Salto Grande. Miembro del Consejo Asesor del Anuario de Justicia Constitucional (México) y Miembro correspondiente de la Academia Nacional de Derecho y Ciencias Sociales de Buenos Aires. Co-Director de la Revista "La Justicia Uruguaya".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (106, 'MAÑE GARZON, Fernando Timoteo ', 'Médico pediatra, parasitólogo e historiador de la ciencia, nacido en Montevideo, Uruguay, en 1925. Adquirió una sólida formación biológica, perfeccionándose en París. Director y Profesor Titular de Zoología de la Facultad de Humanidades y Ciencias (UDELAR). Miembro Titular de la Academia Nacional de Medicina (Uruguay) y de la Academia Riale de Medicina de Catalunya. Creador, en Uruguay, de la Genética Clínica. Autor de trabajos de investigación sobre diversas disciplinas: biología, sistemática, genética de poblaciones, clínica pediátrica, entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110, 'PASCALE, Ricardo ', 'Nacido en Montevideo (Uruguay) en 1942. Doctor en Sociedad de la Información (Economía Aplicada) por la Universidad de O. de Cataluña, Barcelona España. Posdoctorado en Finanzas, University of California, Los Angeles, (UCLA). Catedrático Finanzas de Empresas en la Facultad de Ciencias Económicas y Administración de la Universidad de la República, Uruguay. Ocupa el cargo de Presidente del Banco Central del Uruguay entre 1985-1990 y 1995-1996, es bajo su presidencia y por sugerencia de Jorge Abbondanza, que se crea el Premio Pedro Figari en Artes Visuales. Publicó "Decisiones Financieras". Asesor del Banco Mundial, Banco Interamericano de Desarrollo, Aladi, Naciones Unidas. Miembro de American Economic Association, American Finance Association, Joseph A. Schumpeter International Society. Recibió distinciones tales como: Premio Rioplatense Rotary Club, otorgado por el Rotary Club de Buenos Aires y el Rotary Club de Montevideo, Caballero de la República de Italia.\r\nComo artista, en la época en que aún era parte del Banco Central, ingresó al Centro de Expresión Plástica que dirigía Nelson Ramos, en donde trabaja durante cuatro años, trabajando en dibujos a la crayola, el collage al grabado, óleo, acrílico, acuarela y técnicas mixtas. Posteriormente comienza a realizar esculturas en madera, hierro y textiles. En 1995 realiza su primera muestra individual. Despues de eso sus obras han estado en Museos de Arte en el país y en el exterior (Argentina, España, Chile, Perú, México, Ecuador, Paraguay, Alemania, etc.).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (129, 'NOTARO, Jorge ', 'Contador. Economista. Profesor Grado 5 Nivel I del Sistema Nacional de Investigadores y Profesor del Instituto de Economía. Autor de publicaciones y presentaciones de temas relacionados con política económica y también con trabajo, empleo y relaciones laborales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (135, 'AGUIRRE RAMIREZ, Gonzalo ', 'Nacido en Montevideo, Uruguay en 1940. Abogado. Político uruguayo, vicepresidente de la República (1990-1995) y senador del Partido Nacional (1985-1990).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (156, 'RAMA, Angel ', 'Nombre propio y forma no usada: RAMA FACAL, Angel Antonio. Nacido en Montevideo, Uruguay, el 30 de abril de 1926 y fallecido en Madrid, España, el 27 de noviembre de 1983. Escritor, crítico literario, profesor y actor. Ejerció la crítica literaria en el diario "El País", en "Marcha", y en un gran número de revistas nacionales y extranjeras. Fue también narrador y dramaturgo. Entre 1945 y 1947 se desempeñó como traductor del francés al español en la agencia internacional France-Presse. Desde comienzos de la década del setenta amplió fuera de fronteras su actividad en los campos del periodismo, la docencia y la actividad editorial. Desde 1974 dirigió la "Biblioteca Ayacucho", editada en Venezuela.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108481, 'CRUZ, Henrique DÍAS da ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108485, 'SALA, Gustavo ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (157, 'ALBISTUR, Jorge ', 'Nacido en Montevideo, Uruguay, en 1940. Crítico y ensayista. Ejerció la docencia universitaria hasta su retiro en 1997, siendo profesor titular Grado 5 de Literatura española en la Facultad de Humanidades de la Universidad de la República. Colaboró con revistas nacionales y extranjeras. Tiene una prolífica producción de prólogos, introducciones y cuadernos de apoyo didáctico para alumnos de Enseñanza Media, con textos anotados y seleccionados.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (212, 'ETCHEGARAY, Alfredo ', 'Experto en Marketing y Relaciones Públicas. Empresario, docente, periodista, investigador de arqueología subacuática, asesor de proyectos de inversión.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (230, 'LARRAÑAGA ZENI, Nelson ', 'Doctor en Derecho (1981). Desde entonces se ha dedidado a la especialización en Derecho del Trabajo, Relaciones Laborales y Derecho de la Seguridad Social. Fue consultor externo de la OIT en temas vinculados a las relaciones colectivas y al Derecho de la Seguridad Social. Se desempeño como Profesor Adjunto (grado 3) en Derecho Laboral y Seguridad Social en la Universidad de la República (1983-2002). También fue Profesor Adjunto en Derecho Laboral y Seguridad Social en la Universidad Católica Dámaso A. Larrañaga (1993-1997). Es autor de más de diez libros en los campos que se especializó. Ha publicado numerosos artículos en revistas tales como "Derecho laboral" ; " Derecho y Tribunales" ; "La Ley" ; "Relaciones Laborales" ; "Tribuna del Abogado" ; "Doctrina y Jurisprudencia".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (239, 'ROSA, Julio C. DA ', 'Nombre propio y forma no usada: ROSA, Julio César DA. Nacido en Costas de Porongos, departamento de Treinta y Tres (Uruguay) el 9 de febrero de 1920 y fallecido en Montevideo en 2001. Escritor. Sus publicaciones: Cuesta arriba - Camino adentro - Recuerdos de Treinta y Tres - Juan de los Desamparados - Ratos de padre - Civilización y terrofobia - Rancho amargo - Buscabichos - Mundo chico - Rumbo Sur - Tata viejo - Hombre-flauta. Fue diputado del partido Colorado en el período 1963-1966. Director de CX32, de la División Cultura de la Intendencia Municipal de Montevideo y del Servicio de Espectáculos de la misma. Por su obra literaria recibió varios premios.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (252, 'SZAFIR, Dora', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (267, 'GARCIA LORCA, Federico ', 'Nacido en Fuente Vaqueros, Granada, España, el 5 de junio de 1898 y fallecieo en Víznar, Granada, España, el 18 de agosto de 1936. Poeta, dramaturgo y proosita. Adscrito a la llamada Generación del 27, es el poeta de mayor influencia y popularidad de la literatura española del siglo XX. Como dramaturgo, se le considera una de las cimas del teatro español del siglo XX, junto con Valle-Inclán y Buero Vallejo. Murió fusilado tras la sublevación militar que dio origen a la Guerra Civil Española.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (275, 'VARELA-MENDEZ, Edgar J. ', 'Uruguayo. Abogado. Catedrático de Derecho Procesal en la Facultad de Ciencias Jurídicas de la Universidad de la Empresa. Director del Instituto Uruguayo de Derecho Procesal. Coordinador y Profesor del Curso para Graduados de Derecho de Arrendamientos y Procesos Arrendaticios Urbanos. Profesor del Centro de Estudios Judiciales del Uruguay, módulo Procesos de Desalojo Urbano. Ex Profesor asociado de Propiedad Horizontal y Locación Urbana en la Facultad de Derecho de la Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (278, 'STIPANICIC BARGES, Emma ', 'Profesora Agregada de Derecho Procesal y Profesora Titular de Técnica Forense de la Facultad de Derecho de la Universidad de la República, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (298, 'MAZZ, Addy', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (327, 'BUSQUETS, José Miguel ', 'Nombre propio y forma no usada:	BUSQUETS APOLITO, José Miguel. Nacido en Montevideo, Uruguay, en 1960. Profesor agregado e investigador del Instituto de Ciencia Política de la Facultad de Ciencias Sociales y del área Socio-Jurídica-Ciencia Política de la Facultad de Derecho de la UdelaR (Universidad de la República, Uruguay). Doctor en Ciencia Política por IUPERJ (Instituto Universitário de Pesquisas do Rio de Janeiro) de Brasil. Investigador activo, nivel 1, del Sistema Nacional de Investigadores (SNI) de la Agencia Nacional de Investigación e Innovación (Uruguay). Ha publicado artículos, capítulos de libros y libros sobre políticas públicas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (351, 'ARAUJO, Ana María ', 'Doctorado en Ciencias Sociales (Universidad Sorbonne Nouvelle, París). Máster en Filosofía (Universidad René Descartes, Strasbourg, Francia). DEA (posgrado) en Psicología de EHESS, París. Profesora Titular de la Facultad de Psicología de la Universidad de la República. Miembro de la Directiva del Instituto Fundamentos y Métodos de la Psicología.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (353, 'MORAS, Luis Eduardo ', 'Doctor en Sociología por el Instituto Universitario de Pesquisas de Rio de Janeiro (IUPERJ). Profesor Titular (Grado 5) de Sociología y Director del Instituto de Sociología Jurídica de la Facultad de Derecho de la Universidad dela República, Uruguay. Profesor Agregado de Sociología y de Metodología. Profesor Invitado en Cursos, Tribunales y tutorías de tesis a nivel de Maestría y Doctorado en Universidades de Uruguay, Argentina, Brasil y México. Investigador del Sistema Nacional de Investigadores de la Agencia Nacional de Investigación e Innovación (ANII). Evaluador de Proyectos de Investigación y Arbitrajes de artículos en revistas científicas de Argentina, Brasil, Estados Unidos, México, Paraguay y Uruguay. Autor de numerosos libros y artículos sobre violencia social, seguridad ciudadana, derechos humanos y políticas sociales, entre los cuales se destacan "Los Hijos del Estado" y "De la Tierra Purpúrea al Laboratorio Social : reformas y proceso civilizatorio en el Uruguay". Ganador del Premio Anual de Literatura en Ciencias Sociales y Jurídicas en dos oportunidades otorgado por el Ministerio de Educación y Cultura uruguayo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (395, 'GAMARRA, Jorge ', 'Nació el 15 de julio de 1922, egresó de la Facultad de Derecho de la Universidad de la República en el año 1947.\r\nProfesor emérito de la Facultad de Derecho de la Universidad de la República Oriental del Uruguay.\r\nProfesor Honorario de la Facultad de Derecho de la Universidad de Buenos Aires.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (398, 'GIOVANETTI VIOLA, Hugo ', 'Escritor uruguayo nacido en 1948. Ha incursionado en narrativa, poesía, canción popular, ensayo, teatro, cine, periodismo y producción cultural. Profesor de guitarra en la escuela de Olga Pierri. En 2005 funda, con el cineasta Alvaro Moure Clouzet, "elMontevideano" Laboratorio de artes y en 2010 la Escuela de Cineastas del Uruguay. Co-fundador y redactor, en 1970, de la revista "Universo". Algunas de sus novelas fueron adaptadas al cine y al teatro.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (399, 'RIBEIRO, Ana ', 'Licenciada en Historia por la Universidad de Salamanca. Historiadora y docente de la Universidad Católica del Uruguay. Recibió el premio Morosoli de la Fundación Lolita Ruibal y el premio Ariel del Ateneo, ambos por su trayectoria. Ha dictado cursos y conferencias en diversas universidades de América y Europa.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (418, 'SAVATER, Fernando ', 'Nacido en San Sebastián, España, en 1947. Estudió filosofìa en la Universidad Complutense de Madrid. Profesor de la Universidad Autónoma de Madrid. Desde 1984 fue Catedrático de Etica en la Universidad del País Vasco y, hasta su jubilación, estuvo a cargo de la Cátedra de Filosofía y Literatura en la Universidad Complutense de Madrid. Ha publicado ensayos de filosofía y literatura, novelas y piezas teatrales. Su obra ha sido traducida a más de veinte lenguas. Doctor honoris causa por diversas universidades hispanoamericanas y europeas. Posee la Orden del Mérito Constitucional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108486, 'HILLEL, Colette ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108488, 'IBARGUREN ALZAIBAR, Juan Carlos ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (428, 'RIPPE, Siegbert ', 'Nombre completo (forma no usada): RIPPE KAISER, Siegbert. Abogado, Doctor en Derecho y Ciencias Sociales y Máster en Administración Pública. Diplomado en Finanzas. Docente y consultor en temas empresariales y negocios.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (456, 'BENEDETTI, Mario ', 'Nacido en Paso de los Toros, Tacuarembó, Uruguay, en 1920 y fallecido en Montevideo el 17 de mayo de 2009. Dramaturgo, ensayista, poeta y novelista. Residió en Buenos Aires entre 1938 y 1941y en Argentina, Perú, Cuba y España después de 1973. Integró en 1945 la redacción del semanario uruguayo "Marcha". Premios: Premio Llama de Oro de Amnistía Internacional (1987); Premio Reina Sofía de Poesía Iberoamericana (1999); Premio Internacional Menéndez y Pelayo (2005). Obtuvo cuatro Doctorados Honoris Causa otorgados por las Universidades de Alicante, de Valladolid, de La Habana y de la República de Montevideo. Bibliografía : Sólo mientras tanto - Poemas de la oficina - Montevideanos - La tregua - Inventario - Gracias por el fuego - El cumpleaños de Juan Angel - La borra del café - El mundo que respiro -  Adioses y bienvenidas - Vivir adrede - Testigo de uno mismo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (463, 'POE, Edgar Allan ', 'Nacido en Boston, Estados Unidos, en 1809 y fallecido en Baltimore, Estados Unidos, en 1849. Escritor, poeta, crítico y periodista romántico, generalmente reconocido como uno de los maestros universales del relato corto, del cual fue uno de los primeros practicantes en su país. Creador del género policial. Autor de un conjunto de historias de horror y misterio.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (471, 'OLIVERO ORECCHIA, José María ', 'Licenciado en Historia, egresado de la Universidad de la República, Uruguay. Asesor en Museología. Docente de la Universidad de Montevideo. Profesor de Historia Militar y Profesor de Conflictos Armados en el IMES (Instituto Militar de Estudios Superiores). Asesor en el film "La Redota".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (483, 'RIVERO DE ARHANCET, Mabel ', 'Abogada. Directora de la Defensoría de Oficio de Familia y Menores. Profesora grado 5 de Derecho Privado VI (familia y sucesiones) en la Facultad de Derecho de Montevideo. Integra la Comisión de Reforma del Código del Niño. Miembro de la Comisión Nacional de la Familia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (505, 'CAETANO, Gerardo ', 'Nacido en Montevideo, Uruguay, en 1958. Historiador y analista político. Doctor en Historia. Director del Instituto de Ciencia Política de la Universidad de la República e investigador principal en el Centro Latinoamericano de Economía Humana, Uruguay. Investigador Nivel III del Sistema Nacional de Investigadores. Académico de Número en la Academia Nacional de Letras.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (508, 'MIERES, Pablo ', 'Abogado, egresado de la Universidad de la República (Uruguay). Grado en Sociología para el Desarrollo (CLAEH). Investigador del Sistema Nacional de Investigadores (ANII). Director de la Licenciatura en Ciencias Sociales de la Universidad Católica del Uruguay. Director de la maestría en Comunicación Política y Gestión de Campañas Electorales, Universidad Católica del Uruguay e Instituto de Investigación Ortega y Gasset de Madrid. Presidente del Partido Independiente, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (531, 'MAGGI, Carlos ', 'Nacido en Montevideo (Uruguay) en 1922. Escritor, ensayista, autor teatral. Columnista del diario El País (Montevideo, Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (532, 'BAUMGARTNER, José Luis ', 'Abogado, periodista y escritor. Ocupó la Secretaría Letrada de la Corte Electoral. Fue editor del diario "Ya" entre 1970 y 1971y periodista en el quincenario "Mate Amargo". Ha publicado en colaboración "América Latina, Liberación Nacional" (1985) y "Desaparecidos" (1986). Autor de: "El contador de cuentos" (1987), "Mamá Julien" (1988), "El asunto y otros asuntos" (1990), "Una gasa leve" (1995), "En la boca del lobo" (2004), "Historia del despótico Melgarejo y su letal amante" (2008), entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (534, 'FRESNEDO DE AGUIRRE, Cecilia ', 'Doctora en Derecho y Ciencias Sociales, egresada de la Facultad de Derecho de la Universidad de la República, Uruguay. Realizó trabajos de investigación como becaria Fullbright en la Universidad de Calidornia en Davis, y como becaria en Unidroit, Roma. Profesora Agregada de la cátedra de Derecho Internacional Privado de la Facultad de Derecho de la Universidad de la República (UDELAR). Su tesis "La Autonomía de la Voluntad en la Contratación Internacional" mereció el "Premio Unico en Obras de Ciencias Sociales y Jurídicas", otorgado por el Ministerio de Educación y Cultura. Corresponsal de Unidroit en Uruguay, miembro de diversas instituciones académicas nacionales y extranjeras, integrante de los Consejos de Redacción de varias revistas especializadas. Evaluadora de la Revista de Derecho (arbitrada) de la Universidad Católica del Uruguay y Miembro de su Consejo Asesor Nacional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (542, 'GROMPONE, Juan ', 'Nombre propio y forma no usada: GROMPONE CARBONELL, Juan Arturo. Otras formas no usadas: GROMPONE, Juan A. y GROMPONE, Juan Arturo. Nacido en Montevideo, Uruguay, en 1939. Ingeniero industrial, profesor, informático y escritor uruguayo. Ha escrito artículos y libros de lógica, epistemología, divulgación científica, literatura y otras áreas. Obtuvo el Primer Premio en Narrativa, otorgado por el MEC (Ministerio de Educación y Cultura, Uruguay) en 1991. Miembro de la Academia de Ingeniería y Miembro de la Academia Nacional de Letras.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (569, 'LAGO, Sylvia ', 'Nacida en Montevideo, Uruguay, en 1932. Egresada del Instituto de Profesores Artigas (IPA), ejerció la docencia en Enseñanza Secundaria, Terciaria y Universitaria. Directora del Departamento de Literaturas Uruguaya y Latinoamericana y Catedrática de Literarura Uruguaya en la Facultad de Humanidades de la Universidad de la República, Uruguay. Autora de novelas y relatos, algunas de sus narraciones fueron traducidas en otras lenguas. Por voluntad del autor, expresada en su testamento es, desde 2009, Presidenta de la Fundación Mario Benedetti. Recibió el Premio a la trayectoria narrativa "Juan José Morosoli".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (572, 'CAMPODONICO, Miguel Angel ', 'Nacido en Montevideo (Uruguay) en 1937. Periodista y autor de cuentos, ensayos y novelas que ha recibido varios premios. Bibliografía.: "Donde llegue el Río Pardo" (1980), "Descubrimiento de cielo" (1986), Mujica (1999, 2005, 2009, 2014), "Las vidas de Rosencof" (2000 y 2003), "Antes del silencio" (2003), "Después del día diez" (2003), "Nuevo diccionario de la cultura uruguaya" (2003), "Palabra de Robles" (2007), entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (595, 'ROSENCOF, Mauricio ', 'Nacido en Florida (Uruguay) en 1933. Escritor y periodista. Ex dirigente del Movimiento de Liberación Nacional - Tupamaros (MLN-T). Entre sus obras publicadas "El regreso del Gran Tuleque", "La rebelión de los cañeros"; "El Bataraz"; "Las cartas que no llegaron"; "Piedritas bajo la almohada"; "El Enviado del Fuego"; "El barrio era una fiesta"; "Vincha Brava"; "La Margarita".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (601, 'AYESTARAN, Angel ', 'Nacido en Montevideo, Uruguay, en 1956. Académico, historiador y periodista. Director del Museo Histórico Nacional. Miembro de la Comisión del Patrimonio Cultural de La Nación. Miembro de la Comisión Nacional "Archivo Artigas" y Consejero del Sistema Nacional de Información. Ha publicado varios trabajos y libros en el Uruguay y en el exterior.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11650, 'POU FERRARI, Ricardo ', 'Nacido en Montevideo, Uruguay, en 1948. Egresado de la Facultad de Medicina de Montevideo en 1972. Ginecotólogo, dedicado a la endocrinología ginecológica. Docente de Historia de la Medicina. Premio Nacional de Medicina de 1987 y 1997. Miembro de la Sociedad Uruguaya de Historia de la Medicina');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109046, 'CURY, Augusto ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (616, 'BAUZA, Francisco ', 'Nació en 1849 en Montevideo, Uruguay. Se inició en la política y en el periodismo como militante del Partido Colorado. Aportó sus ensayos a dirversos periódicos consagrándose como escritor y polemista. Fue también representante, senador, ministro y candidato a la presidencia en Uruguay, y ministro en Brasil.\r\nEn sus libros publicados ha dejado plamada la realidad uruguaya de su tiempo, encontrándose valiosos estudios de carácter económico, social, jurídico, literario, pedagógico e histórico');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (664, 'ORDOQUI CASTILLA, Gustavo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (665, 'LANGON CUÑARRO, Miguel A. ', 'Catedrático de Derecho Penal y Criminología.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (673, 'PLA RODRIGUEZ, Américo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (840, 'LESCANO, Héctor ', 'Senador (2010-2015), ex diputado. Ex Ministro de Turismo y Deporte. Presidente de la Comisión Nacional de Programa del Frente Amplio, Partido Demócrata Cristiano.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (854, 'RAFFO, Juan Carlos ', 'Nacido en Montevideo, Uruguay, en 1946. Cursó estudios en la Facultad de Derecho, UDELAR. Se dedicó a actividades empresariales hasta 1989. Fue electo senador por el Partido Nacional por el período 1990-1995 y Representante Nacional por Montevideo por el período 1995-2000. Ministro de Transporte y Obras Públicas entre 1993-1994. Integró el Directorio del Partido Nacional. Analista y asesor independiente en temas referidos al gobierno y a la comunicación. Ha publicado artículos periodísticos en diversos medios y escrito obras de ficción (novelas y cuentos).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (877, 'RODRIGUEZ OLIVERA, Nuri', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (932, 'ADRIASOLA, Gabriel ', 'Abogado. Profesor de posgrado de la Universidad Católica del Uruguay, Universidad de Montevideo y de la Universidad Austral de Buenos Aires. Profesor de Derecho Penal del CLAEH. Asesor del Tribunal de Etica Médica de la Federación Médica del Interior. Juez Letrado en lo Penal. Asesor del Gobierno Departamental de Maldonado. Docente colaborador de la Cátedra de Medicina Legal de la Facultad de Medicina, UDELAR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (965, 'LICANDRO, Oscar ', 'Nombre propio y forma no usada: LICANDRO, Oscar D. Licenciado en Sociología por la Universidad de la República (Uruguay).  Magister en Administración Internacional (MIM) en la Universidad de San Thomas (Estados Unidos). Profesor titular del Seminario de Marketing Social y del Seminario de Tesis de la Universidad Católica de Uruguay. Dirige tesis sobre Responsabilidad Social y Marketing Social. Consultor de empresas (Grupo BBVA). Ha escrito artículos sobre acción social corporativa, en publicaciones periódicas y prensa uruguaya. Coordinador del Programa de Investigación en Responsabilidad Social, Universidad Católica del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (968, 'VAZ FERREIRA, María Eugenia ', 'Nacida y fallecida en Montevideo, Uruguay (13 de julio de 1875 - 20 de mayo de 1924). Profesora, poetisa y dramaturga.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (983, 'CAJARVILLE PELUFFO, Juan Pablo ', 'Abogado. Ex-catedrático de Derecho Administrativo y ex-Director del Instituto de Derecho Administrativo de la Facultad de Derecho, Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1001, 'RUBIO, Enrique ', 'Nacido en Florida, Uruguay, en 1943. Profesor de Historia. Fundador del Frente Amploo y de los Grupos de Acción Unificadora (GAU), es el presidente de la Vertiente Artiguista. Integra la dirección de la Fundación Líber Seregni. Legislador desde 1995 a la acutalidad (2014). Ocupó el cargo de Director de la Oficina de Planeamiento y Presupuesto durante el gobierno de Tabaré Vázquez (2005-2010).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1048, 'VILARIÑO, Idea ', 'Nacida en Montevideo, Uruguay, el 18 de agosto de 1920 y fallecida en la misma ciudad el 28 de abril de 2009. Poeta, crítica, traductora y docente. Profesora de Literatura en Enseñanza Secundaria desde 1952 hasta 1973. Restablecida la democracia, accede por concurso al cargo de Profesora Adjunta de Literatura uruguaya en la Facultad de Humanidades, del cual se retira en 1988. Ya en 1970 había dictado un cursillo en el Departamento de Literatura Iberoamericana de dicha facultad sobre "Problema de métrica y de ritmo en la poesía de Darío". Su preocupación por la materia se ha puesto de manifiesto en diversos trabajos especializados, desarrollando una importante obra ensayística y crítica. Otro de los rasgos salientes de su trayectoria intelectual ha sido su intensa labor como traductora. Fundó y dirigió junto a otros escritores de la denominada generación del 45, la revista "Número" en su primera época (1949-1955). Ha colaborado en diversas publicaciones periódicas. Es una de las fundamentales voces femeninas de la lírica hispanohablante de la segunda mitad del siglo XX.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1149, 'MASTRANGELO, Stella', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1184, 'CERVINI, Raúl ', 'Docente Facultad de Derecho, Udelar. Catedrático, docente de posgrado y director del Departamento Penal de la Facultad de Derecho de la Universidad Católica del Uruguay. Secretario General para América Latina y Vicepresidente del Consejo Consultivo Internacional del ICEPS (International Center of Economic Penal Studies, New York)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1224, 'ZUBILLAGA, Carlos ', 'Nombre propio completo y forma no usada: ZUBILLAGA BARRERA, Carlos A. Licenciado en Ciencias Históricas (Udelar) y Doctor en Historia (UBA), se desempeña como Profesor Titular de Teoría y Metodología de la Historia en la Facultad de Humanidades y Ciencias de la Educación, Udelar. Es investigador del Sistema Nacional de Investigadores (ANII).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1286, 'ABAL OLIU, Alejandro ', 'Profesor titular de Derecho Procesal, Facultades de Derecho de Udelar y CLAEH. Integrante del Sistema Nacional de Investigadores de la ANII.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1323, 'AMEZAGA, Juan José De ', 'Forma usada del nombre Juan José de Amézaga. En sus obras figura como Juan José Amézaga (forma no usada) \r\nNacido en Montevideo,1881-1956. Nombre propio completo:  Juan José de Amézaga Landabaso (forma no usada) político y jurista uruguayo. Presidente Constitucional de Uruguay desde el 1 de marzo de 1943 al 1 de marzo de 1947.\r\n Recibió el título de abogado en 1905. Obtuvo una beca para continuar estudios en Europa (1906-1907) permaneciendo casi dos años donde realizó estudios en la Sorbona y en la Universidad de Berlín, entrando en contacto con las experiencias sociales y políticas europeas, lo que lo aproximó al pensamiento de José Batlle y Ordóñez. \r\nFue catedrático de Filosofía en Enseñanza Secundaria e impartió clases de Derecho Civil y Derecho Penal. Escribió abundantemente sobre temas jurídicos, publicando folletos y colaborando en dos prestigiosas revistas la de Derecho y Ciencias Sociales y la de Derecho, Jurisprudencia y Administración, logrando en esa tarea un prestigio de jurista brillante, no sólo en el ejercicio práctico de su profesión sino en el plano doctrinario, y ello le valió ser nombrado Director Honorario de la Biblioteca Universitaria de Derecho y miembro del Consejo Directivo de la Facultad.\r\nFue candidato a la diputación por Durazno, por el Partido Colorado, en 1908, con 27 años, cargo que ejerció hasta 1915.\r\nEn 1916, el Presidente Claudio Williman lo designó Ministro de Industrias, cargo que ocupó durante un año.\r\nPresidió el Banco de Seguros del Estado entre 1917 y 1933, renunciando al producirse el golpe de estado de Gabriel Terra. \r\nIntegró el Consejo de Estado de 1942, encargado de redactar la Constitución de 1942.\r\nEn marzo de 1943, asume la Presidencia de la República contando con respaldo de batllistas y baldomiristas, manteniendo la línea estatista y normalizando la situación política tras los golpes de Gabriel Terra y de Alfredo Baldomir. Su compañero de fórmula fue Alberto Guani.\r\nDurante el período de su gobierno, solicitó a su amigo Aarón Anchorena que donara su establecimiento ubicado en el departamento de Colonia al gobierno uruguayo, lo que éste accedió a realizar.\r\nAl finalizar su mandato, se retiró a la vida familiar, aunque se mantuvo activo en el campo del Derecho, falleciendo en Montevideo el 20 de Agosto de 1956 a los 75 años de edad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33753, 'HORMAIZTEGUY, Gabriela ', 'Nombre propio completo: Gabriela Hormaiztegui Casaravilla (forma no usada).\r\nEscribana Pública. Actuaria en el Poder Judicial, ha participado en las ediciones III, IV y V del Curso Internacional de Derecho Notarial Profundizado. (Universidad Notarial Argentina (UNA)).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1345, 'ARDAO, Arturo ', 'Nació en 1912 en Lavelleja, y murió en 2003 en Montevideo (Uruguay). Doctor en Derecho y Ciencias Sociales. Prosiguió su carrera en Filosofía, fundamentalmente en Historia de las ideas. Referente intelectual del siglo XX en Uruguay. En el año 1929, participa del proceso fundacional del semanario "Marcha". En 1958 integra la delegación uruguaya en la Asamblea de la UNESCO desarrollada en París, Francia. Decano de la Facultad de Humanidades y Ciencias (1968-1972). Investigador del Centro de Estudios Latinoamericanos Rómulo Gallegos entre 1976-1988 (Caracas) y docente en la Universidad Simón Bolívar. Publicó: "La filosofía en el Uruguay en el siglo XX" (México, 1956), "Filosofía de lengua española" (Montevideo, 1963), "Génesis de la idea y el nombre de América Latina" (Caracas, 1980), "Nuestra América Latina" (1986), entre otros. En 1987 el Ministerio de Educación y Cultura le concede el Gran Premio Nacional a la Obra Intelectual, en 1990 la OEA la entrega al Premio Interamericano Gabriela Mistral, en 1992 la Universidad de la República le otorga el título  "Doctor Honoris Causa", en 2002 el parlamento uruguayo le rinde un homenaje y la Academia Nacional de Letras lo nombra Académico de Honor, en 2003 recibe el premio Bartolomé Hidalgo a la trayectoria.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1363, 'AREVALO, Marta de ', 'Seudónimo y forma usada: ISIS\r\nNacida en Montevideo (Uruguaya) en 1933. Su obra abarca los géneros de poesía, narrativa, ensayo, canciones, y cuento, poesía y teatro infantil. Editora de las revistas: B.L.A.N.C.O. y Lunita de papel. Directora de un taller poético. Ha publicado 23 libros de poesía; y títulos de narrativa, crónicas históricas, y poesía y teatro infantil. En 1982 su poemario "Ojo de Leopardo" recibió el Premio del Ministerio de Educación y Cultura y Segundo Premio Intendencia Municipal de Montevideo. Como miembro y co-fundadora del "Grupo de los 9" recibió, junto con otros 5 poetas, el Premio "José Vasconcelos 1994" del Frente de Afirmación Hispanista A. C., de México. En enero del 2000 recibe el "Premio Internacional de Literatura Latinoamericana y del Caribe-Gabriela Mistral". Es socia del Capítulo Montevideo de la Academia Iberoamericana de Poesía, co-findadora de la Casa del Poeta Latinoamericano, co-fundadora del Club de Leones "Joana de Ibarbourou". Ha recibido numerosas distinciones a lo largo de su carrera.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1420, 'BERTOCCHI MORAN, Alejandro N. ', 'Nombre propio y forma no usada: BERTOCCHI MORAN, Alejandro Nelson. Egresado de UTU, profesor de Historia de los Conflictos Armados, Insituto Militar de Estudios Superiores. Miembro de la Academia Uruguaya de Historia Marítima y Fluvial, de la Asociación Uruguaya de Geopolítica y Estrategia, del Instituto Nacional Browniano de Argentina y del Consejo Editorial de la Revista Naval.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1421, 'BERTOLA, Luis ', 'Montevideo, 1954. Máster en Ciencias Sociales. PHD en Historia Económica otorgado por la Universidad de Gotemburgo. Decano de la Facultad de Ciencias Sociales en el período 2002-2006 y consultante de múltiples organismos como el Banco Central, el BID y múltiples universidades extranjeras.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1425, 'BERNIGER, David', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1429, 'AROCENA, José ', 'Licenciado en Filosofía por la Universidad del Salvador (Buenos Aires) y Doctor en Sociología por la Ecole des Hautes Etudes en Sciences Sociales (París). Director del Instituto de Desarrollo Local y Regional (IDEL) de la Universidad Católica del Uruguay Dámaso Antonio Larrañaga (UCUDAL). Profesor e investigador universitario en las áreas de desarrollo regional y local, y de análisis organizacional. Ha sido profesor invitado en universidades de Europa y América Latina. Evaluador de proyectos científicos, doctorados y posdoctorados. Preside la Corte Electoral del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1436, 'BENAVIDES, Washington ', 'Forma no usada: BENAVIDEZ ALIANO, Atahualpa Washington. Nacido en Tacuarembó, Uruguay, (1930-2017). Poeta, crítico literario y traductor. Profesor de Literatura en Enseñanza Secundaria, Profesor de Historia del Arte y Profesor de Ciencias de la Comunicación y de Letras en la Facultad de Humanidades y Ciencias de la Educación (UDELAR), integrando el Departamento de Literatura Hispanoamericana. Profesor en la Escuela Universitaria de Música. Ha recibido varios premios literarios y su obra ha sido traducida al francés, portugués, inglés e italiano.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1442, 'BERMUDEZ, Washington Pedro ', 'Uruguayo, 1847-1913. Se dedicó a la crítica periodística y a la poesía, la cual fue publicada en semanario. Es autor de un drama "Artigas", que obtuvo aplausos en el teatro uruguayo y también escribió epigramas, epitafios y composiciones de carácter bíblico. Fue miembro de la Real Academia Española.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1445, 'AROCENA, Rodrigo ', 'Nacido el 23 de febrero de 1947 en Montevideo, Uruguay. Matemático. Profesor titular de la Unidad de Ciencia y Desarrollo de la Facultad de Ciencias y hasta 1996 fue profesor titular de Matemáticas de esa facultad. Es licenciado y doctor en Matemáticas y doctor en Estudios del Desarrollo, los tres títulos otorgados por la Universidad Central de Venezuela. Fue rector de la Universidad de la República entre 2006 y 2014. Su labor de investigación se centra en la democratización del conocimiento como una estrategia para el desarrollo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1454, 'BATALLA FAGUNDEZ, Rosa ', 'Nacida en Vergara, departamento de Treinta y Tres, Uruguay (1909 -1981).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1472, 'BARRIOS PINTOS, Aníbal', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1500, 'HARGAIN, Daniel ', 'Escribano.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1515, 'ALADI', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1534, 'NOWINSKI, Aron', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1538, 'ATIENZA, Manuel ', 'Nombre propio completo: Atienza Rodríguez, Manuel. Nacido en  Oviedo, 1951. Jurista y filósofo del derecho español. Estudió su licenciatura en Derecho en la Universidad de Oviedo y posteriormente obtuvo el título de doctor en Derecho por la Universidad Autónoma de Madrid. Se ha desempeñado en el ámbito académico y ha sido profesor y conferencista de numerosas universidades en todo el mundo, así como en tribunales y escuelas judiciales. \r\nCatedrático de Filosofía del Derecho de la Universidad de Alicante, donde es además director de la revista Doxa-Cuadernos de Filosofía del Derecho y director del posgrado en argumentación jurídica. Ha sido profesor en la Universidad Autónoma de Madrid y la Universidad de Valencia, así como de la Academia Europea de Teoría del Derecho. Ha sido profesor visitante en numerosas universidades, entre las que se destacan la Universidad de Buenos Aires, en Argentina y la Cornell University, en Estados Unidos.\r\nFue Vicepresidente de la Asociación Internacional de Filosofía Jurídica y Social');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1579, 'BARLOCCO, Enrique', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1594, 'BANCHERO, Anderssen ', 'Nacido y fallecido en Montevideo (18 de junio de 1925-26 de julio de 1987). Narrador. Bfía.: "Mientras amanece", "Un breve verano"; "Triste de la calle cortada", "Las orillas del mundo", "Ojos en la noche", "Los regresos". En forma póstuma en 1988, recibió el premio "Bartolomé Hidalgo" de la Cámara Uruguaya del Libro por su novela "Los regresos" (cuyo título original era "Los mezquinos rincones").');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4684, 'ROTONDO TORNARIA, Felipe ', 'Doctor en Derecho, Ciencias Sociales y Diplomacia por la Universidad de la República. Diplomado en Dirección de Administración Pública en el Instituto Nacional de Administración Pública de España. Profesor Titular de Derecho Administrativo en la Facultad de Derecho de la Universidad de la República. Director del Instituto de Derecho Administrativo de la Universidad de la República entre los años 2013-2015 y 2015-2017.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4705, 'BIASCO MARINO, Emilio', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1643, 'NEIRA, Luis ', 'Forma no usada: NEIRA RAGNI, Luis. Nacido en Montevideo, Uruguay, el 8 de abril de 1936. Maestro, periodista y escritor. En 1963 obtuvo el cargo efectivo de maestro por concurso y realizó cursos de posgrado de Literatura en los Institutos Normales de Montevideo, donde trabajó como profesor de Expresión por el Lenguaje. Dirigió talleres de Apreciación Literaria para niños y jóvenes. Trabajó en diversos periódicos y fue director del suplemento infantil del diario "El Día" de Uruguay. También dirigió revistas educativas como "Colorín Colorado", entre otras. Ha publicado libros sobre teoría educativa y ha obtenido diversos premios. Algunas de sus obras para niños son: "El árbol de los cuentos latinoamericanos" (1987), "Las aventuras de Pepe y sus amigos" (1987, luego reeditado) y "Cuentos y canciones dibujadas en los vidrios" (1987).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1748, 'MAZZEO, Mario ', 'Nació en Carmelo (Uruguay) en 1953. Periodista autor de varios libros. Bibliografía: "Chile : el problema del poder"; "Bolivia : país mutilado, pueblo combatiente"; "Charlando con Pepe Mujica"; "A campo traviesa : los caminos de Mario Costa"; entre otros; y en coautoría: "Desaparecidos".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1860, 'BONIFACINO, María Elena ', 'Nombre propio y forma no usada: BONIFACINO DE LOS TOYOS, María Elena.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1881, 'PEREZ DEL CASTILLO, Santiago', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1915, 'BOVE, María Isabel ', 'Nutricionista uruguaya. Hace parte de la ONG RUANDI.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1931, 'MARTINEZ, Ignacio ', 'Escritor uruguayo, nacido en Montevideo en 1955. Durante la dictadura uruguaya firmó algunas publicaciones con el seudónimo de Ignacio Seger. Publicó libros para niños, jóvenes y adultos, habiendo recibido varios premios. Fundador y redactor responsable de la revista "Inter Nos" y redactor responsable de la revista "El Tomate Verde". Colabora con la revista "La Mochila" y fue columnista del semanario "El Popular". Presidente del Foro EMTIJ (Encuentro Mundial de Teatro Infantil y Juvenil) y Miembro de la Red Internacional de Escritores por la Tierra (RIET) y de la Red Mundial de Escritores en Español (REMES). Integrante de la Comisión de Cultura de la central sindical PIT-CNT y director de la editorial "Primero de Mayo" en ese organismo sindical.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1942, 'ONETTI, Juan Carlos ', 'Montevideo, 1 de julio de 1909 - Madrid, 30 de mayo de 1994. Escritor uruguayo. En 1932 aparece la primera versión de "El pozo" la obra más significativa del autor. Es secretario de redacción del semanario "Marcha". Trabaja en la agencia internacional Reuters. Director de Bibliotecas en la División de Artes y Letras de la IMM. Algunas de sus obras son: "Tierra de nadie" , "Para esta noche" , "La vida breve" , "Los adioses" , "El astillero" , "La cara de la desgracia" , "Juntacadáveres" , "Jacob y el otro".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1958, 'VARELA, Rafael ', 'Profesor de Literatura egresado del Instituto de Profesores Artigas (IPA). Realiza cursos de postgrado en Minnesota. Se desempeñó como profesor en diversas universidades de Estados Unidos, siendo además editor y periodista tanto en ese país como en Venezuela. En Uruguay inició su tarea editorial en Uruguay en los años 60, en la Fundación de Cultura Universitaria. Posteriormente colaboró con Monte Avila y Biblioteca Ayacucho en Venezuela. Al regresar a Uruguay estuvo a cargo de las publicaciones de la Biblioteca Nacional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1968, 'ACHUGAR, Hugo ', 'Otra forma usada: JUANA CABALLERO. Nacido en Montevideo, Uruguay, en 1944. Poeta, ensayista e investigador. Autor de diversos ensayos y publicaciones. Ha investigado especialmente sobre el tema del consumo cultural. Profesor egresado del Profesorado de Literatura del Instituto de Profesores Artigas (IPA). Ph.D en la Latin American Literature University of Pittsburgh. Director Nacional de Cultura del Ministerio de Educación y Cultura de Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (1997, 'IBARGOYEN ISLAS, Saúl ', 'Forma no usada: IBARGOYEN, Saúl. Nacido en Montevideo, Uruguay, en 1930. Poeta y narrador, ha publicado más de 50 títulos de poesía, novela, cuento, testimonio, teatro infantil, ensayo. Radicado en México desde hace muchos años, en 2001 le fue concedida la nacionalidad mexicana. Es miembro correspondiente a la Academia Nacional de Letras de Uruguay. Editor de la "Revista de literatura mexicana contemporánea". Su obra premiada en varias oportunidades, ha sido traducida a trece idiomas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2004, 'BRAVO, Luis ', 'Nacido en Montevideo, Uruguay, en 1957. Poeta y performer. Ensayista y profesor a nivel terciario en el Instituto de Profesores Artigas (IPA) y en la Universidad de Montevideo (UM). Especializado en la crítica de poesía uruguaya y latinoamericana. Articulista y columnista en prensa escrita (Brecha, Cuadernos de Marcha) y en radio (SODRE), así como en revistas especializadas. Artículos y ensayos de su autoría han sido publicados en revistas de Francia, España, Canadá, Perú, México y Argentina. Maestrando de Literatura Latinoamericana en la Facultad de Humanidades y Ciencias de la UDELAR. Investigador adjunto de la Academia Nacional de Letras.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2053, 'CAIROLI MARTINEZ, Milton H. ', 'Uruguayo. Abogado. Profesor de Derecho Penal de la Facultad de Derecho de la Universidad de la República. Director del Instituto Uruguayo de Derecho Penal de la Facultad de Derecho de la Udelar. Ex Magistrado. Ex Ministro de la Suprema Corte de Justicia del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2238, 'CASAL, Selva ', 'Nacida en Montevideo, en 1930. Abogada, poetisa. Entre su obra poética se destaca: "Días sobre la tierra", "Poemas 65" (este libro fue traducido al inglés por Angel Castillo Jr.1966 y publicado en la Poetry Review de la University of Tampa Florida USA), "El infierno es una casa azul" (Premio Ministerio de Cultura ), "Mi padre Julio J. Casal". En el año 2010 la Fundación Lolita Ruibal le otrogó el premio Morosoli de Poesía.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2249, 'CASAUX, Gastón ', 'Doctor en Derecho y Ciencias Sociales. Economista. Profesor Titular de Legislación Veterinaria en la Facultad de Veterinaria. Profesor de las facultades de Derecho, Ingeniería y Agronomía y profesor de la Maestría en Derecho Ambiental en Curitiba (Brasil) y en Arequipa (Perú). Asesor Letrado Honorario de la Sociedad de Medicina Veterinaria. Miembro de Honor de la Academia Nacional de Veterinaria. Miembro de la Comisión Nacional de Rabia. Asesor Jurídico de la División Salud Ambiental del Ministerio de Salud Pública (Uruguay). Consultor de Naciones Unidas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2294, 'CASTELLANOS, Alfredo R.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2304, 'LEVRERO, Mario ', 'Nombre propio Jorge Varlotta. Nació en Montevideo (1940-2004). Escritor, fotógrafo, librero, guionista de cómics, humorista y redactor jefe de revistas de ingenio.\r\nEntre sus obras se encuentran: La ciudad, Dejen todo en mis manos, El alma de Gardel, El discurso vacío, la máquina de pensar en Gladys, Todo el tiempo, etc.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2332, 'CASTRO VEGA, Jorge ', 'Nacido en Montevideo, Uruguay, en 1963. Abogado, periodista, crítico literario y teatral, ha participado en diversos congresos y encuentros internacionales de poesía. Su obra ha sido total o parcialmente traducida a más de media docena de idiomas, siendo incluido en numerosas antologías y muestras de poesía uruguaya del siglo XX. Autor de los siguientes poemarios: "Primera línea" (1983), "Poesía de sitio" (1985), "Poesía involuntaria" (1987), "Poesía certificada" (1989), "Poesía arbitraria : antología personal : 1982-1989 " (1989), "Con motivo de Ana" (1991),  "Un poco de sol" (1993) y "Cosas que pasan" (1997). Su primera novela es "El padrino de Batlle".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2362, 'LINN, Tomás ', 'Periodista. Columnista del semanario "Búsqueda". Profesor de periodismo en la Universidad Católica del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2436, 'MADFES, Irene ', 'Profesora Adjunta del Instituto de Lingüística de la Facultad de Humanidades y Ciencias de la Educación, UdelaR. Sus intereses comprenden la forma como las prácticas lingüísticas son utilizadas en la construcción y organización de relaciones sociales, en la relación entre discursos institucionales como al interacción medico-paciente, la interacción telefónica en contextos de servicios y se encuentra abocada, actualmente al estudio de interacciones de llamadas telefónicas de mujeres víctimas de violencia doméstica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2456, 'URUGUAY. MINISTERIO DE SALUD PUBLICA', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2520, 'SHAKESPEARE, William ', 'Nacido y fallecido en Stratford-upon-Avon, Warwickshire, Reino Unido (1564-1616). Dramaturgo, poeta y actor inglés. Conocido en ocasiones como El Bardo de Avon (o simplemente El Bardo), es considerado el escritor más importante en lengua inglesa y uno de los más célebres de la literatura universal.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2613, 'COURTOISIE, Rafael ', 'Nacido en Montevideo, Uruguay, en 1958. Poeta, narrador, ensayista y crítico. Docente de la Facultad de Comunicación. Ejerce la crítica literaria y el periodismo cultural. Ha recibido varios premios literarios nacionales e internacionales y parte de su obra ha sido traducida a varios idiomas. Obras publicadas: "Contrabando de aurora" (1977), "Tiro de gracia" (1981), "Tarea" (1982), "Orden de cosas" (1986), "Cambio de estado" (1990), "El mar interior" (1990), "El mar rojo" (1991), "Textura" (1994).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2646, 'CORTAZZO, Walter E. ', 'Nacido en Paso de los Toros, departamento de Tacuarembó (Uruguay) en 1939. Presidente de la Comisión Directiva en Casa Bertolt Brecht. Colaboró en la publicación: "Participación y proyecto político : aportes de la Casa Bertolt Brecht". Fue Director General de Descentralización y Participación. Escribió dos libros de poemas: "Todavía no es hora" (2012) y "Muchedumbre y otros poemas" (1989).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2678, 'CORBO LONGUEIRA, Daniel J. ', 'Licenciado en Historia, Udelar. Docente. Miembro del Consejo Directivo Central de la ANEP (2010-1015). Presidente del Consejo de Educación Secundaria (1990-1995). Representante Nacional (1995-2000). Especialista en el tema de educación en valores y ciudadanía democrática, así como en historia de la educación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2786, 'CURBELO, Graciela ', 'Nació en Montevideo en 1948. En el año 1969, se recibió de experta agraria. Viajó a Chile y estuvo en Suecia desde sus 25 a sus 37 años, donde estudió y fue nurse en un hospital psiquiátrico.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2949, 'FARAONE, Roque ', 'Fue profesor (grado 5) de Historia de las ideas en la Facultad de Derecho y Ciencias Sociales y de Teoría de la Comunicación Social (grado 3) en la Facultad de Humanidades y Ciencias de la Educación. Es socio de honor de la Asociación Internacional de Estudios sobre Comunicación (IAMCR)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2961, 'FEDERICI, Carlos María ', 'Montevideo, 1941. Autor de novelas y cuentos policiales, de ciencia ficción y terror, también dibujante y guionista de historietas. En 1968 publicó la tira Barry Coal, protagonizada por un detective negro. En 1982 publicó la aventura intergaláctica Jet Galvez. Antes publicó Dinkenstein, una historieta inconclusa de terror. Y a fines de los noventa publicó Tribunal Militar en la desaparecida revista Balazo. En todas está presente el mismo factor: la mirada hacia la edad de oro de la historieta, cuando los niños las compraban en los kioskos para alimentar sus fantasías.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (2999, 'CORTAZAR, Julio ', 'Hijo de padres argentinos, nació en Bruselas, Bélgica, el 26 de agosto de 1914 y falleció en París, Francia, el 12 de febrero de 1984. Nacionalizado francés. Escritor, traductor, profesor e intelectual. Llegó a la Argentina a los cuatro años, donde vivió gran parte de su vida hasta que en 1951 se radica en París, lugar donde fallece. Se graduó como Maestro Normal en 1932 y como Profesor Normal en Letras en 1935 en la Escuela Normal de Profesores Mariano Acosta. Es considerado uno de los autores más innovadores y originales de su tiempo, maestro del relato corto, la prosa poética y la narración breve en general. En 1938 bajo el seudónimo de Julio Denis, publicó el libro de sonetos "Presencia". Entre sus obras se destacan: "Los reyes", "Bestiario", "Los premios", "La rayuela", "Modelo para armar", "LIbro de Manuel", entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3005, 'FERNANDEZ, Gonzalo D. ', 'Nombre propio y forma no usada: FERNANDEZ DOMINGUEZ, Gonzalo Daniel.\r\nNacido en Montevideo (Uruguay) el 21 de marzo de 1952. Abogado penalista, Político y Profesor de Derecho Penal en la Facultad de Derecho y Ciencias Sociales de la Universidad de la República, Uruguay. Secretario del Instituto Uruguayo de Derecho Penal.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3032, 'FERNANDEZ STRAUCH, Daniel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3088, 'ALSINA THEVENET, Homero ', 'Nacido en Montevideo (Uruguay) en 1922 y fallecido en 2005. Periodista y ensayista, con particular atracción hacia el cine. Trabajó como editor en el suplemento "El País Cultural".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3113, 'DELGADO APARAIN, Mario ', 'Nació en Florida, Uruguay, en 1949. Escritor, periodista, docente universitario y gestor cultural. Autor de libros de cuentos y novelas. Como periodista escribió para el diario argentino "Clarín", semanarios "Jaque", "La Razón" y "Búsqueda", revista "Tres" "El País Cultural" y diario "La República". Dirigió las revistas "Tercera orilla" y "Montevideo Ciudad Abierta".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3259, 'DELPIAZZO, Carlos Eduardo ', 'Doctor en Derecho y Ciencias Sociales por la Universidad de la República, Uruguay. Profesor de Derecho Administrativo, Profesor de Informática Jurídica y de Derecho Telemático, y Director del Instituto de Derecho Administrativo en la Facultad de Derecho de la UDELAR. Director del Programa Master de Derecho Administrativo Económico (PMDAE) en dicha Facultad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3284, 'FIGARI, Pedro ', 'Nacido y fallecido en Montevideo, Uruguay (29 de junio de 1861-24 de julio de 1938). Pintor, abogado, político, escritor y periodista. Una de las figuras más destacadas de la pintura latinoamericanista. Nombre propio y forma no usada: FIGARI SOLARI, Pedro.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3291, 'FERREIRO, Alfredo Mario ', 'Nacido en Montevideo, Uruguay, en 1899. Poeta, crítico y humorista. Dirigió la sección uruguaya en las ediciones de la Sociedad Amigos del Libro Rioplatense.  Escribió dos libros de poesía futurista y humorista: "El hombre que se comió un autobús" (1927) y "Se ruega no dar la mano" (1930). Después de 1930, no volvió a publicar volúmenes de poesía, dedicándose al periodismo gráfico y radial. Su actividad última más febril se desarrolló en el territorio del humorismo. Páginas de humor suyas, con su firma o bajo diversos seudónimos (Gong y Marius fueron los más usados), figuran en la revista "Peloduro" y en "Marcha". Falleció en Montevideo, en 1959.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3315, 'FERRERE, Daniel M. ', 'Abogado, socio fundador de Ferrere Abogados, CPA Ferrere y Ferrere Internacional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3409, 'FOUCAULT, Michel ', '1926-1984. Nació en Poitiers, Francia. Fue uno de los pensadores más influyentes del siglo XX. Estudió Filosofía Occidental y Psicología en la École Normale Supérieure de París. Encabezó los departamentos de Filosofía de las universidades de Clermont-Ferrand y Vincennes. Fue profesor de Historia de los Sistemas de Pensamiento en el Collège de France. Llevó a cabo análisis sobre los mecanismos de control social. Mantubo una activa lucha política e ideológica, y su pensamiento ha sido bien acogido por quienes intentan mejorar la situación de los sectores sociales excluidos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109048, 'GANDARIA PONTE, Patricia ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109049, 'WOJNAROWICZ URIARTE, Elizabeth ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3437, 'METHOL FERRE, Alberto ', '(1929-2009). Pensador católico latinoamericano; incursionó en la historia, la geopolítica y la teología. Reconocido como uno de los principales referentes de las corrientes del revisionismo histórico hispanoamericano, del continentalismo y de la Teología de la Cultura. Autor de "La crisis del Uruguay y el Imperio Británico", "El Uruguay como problema", "La iglesia en la historia de Latinoamérica", "Il Risorgimento Cattolico Latinoamericano" y "La América Latina del siglo XXI". Asesor político de Eduardo Víctor Haedo, Benito Nardone, Líber Seregni, Alberto Volonté y José Mujica. Dictó innumerables cursos y conferencias durante más de cuarenta años. Fundador de la revista Nexo. Fue miembro del Consejo Teológico Pastoral del CELAM y profesor de Historia Contemporánea e Historia de América Latina en el Instituto Artigas del Servicio Exterior, en la Universidad Católica, el CLAEH y la Universidad de Montevideo, donde fue fundador del Instituto de Estudios Latinoamericanos que hoy lleva su nombre.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3446, 'FOLADORI, Guillermo ', 'Doctorado en Estudios del Desarrollo, Universidad de Zacatecas. Coordinador de la ReLANS.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3453, 'ROEMER, Milton I.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3460, 'MELAZZI, Gustavo ', 'Doctorado en Economía en la Universidad Autónoma de México. Profesor en la Multiversidad Franciscana de América Latina, Catedrático de Economía en la Facultades de Ciencias Sociales y de Derecho de la UdelaR. Integró la Comisión del Programa del Frente Amplio hasta 2005.  Fue coordinador general del Programa 1981 del gobierno de Nicaragua y asesor gubernamental en México.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3467, 'FISCHER, Diego ', 'Nació en Montevideo, Uruguay, en 1961. Estudió periodismo en la Universidad de Navarra (España) y en la Universidad de Boston (EUA). Periodista de radio, televisión y prensa. Fue corresponsal en Montevideo de la agencia de United Press International (UPI) de Estados Unidos. Columnista del diario "El País" y asesor en empresas de comunicación. Autor de libros y obras de teatro. Dirigió, produjo y libretó el documental cinematográfico "Cien Años", sobre la historia de Punta del Este. Forma no usada: FISCHER REQUENA, Diego');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3474, 'DUPREY, Jacques-André', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3481, 'DOMINGUEZ, Carlos María ', 'Buenos Aires, 1955. Desde 1989 reside en Montevideo. Fue secretario de redacción y director de la Revista Crisis, de Buenos Aires, jefe de redacción del Semanario Brecha y editor de las páginas literarias del samanario Búsqueda. Es autor de una veintena de libros y de dos obras de teatro: "La incapaz" y "Polski". \r\nHa publicado las novelas "Pozo de vargas", "Bicicletas negras", "La mujer hablada", "Tres muescas en mi carabina", "La casa de papel" y "La costa ciega"; el libro de cuentos "Mares baldíos"; las biografías "Construcción de la noche, la vida de Juan Carlos Onetti"; "El bastardo, la vida de Roberto de las Carreras y su madre Clara"; "Tola Invernizzi, la rebelión de la ternura"; y los libros de crónica "El compás de oro", "Historias del polvo y el camino", "Delitos de amores crueles", "Una joya por cada rata" (memorias de un asaltante de bancos, con Darío Giró), "Escritos en el agua", "El norte profundo", "Las puertas de la tierra" y "Cuando el río suena, entre Montevideo y Buenos Aires".\r\nSus libros han sido editados en Uruguay, Argentina, España, y traducidos a distintas lenguas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3506, 'DRETS, Máximo E. ', 'Montevideo, 1930- .Médico graduado de la Facultad de Medicina, UdelaR en 1965. Licenciado en Ciencias Biológicas por la ex Facultad de Humanidades y Ciencias. Doctor en Ciencias por la Universidad Federal de Río Grande del Sur, por competencia notoria. Como investigador ha profundizado en los temas: microscopía, instrumentación científica, citofotometría, citogenética, genética, genéica toxicalógica. Especialista en Citogenética y findador del primer Laboratorio de Citogenética Humana en Uruguay. Publicó más de 130 trabajos de investigación y ha ocupado todos los cargos científicos disponibles en el IIBCE. Recibió numerosas distinciones por su labor científica. Fue Presidente de la Asociación Latinoamericana de Genética, miembro de la Academia de Ciencias de América Latina e integrante de su consejo hasta la actualidad. En 2002 el IIBCE lo designó Investigador Emérito por su relevante trayectoria científica y su contribución al desarrollo de la institución');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3593, 'FRESSIA, Alfredo ', 'Nació en Montevideo, en 1948. Su obra ha sido premiada y traducida a varias lenguas, se destacan títulos como: "Un esqueleto azul y otra agonía" 1973; "Clave final",1982; "Noticias extranjeras", 1984; "Destino : Rua Aurora", 1986; "Frontera móvil". 1997; "El futuro /o futuro",1998; "Veloz eternidad",1999, "Eclipse, cierta poesía,1973-2003",2003; "Senryu o el árbol de las sílabas",2008; "Ciudad de papel",2009; "El memorial de hombres que me amaron",2012, "Poeta en el Edén",2012.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3642, 'LARRIMBE, Miguel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3766, 'HOLZ, Eva ', 'Profesora Agregada de Derecho Comercial en la Facultad de Derechos de la Universidad de la República (UDELAR), Uruguay. Profesora de Postgrado de Derecho Bancario en la Universidad de Montevideo, Uruguay. Profesora visitante en la London University (Londres, Reino Unido) y en la Southern Methodist University (Dallas, Texas, EE.UU.).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3782, 'MONTIEL, Stella', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3785, 'DEGIOVANANGELO, Guillermo ', 'Nombre completo y forma no usada: DEGIOVANANGELO HACKENBRUCH, Guillermo.  Nacido en la ciudad de Canelones, departamento del mismo nombre, Uruguay, en 1956. Obrero gráfico (linotipista). Ha publicado numerosos libros de cuentos y poesías, entre los que se encuentran : "Poesía Instrumental"; "Poemas de amor contra Albertina y otras lluvias" ; "Descubrimiento de la melancolía"(novela); "Al salir la luna"( cuentos, Premio del Ministerio de Educación y Cultura), "Campo de maíz con vuelo de tordos" (cuentos, Premio Ministerio de Educación y Cultura), "Poemas sinfónicos, Los caminos (cuentos), "Años de peregrinaje" (novela). Ha obtenido premios a nivel nacional e internacional por sus cuentos y poesías. Escribió una obra de teatro en homenaje al escritor uruguayo Carlos Sabat Ercasty, denominada "Sabat" y que fuera estrenada en el año 2007 en la Biblioteca Nacional. Ha ocupado un cargo en la Dirección de Cultura de la Comuna Canaria.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3799, 'DUTRA VIEYTO, Ethel ', 'Nacida en Melo, departamento a Cerro Largo (Uruguay). Docente de Literatura egresada del Instituto de Profesores Artigas (IPA). Profesora de francés, formada de la Alianza Francesa, realizando además estudios de inglés (Anglo), italiano (Instituto Italiano de Cultura) y portugués (I.C.U.B.). Cofundadora del Instituto Anglo-Uruguayo en Melo. Integrante de la Comisión de UNESCO, de la Unión Libanesa Cultural Mundial. Secretaria de la Gobernación de Zonta Iternacional (Club Melo). Fundadora de la Asociación de Escritores de Cerro Largo. Directora del Taller de Literatura "José Lucas y Lucas", y la página de Literatura del "Semanario Cerro Largo". Ha publicado: "La radical soledad del ser"; "Aspectos culturales del Líbano"; "Aproximación a Juana de Ibarbourou"; y ha participado en antologías como: "Distancias del Agua"; "Al noreste" (que también dirigió) ; "Os vinculos Culturás Galicia y Uruguay"; etc.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4734, 'MILLER ARTOLA, Alejandro ', 'Doctor en Derecho y Ciencias Sociales por la Facultad de Derecho (UdelaR). Profesor Agregado (Grado 4) de Derecho Privado IV y V y profesor de cursos de postgrado en Derecho Societario en la Escuela de Posgrado en la Maestría de Derecho Comercial, en la mencionada Facultad. Diplomado en Derecho del Mar y Marítimo por la Pontificia Universidad Católica de Valparaíso, Chile.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3828, 'GARCIA, Mario ', 'Montevideo, 1922. Fue fundador de las primeras asociaciones de escritores de Uruguay, así como de la Casa de los Escritores del Uruguay, donde fue impulsor del Homenaje a Federico García Lorca e integrante de la Comisión Organizadora del mismo (2006).\r\nLibros de poesía publicados: "El ojo de los candados" (Destabanda, 1983), "Momentos" (Destabanda, 1987), "De los días y los tiempos" (Signos, 1991), "Transparencias" (1994) y "Pen(útlimos) ritmos. Partidas y regresos. Los tangos" (1996), ediciones del autor. Poemas suyos han integrado antologías, entre ellas "Antología de la actual poesía latinoamericana" (Moscú, 1988), y revistas literarias nacionales e internacionales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3872, 'GARET, Leonardo ', 'Nació en Salto (Uruguay) en 1949. Profesor en el Instituto de Estudios Superiores de Montevideo, Cátedra de Literatura Uruguaya (1973), en el Instituto de Filosofía Ciencias y Letras, Cátedra de Literarura española (1973) y el Instituto Cultural de la Casa de Nuna. También profesor de enseñanza secundaria. Escritor de crítica, poesía y narrativa. Orientó el Taller Literario de Artigas, dependiente del Ministerio de Educación y Cultura.\r\nJunto a César Rodriguez Musmanno, han expuesto obras y presentado libros en innumerables instituciones culturales de todo el país y del extranjero, obteniendo dstinciones en importantes concursos de sus respectivas disciplinas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3937, 'GENTA, Edgardo Ubaldo ', 'Nacido en Montevideo (Uruguay) en 1894 y fallecido en 1983. Poeta, su primera obra publicada fue "Besos, lágrimas y gritos" (1917). Parte de su trabajo se compone de poesía épica. Fue General de la Fuerza Aérea Uruguaya.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (3982, 'GIORGI, Héctor', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4006, 'BUSCAGLIA, Horacio ', 'Nombre completo y forma no usada: BUSCAGLIA VIDAL, Horacio Ricardo. Nacido en Montevideo, Uruguay, el 23 de marzo de 1943 y fallecido en la misma ciudad el 1º de febrero de 2006. Músico, actor, director teatral, poeta, periodista y publicista. En 1969, junto a Eduardo Mateo, crea y dirige Musicasión, cuatro espectáculos fundamentales para la música popular uruguaya. Compuso junto a Eduardo Mateo, Urbano Moraes, Pippo Spera, Ruben Rada, Martín y Paolo, sus hijos. Fue uno de los fundadores de "Canciones para no dormir la siesta". Se dedica a la dirección teatral en el Teatro Circular, en El Galpón y en Comedia Nacional, entre otros, y también en la actuación con la puesta en escena de Inodoro Pereyra.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4027, 'GOMENSORO, Arnaldo ', 'Titulado en el ISEF como Profesor de Educación Física (1968). Titular de Historia de la Educación Física, el Deporte y la Recreación en la ACJ (Facultad de Educación Física). Titular de la asignatuira "Deporte, Cultura y Sociedad" del Instituto Universitario CLAEH (Licenciatura en Gestión Cultural). Editor de la revista Nexo Sport. Titular del Centro de Rehabilitación Cardíaca del Club Banco República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4077, 'GONZALEZ LAPEYRE, Edison ', 'Ex profesor de Derecho Internacional Privado, Derecho Internacional Público y Derecho Diplomático de la Facultad de Derecho de la UDELAR, y de Derecho Internacional Marítimo de la Academia de Derecho de La Haya.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4151, 'MILAN, Eduardo ', 'Nació en Rivera, Uruguay, en 1952. Poeta. Se exilió en México en 1979, donde se dió a conocer como crítico de poesía desde el consejo de redacción de la revista "Vuelta", dirigida por Octavio Paz. Publicó: "Manto" (1999), "Acción que en un momento creí gracia" (2004), "Indice al sistema del arrase" (2007), "Habrá tenido lugar" (2008), "El camino Ullán seguido de Durante" (2009), "Solvencia" (2010).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4335, 'HERNANDEZ, Graciela ', 'Artigas, 1951. Completa su formación magisterial en Montevideo. Sus intereses estuvieron centrados en la enseñanza, los que la condujeron a realizar dos especializaciones: en Dirección y en Discapacitados Intelectuales. Trabajó como profesora de Expresión por la Plástica en el Instituto Nacional de Docencia "General Artigas" (Centro I), en el año 1983, atendiendo primero y segundo pre-magisterial. Obras de poesía publicadas: "Juego con la luna. Plata y espuma" (1988), "Pesco que pesco, pescando" (1997) y "Hacia la luz" (2013). \r\nNombre completo. Forma no usada: HERNANDEZ FAVALE, GRACIELA ETHEL.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4336, 'HERRERA Y REISSIG, Julio ', 'Nacido y fallecido en Montevideo, Uruguay (1875-1910). Poeta, dramaturgo y ensayista.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4373, 'GUICHON, Víctor ', 'Nace en Casupá, departamento de Florida en 1960. En 1984 edita su primer libro de poesía "Una hilera de poemas". Integra el grupo de teatro  "espejos" desde su inicio en 1985, participando como músico y actor.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4416, 'SABELLI, Martha ', 'Licenciada en Bibliotecología por la Escuela Universitaria de Bibliotecología y Ciencias Afines (EUBCA) de la Universidad de la República, Uruguay. Profesora de Historia por el Instituto de Profesores Artigas (IPA). Doctora en Documentación por la Universidad de Alcalá. Docente del Departamento de Información y Socieadad en la EUBCA. Investigadora del Sistema Nacional de Investigadores (SNI) de la Agencia Nacional de Investigación e Innovación (ANII). Integrante del Comité Académico y de la Comisión de Posgrado de la Maestría en Información y Comunicación del Programa de Información y Comunicación (Prodie) de la UDELAR. Miembro del Grupo Interdisciplinario Información y Comunicación para la Inclusión y la Integración Social.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4449, 'HESSE, Hermann', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4454, 'HIDALGO, Bartolomé ', 'Nacido en Montevideo, Uruguay, el 24 de agosto de 1788 y fallecido en Morón, Argentina, el 28 de noviembre de 1822. Empezó esribiendo himnos y marchas patrióticas, de mérito muy secundario, para los soldados de Artigas; pero pronto se hizo el creador de una escuela nueva que llevó a la poesía asuntos y locuciones de su tierra no vistos en América. Reconocido escritor de poesía gauchesca, es considerado el primer poeta del Río de la Plata.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4492, 'COTUGNO, Monseñor Nicolás ', 'Arzobispo de Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4516, 'ARGAÑARAZ, N. N. ', 'Artigas, 25 de diciembre de 1958. Ha vivido en Porto Alegre, Birmingham (UK) y Montevideo, donde reside. En Doctor en Letras (UFRGS), Magíster en Letras (UFRGS) y Licenciado en Letras Hispánicas (UDELAR). Desde 1985 es docente e investigador de la Universidad de la República, done, actualmente, se desempeña como Profesor Adjunto de Literatura Uruguaya y Asistente de Literatura Latinoamericana. Entre 1993 y 1994 ocupó el cargo de "José Artigas Research & Lector" en The University of Birmingham (UK). Entre sus publicaciones, se destacan "Poesía visual uruguaya", "La escritura bajo el signo del travestismo", "Poesía latinoamericana de vanguardia", "Formas de la micropolítica en el Uruguay de fin del milenio", "Supersticiones", "La poesía negra" (ensayo) y "No dejes de escribirme... amor" (ficción).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4577, 'BERETTA CURI, Alcides ', 'Licenciado en Ciencias Históricas (UDELAR). Doctorado en la Universidad de Barcelona. Doctorado en Historia Americana. Profesor y director del Centro de Estudios Interdisciplinarios Latinoamericanos "Prof. Lucía Sala", Facultad de Humanidades y Ciencias de la Educación, Universidad de la República, Uruguay. Investigador del SNI (Servicio Nacional de Investigadores). Desarrolla sus investigaciones sobre inmigración europea y actividades de innovación en la agricultura y la industria en el Uruguay entre 1870 y 1930.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6792, 'PEREYRA, Carlos Julio ', 'Nacido en Rocha (Uruguay) en 1922. Político perteneciente al Partido Nacional, fue presidente del directorio en el periodo de 2008-2009. Maestro, profesor de historia y educación cívica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4800, 'ORONOZ, Isabel ', 'Nacida en Montevideo (Uruguay). Periodista, ha trabajado en radio, televisión y prensa escrita. Desde el retorno de la democracia, en 1985, fue cronista parlamentaria en el semanario Jaque, en el noticiero Tres Millones y en el Primer Informe de Canal 5, siendo la primera presentadora de noticias afro de la televisión uruguaya. Publicó su primer libro de entrevistas  "Blancos" en 1986. Responsable de prensa de la Bancada de Partido Socialista del Uruguay. Presidente del Centro Cultural de Integración. Columnista en Mesa de Noticias, en la radio 1410 AM libre.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4867, 'MIRZA, Roger ', 'Forma no usada: MIRZA, Rogelio. Doctor en Letras por la Universidad de Buenos Aires. Licenciado en Letras por la Universidad de la República (UDELAR). Profesor de Literatura egresado del Instituto de Profesores Artigas. Profesor Titular y Director del Departamento de Teoría y Metodología Literarias y Coordinador Académico de la Maestría en Teoría e Historia del Teatro en la Facultad de Humanidades y Ciencias de la Educación de la UDELAR. Decano interino de la Facultad de Humanidades y Ciencias de la Educación en los períodos enero-marzo 2006 y marzo-junio 2010).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4874, 'ZORRILLA DE SAN MARTIN, Juan ', 'Uruguayo, 1855-1931. Poeta, orador, escultor, magistrado, diputado, diplomático, periodista, y docente de la Universidad de la República. Fue fundador del diario "El bien público". Autor de "Leyenda patria", "Tabaré", "La epopeya de Artigas", "Notas de un himno", "Resonancias del camino", "Huerto cerrado", "conferencias y discursos", etc.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (4887, 'GARCIA GUAL, Carlos', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5161, 'PIGNATTA, Alfredo ', 'Nació el 12 de enero de 1943, en Uruguay. Contador Público. Especialista en temas de contabilidad sobre los cuales ha dictado cursos en el país y en el extranjero. Presidente de la Comisión de Investigación Contable de la Asociación Interamericana de Contabilidad. Profesor Titular de la Unidad Académica de Contabilidad Superior de la Facultad de Ciencias Económicas y Administración. Delegado del Colegio de Contadores, Economistas y Administradores del Uruguay ante la Comisión Permanente de Normas Contables.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5162, 'ROSSI BAYARDO, Walter', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5316, 'ARISTIMUÑO, Adriana ', 'Nombre completo y forma no usada: ARISTIMUÑO GÜENZATTI, Adriana. Doctora en Ciencias de la Educación por la Universidad Católica de Lovaina (Bélgica). Directora del Departamento de Formación Humanística. Profesora de Alta Dedicación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5434, 'MACEDO, Juan Carlos ', '1943-. Obras: "Durar" (1974), "Durar II : referencial e instrumentos" (1976), "Durar III : resistencias" (1986).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5463, 'SILVA FORNE, Diego ', 'Abogado, egresado de la Facultad de Derecho de la Universidad de la República. Docente e investigador en dicha Facultad. Ha realizado estancias de investigación en las Universidades de Zaragoza, Valencia y Cádiz. Director General de la Asesoría Jurídica de la Intendencia de Montevideo en dos oportunidades (2005-2008 y 2010). Socio fundador del Centro de Investigaciones y Estudios Penales del Uruguay "Dra. Adela Reta" (CIEPUR). Director de la "Revista de Derecho Penal", desde 2004.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5555, 'TELLECHEA BERGMAN, Eduardo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5634, 'MARTORELLI, Horacio', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5642, 'MARTINEZ MARTINEZ, Raquel ', 'Nombre propio y forma no usada: MARTINEZ MARTINEZ, Raquel Susana Escritora nacida en Montevideo, Uruguay, en 1937. Ha incursionado en la narrativa y la lírica. Ex Inspectora de Educación Inicial, cursó la Licenciatura en Letras en la Facultad de Humanidades y Ciencias de la Educación (UDELAR). Ha recibido varios premios literarios e integra Jurados literarios en su medio. Dicta charlas y conferencias en centros educativos nacionales y extranjeros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5699, 'MARTIRENA, Gregorio', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5704, 'MASLIAH, Leo ', 'Nacido en Montevideo, Uruguay, en 1954. Músico. Ha editado más de 40 trabajos discográficos. Recibió el "Premio Gardel" al "mejor álbum instrumental" en 2008. En 1998 le fue adjudicado el "Premio Morosoli" (Uruguay) por su actividad en la música popular. Autor de novelas, recopilaciones de cuentos y obras de teatro. Su obra "Telecomedia" fue distinguida con el premio del Ministerio de Educación y Cultura (Uruguay), en la categoría "comedia", en el año 2000 y, traducida, fue publicada en Francia en 2012.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5881, 'SAJON, Rafael', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (5954, 'MEDINA, Dionisio ', 'Nacido en Durazno en 1943. Licenciado en Educación Cristiana. Pastor de la Iglesia Asamblea de Dios. Forma no usada: MEDINA RAMIREZ, Dionisio.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6209, 'MONTEVIDEO. INTENDENCIA ', 'Formas no usadas: MONTEVIDEO. INTENDENCIA DEPARTAMENTAL\r\n                             MONTEVIDEO. INTENDENCIA MUNICIPAL\r\n                             INTENDENCIA DE MONTEVIDEO');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6215, 'MOLINA, Gerardo ', 'Nombre propio y forma no usada: MOLINA CASTRILLO, Gerardo. Nacido en Los Cerrillos, departamento de Canelones, Uruguay, en 1938. Autor de poesía, cuentos, ensayos, historia, teatro y preceptiva. Docente, historiador. Profesor de Idioma Español y ex Director del Liceo Nº 2 de Las Piedras y del Liceo de Santa Lucía. Integra la Comisión Directiva de la Federación de Instituciones Históricas de Canelones, creada el 21 de julio de 2008. Ha dictado conferencias y ofrecido recitales de su poesía en Uruguay, Argentina, Chile, Perú, Brasil, España, Francia e Italia. Ha obtenido varios premios y distinciones literarias.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6230, 'MOREIRA, Rubinstein ', 'Nacido en Melo, departamento de Cerro Largo (Uruguay) en 1942. Poeta, narrador, maestro normalista y profesor de enseñanza media.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6231, 'MOREIRA, Constanza ', 'Montevideo, 1960. Doctora y Máster en Ciencia Política por la Universidad Candido Mendes (Brasil) y Licenciada en Filosofía por la Facultad de Humanidades y Ciencias de la Educación, UdelaR (Universidad de la República, Uruguay. Profesora titular del Instituto de Ciencia Política de la Facultad de Ciencias Sociales, UdelaR. Senadora de la República (2010-2015), por el Espacio 609 del Frente Amplio (Uruguay). Coordinó el Informe de Desarrollo Humano en Uruguay 2008 (PNUD). Autora de varios artículos y textos de su especialidad. Publicó entre otros: "Democracia y desarrollo en Uruguay" y "Final de juego".\r\nSu interés por las letras, y en particular por la literatura de ciencia ficción, la llevó a participar del taller del escritor Mario Levrero, publicando una novela  (De regreso a casa, Artefato, 2006, con el seudónimo O. F. Slims y un libro de cuentos (10 relatos fantásticos, parte de la colección De los Flexes Terpines, Cauce editorial, 2002), "White World" integró el volumen "10 relatos fantásticos"(Seudónimo: Olympia Frick).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6488, 'OIT (OFICINA INTERNACIONAL DEL TRABAJO)', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6703, 'ROJAS, Fernando de', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6750, 'PAEZ VILARO, Carlos ', 'Nacido en noviembre de 1923, en Montevideo, Uruguay y fallecido en febrero de 2014. Artista plástico. Pintor, ceramista, escultor, muralista, escritor, compositor y constructor.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6789, 'DIAZ DE TONNA, Belta ', 'Formas no usadas: DIAZ BENZANO DE TONNA, Belta - D. DE TONNA, Belta. Oriunda de San José, incursiona en los géneros de poesía, cuento, ensayo, teatro. Ha musicalizado alguno de sus poemas. Laureada en concursos nacionales e internacionales, ha integrado jurados literarios. Colabora en periódicos y revistas literarias del país y del extrranjero y ha participado en congresos latinoamericanos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (57130, 'SOULIER, Daniel ', 'Nacido en Estanzuelas, Colonia (Uruguay),en 1965. Ilustrador de libros. Autor de dibujos animados e historietas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6796, 'PEREDA VALDES, Ildefonso ', 'Nacido en Tacuarembó, Uruguay, el 6 de marzo de 1899. En su niñez se radicó en Montevideo, donde cursó estudios de abogacía, graduándose en 1927. La mayor parte de su vida se desempeñó como Profesor de Literatura en Enseñanza Secundaria, tarea para la cual redactó varios manuales de lectura (algunos en colaboración con Nicolás Fusco Sansone). Junto a Francisco Morador fundó, en 1920, la revista "Los Nuevos". Desde sus primeros años de trabajo como ensayista, se dedicó a temas de antropología cultural, sobre todo acerca de los afrodescendientes en el Río de la Plata.\r\nDesempeñó, entre mediados de la década del treinta y principios de los años setenta, una activa labor en entidades gremiales y académicas de escritores e investigadores, tanto en Uruguay como en el exterior. En 1976 se lo eligió Miembro de Número de la Academia Nacional de Letras.\r\nFalleció en Montevideo, Uruguay, el 17 de julio de 1996.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (6831, 'IGLESIAS, Enrique V. ', 'Nombre completo: Enrique Valentín Iglesias García.\r\nEconomista uruguayo de origen español. Secretario ejecutivo de la CEPAL (1972-1985), Ministro de Relaciones Exteriores de Uruguay (1985-1988), Presidente del Banco Interamericano de Desarrollo (BID 1988-2005) y desde 2005 Secretario General de la Secretaría General Iberoamericana. Integrante del Consejo de Administración de la Fundación ASTUR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7039, 'POLLERI, Felipe ', 'Nombre propio completo y forma no usada: POLLERI SIERRA, Felipe. Nacido en Montevideo, Uruguay, en 1953. Licenciado en Bibliotecología. Escritor. Entre sus obras se encuentran: "El Carnaval"(1990), "Colores"(1991), "El Rey de las cucarachas" (2001), "Vida de los artistas" (2001) y "El alma del mundo" (2005).  Publicó además "Gran ensayo sobre Baudelaire" (2007) y "La inocencia" (2008).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7124, 'CAPUTO MACHADO, Alfredo ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7385, 'TODARO, Rosalba ', 'Nombre propio completo : Rosalba Todaro Cavallero (forma no usada). Economista de la Universidad de Buenos Aires, Magister y estudios de doctorado en Economía regional de la Universidad de Pensilvania. Investigadora del Centro de Estudios de la Mujer (CEM), Chile. Investigadora en las áreas de economía feminista, condiciones de empleo, trabajo reproductivo y de cuidado y políticas públicas de género. Profesora de Economía y Género en la Maestría en Género, Sociedad y Políticas de Flacso, Argentina. Presidente de la Asociación Internacional de Economía Feminista.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7432, 'MOLLA, Roque', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7492, 'ROCCA, Pablo ', 'Nacido en Montevideo, Uruguay, en 1963. Doctor en Letras (FFLCH, Universidade de São Paulo). Profesor Titular de Literatura Uruguaya en la Facultad de Humanidades y Ciencias de la Educación (Universidad de la República, Montevideo, Uruguay). Director Académico de la Maestría en Literatura Latinoamericana en la Facultad de Humanidades y Ciencias de la Educación. Director del archivo cultural en tal institución universitaria pública denominado Sección de Archivo y Documentación del Instituto de Letras. Docente en Universidades de Argentina y Brasil; participó en congresos en Alemania, Argentina, Brasil, Cuba, España, Estados Unidos y México. Tradujo diversos autores del portugués: Machado de Assis, Murilo Rubião, Cyro Martins, Tabajara Ruas, Sergio Faraco, entre otros.\r\nDe sus libros se destacan "35 años de Marcha"; "Horacio Quiroga: el escritor y el mito" , "Historia de la literatura uruguaya contemporánea 1996-1997"; "Dos caras de un proyecto latinoamericano" entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7528, 'REBOLLO, María Antonieta ', 'Profesora Emérita de la Facultad de Medicina. UdelaR. Rectora del Instituto Universitario CEDIIAP');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7611, 'TURNES, Antonio L. ', 'Nombre propio completo y forma no usada: TURNES UCHA, Antonio L. Nacido en Montevideo, en enero de 1943. Médico desde 1975. Secretario ejecutivo de la Confederación Médica Panamericana (1964-1971). Secretario del coordinador técnico del Ministerio de Salud Pública (1966-1967) y de la Dirección del Hospital Pereira Rosell (1967). Vinculado al Sindicato Médico del Uruguay desde 1964 hasta 1976, en que se exilió en Argentina. Desempeñó desde 1985 hasta 2005 el cargo de Administrador General del SMU. Miembro de las Sociedades Uruguayas de Historia de la Medicina y de Especialistas en Salud Pública y del Colegio Uruguayo de Administradores de Servicios de Salud. Miembro de la Comisión Honoraria de Salud Pública (2005-2008) y del directorio de la Caja de Jubilaciones y Pensiones de Profesionales Universitarios (2005-2008).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7624, 'CASTELVECCHI, Gladys ', 'Nació en Rocha, Uruguay, en 1922 y falleció en Montevideo en 2008. Escritora de poemas y cuentos para niños. Trabajó en periodismo cultural. Dictó cursos de periodismo. Docente de Literatura egresada del IPA (Instituto de Profesores Artigas), dictó clases en Enseñanza Secundaria durante veinte años hasta ser destituida en 1976. Fue encarcelada a fines de ese año en el Penal de Punta de Rieles. Fue puesta en libertad en 1979 y restituida en su cargo docente al reinstalarse la democracia. Publicó "No más cierto que el sueño", su primer libro, en 1965 y "Fe de remo" en 1983.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7625, 'RICO, Alvaro ', 'Doctorado en Filosofía. Docente de Ciencia Política en la Facultad de Humanidades y Ciencias de la Educación de la UDELAR. Decano de la misma Facultad. Representante de la Universidad de la República en la Secretaría para los Derechos Humanos de la Presidencia de la República. Coordinador del Grupo de Estudios Disciplinarios sobre el Pasado Reciente, Comisión Sectorial de Investigación Científica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7646, 'RIVERO, Raquel ', 'Master en Educación por la Universidad de Entre Rios, Argentina. Posgraduada en Ciencias Sociales por la Facultad Latinoamericana de Ciencias Sociales. Licenciada en Ciencias de la Educación por la UdelaR. Formación en magisterio por los Institutos Normales Joaquín R. Sánchez y María S. de Munar.\r\nFormación en arte dramático (Teatro Circular), música (Conservatorio Falleri-Balzo y Municipal de Montevideo) y danza contemporánea (Grupo Babinka).\r\nExperiencia docente en todos los subsistemas de la ANEP, con estudiantes y docentes.  Docente del Centro Regional de Profesores del Centro, ANEP-CODICEN.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7783, 'SALAMANO TESSORE, Ronald ', 'Neurólogo. Profesor de Neurología y Director del Instituto de Neurología de la Facultad de Medicina, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7818, 'SAAVEDRA METHOL, Juan Pablo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7892, 'ROSSIELLO, Leonardo ', 'Nombre propio y forma no usada: ROSSIELLO RAMIREZ, Leonardo. Nacido en Montevideo, Uruguay, en 1953. Perseguido y exiliado por la dictadura militar. Se mudó a Suecia en 1978. Profesor universitario e investigador, se doctoró de la Universidad de Gotemburgo con una tesis sobre el origen de la narrativa breve en Uruguay. Publicó libros y artículos,  y sus relatos fueron premiados y publicados en diarios y revistas de varios países.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7940, 'ROMERO ULLMANN, Roberto', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (7941, 'LLAMAZARES, Juan', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8146, 'SCHELOTTO, Salvador ', 'Arquitecto uruguayo. Docente universitario. Fue Decano de la Facultad de Arquitectura entre 2001 y 2009. Realizó estudios de especialización en investigación histórica. Integrante de la Comisión del Patrimonio Cultural de la Nación y del Colegio de Jurados de la Sociedad de Arquitectos del Uruguay. Coordinador de Programa en la OPP. Fue Director de Planificación de la Intendencia de Montevideo. Consultor y proyectista en la escala urbana y territorial, habiendo recibido premios y menciones en concursos nacionales e internacionales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (57277, 'WEBB, Beatrice', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (57278, 'WEBB, Sidney', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8185, 'WALSH, Rodolfo Jorge ', 'Nacido en Argentina, provincia de Río Negro en 1927. Desaparecido en Buenos Aires el  25 de marzo de 1977.\r\nFue un periodista, escritor, dramaturgo y traductor argentino que militó en la Alianza Libertadora Nacionalista y luego integró las organizaciones guerrilleras FAP y Montoneros.\r\nComo escritor trascendió por sus cuentos policiales ambientados en Argentina y por sus libros de investigación periodística sobre el fusilamiento ilegal de civiles en José León Suárez de junio de 1956 ("Operación Masacre") y sobre los asesinatos de Rosendo García ("¿Quién mató a Rosendo?") y Marcos Satanowsky ("Caso Satanowsky").');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8304, 'WOJCIECHOWSKI, Gustavo ', 'Seudónimo y forma también usada: MACA. Nacido en Montevideo, Uruguay, en 1956. Ha publicado libros, y en revistas sus poemas y ensayos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8396, 'BERENGUER, Amanda ', 'Nombre propia y forma no usada: BERENGUER BELLAN, Amanda\r\nMontevideo, 1921-2010. Poeta, Premio Ministerio Instrucción Pública (1952), colaboradora de importantes revistas uruguayas y extranjeras, jurado de los premios poesía "Casa de las Américas" (La Habana, 1986). Obras: "A través de los tiempos que llevan a la gran calma" (1940), "Canto hermético, a los incesantes peregrinos" (1941), "Elegía por la muerte de Paul Valéry" (1945), "El río" (1952), "La invitación" (1957), "Contracanto" (1961), "Quehaceres e invenciones" (1963), "Declaración conjunta" (1964), "Materia prima" (1966), "Composición de lugar" (1976), "Poesía 1949-1979" (1980), "Identidad de ciertas frutas" (1983), "La dama de Elche" (1987), "Los signos sobre la mesa" (1987), "El monstruo incesante" (1990).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8446, 'TEZANOS, Sabela DE ', 'Nacida en Montevideo, Uruguay, en 1959. Realizó estudios completos de Filosofía en la Facultad de Humanidades y Ciencias, además de haber cursado los tres años del Primer Período de la Escuela Nacional de Bellas Artes. Publicó: "Palabras sin nombre", "Los desprendimientos", "Jugar con fuego", "Pliegues en el silencio".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8483, 'VILLARINO, Ciro', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8534, 'SALGADO, José ', 'Profesor de la Universidad de Montevideo. Constituyente en 1917 y en 1934.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8558, 'PEREIRA CAMPOS, Santiago', 'Abogado. Socio de la firma Rueda, Abadi & Pereira. Profesor De Derecho Procesal y de Derecho Tributario de la Seguridad Social. Consultor del Programa de Apoyo a la Defensa de la Competencia y del  Consumidor, y del PNUD. Autor de cuento en la obra literaria “Proyecto 17-11”');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8603, 'AHARONIAN, Coriún ', 'Nacido en Montevideo (Uruguay), en 1940, fue discípulo de Héctor Tosar y Luigi Nono en composición, y de Lauro Ayestarán en musicología. Ha sido docente en la Universidad de la República y en el Instituto de Profesores Artigas (IPA). Ha dictado cursos en Argentina, Bolivia, Brasil, Colombia, Ecuador, España, Paraguay y Venezuela. Ha sido conferencista en diversos países de América, Europa y Asia. Es autor de ensayos y artículos publicados en varios idiomas, y de los libros "Introducción a la música" (1981/1992), "Héctor Tosar, compositor uruguayo" (1991), "Conversaciones sobre música, cultura e identidad" (1992), "Educación, arte, música" (2004), "Músicas populares del Uruguay" (2007) y "Hacer música en América Latina" (2012). Cinco de ellos han recibido el Premio del MEC, Uruguay. Ha tenido a su cargo la edición de los "Estudios para los orígenes del tango argentino" de Carlos Vega (2007) y de los "Textos breves" de Lauro Ayestarán (2014). Ha integrado el comité ejecutivo de la Asociación Internacional para el Estudio de la Música Popular (IASPM) en su etapa fundacional. Ha sido co-organizador de los 15º Cursos Latinoamericanos de Música Contemporánea, realizados en diferentes países del continente. Es director honorario del Centro Nacional de Documentación Musical Lauro Ayestarán (CDM). El Sistema Nacional de Investigadores lo ha designado Investigador Emérito.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8807, 'VERNE, Julio', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8814, 'VALANZANO, Hugo E.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8865, 'SILVA, Elder ', 'Nombre propio y forma no usada: SILVA RIVERO, Elder. Nacido en Pueblo Lavalleja, departamento de Salto, Uruguay, en 1955. Poeta, periodista, maestro y gestor cultural. Dirige el Centro Cultural "Florencio Sánchez" de Montevideo y dicta clases de Gestión Cultural en la Facultad de las Artes del Centro Latinoamericano de Economía Humana, Claeh.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (8971, 'SORIA, Abel ', 'Nacido en Los Cerrillos, departamento de Canelones, Uruguay. Desde la infancia ayudó a sus padres en las labores del campo, alternando esta actividad con las primeras incursiones por el mundo de las letras y de la música. Recibió clases de solfeo y de guitarra y también fue acordeonista. En 1956 trabajó en radio como operador, locutor e informativista. Ha grabado varios discos y ofrecido charlas y disertaciones sobre variadas temáticas. Intérprete de sus propias composiciones en las que predomina la veta humorística. También practica el dibujo y la pintura. Ha recibido diversos premios por su trayectoria artística.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (9016, 'BERTULLO SANTILLAN, Guillermo ', 'Nombre propio y forma no usada: BERTULLO SANTILLAN, Guillermo Evaristo. Nacido en Fray Bentos, Uruguay, el 1º de setiembre de 1953. Autor de poesía y canciones. Realiza estudios de filosofía y antropología. En 1999 recibe el título de Experto en uso, manejo y conservación de recursos naturales renovables, expedido por la Unifersidad de Ciencias Agrarias. En 1991 integra el Taller Literario "Juana de Ibarbourou" de Young. Es panelista del III Seminario Nacional de Literatura, realizado en Montevideo y organizado por AEDI (Asociación de Escritores del Interior). Realiza actividad de Cuenta cuentos en muchos centros educativos, hasta en la escuela del Solar de Artigas en Paraguay. Participa  en el IV Seminario Nacional de Escritores, también participa en el primer encuentro internacional de poesía en "Fray Bentos capital de la poesía". Se integra a la publicación de la Revista Cultural "Charrúa" en calidad de Director. Construye el Museo Privado Guyunusa, museo de rescate arqueológico del material indígena. Es egresado de la Escuela de Policía.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (9142, 'DIAZ DE DEVITA, Ruth ', 'Uruguaya. Poetisa y pintora. Miembro de AEDI (Asociación Escritores del Interior).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (9154, 'SORONDO, Myrtha Myriam ', 'Nacida en Montevideo, Uruguay. Poeta y narradora. Publicó en 1979 "Natahel". Su cuento infantíl "Florito y Feston" fue editado en la colección de Cuentos del Gallito del diario El País. Miembro de AEDI (Asociación de Escritores del Interior) y Grupo "Erato" Forma no usada: SORONDO Myrtha Myriam.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (9372, 'GUTIERREZ, Alejandro', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (9763, 'URUGUAY. UNIVERSIDAD DE LA REPUBLICA', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (9996, 'PUCCI, Francisco Eduardo ', 'Forma no usada: PUCCI GARMENDIA, Francisco Eduardo; PUCCI, Francisco. Sociólogo egresado del Instituto Universitario de Pesquisas de Río de Janeiro. Doctor en Sociología y Antropología por la Universidad Lyon II. Investigador del CIESU y docente en la Facultad de Derecho y en la Facultad de Ciencias Sociales. Coordinador del Grupo de Investigación "Sociología de la gestión de recursos humanos" financiado por la Comisión Sectorial de Investigación Científica de la UDELAR. Investigador nivel II del Sistema Nacional de Investigadores (SNI) de la Agencia Nacional de Investigación e Innovación (ANII). Ha publicado trabajos referidos al movimiento sindical.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33813, 'CABRERA, Fernando ', 'Nacido en Montevideo (Uruguay) en 1956. Cantautor de música popular y gruitarrista. Escritor de poesía, enseña y produce música.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (57855, 'MOORE, John Bassett', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109051, 'GRAMATICA, Luis ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10017, 'REY MORATO, José María del ', 'Nacido en Montevideo, Uruguay, en 1940. Abogado egresado de la Universidad de la República, Uruguay. Estudió en España Administración Pública Local y Sociología Política. Integró las redacciones de los diarios "El Diario" y "La Mañana". Docente en la Universidad Católica del Uruguay "Dámaso A. Larrañaga" (UCUDAL), en la que fue Director de la carrera de Comunicación Social. Autor de libros sobre temas de su profesión y de libros de cuentos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10202, 'AMORIN, Isabel ', 'Nacida en Uruguay, en la ciudad de Treinta y Tres, capital del Departamento con el mismo nombre. Vivió en el campo. Es maestra y ha desempeñado sus tareas tanto en escuelas rurales como en su ciudad natal y Montevideo. En 1991 obtiene el segundo premio en un concurso de Literatura infantil, realizado por la Intendencia Municipal de Montevideo con su obra “Cuentos infantiles”. Forma no usada: AMORIN DE DOMINGUEZ, Isabel');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10262, 'CATSIGERAS, Eleonora ', 'Instituto de Matemática y Estadística "Prof. Ing. Rafael Laguardia", Facultad de Ingeniería, Universidad de la República, Montevideo, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10280, 'BAUDELAIRE, Charles ', 'Nombre propio y forma no usada: BAUDELAIRE, Charles Pierre.\r\nNacido en París (Francia) en 1821 y fallecido en 1867. Fue poeta, crítico de arte y traductor.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10450, 'RIELLA, Alberto ', 'Doctor en Sociología por la Universidade Federal do Rio Grande do Sul. Profesor Efectivo Adjunto en el Area de Sociedad Rural y Desarrollo de la Facultad de Ciencias Socales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10458, 'CAMPERO, Guillermo ', 'Sociólogo, profesor de Políticas Públicas en la Universidad de Chile y en la Universidad Católica');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10588, 'GIORDANO, Gustavo ', 'Nacido en 1952 en Florida, Uruguay. Maestro egresado del Instituto Normal de dicha ciudad. Maestro, Subdirector y Director en Escuelas de Práctica. Realizó en el Instituto Magisterial Superior el Curso para Directores. Subdirector y Director, también, de Escuelas de Educación Común. Inspector de Zona en la Jurisdicción de Canelones Oeste (Uruguay). Autor de trabajos relacionados con enseñanza Primaria, vinculados fundamentalmente a las Ciencias Sociales y al área de la Lengua.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10591, 'LASA, Julio', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10596, 'WALTER, Jorge', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10615, 'OLMEDO, Ignacio ', 'Nació en Artigas en 1927. Publicó un libro de cuentos, "Yarao", y una novela corta "La venganza de la Diosma", acompañada de dos relatos. Cuentos suyos fueron seleccionados para integrar las antologías "Hombres de mucha monta" y "Cuentos de boliche". su obra narrativa (tardía, ya que descubrió la escritura a los sesenta años), ha sido destacada -entre otros críticos- por Oscar Brando y Jorge Albistur.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10875, 'BEHARES, Luis Ernesto', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (10912, 'HERMOSA ANDUJAR, Antonio', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11023, 'CALDERON DE LA BARCA, Pedro', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11170, 'ANDRADE DE RAMOS, Celestina ', 'Nació en Durazno, Uruguay en 1934. Poeta por vocación y periodista.\r\nParticipó en la Antología "Uruguay y su poesía infantil" (1979), dirigida por Sylvia Puentes de Oyenard, en "Letras femeninas de América" (1981) y "Literatura Infantil Uruguaya" (1982).\r\nCompuso la letra de varias canciones llevadas al disco por Carlos Benavídez.\r\nSocia fundadora de la Asociación de Literatura Infantil');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11249, 'BAYER, Osvaldo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11258, 'VAYRA, Renzo ', 'Nacido en Montevideo, Uruguay en 1971. Es artista plástico, escultor e ilustrador. Publió La leyenda de Laridia de Marcos Vázquez (Trilce, 2012). Tres cuentos de la selva de Horacio Quiroga (Trilce, 2010), Imaginarius de Marcos Vázquez, (Trilce, 2010).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11281, 'LUXEMBURGO, Rosa ', 'Nombre propio y forma no usada: LUXEMBURG, Rose. Nacida en Zamosc, Imperio ruso, el 5 de marzo de 1871 y fallecida en Berlín, Alemania, el 15 de enero de 1919. Teórica marxista de origen judío. Conocida por su nombre castellanizado LUXEMBURGO, Rosa.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11305, 'INVERSO, Julio ', 'Nacido y fallecido en Montevideo, Uruguay (1963-1999). Poeta y narrador.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11333, 'LLANTADA FABINI, Modesto Juan ', 'Es periodista. Militante del Partido Colorado. Fue director del desaparecido matutino "Tribuna Salteña". Presidente de la Organización de la Prensa del Interior, Presidente de la Comisión Honoraria de Cultura de la Intendencia de Salto entre 1985-1990, Secretario de la Delegación del Uruguay en la Comisión Técnica Mixta de Salto grande entre 1995-2005. Participó activamente desde 1984 en la gestión de las campañas electorales del Partido Colorado en Salto. Fue designado delegado de la República en la Comisión Técnica Mixta de Salto Grande en agosto de 2011, presentando su renuncia en agosto de 2012.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11334, 'SANJURJO TOUCON, Alvaro ', 'Crítico cinematográfico y escritor humorista uruguayo. Nació en Montevideo en 1942. Comenzó su actividad humorística escribiendo en la revista Guambia bajo el seudónimo de "El Miope". Bibliografía: Tiempo de imágenes, La luz de la linterna : (cuentos cinematográficos), Biografías biodegradables, Indiscretas biografías de gente famosa : (verídicas e irrespetuosas).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11388, 'SIERRA, Julio', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11422, 'ARCOS, José Pedro ', 'Médico internista. Neumólogo. Prof. Agdo. del Instituto del tórax. Laboratorio de función respiratoria. Hospital de Clínicas "Prof. Dr. Manuel Quintela", FMED-UDELAR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11460, 'CASTRO, Julio César ', 'Otra forma usada: JUCECA. Nacido y fallecido en Montevideo, Uruguay, 1928-2003. Escritor. Guionista y dramaturgo. Ha escrito también bajo el seudónimo: JUCECA. Publicó: "Los cuentos de don Verídico" (1972), "Don Verídico se la cuenta" (1975), "La vuelta de don Verídico" (1977), "Más cuentos de don Verídico" (1982), "Entretanto cuento" (1992), "Nadie entiende nada" (2003).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11480, 'DIBARBOURE, María N. ', 'Nombre propio y forma no usada: DIBARBOURE ROSSINI, María N. Química Farmacéutica egresada de la Udelar, Uruguay. Diploma Superior en Constructivismo y Educación y Diploma Superior en Enseñanza de la Ciencias, ambos de la Facultad Latinoamericana de Ciencias Sociales (FLACSO). Magíster em Psicología Cognitiva y Aprendizaje (FLACSO-Universidad Autónoma de Madrid, UAM). Profesora de Química y Ciencias Físicas. Especialista en Tecnología de Enseñanza Secundaria. Ayudante de Farmacología en la Facultad de Química de la UdelaR. Coordinadora de Ciencias en Institutos de Enseñanza Primaria. Formadora de formadores maestros (PAEPU y CEIP). Directora del Programa Educación del Centro Latinoamericano de Economía Humana (CLAEH).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11552, 'GUERRA, Nelson ', 'Forma no usada: GUERRA, Nelson A. Nacido en Montevideo, Uruguay, en 1943 y radicado en Maldonado a partir de 1979. Poeta y narrador. Desde pequeño frecuenta el taller del escultor José Zorrilla, de quien, informalmente, recibe instrucción y guía en sus primeros pasos artísticos. Ha recibido premios en las categorías dibujo y acuarela. Se especializa en acrílicos y vitrales. En 1974 abandona momentáneamente la pintura, para dedicarse a la literatura, donde también ha recibido premios. Edita la Revista de Arte y Literatura "Imágenes", conjuntamente con Fernando Juanicó Peñalva y Juan Pedro Carbajal, revista en la cual publica numerosas obras tanto plásticas como literarias.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11566, 'NOBOA, Oscar ', 'Director de la Cátedra y del Centro de Nefrología del Hospital de Clínicas, Facultad de Medicina, Universidad de la República, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63177, 'SILVA, Sebastián DA', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63214, 'TOLEDO, Mirta', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11690, 'BEROCAY, Roy ', 'Nacido en Montevideo, Uruguay, el 21 de febrero de 1955. Escritor, periodista, guitarrista, compositor y cantante. Integrante del grupo de rock "La conjura de los necios", del grupo "El Conde Saint Germain" y, junto a sus hijos, del trío "Rocandrol". Como periodista ha desarrollado su actividad en las revistas "Zeta", "Guambia", "El Dedo" y en los semanarios "Búsqueda" y "Aquí". Entre los años 1982 y 1995 se desempeñó como corresponsal de la agencia de noticias "Reuters". En el año 2006 abandona definitivamente el periodismo, aunque esporádicamente colabora con "El País cultural". Algunas de sus obras son: "Los telepiratas", "Pateando lunas", "Lucas, el fantástico", "Babú", "Las aventuras del sapo Ruperto", "Ruperto detective", "Ruperto insiste", "Ruperto de terror".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (11871, 'BORJA, Rodrigo ', 'Rodrigo Borja Cevallos (Quito, 19 de junio de 1935), político y jurista ecuatoriano, fue presidente del Ecuador desde 1988 a 1992. Desde temprana edad se dedicó a la política. Fundador ideológico, y figura máxima del partido socialdemócrata Izquierda Democrática, con el cual fue candidato presidencial en 1978, 1984, 1988 y 1998, ganando las elecciones presidenciales en 1988. Además, ha sido diputado al Congreso Nacional en 1962, 1970, y 1979 y profesor de ciencias políticas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (12148, 'PALLARES, Ricardo ', 'Nació en 1941, Montevideo, Uruguay. Docente de literatura, ensayista, crítico y poeta. Miembro de la Academia Nacional de Letras, de la Casa de los Escritores del Uruguay y de la Fundación Vivan Trías. Publicó: "Felisberto Hernández y las lámparas que nadie encendió", "La circunstancia rioplatense en la obra de Felisberto Hernández", "¿Otro Felisberto?", "La función humanizadora de la palabra", "Tres mundos en la lírica uruguaya actual", "Propuesta para una metodología de la literatura", entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (12239, 'CASALAS VIERA, Carlos ', 'Nacido en 1951. Doctor en Derecho y Ciencias Sociales, Facultad de Derecho de la Universidad de la República (Montevideo, Uruguay). Profesor de Derecho del Trabajo en la Regional Norte de la Facultad de Derecho de la Universidad de la República (Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (12397, 'LUPPI, Carlos', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (12545, 'MAQUIAVELO, Nicolás', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (12646, 'BERIZONCE, Roberto Omar', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (12688, 'PODETTI, J. Ramiro ', 'Uruguayo, docente de la Universidad de Montevideo, donde coordina el Instituto de Estudios Latinoamericanos Alberto Methol Ferré. Sus dedicaciones son la historia del pensamiento y la cultura en América Latina y la historia de las ideas políticas. Es miembro fundador de la Sociedad Rodoniana y la Asociación Alberto Methol Ferré, e integra la Asociación Latinoamericana de Literatura y Teología. En 2006 recibió el Premio Internacional de Ensayo Mariano Picón Salas, que otorga la Fundación Rómulo Gallegos, por su obra "Cultura y alteridad : en torno al sentido de la experiencia latinoamericana".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (13130, 'RODRIGUEZ, Yamandú ', 'Nacido en Montevideo, Uruguay, en 1891. Poeta, dramaturgo, narrador. En la poesía y en el teatro desplegó innumerables efectos que halagaban a su público y explotó la sentimentalidad, el coraje gaucho y la raza; en el cuento es donde todos los críticos coinciden en ver el valor perdurable de la obra de Rodríguez. Su poema dramático "El matrero" (1919), llevado al cine en Argentina, inspiró al maestro Felipe Boero para realizar la ópera homónima. Publicó una gran cantidad de cuentos bajo el seudónimo John Moreira. Falleció en Montevideo, en 1957.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (13144, 'LAMAISON PAEZ DE MUTARELLI, Myriam Raquel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (13213, 'CERVANTES SAAVEDRA, Miguel DE ', 'Soldado, novelista, poeta y dramaturgo español. Nació 1547 en Alcalá de Henares y murió en 1616 en Madrid. Considerado la máxima figura de la literatura española. Escritor de "Don Quijote de la Mancha", que muchos críticos han descrito como la primera novela moderna y una de las mejores obras de la literatura universal. Se le ha dado el sobrenombre de Príncipe de los Ingenios.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (13269, 'COSTABEL, Miriam ', 'Profesora Mg. Ed. en Cátedra de salud del adulto y del anciano de la Facultad de Enfermería de la Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (13396, 'ARROSA CARVE, Juan Carlos ', 'Nació en Montevideo, Uruguay, en 1930. Doctor en Derecho y Ciencias Sociales. Publicó comentarios en diversos periódicos de Maldonado, Uruguay; Porto Alegre, República Federativa de Brasil; y de la ciudad de Buenos Aires, República Argentina. Cursó estudios de Derecho Civil, y Derecho del Trabajo y Seguridad Social, en la Facultad de Derecho de París (la Sorbonne). Cursó estudios de Derecho Estadounidense y de Derecho Internacional en Southwestern Legal Fundation de la ciudad de Dalas, Texas, Estados Unidos de América. En 1973 ocupó la vicepresidencia del Club Malvín de basketball. Director Ejecutivo del Cine Universitario durante cuatro años, a partir 1985. Publicó: "Andanzas por bailes y cafés", "Contactos entre mujeres y hombres", "Relatos amorosos y otros cuentos", "Encuentros y desencuentros", "Historias de verano" entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (13547, 'VILLAMIL, Roberto', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14019, 'ALTERINI, Atilio Aníbal', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14230, 'TOCQUEVILLE, Alexis de', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14477, 'AJA ESPIL, Jorge A.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14556, 'ANDERSON, Perry ', 'Perry Anderson, nacido en 1938 en el seno de una familia angloirlandesa, es uno de los grandes pensadores marxistas de nuestro tiempo y ha sido la columna vertebral durante muchos años de la New Left Review, una revista fundamental para el pensamiento de izquierdas. Entre sus obras más importantes figuran `Consideraciones sobre el marxismo occidental`, `El Estado absolutista`, `Transiciones de la antigüedad al feudalismo`, `Tras las huellas del materialismo histórico`, publicadas por Siglo XXI, mientras que Anagrama publicó en 1977 su excelente ensayo `La cultura represiva` y posteriormente `Los fines de la historia` (1996) y `Campos de batalla` (1998).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14596, 'MIHALI, Gabriel ', 'Escribano.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14651, 'FERRA BOSCH, Catalina', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14687, 'DI MAGGIO, Nelson ', 'Nacido en San José de Mayo, Uruguay, en 1928. Profesor, historiador, crítico de arte y curador de exposiciones en diversas ciudades del mundo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14693, 'PIGLIA, Ricardo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14695, 'CHURI BON, Hermes Walquivan ', 'Poeta uruguayo nacido en 1949.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14700, 'RIERA, Estanislao ', 'Nació en Canelones, Uruguay, en 1935. Escritor de poesías y narrativa. Algunos de sus textos han sido musicalizados por cantautores nacionales. Colaboró en la página literaria de la revista "Artigas", "Riachuelo" y "Periódico argentino". Cofundador de la revista "Punto a punto". Perteneciente a los movimientos literarios "Círculo artes y letras Angel Falco", "Rondas de Nelly de Perino", "Grupo Diálogo", "Peña Yolanda Migues", "Camino al futuro", "Arte hermano", y cofundó "Artes y letras de la Costa de Oro", "Escritores a la rueda" y "Grupo Nubes".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14709, 'AGORRODY, Fernando', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14714, 'ANDREOLI, Miguel ', 'Abogado y Licenciado en Filosofía. Investigador nivel 2 del Sistema Nacional de Investigadores (SNI) de la Agencia Nacional de Investigación en Innovación (ANII). Profesor en Etica y en Filosofía política y Director del Departamento de Filosofía de la Práctica en la Facultad de Humanidades y Ciencias de la Educación de la Universidad de la República. Autor de varios trabajos sobre ética, filosofía política, justicia y fundamentos de los derechos humanos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14752, 'FINLEY, Moses I.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14777, 'CURBELO SORIA, Carmelo J.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14938, 'ESMORIS, Gustavo ', 'Nacido en Montevideo (Uruguay) el 26 de enero 1959. Escritor, ha publicado "Detrás de la noche" (EBO, 1992); "Calles vacías" (EBO, 1998); "Adyacencias" (AEBU, 2002); "Un viejo octubre roto" (Rumbo, 2007); "Ciudad Perdida" (del Rincón, 2011); y "Será que nací al sur" (del Rincón, 2013). Ha ganados diversos premios literarios nacioneles e internacionales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (14947, 'KACHINOVSKY, Alicia ', 'Profesora Titular del Instituto de Psicología Clínica de la Facultad de Psicología de la Universidad de la República, Uruguay. Psicóloga, con Maestría en Psicoanálisis, y maestra especializada en el área del  discapacitado intelectual. Integra la Asociación Psicoanalítica del Uruguay (APU). Directora Académica de la Maestría en Psicología y Educación de la Facultad de Psicología. Investigadora en temas de la interfaz psicoanálisis y educación. Investigadora nivel I del Sistema Nacional de Investigadores (SNI) de la Agencia Nacional de Investigación e Innovación, Uruguay (ANII).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15136, 'AROCENA, Martín ', 'Nacido en Montevideo, Uruguay, en 1979. Profesor de Historia y estudiante avanzado de Literatura. Docente en liceos de Montevideo. Primer Premio en la categoría Narrativa del Concurso Literario de la Intendencia Municipal de Montevideo 2010, con el libro "Exiliados".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15185, 'BARES, Alba ', 'Poeta y narradora uruguaya, nacida en Montevideo. Psicóloga. Periodista. Manager en Marketing.Terapeuta floral. Conferencista y jurado en varios certámenes literarios. Ha recibido varios premios literarios: en el certamen "Puente de Palabras del Mersocur": Tercer Premio (2009), Primer y Segundo Premios (2010) y en 2011 Tercer Premio en AEDI. Miembro de AEDI (Asociación de Escritores del Interior).\r\nIntegra el Grupo Armonía de Solymar, Canelones.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15188, 'DOVAL, Mario ', 'Nacido en Montevideo, Uruguay, 1963. Poeta, narrador, actor. Miembro de AEDI (Asociación Escritores del Interior).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15221, 'CRESTANELLO, Francisco A. ', 'Nacido en Montevideo, Uruguay, en 1938. Doctor en Medicina egresado de la Facultad de Medicina de la Universidad de la República. Practicante Externo y Practicante Interno titular del Ministerio de Salud Pública. Especialista en cirugía. Su carrera académica y docente fue continua ocupando, por concurso y en titularidad, varios cargos en diversas cátedras, servicios y clínicas de la Facultad de Medicina. Miembro titular de la Academia Nacional de Medicina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15237, 'OSTUNI, Omar ', 'Nacido en Paysandú, Uruguay, en 1935. Locutor de radio, profesor de Filosofía. Escribió para diarios, fundó una librería y a partir de la década de 1980 comienza su dedicación a la dramaturgia como actor, director, profesor de actuación, fundador de teatros y escritor de varias obras. Falleció en 2012.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15328, 'VIGORITO, Andrea ', 'Economista egresado de la Universidad de la República, Uruguay. Maestría en Economía por la London School of Economics and Political Science. Investigadora del Instituto de Economía de la Facultad de Ciencias Económicas, UDELAR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15369, 'SKINNER, Quentin', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15416, 'CHERRO AGUERRE, Miguel A. ', 'Nació el 30 de agosto de 1933 en Montevideo, Uruguay. Doctor en Medicina. Pediatra y Psiquiatra de niños y adolescentes y Psicoterapeuta Psicoanalítico. Profesor Titular de Psiquiatría de Niños y Adolescentes y ex-Director de dicha Clínica de la Facultad de Medicina. Autor de cuatro libros escritos, artículos y capítulos en revistas y libros nacionales e internacionales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15817, 'VARESE, Juan Antonio ', 'Nombre propio y forma no usada: VARESE SAIZ, Juan Antonio. Nació el 11 de junio de 1942 en Montevideo, Uruguay.Escribano público. Escritor e investigador de temas de historia, fotografía y tradiciones populares. Estudió periodismo en la Asociación Internacional de Prensa y de Historia de las Religiones en la UCUDAL Socio de ICOM Uruguay (International Council of Museums) y Miembro fundador de la Academia Uruguaya de Historia Marítima y Fluvial. Colaborador de suplementos culturales en periódicos nacionales y revistas extranjeras. Co realizador de audiovisuales sobre barrios y tradiciones de Montevideo. Presidente del Foto Club Uruguayo (1987-1991). Publicó: "De naufragios y leyendas en las costas de Rocha", "Memorias del tamboril", "Los candombes de Reyes", "Rocha, tierra de aventuras", "De náufrago a pionero", "Faros del Uruguay", "Historia de la fotografía en el Uruguay", y "Montevideo bajo bandera británica".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15824, 'URIARTE AUDI, Gonzalo ', 'Profesor Agregado de Técnica Forense y Derecho Procesal y Director del Consultorio Jurídico de la Facultad de Derecho de la Universidad de la República, Uruguay. Forma no usada: URIARTE, Gonzalo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15944, 'GRAÑA, François ', 'Nacido en 1951. Doctor en Sociología. Profesor Agregado del Departamento de Ciencias Humanas y Sociales de la Licenciatura en Ciencias de la Comunicación de la Universidad de la República (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15946, 'ERREA, Eduardo ', 'Ingeniero Agrónomo, especialista en temas de economía agraria. Asesor técnico en el MGAP (1975-2012). Fue subdirector del Programa Nacional de Desarrollo Ganadero. Consultor privado en organizaciones nacionales e internacionales. Docente de la Universidad Católica del Uruguay en Proyectos y en Cadenas Agroindustriales. Integra el Programa Agronegocios-Facultad de Ciencias Empresariales de la UCUDAL. Fue presidente de la Sociedad Uruguaya de Economistas Agrícolas. Delegado por el orden de egresados en ámbitos de cogobierno de la Facultad de Agronomía.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (15974, 'VIDART, Daniel D. ', 'Nombre propio y forma no usada: VIDART BARTZABAL, Daniel. Nacido en 1920 en Paysandú, Uruguay. Antropólogo, docente, investigador, ensayista y poeta. Estudió Derecho y Ciencias Sociales en la Universidad de la República. Profesor de Sociología en el Instituto de Profesores "Artigas", y Profesor de Antropología Social en la Escuela Universitaria de Servicio Social de la Universidad de la República, hasta 1972. Fue, entre 1985 y 1988 Profesor Titular y Director del Departamento de Antropología de la Facultad de Humanidades y Ciencias de la Universidad de la República, Uruguay. Director del Centro de Estudios Antropológicos Dr. Paul Rivet desde 1962, y experto de la UNESCO en Investigación Sociocultural y Consejero Regional de Educación Ambiental para América Latina y el Caribe. Jefe del Departamento de Sociología Rural y Director del Centro de Recursos Humanos del Ministerio de Ganadería y Agricultura hasta 1972.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16160, 'BONILLA MONEGAL, Myrtha ', 'Profesora de Literatura, Historia y Filosofía. En 1969 publicó "Los topos" y la "Simbólica Aria". Desde 1967 integra Antologías  de la Colección AEDI y otras extranjeras. Entre 1971 y 1974 fue ganadora de diversos premios en el extranjero.En 1977 publicó "Los signos de la lluvia"; en 1990 "Ls corrientes humanísticas en la parapsicología". Realiza una intensa actividad como docente, conferencista, actuando como Jurado en la Intendencia Municipal de Montevideo, Concurso Literario Dr. Alberto Manini Ríos y en otras importantes entidades culturales. Fue directora del periódico desaparecido "El deber cívico", en Melo (Cerro Largo). Actualmente es Vice-presidente de la Asociación de Escritores del Interior (AEDI).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16240, 'LARRE BORGES, Ana Inés ', 'Nacida en 1958. Escritora. Investigadora. Periodista.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65180, 'DESTOUET, Raquel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104898, 'PICASSO, Valentín ', 'Ingeniero Agrónomo, de la Facultad de Agronomía (UdelaR, Uruguay). Doctor en Agricultura Sustentable, Universidad de Ciencia y Tecnología del Estado de Iowa (Estados Unidos).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16256, 'MASELLO, Laura ', 'Doctora en Ciencias del Lenguaje (Universidad Nacional de Córdoba). Licenciada en Letras Modernas con especialidad en Literatura Francesa (Université de Bordeaux III). Especialista en Enseñanza del Portugués Lengua Extranjera (Universidad de la República y Universidad Estadual de Campinas). Directora del Centro de Lenguas Extranjeras de la Facultad de Humanidades y Ciencias de la Educación de la Universidad de la República (UDELAR), donde se desempeña como Profesora Agregada de portugués y Profesora Adjunta de francés. Profesora Adjunta de francés en la Facultad de Derecho, en la carrera de Traductorado. Traductora literaria. Desarrolla líneas de investigación sobre las culturas de enseñar y de aprender lenguas extranjeras y sobre las litreraturas caribeñas del área creolo-francesa.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16284, 'GUERRA, Eriberto A. ', 'Nació el 11 de marzo de 1914 en Libertad, San José, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16496, 'ANCAP', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16938, 'VALLE INCLAN, Ramón del ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16957, 'MONTES, Cándido ', 'Nacido en Montevideo, Uruguay. Diploma de Entrenador Deportivo. Pedícuro y Podólogo. Estudió en el exterior "Gestión Financiera y Contable en la Empresa" (Italia, Dinamarca y Holanda); "Economía Laboral" (Universidad de Georgetown, Washington). Realizó pasantías en España y Francia. Docente de Enseñanza Secundaria. Director y docente en el Instituto Uruguayo de Deportología. Doctorado en "Economía Deportiva", "Deportología", "Investigación Deportiva".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16973, 'CARDELLINO, Ricardo A. ', 'Ingeniero Agrónomo (Uruguay, 1968). Master of Science (M.S) en mejoramiento animal (Oklahoma State University, E.U.A, 1970) como becario de la Comisión Fulbright. Doctor of Philosophy (Ph.D) en Genética y Estadística (North Carolina State University, E.U.A, 1973). Docente en la Universidad de Minnesota, E:U.A (1973-1975). Investigador del Centro Nacional de Ganado de Carne, EMBRAPA, Brasil (1975-1977). Profesor de Genética Cuantitativa, Mejoramiento Animal y Estadística del Curso de Posgrado en Zootecnia, Universidad Federal de Pelotas, Brasil (desde 1977). Trabajos de investigación en mejoramiento genético de bovinos para carne y ovinos. Coordinador de Programas de mejoramiento en el sur de Brasil. Consultor en el área privada en Uruguay y Brasil.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (16990, 'CARETTE, Augusto', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (17082, 'BETTONI, Roma ', 'Nacida en Montevideo, es abogada.\r\nEn 1988, descubre la comunicación, vocación que la absorbe por completo, dedicándose al aprendizaje y enseñanza de técnicas de dominio mental, inteligencia emocional, ley de atracción y lectura de lenguaje textual.\r\nEntre sus obras se cuentan: \r\nViaje a tu mundo interior (Ed. Fin de Siglo, 1993)\r\nArmoniosa mente (Ed. Fin de Siglo, 1994)\r\nHay otro camino (Ed. Fin de Siglo, 1998)\r\n1/4 de segundo. Inteligencia emocional  (Ed. Fin de Siglo, 2005 y 4 ed. 2010)\r\nEl libro de oro de la atracción. Si puedes imaginarlo, puedes tenerlo (Ed. Fin de Siglo, 2008)\r\nLa magia de las respuestas (Ed. Fin de Siglo, 2010)\r\nGestos. Un lenguaje para aprender a descifrar  (Ed. Fin de Siglo, 2011)\r\nLos gestos de la seducción (Ed. Fin de Siglo, 2013)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (17528, 'BOTTA ROCCATAGLIATA, José', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (17562, 'CALABRIA, Robert ', 'Catedrático de Filosofía Teórica en el Instituto de Filosofía de la Facultad de Humanidades y Ciencias de la Educación (UDELAR). Inspector de Filosofía en Enseñanza Secundaria.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (17807, 'MEZZERA, Ricardo ', 'Nacido en Montevideo (Uruguay) en 1961. Abogado y docente universitario. Publicó "Las Horas Enteras" (EBO, poesía, 1985), "Río ancho como niebla" (Artemisa, novela, 2005), "Una razón imperfecta" (Artemisa, 2007).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (17910, 'PRATS, Luis ', 'Nacido en Montevideo, Uruguay. Cronista en las páginas deportivas de "El Día". Periodista de los diarios "El País" y "El Observador", del semanario "Búsqueda" y de la revista "Galería". Se ha desempeñado en otras áreas como son la información parlamentaria e internacional. Realizó seminarios de especialización en la Universidad de Columbia (Nueva York) y en Miami.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18111, 'GARINI, L. S. ', 'Nombre propio completo y forma no usada: URDANGARIN, Héctor. Nacido en Mercedes, departamento de Soriano, Uruguay, en 1903. Narrador. Su obra comienza a publicarse en 1963. Falleció en Montevideo en 1983.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18154, 'DIAZ BERENGUER, Alvaro ', 'Nacido en Montevideo, Uruguay, en 1954. Médico especialista en Medicina Interna. Profesor agregado de Clínica Médica de la Facultad de Medicina de la Universidad de la República. Integrante de la Comisión honoraria de seguridad del paciente y prevención del error médico del Ministerio de Salud Pública. Autor de varias publicaciones científicas y de artículos periodísticos y publicaciones vinculadas con las humanidades médicas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18205, 'FIGUEREDO, Ricardo Leonel ', 'Nacido y fallecido en Pan de Azúcar, departamento de Maldonado, Uruguay (1918-2014). Escritor, artista plástico, indigenista. Maestro. En el año 2000 se designa a la Casa Municipal de Cultura de Pan de Azúcar con su nombre.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18259, 'HAMED, Amir ', 'Nació en Montevideo, Uruguay, en 1962. PdH en Literatura Hispanoamericana y Teoría, por la Northwestern University. Escritor. Ha publicado, entre otros, las novelas "Artigas Blues Band", "Troya Blanda" y "Semidiós"; los volúmenes de relatos "Qué nos ponemos esta noche" y "Buenas noches, América", y, en 2003, el volumen ensayístico "Retroescritura, Orientales : Uruguay a través de su poesía Siglo XX". En 2007, publicó el libro ensayo "Mal y nemoal. Rudimentos de geoidiocia"; tradujo "The two noble kinsmen" de William Shakespeare & John Fletcher". Se desempeñó como redactor en jefe de la "Guía del mundo : el mundo visto desde el sur" y como editor de "Social Watch". Docente e investigador en Universidad ORT Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18300, 'ACHARD, José Pedro', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18307, 'INSTITUTO INTERAMERICANO DEL NIÑO', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18824, 'PERDOMO, Jesús ', 'Nombre propio completo y forma no usada: PERDOMO BENTANCOUR, Jesús. Nacido en Rsario, departamento de Colonia, Uruguay. Reside en Castillos, departamento de Rocha, desde 1954. Investigador y docente de Historia y Educación Musical en liceos de Castillos y Chuy.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18912, 'ALZUGARAT, Alfredo ', 'Nacido en Montevideo en 1952. Es Licenciado en Letras (UDELAR), narrador, crítico e investigador. Entre sus obras se encuentran: Porque la vida ya te empuja; War; Extraños y Extrajeros (antología de cuentos); Cuentos de Atar; Primer Vuelo; Lautaro; Segundo Vuelo entre otros. Como investigador publicó: Desde la otra orilla, Trincheras de papel, Dictadura y literatura carcelaria en Uruguay entre otros. Como crítico colabora en El País Cultural.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (18933, 'CHEBATAROFF, Nicolás', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19009, 'BERDAGUER, Jaime ', 'Abogado. Profesor de Derecho Civil 2 y 3 y Director del Instituto de Derecho Civil de la Facultad de Derecho de la Universidad de la República, Uruguay. Consultor del Programa de apoyo a la Defensa de la Competencia y del Consumidor (BID/FOMIN). Autor de diversos libros en materia de obligaciones y contratos. Forma no usada: Jaime Berdaguer Estrader.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28121, 'LAVIÑA, Pamela ', 'Nacida en Uruguay, en 1965. Licenciada en Psicología, Udelar. Master en "Política y derecho de la integración en el Mercosur", Universidad de Montevideo. Asesora para el "Programa Esquinas de la Cultura" del Departamento Cultura de la Intendencia de Montevideo. También trabaja en la División Políticas Sociales de la misma Intendencia, integrando la Comisión de Atención a Personas en Situación de Calle.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109052, 'SUAREZ ANZORENA, Francisco ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19303, 'EHRLICH, Ricardo ', 'Nacido en 1948. Ministro de Educación y Cultura. Fue Intendente de Montevideo (2005-2010). Magister en Ciencias (DEA, opción Bioquímica y Biología Molecular) y Doctor de Estado en Ciencias Físicas. de la Universidad Luis Pasteur de Estrasburgo, Francia. Participó en la creación  de la Facultad de Ciencias, habiendo sido el creador del Laboratorio de Bioquímica y Biología Molecular de la misma. Fue Director del Instituto de Biología. Presidente de la Comisión Sectorial de Investigación Científica de la UdelaR (Universidad de la República, Uruguay). Investigador del Centro Nacional de Investigación Científica (CNRS), Francia. Decano de la Facultad de Ciencias de la UdelaR (1997-2005). Presidió el Consejo de Administración del Instituto Pasteur de Montevideo (2004-2010).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19393, 'IRURETA GOYENA (1874-1947), José ', 'Nombre propio y forma no usada: IRURETA GOYENA ANZA, José. Nacido en Montevideo (Uruguay) en 1874 y fallecido en 1947. Fue abogado penalista, profesor, decano y empresario rural uruguayo.  Decano de la Facultad de Derecho de la UdelaR (Uruguay). Autor del Código Penal uruguayo en 1934.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19509, 'RUOCCO, Angel V.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19578, 'DEWEY, John', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19698, 'ESCARDO, Florencio', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19728, 'MORAS, Héctor', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (19890, 'ALONSO, Fernando ', 'Nacido el 17 de julio de 1975 en Las Piedras, Canelones. Comienza en 1992 en taller literario coordinado por la profesora Isabel Rubbo. En 1995 pasa a integrar el taller literario de Jorge Arbeleche y Sylvia Lago. Publica poemas en revistas literarias. Publica en el libro colectivo "Polifonia".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20011, 'CACERES, Esther de ', 'Formas no usadas: CORRECH DE CACERES, Esther - CORRECH, María Esther.\r\nNació en Montevideo, Uruguay, en 1903 y murió en Galicia en 1971. Estudió en la Universidad de Mujeres y en la Facultad de Medicina graduándose en 1929. Médica y catedrática. Obras: Las ínsulas extrañas, 1929; Canción de Esther de Cáceres, 1931; Libro de la Soledad, 1933; Los Cielos, 1935.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20032, 'OSE', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20053, 'CLARE, Dardo E.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20066, 'LISSARDI, Ercole ', 'Nombre propio no identificado. Nacido en 1950, Montevideo, Uruguay. Escritor. Publicó: "Calientes" (1995), "Aurora lunar", "Ultimas conversaciones con el fauno", "Interludio interlunio", "Evangelio para el fin de los tiempos", "El amante espléndido", "Una como ninguna" (2008), "La vida en el espejo" (2009), entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20132, 'SANSEVIERO, Rafael ', 'Director de proyecto político de la Fundación Friedrich Ebert en Uruguay. Fue coordinador general del Centro de Investigación e Información de la Universidad para la Paz de Naciones Unidas. Diputado del Frente Amplio (1990-1995). Activista en movimientos contra la violencia hacia las mujeres y contra la impunidad. Columnista de medios de prensa. Ha realizado investigaciones, publicado libros y artículos referidos a temas de género y derechos humanos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20147, 'BERON, María Soledad ', 'Escritora de poesía nacida en Montevideo (Uruguay). Dedica su poesía a resaltar las relaciones humanas, por emdio de elementos sensibles. Miembro de AEDI (Asociación de Escritores del Interior).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20282, 'INFANTOZZI DURAN, Rosario ', 'Nombre propio y forma no usada: INFANTOZZI DURAN, María del Rosario. Nacida en Montevideo, Uruguay, en 1947. Traductora pública de francés, escritora. En 1992 publicó su primer libro "Yo, Matos Rodríguez, el de La Cumparsita". También escribió guiones cinematográficos, y produjo y dirigió espectáculos teatrales musicales y cortometrajes de ficción.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20328, 'MASLIAH, Roberto ', 'Forma no usada: MASLIAH GALANTE, Roberto. Nacido en Montevideo, Uruguay, el 18 de mayo de 1927. Cursó estudios en la Universidad de la República y se recibió de Médico el 5 de noviembre de 1955. Se dedicó a la Ortopedia y a la Traumatología. Incorporó al Instituto Nacional de Ortopedia y Traumatología (INOT) nuevas técnicas y su instrumental. Fue Traumatólogo de Racing desde 1955 a 1960 y Jefe del Departamento Médico de del Club Nacional de Fútbol entre 1961 y 1965. Con la selección Uruguaya debutó en el Sudamericano de Guayaquil 1959 y continuó participando en las eliminatorias, giras previas y mundiales de los años 1962, 1966 y 1970, y participó en la gira previa del Mundial de 1974. Usufructuó Becas en Clínicas Europeas. Ex-presidente de la Sociedad Uruguaya de Medicina y Deporte, 1968. Ex-Presidente de la Sociedad de Ortopedia y Traumatología Uruguay, 1971-72. Ex-vicepresidente de la Sociedad Latinoamericana de Ortopedia y Traumatología. Ex integrante de la Junta Directiva del CASMU en varios períodos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20440, 'RODRIGUEZ DIAZ, Universindo ', 'Artigas, 1952-2012. Licenciado en Ciencias Históricas (Udelar). Estudioso de la historia social y del movimiento obrero, e integrante del Departamento de Investigaciones Literarias e Históricas de la Biblioteca Nacional. Entre sus obras se destacan: "Los sectores populares en el Uruguay del Novecientos" (1989-2006), "Juan Carlos Mechoso, anarquista" (2006) y "José D''Elía. Constructor de unidad, forjador de esperanzas" (2008).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20445, 'VILLAR, Hugo ', 'Doctor en Medicina (UdelaR). Especialista en Salud Pública y en Administración de servicios de salud. Docente de la Facultad de Medicina (UdelaR), Director del Hospital de Clínicas (1969-1974, y 1985-1991)\r\nMiembro de la Comisión Directiva y Secretario General de la la Asociación de Estudiantes de Medicina.Profesor y Jefe del Depto. de Administración de Salud een el Instituto de Desarrollo de Salud, cuba, 1974-1978. Profesor de Salud Pública y Administración de servicios de salud. España, 1978-1984.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20483, 'STIGLITZ, Joseph E. ', 'Premio Nobel de Economía en 2001, es actualmente catedrático de Economía en la Universidad de Columbia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20719, 'PAULLIER, Juan Carlos ', 'Abogado, periodista deportivo. Fue presidente de la Comisión Nacional de Educación Física y vicepresidente del Consejo Intergubernamental de la Educación y el Deporte de la UNESCO. Creador y director del programa televisivo "Calidad de Vida"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20803, 'MARGENAT, Juan Pedro ', 'Nace en 1940 en Montevideo, Uruguay. Arquitecto graduado de la Universidad de la República (UdelaR). Docente en el área de Diseño en la Facultad de Arquitectura, Universidad Central de Venezuela y profesor en diseño interior en el instituto ADI y "Las Mecedes", donde dictó la asignatura de Diseño y de Historia del Mueble. Investiga sobre el surgimiento y desarrollo del Art Decó. Dictó un curso sobre Historia del Mobiliario en Occidente en el Instituto de   Diseño (Facultad de Arquitectura, UdelaR). Escribe para le ctálogo de la exposición Arte Abstacto en el Río de la Plata. Investigó sobre la arquitectura "estilo blanco" en Uruguay, publicando el libro Barcos de ladrillos : arquitectura de referentes náuticos en Uruguay : (1915-1950).  \r\nSe desempeña como docente de anteproyecto en el Taller Parodi, sinedo Profesor Agregado Gº 4 desde 1992 hasta 1998 (Facultad de Arquitectura, UdelaR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20872, 'BIANCHI, Roberto ', 'Nacido en Montevideo, Uruguay, el 30 de marzo de 1940. Poeta y editor. Co-director de aBrace, movimiento coordinador para la edición, publicación, promoción y edición de obras culturales. Ha recibido premios literarios. Poemas y artículos suyos han sido publicados en numerosas antologías.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20920, 'RODRIGUEZ, Adolfo ', 'Nacido y fallecido en Montevideo, Uruguay (30 de noviembre de 1814- 06 de octubre de 1873). Abogado, político, diplomático, financista y magistrado. Nombre propio y forma no usada: RODRIGUEZ VAZQUEZ, Adolfo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (20962, 'ETCHEVERRY ESTRAZULAS, Nicolás ', 'Doctor en Derecho y Ciencias Sociales egresado de la Facultad de Derecho de la Udelar. Profesor de Filosofía del Derecho en la mencionada Facultad (1986-2003) y profesor de Filosofía del Derecho, Etica y Retórica de la Universidad de Montevideo. Miembro del Instituto de Filosofía del Derecho del Uruguay y de la Asociación Argentina de Filosofía del Derecho. Co-fundador y Director del Instituto Pre-Universitario de Montevideo (1995-2007). Decano de la Facultad de Derecho de la Universidad de Montevideo desde 2004. Miembro de la Academia Internacional de Derecho Comparado (International Academy of Comparative Law), con sede en París.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (21016, 'JULIA, Santos', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (21282, 'LIGRONE FERNANDEZ, Pablo ', 'Arquitecto, egresado de la Universidad de la República, Uruguay. Doctor en urbanismo y ordenamiento territorial, egresado de la Universidad de París III (Sorbonne Nouvelle). Catedrático de teoría de la arquitectura y urbanismo en la Facultad de Arquitectura (Farq) de la UdelaR. Director académico de la maestría en ordenamiento territorial y desarrollo urbano de la Farq, Udelar. Investigador nivel I del Sstema Nacional de Investigadores (SNI), Agencia Nacional de Investigación e Innovación (ANII). Profesor invitado en másteres y doctorados de diversas universidades de distintos países del mundo. Director de políticas y planes territoriales del Ministerio de Vivienda, Ordenamiento Territorial y Medio Ambiente en el período 2005-2009. Director junto a la arquitecta Astrid Sánchez Rossel del emprendimiento Bastides-territorio-ambiente-desarrollo-arquitectura-diseño.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (21330, 'RECCIUTTI DENUCCI, Pedro ', 'Nacido en Montevideo, Uruguay. Narrador, poeta, ensayista y dramaturgo. Ha recibido premios y distinciones literarias. Dirigente del "Grupo Erato". Colabora con distintos movimientos culturales del interior del país con el "Proyecto Libros Sin Tapas" y el "Espacio Mixtura". Miembro de la Comisión Organizadora de los "Encuentros Internacionales Poetas y Narradores de las Dos Orillas". Imparte talleres de creatividad literaria en capital e interior. Realiza recitales unipersonales o en colaboración con músicos y otros escritores. Disertante en charlas y conferencias relacionadas con la creatividad literaria y la obra de escritores uruguayos e iberoamericanos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (21518, 'PINTO, Guilherme de ALENCAR ', 'Nació en 1960 en San Pablo, reside en Montevideo desde 1986. Es docente en la Universidad ORT. Cómo periodista ha colaborado para varios medios uruguayos y argentinos. Colaboró como productor artístico, arreglador, director musical o tecladista en grabaciones de diversos músicos uruguayos. Es autor del libro "Razones locas : El paso de Eduardo Mateo por la música uruguaya" (1994)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (21591, 'GARCE, Adolfo ', 'Forma no usada: GARCE GARCIA Y SANTOS, Adolfo. Nació en 1965, en Montevideo, Uruguay. Politólogo y ensayista. Licenciado y Magíster en Ciencias Políticas (UdelaR). Docente en la Facultad de Ciencias Sociales y en la Facultad de Ciencias Económicas y Administración (UdelaR). Investigador en el Instituto de Ciencia Política (UdelaR). Consultor de la empresa de opinión pública Pulsar. Publicó: "Uruguay y su conciencia crítica", "Técnicos y política", "El giro republicano : bases conceptuales del déficit democrático de América Latina", entre otros. Columnista del diario "El Observador" e integrante del equipo de "Dosmil30".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (21593, 'ARMAS, Gustavo DE ', 'Doctor en Ciencia Política y Magíster en Ciencia Política por la Universidad de la República. Profesor en la Maestría de la Licenciatura de Ciencia Política, de la Universidad de la República. Investigador del Instituto de Ciencia Política e investigador (nivel 1) del Sistema Nacional de Investigadores del Uruguay. Autor de varios trabajos en el área de políticas sociales y de la educación. Especialista en Políticas Sociales para el Fondo de las Naciones Unidas para la Infancia (UNICEF) en Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (21641, 'BASTIAT, Frédéric Claude ', 'Nacido en Bayona, Francia, el 30 de junio de 1801 y fallecido en Roma el 24 de diciembre de 1850. Escritor, legislador y economista francés. Formó parte de la Escuela liberal francesa. Conocido también como el "Cobden" francés, fue un entusiasta del libre comercio y del pacifismo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (21995, 'MORIN, Edgar ', 'Nacido en París en 1921. Director de investigaciones emérito en el Centro Nacional de Investigaciones Científicas (CNRS), de Francia. Pensador multidisciplinar e indisciplinado, es autor de una extensa obra de referencia y ha sido reconocido internacionalmente por haber concebido el "pensamiento complejo" en su obra maestra, "El Método". Es doctor honoris causa por veinticuatro universidades de todo el mundo. \r\nEs autor, entre otros libros, de "Los siete saberes necesarios para la educación del futuro", "Breve historia de la barbarie en Occidente", "El año I de la era ecológica", "Para una política de la civilización", "¿Hacia el abismo? Globalización en el siglo XXI" y "Hacia dónde va el mundo?".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (22110, 'ALVAREZ PETRAGLIA, Federico ', 'Fue Magistrado entre los años 2002 y 2010, habiéndose desempeñado como Juez Letrado con competencia en materia penal durante 7 años. Actualmente ejerce libremente la profesión, esencialmente en defenza de casos penales y vinculados a los derechos humanos violentados en el pasado reciente. Es aspirante a Profesor Adscripto de Derecho Penal en la Universidad de la República (UdelaR). Integrante del estudio jurídico Vanzini y Asociados Abogados, encargado del Departamento Penal del mismo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (22116, 'PEREZ NOVARO, César ', 'Doctor en Derecho y Ciencias Sociales en la Universidad de la República (1975). Profesor Titular de Derecho Financiero y Profesor Titular de Derecho Tributario en la Facultad de Ciencias Jurídicas de la Universidad de la Empresa (UDE). Profesor Titular de Derecho Financiero de la Facultad de Derecho del Centro Latinoamericano de Educación Humana (CLAEH) con sede en Punta del Este. Profesor Adjunto de Derecho Financiero de la Facultad de Derecho de la UdelaR, responsable de la reseña de la jurisprundencia tributaria que se publica en la página de la misma Facultad. Rrofesor de Cursos de Posgrado en UdelaR, UDE, en el Centro de Estudios Judiciales del Uruguay (CEJU) y en el Colegio de Abogados del Uruguay, Vicepresidente del Instituto Uruguayo de Estudios Tributarios (IUET). Presidente del Colegio de Abogados.del Uruguay (2006-2008). Ha publicado artículos en revistas uruguayas como: "Revista Tributaria", en el "Consultor Tributario de la Ley"; "La Justicia Uruguaya"; "Tribuna del Abogado", "Revista de la UDE"; y en revistas del exterior: "Revista de Ciencias Jurídicas de Costa Rica" y en " Revista del COADEM".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (22416, 'TORRES, Alicia ', 'Nombre propio y forma no usada: TORRES DOS SANTOS, Alicia ; TORRES DOS SANTOS, Alicia Stella. Uruguaya. Egresada del Instituto de Profesores Artigas y Magíster en Ciencias Humanas opción Literatura Latinoamericana por la Facultad de Humanidades y Ciencias de la Educación (UdelaR). Docente de Literatura española, en dicha Facultad. Integra el Consejo Editor Honorario de la BIblioteca Nacional, es crítica literaria y periodista cultural. Ha colaborado en varios medios de prensa de Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (22474, 'DIAZ, Hugo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38952, 'OGUEZ, Martha ', 'Nacida en Montevideo, Uruguay, el 22 de marzo de 1939. Maestra en escuelas primarias urbanas y rurales. Docente en el Instituto de Formación Docente Clelia Vitale D''Amico de Mendoza y directora del Jardín de Infantes Nº 104. Ganadora de varios premios en concursos literarios. Forma no usada: OGUEZ DE PEREZ, Martha');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (22738, 'OCHS OLAZABAL, Daniel ', 'Abogado y graduado con el título de Especialista en Derecho Constitucional y Derechos Humanos por la Universidad Católica del Uruguay. Profesor de grado de Derecho Constitucional, de la Maestría en Derechos Humanos en la Facultad de Derecho de la Universidad Católica del Uruguay y de la Escuela de Gobierno del Parlamento Uruguayo. Ex docente de Derecho Constitucional en la Facultad de Derecho de la Universidad de la República y en la Facultad de Derecho de la Universidad de Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (22950, 'ACOSTA PITTETA, Luis', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (22960, 'VARELA, Héctor A. ', 'Formas no usadas: VARELA DENIS, Héctor Aníbal y VARELA, Héctor. Contador Público y Licenciado en Administración. Profesor Adjunto de "Introducción a la Contabilidad"; profesor de "Contabilidad Básica" y "Banca y Negocios con el Exterior" en la Facultad de Ciencias Económicas y de Administración. (UDELAR).  Docente de Teneduría de Libros y Contabilidad Aplicada en la Escuela de Administración de la FCEyA - UDELAR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (22971, 'RUVERTONI, Marcelo ', 'Pediatra. Dermatólogo pediatra.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (23362, 'CINTERFOR', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (23978, 'VACCARO PEREIRA, Alberto Juan ', 'Nació en Pan de Azúcar, Maldonado, Uruguay en 1958. Profesor de Astronomía de Educación Secundaria, Profesor de Acordeón a Piano y de solfeo, Periodista radial.Ha publicado sus poemas en la revista "Letras" de Pan de Azúcar. Sus obras publicadas son : "El cerro desde cada esquina" (1955), "El telón azul del cielo" (2000, astronomía) . "En los rieles del tiempo" (2000, crónicas) , "Tu hijo, mi alumno" (2005, docencia) y "Reflexiones en la Cueva de Pan de Azúcar" (2008).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24027, 'IFRAN, Douglas ', 'Nacido en Treinta y Tres, Uruguay, en setiembre de 1950. Maestro y escritor. En su labor sindical, junto a L. Neira, refunda la Revista Quehacer Educativo. También pronuncia sus primeras conferencias destinadas a sus colegas. Complementa su formación inicial con diversos cursos de especialización que culminan con la Maestría en Educación y Sociedad. Al culminar su etapa de docente "activa" se volcó a la actividad literaria, publicando cuentos y teatro. En el terreno del pensamiento educativo tiene en su haber un buen número de artículos publicados en diversas revistas y periódicos, nacionales y extranjeros. Ha realizado un trabajo sistemático que lo ha llevado a analizar la genealogía de nuestra enseñanza pública.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24109, 'REHERMANN, Carlos ', 'Nacido en Montevideo en 1961. Estudiante de  ingeniería. Arquitecto por la Universidad de la República, Uruguay. \r\nAunque trabajó algunos años como arquitecto, desde 1995 se dedica plenamente a la escritura. Autor de novelas y de numerosas obras de teatro. Ha publicado centenares de notas de prensa especializadas en temas culturales, y ha escrito ponencias para congresos, seminarios y encuentros académicos sobre teatro y políticas culturales. Director y conductor del programa radial "Tormenta de Cerebros" y el programa de televisión "La habitación china".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24114, 'FORNARO BORDOLLI, Marita ', 'Licenciada en Musicología, en Ciencias Antropológicas, y en Ciencias Históricas, por la Universidad de la República, Uruguay. Especialista en Etnomusicología y sus Aplicaciones a la Educación (INIDEF - Consejo Nacional de la Cultura de Venezuela/OEA), Caracas, 1982. Ha obtenido el Diploma de Estudios Avanzados en el Doctorado en Música y en el Doctoral en Antropología de la Universidad de Salamanca. Sus principales campos de trabajo son la cultura y música populares y la música en las instituciones teatrales. Coordinadora del Departamento de Musicología de la Escuela Universitaria de Música entre 2003 y 2015. Coordinadora del Centro de Investigación en Artes Musicales y Escénicas del Litoral Noroeste de la Universidad de la República, Uruguay. Miembro del Grupo Interdisciplinario Cuerpos, Arte, Sociedad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24156, 'NAPOL, Marta ', 'Nutricionista uruguaya. Trabaja en Subcomponente "Eliminación del riesgo nutricional" y en el proyecto "Canelones crece contigo"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24169, 'MIRES, Fernando ', 'Chileno. Profesor de Historia. Docente. Doctor en Ciencias Económicas y Sociales.. Doctor en Poliítica Internacional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24170, 'URUGUAY. LEYES Y DECRETOS', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24373, 'PORTA, Fernando ', 'Licenciado en Economía Política por la Universidad de Buenos Aires, con estudios de especialización de posgrado en la Universidad de Sussex, Inglaterra. Especialista en Economía Internacional y Economía Industrial. Profesor Titular de las Universidades Nacionales de Quilmes y Buenos Aires.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24408, 'MIRABAL BENTOS, Gustavo ', 'Montevideo, 1957. Doctor en Derecho y Ciencias Sociales. Juez Letrado de Primera Instancia de Durazno. Ex docente universitario. Ex Prosecretario Letrado de la Suprema Corte de Justicia. Integra Grupos de Estudio en Psicología Jurídica y una Comisión Asesora de la Suprema Corte de Justicia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24583, 'SILVEIRA, Pablo da ', 'Nacido en 1962 en Uruguay. Doctor en Filosofía por la Universidad de Lovaina (Bélgica). Profesor de Filosofía Política en la Universidad Católica del Uruguay. Escritor. Director del Programa de Gobierno de la Educación de la UCUDAL.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24800, 'DIAZ, José ', 'Nombre completo: José Enrique Díaz Chávez\r\nNacimiento: 17 de enero de 1932, Uruguay, Cerro Largo\r\nOcupación: Abogado, Político\r\nFue Ministro del Interior desde marzo de 2005, al tomar Tabaré Vázquez posesión como presidente, hasta 2007. Díaz fue cofundador del Frente Amplio y junto a José Pedro Cardoso firmó los documentos que integraban al Partido Socialista al Frente Amplio.\r\nEn su juventud Díaz fue militante del Partido Socialista, así como también Secretario General de la Federación de Estudiantes del Interior y dirigente de la Federación de Estudiantes Universitarios del Uruguay (FEEU), por la cual participó en el Congreso Mundial de Estudiantes en 1957 en Nigeria.\r\nEs egresado de la Facultad de Derecho de la Universidad de la República con el título de Doctor en Derecho (Abogado Laborista).\r\nEn épocas de Dictadura, Díaz se debió exiliar hacia Argentina porque era militante de izquierda y allí revalidó su título de abogado. Años más tarde al establecerse una Dictadura también en Argentina, Diaz se exilia a España donde nuevamente revalida su título de abogado. Durante su exilio Díaz representó al Partido Socialista en varios países participando así en numerosos eventos internacionales.\r\n Luego de la dictadura, Díaz vuelve de su exilio en España y fue electo diputado en los años 1984 y 1989 y desde ahí ha tenido cargos de mucha importancia como por ejemplo fue vicepresidente de la Cámara de Representantes, fue Director General del Instituto Fernando Otorgués del Frente Amplio y fue Presidente de la Fundación Vívian Trías que él mismo ayudó a fundar en el año 1995.\r\nCuando asume Tabaré Vázquez el 1º de marzo del 2005 es designado como Ministro del Interior. Presentó una ley llamada de "Humanización y Modernización del Sistema Carcelario", que mejora las condiciones de reclusión, y liberó anticipadamente a algunos presos.\r\nEl 1º de marzo de 2007 se anunció su retiro, por su propia iniciativa, del Ministerio que ocupaba, a hacerse efectivo en los próximos días, siendo sustituido por la diputada Daisy Tourné, la primera mujer en ocupar la titularidad de dicha cartera.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28145, 'MANCEBO, María Ester ', 'Doctora en Ciencias Humanas, opción Educación, por la Universidad Católica del Uruguay. Magíster en Ciencia Política por FLACSO (Facultad Latinoamericana de Ciencias Sociales) Argentina, y profesora de historia egresada del IPA (Instituto de Profesores Artigas). Profesora e investigadora (grado 4) del Departamento de Ciencia Política de la Fac. de Cs. Sociales de la Universidad de la República. Especialista en políticas educativas. Ha sido consultora de organismos nacionales e internacionales como UNESCO, UNICEF, CEPAL, PREAL, OEI y otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28269, 'CAPRA, Gustavo E. ', 'Ingeniero Agrónomo. MsC. Programa Nacional de Investigación Carne y Lana, Programa Nacional de Producción Familiar, INIA Las Brujas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28281, 'ARGENTINA. LEYES Y DECRETOS', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104919, 'BUSCAGLIA, Martín ', 'Nacido en Montevideo (Uruguay) en 1972. Artista, cantautor y productor.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (24995, 'MARCO AURELIO ', 'Marco Aurelio Antonino Augusto (apodado el Sabio o Philosopho) (26 de abril de 1214 – 17 de marzo de 180) nacido en Roma, fue co-emperador del Imperio romano desde el año 161 hasta el año de su muerte en 180. Fue el último de los llamados Cinco Buenos Emperadores, tercero de los emperadores de origen hispano y está considerado como una de las figuras más representativas de la filosofía estoica. Marco Aurelio y Lucio Vero fueron hijos adoptivos de Antonino Pío por mandato de Adriano y los dos primeros que imperaron conjuntamente en la historia de Roma. \r\nSu gobierno estuvo marcado por los conflictos militares en Asia frente a un revitalizado Imperio parto y en Germania Superior frente a las tribus bárbaras asentadas a lo largo del Limes Germanicus, en la Galia y a lo largo del Danubio. Durante el período de su imperio tuvo que hacer frente a una revuelta en las provincias del Este liderada por Avidio Casio a la cual aplastó.\r\n La gran obra de Marco Aurelio, Meditaciones, escrita en griego helenístico durante las campañas de la década de 170, todavía está considerada como un monumento al gobierno perfecto. Se la suele describir como "una obra escrita de manera exquisita y con infinita ternura');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (25765, 'GARI IRURETA GOYENA, Pedro ', 'Abogado y Escribano, Udelar. Docente de Derecho del Trabajo y de la Seguirdad Social');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (25985, 'MALET VAZQUEZ, Mariana ', 'Doctora en Derecho y Ciencias Sociales. Docente egresada del IPA. Profesora Agregada en Derecho Penal en la Facultad de Derecho (UDELAR). Fiscal Letrada de Menores. Integrante del Directorio del Centro de Investigaciones y Estudios Penales del Uruguay (CIEPUR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (26028, 'SAVIO LARRIERA, Eduardo ', 'Médico especilista en Medicina Interna y en Enfermedades Infeccionsas. Ex Director de la Cátedra de Enfermedades Infecciosas de la Facultad de Medicina, Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (26041, 'GARCIA ABAD, José Wilman ', 'Nacido en Melo, departamento de Cerro Largo, Uruguay. Docente y escritor de obras prosa y poesía para niños y adultos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (26126, 'BAROFFIO BURASTERO, Odila', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (26521, 'ROMAN, Javier', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (26688, 'RODRIGUEZ SANDRO, Ana María ', 'Uruguaya. Profesora de Historia, egresada del IPA y ex docente en dicha institución. Ex docente de Institutos Normales. Directora de liceos en Las Piedras, departamento de Canelones, Uruguay. Inspectora de institutos y liceos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (26735, 'TRELLES, Paco ', 'Nacido en Montevideo, Uruguay, en 1940. Con amplia actividad artística y literaria vinculada al folclore uruguayo. Autor, intérprete y recitador. Integra desde 1968 el Centro de la Canción Protesta del Uruguay. Graba su primer long play para el sello discográfico "De la Planta" conjuntamente con M. Capella. Luego con "Los solitarios" graba más de 70 temas de au autoría para los sellos discográficos "América Hoy", "Tupac Amarú", "Sondor", "R.C.A." Y "Palacio de la Música". También incursiona en antologías como "Canciones desde el Cuartel" y "Canciones con Historia", además de haber sido halagado von la inclusión de uno de sus trabajos en el almanaque del Club de Grabados del Uruguay. En el año 1995 edita el libro de poemas "Los muertivos", en la editorial "El estudiante" de Piriápolis.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (26738, 'ESCARDO VEGH, Alicia ', 'Nacida en Montevideo en 1963. Consultora en informática y escritora. Tiene una empresa de producción de contenidos educativos multimedia. Desarrolla proyectos para la apropiación de la tecnología en la educación, con pilotos educativos en varias escuelas e institutos del país. En 2011 obtuvo el Primer Premio en el Concurso Internacional de Cuentos Horacio Quiroga con el libro "El poder invisible". Tiene cuentos publicados en los libros colectivos "Los martes un gato" y "Lapislázuli". Editora de la revista literaria "LetraNueva". Residente en Barcelona y Madrid. Curso estudios universitarios en Montevideo, Madrid y Barcelona.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (26852, 'DOYENART, Juan Carlos ', 'Nacido en Montevideo, Uruguay, en 1950. Analista político. Director de Interconsult. Ha ejercido la docencia y ha sido catedrático en la Universidad de la REpública y en la Universidad ORT. Fue consultor del BID y otros organismos internacionales. Fue director de Canal 5 (TVEO)y como periodista se desempeñó como columnista de El Observador, codirector del quincenario dosmil 30 e intefrante del Consejo Editorial del semanario Aquí.\r\nEn la actividad política, se destacó como dirigente del Partido Demócrata Cristiano, en el FA y en el Nuevo Espacio.\r\nFue integrante de la tertulia de El Espectador. Fue asesor en materia de opinión pública de la Presidencia de la República en el período 2000-2004.\r\nEntre sus publicaciones se destacan: "El Uruguay entre dos siglos", "El problema está en nosotros", "Como el Uruguay no había" y "Octubre 2014 : no tire su voto a la basura".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (27038, 'GONZALEZ SOTO, Gustavo Daniel ', 'Uruguayo. Estudiante de Magisterio. Fue Presidente y Secretario General de la Federación Uruguaya de Cooperativas de Vivienda por Ayuda Mutua (FUCVAM). Coordinador del Programa Regional de Vivienda y Hábitat para América Latina del Centro Cooperativo Sueco. Forma no usada: GONZALEZ, Gustavo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (27114, 'ZIBECHI, Raúl ', 'Escritor y pensador-activista uruguayo, dedicado al trabajo con movimientos sociales en América Latina. Como periodista publica en el semanario Brecha (Uruguay), La Jornada (México), Carta (Italia), The Guardian (Reino Unido), Miradas al Sur (Argentina) y Lavaca (Argentina).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (27209, 'HERNANDEZ CORREA, Rubens Darío ', 'Forma no usada: HERNANDEZ, Rubén Darío. Nacido en Montevideo, Uruguay, el 29 de setiembre de 1935. Escritor y poeta. Paisajes y personajes de Lavalleja , Departamento de Uruguay, forman parte de su literatura. Su primer trabajo fue "Poesías", libro publicado en 1983; en 1986 publicó "Hojas"; en 1988 interviene en la publicación de "AEDI Uruguay Poesía 88"; en 1990 publicó "Violetas" (poesías) y en 1991 "Simientes" (prosa y poesía), entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (27223, 'DEAL, Eduardo ', 'Nombre propio completo y forma no usada: DEAL FRECCERO, Eduardo Francisco. Uruguayo. Ingeniero Agrónomo, productor y agricultor. Asesor de grupos CREA, técnico de la CHPA y del IPA. Profesor de Bienestar Animal en la Facultad de Ciencias Agrarias de la UDE en Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (27393, 'DAHL, Roald ', 'Novelista y autor de cuentos británico de ascendencia noruega, famoso escritor para niños y adultos. Entre sus libros más populares están “Charlie y la fábrica de chocolate”, “James y el melocotón gigante”, “Matilda”, “El gran gigante bonachón”, “Las brujas” y “Relatos de lo inesperado”.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (27433, 'DICKINSON, Emily ', 'EEUU (1830-1886), poeta de Nueva Inglaterra. En vida sólo publicó una carta y unos pocos poemas. Hizo varios fajos de papel con sus escritos y los guardó en su casa. Después de su muerte su hermana los encontró y los dió a conocer. Compuso al rededor de 2000 poemas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (27793, 'MIZRAJI, Eduardo ', 'Nacido en 1948, en Montevideo, Uruguay. Doctor en Medicina de la Universidad de la República. Realizó estudios de posgrado en Matemáticas (Universidad de París V). Docente de biofísica en la Facultad de Ciencias (UdelaR). Publicó: "El segundo secreto de la vida", "Borges y la ciencia". Investigador centrado en los modelos de redes neuronales y el procesamiento de la información por parte de los sistemas biológicos (Grado 5 del PEDECIBA y Nivel III del SNI).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33738, 'GONZALEZ PIANO, María del Carmen', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (105509, 'PEREIRA, Inés ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111141, 'MARENALES, Julio ', 'Fue Militante del Partido Socialista, dirigente tupamaro del MLN');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28289, 'MIRANDA BURANELLI, Alvaro ', 'Nombre propio completo y forma usada: MIRANDA BURANELLI, Alvaro. Forma no usada: MIRANDA, Alvaro. Seudónimos usados: M. OLIVAR ARANDA y ARNO MALVADARI. Nacido en Montevideo, Uruguay, en 1948. Poeta, crítico teatral y cinematográfico. Profesor egresado del IPA (Instituto de Profesores "Artigas"). Docente en Enseñanza Secundaria y Superior. Director de Ediciones del Mirador. Cofundador de las revistas "Foro Literario" y "Poética". Investigador de la Biblioteca Nacional. Su poesía ha sido publicada y traducida al portugués, inglés, francés e italiano. Obras: "Nacimiento habitado" (1971-1976), "Apertura, construcción y cierre" (1980), "La vida en sintaxis" (1981), "Palabra libre" (1982), "El mundo no es como uno lo usa" (1982), "Escalas escal(er)as : poemas para ascender y descender" (1983), "Inducción completa" (1983), "¿Qué está pasando?" (1984), entre otras.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28369, 'BURGUES ROCA, Sandra ', 'Uruguaya. Asistente del Departamento de Historia de la Medicina de la Facultad de Medicina de la Universidad de la República. Secretaria de la Sociedad Uruguaya de Historia de la Medicina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28630, 'NIETZSCHE, Friedrich', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28687, 'BARBOZA, Oruam ', 'Profesor de Historia, Licenciado en Sociología, Magister en Filosofía y Sociedad. Profesor del IPA. Director Ejecutivo de la Dirección de Formación y Perfeccionamiento Docente.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (28690, 'BALEATO, Paula ', 'Licenciada en Sociología. Facultad de Ciencias Sociales, UDELAR. Especializada en políticas de infancia y adolescencia. Coordinadora del Programa Infancia, Adolescencia y Juventud del Abrojo e integrante de la Dirección ejecutiva de esa organización. Ha participado en diversas publicaciones y dictado conferencias en Uruguay y en eventos regionales e internacionales en la temática niñez, adolescencia y políticas públicas. Ejerce la dirección ejecutiva de la Agencia Voz y Vos: Comunicación Social, Niñez y Políticas Públicas. Responsable de monitores de medios de comunicación en niñez y capacitaciones a periodistas y comunicadores. Integró la dirección ejecutiva del Comité de los Derechos del Niño- Uruguay de 1998 a 2002. Integra la Comisión Directiva de la Asociación Nacional de Organizaciones No Gubernamentales orientadas al Desarrollo. Participa como miembro en la Asamblea de Socios de la Red ANDI América. Participó del Comité Técnico Consultivo para la nueva Ley de Servicios de Comunicación Audiovisual, convocado por la DINATEL (Dirección Nacional de Telecomunicaciones, del Ministerio de Industria, Energía y Minería del Uruguay). Actualmente integra el Comité Técnico Consultivo sobre Derechos de Niños, Niñas y Adolescentes, Libertad de Expresión y Medios de Comunicación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (29155, 'GHIERRA, Alfredo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (29201, 'ROVIRA MOLINS, Jaime', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (29912, 'BELOFF, Mary ', 'Forma no usada: BELOFF, Mary A. Nacida en Argentina. Abogada formada en la Facultad de Derecho de la Universidad de Buenos Aires. Magistri in Legibus (LL.M.) por la Escuela de Leyes de la Universidad de Harvard de los Estados Unidos. Profesora de la Facultad de Derecho de la UBA donde enseña justicia juvenil, derecho penal y procesal penal, criminología y género y justicia penal en el grado. Profesora de Posgrado de las Carreras de Especialización en Problemáticas Infanto-Juveniles, Derecho Penal y Derecho de Familia y de la Maestría profesora en Derechos Humanos de la Facultad de Derecho de la UBA, de la Maestría en Derechos Humanos de la Universidad Nacional de La Plata, de la Maestría en Derecho de la Universidad de Palermo . Fiscal General de Política Criminal, Derechos Humanos y Servicios Comunitarios de la República Argentina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (29958, 'MARCHESE, Marcelo ', 'Estudiante de Profesorado de Historia en el  IPA (Instituto de Profesores Artigas). Docente en enseñanza secundaria. Integrante de la brigada poética "La Torre Maladetta" junto con Julio Inverso y Rodolfo Tizzi. Fundador de las librerías "Babilonia" y "Puro Verso" y de las editoriales "Mandinga" y "El Mendrugo".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30020, 'KREIMERMANN, Roberto ', 'Docente de Ingeniería Química. Se ha desempeñado como Director General de Industrias. Subsecretario y Ministro de Industria, Energía y Minería, vinculado también con la Universidad de la República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30038, 'ACOSTA, Yamandú ', 'Egresado de Filosofía del IPA. Magíster en Ciencias Humanas, opción Estudios Latinoamericanos. Profesor titular de Historia de las Ideas en la Facultad de Derecho y profesor adjunto e investigador del Centro de Estudios Interdisciplinarios Latinoamericanos en la Facultad de Humanidades y Ciencias de la Educación (UDELAR). Investigador activo (Nivel II) del Sisteman Nacional de Investigadores.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30040, 'PUCHET C., Enrique ', 'Profesor adjunto de Historia y Filosofía de la Educación en el Instituto de Educación de la Facultad de Humanidades y Ciencias de la Educación (UDELAR). Inspector y profesor de Filosofía en enseñanza media. Integrante del Comité Académico de la Revista Fermentario del Departamento de Historia y Filosofía de la Educación, de la que es cofundador. Autor de artículos sobre la temática en revistas nacionales e internacionales. Forma no usada: PUCHET, Enrique');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30057, 'BALIÑAS, Susana', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30116, 'ARIAS, Mortimer ', 'Uruguayo. Pastor. Educado teológicamente en Argentina. Promotor del ecumenismo cristiano a  nivel continental y mundial. Ejerció la docencia teológica en Estados Unidos y en Costa Rica. Autor de libros traducidos a distintos idiomas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30119, 'PEREIRA DE CUADRADO, Martha ', 'Nació en Punta del Este (Uruguay), en 1942. Integra el Centro de Investigaciones Históricas de San Carlos. Vinculada a la Escuela Nº 3. "Juan de Dios Curbelo"- San Carlos. Forma no usada del nombre: Pereira, Martha');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30121, 'NOGUEZ REYES, Andrés ', 'Nombre propio y forma no usada: NOGUEZ REYES, Andrés Esteban. Nació en San Carlos, departamento de Maldonado, Uruguay, en 1977. Egresó en 2002 del Instituto de Profesores Artigas como profesor de Historia y en 2012 obtuvo el título de Magister en Historia del Río de la Plata en la Facultad de Humanidades y Ciencias de la Educación, Universidad de la República. Docente de Historia en el CERP (Consejo de Formación en Educación) del Este, a cargo de los cursos de Teoría y Metodología de la Historia, Historia Regional del Río de la Plata hasta 1830 e Historia de las Artes Visuales del Siglo XX. Sub Director del Liceo Nº 1 Monseñor Mariano Soler, de la ciudad de San Carlos, departamento de Maldonado, Uruguay. Publicó en coautoría con Jorge González "Los orígenes del fútbol en San Carlos. 1919-1950" en "Historias Locales del Uruguay" y "Secuestro y Desaparición de Horacio Gelós Bonilla" en la revista "Encuentros Uruguayos".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30155, 'URUGUAY. CODIGO TRIBUTARIO', NULL);
