INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30509, 'LAMSCHTEIN, Susana ', 'Máster en Análisis, Diseño y Management de Sistemas de Información por la London School of Economcs (Reino Unido) y Licenciada en Sociología por la Facultad de Ciencias Sociales de la Udelar. Docente e investigadora de la Facultad de Ciencias Sociales de la Universidad de la República, Uruguay. Coordinadora de ObservaTIC.');
