INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111422, 'DIAZ BACCINO, Carolina ', 'Abogada');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30743, 'ETCHEBEHERE ARENAS, Gabriela ', 'Psicóloga, máster y especialista en derechos de infancia y políticas públicas, Universidad de la República (UdelaR), 2010, y se encuentra doctorando en la Universidad Rey Juan Carlos, Madrid. Actualmente se desempeña como docente en la Facultad de Psicología de la UdelaR, como directora del Instituto de Psicología, Educación y Desarrollo Humano, y como encargada del Servicio de Educación Inicial. Integra el equipo del proyecto "Diseño y planificación de la creación de una Unidad de Psicología de la Salud Ocupacional y del Desarrollo Innovación Organizacional", en el marco de los programas de cooperación interuniversitaria e investigación científica, Convenio Universidad Rey Juan Carlos y UdelaR, aprobado por la Agencia Española de Cooperación Internacional para el Desarrollo (AECID). Forma parte del Comité Académico de la Maestría de Derechos de Infancia y Políticas Públicas (UdelaR) desde 2010, y en 2009 fue designada por el Ministerio de Educación y Cultura como representante alterna ante el Consejo Coordinador de la Educación en la Primera Infancia. Integra también la Comisión Directiva del Comité uruguayo de la Organización Mundial de Educación Preescolar (OMEP).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30746, 'GALEOTTI GALMES, Raquel ', 'Magíster en Derechos de infancia y Políticas Públicas (UNICEF-UDELAR). Licenciada en Psiocología (UDELAR). Psicóloga integrante de equipos técnicos de asesoramiento de Juzgados de Adolescentes de Montevideo - Poder Judicial. Ex co-coordinadora de la Cátedra Libre de Psicología Jurídica (Facultad de Psicología 2001-2011). Psicoterapeuta. Autora de diversas publicaciones especializadas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30968, 'IRIGOYEN, Emilio ', 'Montevideo, 1965. Licenciado en Letras de la Facultad de Humanidades y Ciencias de la Educación. Magíster en Literatura Latinoamiercana por la Universidad de Pittsburgh. Doctor en Letras Romances por la Universidad de Pennsylvania.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (30987, 'RUIZ, María Isabel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (31712, 'RIOS, Amalia ', 'Ingeniera Agrónoma del INIA La Estanzuela.');
