INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32024, 'URUGUAY. CODIGO DE MINERIA', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32116, 'SANJUAN, Alfonso ', 'Nació en Srandí Grande (Florida) en 1928. Cursó estudios de Derecho en la Universidad de la República (Uruguay), en la Universidad Carlos III en Madrid y en el Instituto Español de Cultura Hispánica (1957-1961). Fue funcionario portuario, llegando a ser Gerente en la Administración Nacional de Puertos. Fue preso político de la dictadura militar uruguaya en el año 1975. A partir de 1990 comenzó a realizar una investigación en el Archivo Histórico-Diplomático del Ministerio de Relaciones Exteriores sobre la Unidad Latinoamericana, lo que representa el presente trabajo.');
