INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32280, 'CALZADA, Julio ', 'Sociólogo y educador. Asesor de la Secretaría Nacional de la Junta Nacional de Drogas (Uruguay). Integrante de la Coordinación General del Instituto de Educación Popular El Abrojo (Uruguay). Forma no usada: CALZADA MAZZEI, Julio.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32284, 'RODRIGUEZ OLIVAR, Gilberto C.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32288, 'BERRO ROVIRA, Guido ', 'Doctor en Medicina. Médico Legista. Profesor del Departamento de Medicina Legal de la Facultad de Medicina de la Universidad de la República. Médico Forense (Poder Judicial). Académico Titular de la Academia Nacional de Medicina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32412, 'CABRERA, Susana ', 'Nacida en Montevideo y radicada en Tacuarembó, en donde fue profesora de Filosofía y Psicología. Ha obtenido numerosos premios nacionales y municipales. Premio Revelación 2002 de la Cámara Uruguaya del Libro.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32474, 'FERNANDEZ ARROYO, Diego P.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32476, 'TURIANSKY, Wladimir ', 'Montevideo, 1927- . Trabajó en UTE, fue delegado sindical de la Agrupación de Funcionarios de UTE, miembro y presidente en diversos periodos. Participó en el Congreso del Pueblo (1965) y en la fundación de la Convención Nacional de Trabajadores (1966). \r\nIntegró desde su adolescencia las filad de la Juventud y del Partido Comunista, del cual se desvinculo en 1998.  Participó de la creación y Fundación del Frente Amplio y fue diputado (1972-1973). Fue detenido en 1975 y permaneció preso durante 10 años. Es militante de base del FA, habiendo integrado el Plenario Nacional en representación de la Coordinadora B de Montevideo. Integra la Comisión de Fundadoras y ex militantes de la CNT, adscripta al PIT-CNT.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (32897, 'SCARAMELLI, Alejandro ', 'Neurólogo. Profesor Agregado. Sección Epilepsia del Instituto de Neurología de la Universidad de la República, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33138, 'BETTUCCI, Lina ', 'Laboratorio de Micología, Facultad de Ciencias /Facultad de Ingeniería, Universidad de la República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33174, 'CEDEÑO, Rubén ', 'Nació en Caracas, Venezuela,  en 1952. Maestro de música. Autor y compositor de obras musicales, tanto populares como académicas. Conferencista internacional. Responsable de la conducción de la mayoría de los grupos de Metafísica a nivel mundial.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33178, 'LUPO, Sandra ', 'Laboratorio de Micología, Facultad de Ciencias/Facultad de Ingeniería. Universidad de la República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33234, 'PIÑA ALDAO, Cristina ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33297, 'VERDE REY, Josefina ', 'Magíster. Profesora Directora del Centro de Posgrado. Magister en Investigación. Licenciada en Educación. Licenciada en Enfermería. Especialista en Diabetología. Miembro del Comité de Educación Médica Contínua de la Sociedad de Diabetología y Nutrición del Uruguay. Ex-educadora de la Asociación de Diabéticos del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33299, 'ALVAREZ BENAVENTE, Gerardo ', 'Nacido en 1964, ha ganado varios premios en concursos nacionales. Ha publicado en libros colectivos, en periódicos y en Internet.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33370, 'PESSOA, Fernando Antonio NOGUEIRA ', 'Nació el 13 de junio de 1888, en Lisboa. Portugal. Poeta, escritor y traductor. Su Obra se encuentra escencialmente dispersa, por varias revistas y publicaciones ocasionales. Forma usada: PESSOA, Fernando. Sus heterónimos son: CAEIRO, Alberto ; REIS, Ricardo ; CAMPOS, Álvaro de ; SOARES, Bernardo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33623, 'MAESO RUIZ, Antonio ', 'Nacido en 1961. Contador público con estudios de posgrado en evaluación y formulación de proyectos de inversión, y en terapia gestáltica. Magíser en Programación Neurolingüística. Consutor en instituciones de cooperación internacional. Director Nacional del proyecto con el Banco Interamericano de Desarrrollo (BID) y la Cámara de Industrias del Uruguay (CIU); consultor del BID, del PNUD, de la Organización Internacional para las Migraciones (OIM), de la Agencia de Cooperación alemana GTZ y de la Agencia de Cooperación Internacional suiza, entre otras. Docente y conferencista sobre redes empresariales, internacionalización de bienes y asociatividad en casi toda América Latina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33689, 'PAIVA, Aníbal', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33701, 'DUFUUR CAÑELLAS, Luis ', 'Licenciado en Ciencias de la Comunicación por la UDELAR y Doctor en Proceso de la Comunicación por la Universidad de Sevilla. Docente de las áreas Audiovisual y Teoría del Instituto de Comunicación de la FIC (Facultad de Información y Comunicación), Universidad de la República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33711, 'SOLARI, Miguel Angel ', 'Escribano público. Profesor de Derecho Tributario y de Derecho Registral en la Facultad de Derecho de la Universidad de la República y profesor agregado de Derecho Tributario en la Facultad de Derecho de la Universidad de Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33835, 'ZABALZA, Jorge ', 'Nacido en Minas (Lavalleja - Uruguay) en 1943. A nivel universitario desarrolla actividad política en el Centro de Estudiantes de Notariado y en la Federación de Estudiantes Universitarios (FEUU). Integrante, a partir de 1968, del Movimiento de Liberación Nacional Tupamaros (MLN-T) e integrante del Comité Central y del Comité Ejecutivo del MLN-T hasta 1995. Director de los periódicos "Mate Amargo" y "Tupamaros".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (33910, 'PESCE LAVAGGI, Eduardo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34031, 'FERRARA, Orestes', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34146, 'URUGUAY. CODIGO DEL PROCESO PENAL', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34215, 'TANI, Ruben ', 'Nombre propio y forma no usada: TANI FERRARI, Ruben Mario. Nacido en Montevideo, Uruguay, en 1946. Licenciado en Filosofía y en Letras. Profesor de Filosofía del Lenguaje en Facultad de Humanidades y en el IPA (Instituto de Profesores Artigas). Ha realizado investigaciones en la frontera norte, en varias escuelas y en asentamientos, con adultos y niños. Ha ejercido el periodismo en las revistas "Relaciones", "La República de Platón", y en otras publicaciones. Docente de cursos sobre semiótica y poesía en la Facultad de Humanidades y Ciencias de la Educación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34291, 'TAKS, Javier ', 'Doctor en Antropología Social. Docente de la Facultad de Humanidades y Ciencias de la Educación. Coordinador de RETEMA (Red Temática de Medio Ambiente) de la Universidad de la República, en el período 2007-2008.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34300, 'CIANCIO, Gerardo ', 'Nacido en Montevideo, Uruguay, en 1962. Egresado del Instituto de Profesores Artigas (IPA) y Máster en Dirección Educativa por la Universidad Complutense de Madrid. Ha obtenido el Premio de la Academia Nacional de Letras por sus ensayos literarios en tres oportunidades; el Premio César Vallejo de la Biblioteca Nacional de Uruguay y la Embajada de Perú en Uruguay; el Premio Ramón Gómez de la Serna de la Embajada de España y el Instituto de Cooperación Iberoamericana; el Premio Anual de Ensayo Literario édito del Ministerio de Educación y Cultura y el Premio "Netzahualcoyotl", en México, por su ensayo "Espacio y paisaje en la poesía latinoamericana".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34368, 'CABRERA DELGADO, Luis ', 'Nacido en Cuba. Escritor. Psicólogo. Ha desempeñado tareas como periodista, guionista, profesor universitaro y promotor cultural.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34497, 'ALDRIGHI, Clara ', 'Profesora de Historia Contemporánea en la Facultad de Humanidades y Ciencias de la Educación de la Universidad de la República. Ha publicado libros y artículos de su especialidad, entre ellos “La izquierda armada. Ideología, ética e identidad en el MLN Tupamaros” (2001); “La intervención de Estados Unidos en Uruguay 1965-1973. El caso Mitrione” (2007); “Memorias de Insurgencia. Historias de vida y militancia en el MLN Tupamaros” (2009); “Uruguay y Estados Unidos 1964-1966. La diplomacia de la guerra fría. Conversaciones reservadas entre políticos uruguayos y diplomáticos estadounidenses” (2012).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34511, 'SILVA, Cristina DA ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34512, 'IMAZ, Graciela', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34513, 'MARTIN, Patricia', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34514, 'RAGGIO, Estela', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34515, 'BAGLIETTO, María Victoria', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34527, 'TARUFFO, Michele ', 'Jurista italiano nacido en Vigevano, (Pavía), en la región de Lombardía, en el año 1943. Doctor en Derecho por la Universidad de Pavía. docente e infestigador en Derecho Procesal Civil, Derecho Procesal Comparado y Derecho Procesal General');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34601, 'GUERRA, Olda Daisy', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34627, 'DUTTO, Livio ', 'Nacido en Mercedes, departamento de Soriano (Uruguay) en 1919. Médico Veterinario egresado de la Facultad de Veterinaria (UdelaR, Uruguay). Su primera obra publicada fue "Manejo fisiológico del ganado de cría" (1972).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34665, 'ORIBE STEMMER, Juan Edgardo ', 'Montevideo, 1946. Autor de estudios sobre Derecho del Mar, administración de recursos marinos y protección del medio ambiente acuático. Realizó estudios de postgrado en Gran Bretaña. Sus trabajos sobre historia marítima y portuaria de los siglos XIX y XX han sido publicados en el Uruguay y en el exterior. Fue Director General del Instituto Nacional de Pesca (Uruguay), Secretario Técnico de la Comisión Técnica Mixta del Frente Marítimo y Especialista Sectorial en el área  jurídica e institucional del proyecto binacional argentino-uruguayo FREPLATA. Miembro fundador de la Academia de Historia Marítima y Fluvial uruguaya. Columnista en la página editorial del diario El País de Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (34750, 'BALLESTEROS BALBASTRE, Francesc ', 'Barcelona, 1960. Profesor de filosofía, traductor e interesado en temas relacionados con los orígenes del pensamiento filosófico y la filosofía comparada');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35052, 'WALDE, Erna von der', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35132, 'NIETO, Manuel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35185, 'NINA REIS ', 'Nacida en Minas Gerais, Brasil, el 30 de marzo de 1955. Realizó estudios hasta nivel universitario en su país. Ha realizado recitales en Uruguay, Argentina, México, Cuba, entre otros. Escribe en español y en portugués. Ha recibido varios premios literarios. Nombre propio: Rosângela Alves Domingos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35198, 'HAREAU, Guy G.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35271, 'FONTICELLI, Alfredo ', 'Nacido en Lomas de Zamora, provincia de Buenos Aires (Argentina), el 18 de febrero de 1961. Arquitecto y escritor de narrativa y cuentos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35721, 'MELLA, Daniel ', 'Seudónimo, también usado: GORJUH, Daniel. Nombre propio y forma no usada: GONZALEZ MELLA, Daniel.\r\nNacido en Montevideo en 1976. Entre sus obras se encuentran: "Pogo", "Derretimiento", "Lengua de Trapo" y "Noviembre". Coordina talleres literarios y es colaborador habitual de "El País Cultural" y la "Revista Lento".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35776, 'SOUTO SANTINI, Gonzalo ', 'Ingeniero Agrónomo egresado en 1982 de la Facultad de Agronomía de la UdelaR (Uruguay). Posgrado en Gestión Ambiental, del Instituto Universitario CLAEH. Integra el equipo técnico de la OPYPA (Oficina de Programación y Política Agropecuaria) del Ministerio de Ganadería, Agricultura y Pesca. Consultor privado para organismos internacionales, orgnizaciones y empresas nacionales. Integra el Programa de Agronegocios en la Facultad de Ciencias Empresariales de la Universidad Católica de Uruguay. Miembro de la Comisión Directiva de la Sociedad Uruguaya de Ecnomía Agraria (SUEA).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35827, 'LANZARINI, Ricardo ', 'Licenciado en Artes Pláticas del Instituto Escuela Nacional de Bellas Artes, UdelaR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (35868, 'GARCIA PRECHAC, Fernando ', 'Uruguayo. Decano de la Facultad de Agronomía desde mayo 2006. Profesor Titular de Manejo y Conservación de Suelos y Aguas, Udelar, por Concurso de oposición y méritos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (36107, 'IGLESIAS, Luis Fernando ', 'Nacido en Montevideo, Uruguay, en 1958. Abogado, docente en informática jurídica, colaborador del Suplemento Cultural de El Pais, director del suplemento Cultural de El Derecho Digital (www.elderechodigital.com) y escritor. Ha publicado Canciones de Otoño (2005), Premio Narradores de la Banda Oriental (Fundación Lolita Rubial), mención Honorifica de los Premios del Ministerio de Educación y Cultura (2007) y Federico (2007), biografía del maestro Federico Garcia Vigil, con la colaboración de Alejandra Volpi.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (36204, 'OEHNINGER GATTI, Carlos L. ', 'Neurólogo. Profesor Agregado en Neurología.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (36264, 'MANZANO, Carlos', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110245, 'BATISTA, Augusto ', 'Nacido en Montevideo, Uruguay, en 1964. Licenciado en Sociología por la Universidad Católica del Uruguay. Periodista.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (36417, 'OLAVE, Mónica ', 'Profesora de Matemática egresada del Instituto de Profesores Artigas. Maestra en Ciencias en Matemática Educativa por el Centro de Investigación Aplicada y Tecnología Avanzada del Instituto Politécnico Nacional de México. Egresada del curso de especialización para profesores de Matemática y Didáctica de los IINN. Docente de Didáctica de la especialidad Matemática del Instituto de Profesores Artigas. Profesora de Matemática de Enseñanza Secundaria. Ha participado como ponente en eventos nacionales e internacionales. Publicaciones en las Actas Latinoamericanas de Matemática Educativa (Argentina, Cuba), Revista Conversación (Uruguay), en Editorial Santillana (Uruguay), en Ediciones Rocamadur (Uruguay), entre otras.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (36419, 'OCHOVIET, Cristina ', 'Magíster y Doctora en Matemática Educativa. Coordinadora Nacional de Matemática, de la Dirección Nacional de Matemática, Consejo de Formación en Educación, ANEP (Administración Nacional de Educación Pública), Uruguay. Docente del Instituto de Profesores Artigas (IPA) y del Profesorado Semipresencial, y docente de posgrado e investigadora en el Instituto de Perfeccionamiento y Estudios Superiores (Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (36421, 'MONTES DE OCA, Marcelo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (36581, 'LOPEZ RODRIGUEZ, Carlos Eduardo ', 'Nacido en Montevideo, Uruguay, en 1962. Abogado. Docente en la Cátedra de Derecho Comercial de la Facultad de Derecho (UDELAR), Uruguay. Especializado en derecho societario y mercado de capitales, en la Facultad de Derecho de la Universidade Federal de Rio Grande do Sul, Porto Alegre. Profesor Asistente en la Facultad de Ciencias Económicas (UDELAR), en la Cátedra de Derecho Comercial.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (36644, 'VALIÑO, José ', 'Profesor Agregado de Medicina Interna y ex Profesor Adjunto de Nefrología, Facultad de Medicina, Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (37162, 'PUZO, Mario ', 'Nueva York, 1920 - Long Island, 1999. Estudió Ciencias Sociales en la Universidad de Columbia. Sus dos primeras obras, "The sark arena" y "The fortunate pilgrim", tuvieron una gran acogida. Su consagración definitiva llegó con la publicación de "El padrino", por la que además obtuvo dos premios Oscar por su trabajo como coguionista del díptico cinematográfico de Francis Ford Coppola. A esta siguieron "Los tontos mueren", "El siciliano", "La cuarta K", "El último Don". Murió en su casa de Long Island por un paro cardíaco, después de finalizar la escritura de "Omertà". Dejó inconcluso el guión teatral en el que se basa la novela "Los Corleone".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (37218, 'CONVENCION SOBRE LOS DERECHOS DEL NIÑO, 1989 ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (37252, 'IBARRA, Ruben ', 'Nombre propio completo: Ruben Darío Ibarra Vázquez (forma no usada). Nacido en Montevideo (Uruguay), 1928.\r\nCurzó la Licenciatura en Letras (Facultad de Humanidades-UdelaR). Se dedica a la cria de caballos. Ganador de numerosos premios, en 1949 con la revista ASIR, con el cuento "Chasque", en la Revista Mundo Uruguayo y en los diarios, El País,yLa Mañana.\r\nEntre sus obras editadas se encuentan "Esperando la Primavera".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (37253, 'IBARRA, Ana ', 'Nacida en Montevideo, Uruguay, en 1933. Maestra. En 1958, funda una Escuela de Ballet creando el estilo teatro-danza.\r\nEntre sus obras de teatro-danza se encuentran: "Mi ciudad en colores", "Historia de paz y de amor", "Crespín y Titina se van a casar", "Cuentos Bailados" entre otros. Entre sus libros publicados se destacan "Esperando la primavera", "Milagro de fe".\r\nUtiliza para sus obras el pseudónimo de Ana Ibarra (forma usada), tomado del apellido de su esposo Ruben Darío Ibarra Vázquez.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (37272, 'CLAVIJO DE INFANZON, Agueda', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (37495, 'FLORES DAPKEVICIUS, Rubén ', 'Doctor en Derecho y Ciencias Sociales y Abogado. Profesor de Derecho Administrativo y de Derecho Constitucional. Ex Asesor Letrado del Servicio Civil de la Presidencia de la República Oriental del Uruguay. Integrante fundador de la Asociación Mundial de Justicia Constitucional, de la Asociación Argentina de Justicia Constitucional y de la Asociación Uruguaya de Derecho Procesal Constitucional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (37608, 'BORETTO OVALLE, René', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (37936, 'VELAZCO, Diego ', 'Nacido en 1967 en Montevideo, Uruguay. Fotógrafo. Ha expuesto en Brasil, Estados Unidos, España y Perú. Ha participado en Photo Plus NYC y Photo Paris. Sus fotografías se encuentran en colecciones privadas en Uruguay, España, Argentina, Holanda, Inglaterra y Alemania.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38472, 'FRANCOLINO, Carla ', 'Profesora Adjunta del Departamento de Psicología Médica de la Facultad de Medicina. Investigadora.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38479, 'URIARTE ARAUJO, Daoiz G. ', 'Abogado. Especialista en Derecho Laboral en la Facultad de Derecho de la Universidad de la República (Uruguay). Profesor Adscripto de Derechos Humanos. Asesor de sindicatos públicos tales como SUTEL (Sindicato Único de Telecomunicaciones), AODAMTOP (Asociación de Obreros de Arquitectura del MTOP) y FENAPES (Federacion Nacional de Profesores de Secundaria). Asesor Letrado de la Junta Departamental de Montevideo durante 2000-2005, y Secretario General. de OSE (Obras Sanitarias del Estado) durante 2005-2010. Presidente del Centro Uruguay Independiente (Centro de Estudios - ONG). Forma no usada: Daoiz Gerardo Uriarte Araújo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38627, 'MORALES, Daniel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38783, 'RUBBO, Horacio ', 'Nombre completo y forma no usada: RUBBO IRIGOYEN, Horacio Domingo. Nacido  en Mercedes, departamento de Soriano, Uruguay, en agosto de 1940. Escribano Público y Doctor en Derecho y Ciencias Sociales, egresado de la Facultad de Derecho de la Universidad de la República, Uruguay. Docente en dicha facultad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38804, 'SANTO RICCARDI, Claudia ', 'Uruguaya. Escribana pública y actuaria adjunta en la Inspección General de Registros Notariales de la Suprema Corte de Justicia. Profesora adjunta, grado III de Derecho Notarial y de Derecho Registral en la Facultad de Derecho, Universidad de la República. Diplomada en Derecho Registral por la Escuela de Posgrados de la Facultad de Derecho de la Universidad de la República. Profesora titular de Derecho Registral en la Universidad de la Empresa. Integrante de las comisiones de Derecho Notarial y Técnicas Notariales y de Derecho Registral de la Asociación de Escribanos del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38807, 'GIMENEZ RODRIGUEZ, Alejandro ', 'Nacido en Montevideo en el año 1961. Es egresado del Instituto de Profesores “Artigas” en 1988, en la especialidad Historia y ejerce la docencia en educación secundaria pública y privada. Ha coordinado y dictado cursos de\r\nHistoria Nacional y Americana y dictado conferencias sobre diversos temas históricos. Asistió y fue ponente en seminarios y cursos sobre historia, museología y patrimonio cultural en Argentina, Colombia, Costa Rica, Bolivia, Brasil, Chile, España y Uruguay. Realizó el curso taller bianual “Artes Museográficas” (2003-2004), organizado por ICOM-Uruguay, por el que obtuvo el diploma de Asesor de Museos y Museología.\r\nCumplió funciones entre 1991 y 2005 en el Museo Histórico Nacional, en donde fue Jefe de Relaciones Públicas (1996-2001) y Encargado de Dirección del Museo Juan Zorrilla de San Martín (2001-2002), y en donde hoy trabaja como asesor.\r\nEntre 2005 y 2010 se desempeñó como Coordinador de Museos en la Dirección Nacional de Cultura del Ministerio de Educación y Cultura. Desde 1998 es asesor del Museo de la Casa de Gobierno de Presidencia de la República y a partir de 2003 del Espacio Cultural “Al pie de la Muralla”. Integró la Comisión Directiva de la Asociación de Profesores de Historia del Uruguay (2005-2007) y es secretario de la Comisión Directiva de la Asociación “Amigos de las Fortificaciones”, desde su constitución en 2009.\r\nDesde 1991 ha cumplido una intensa tarea periodística en torno a temas de índole histórica y patrimonial, en prensa escrita, radial y televisiva. Fue autor de "Montevideo. Vida y obra” (1997), “Por mi honor. Vida de los presidentes\r\nuruguayos” (2000), “Montevideo. Genio y Figura” (2001), “Breve Historia de Montevideo” (2003), “El Libro de los presidentes uruguayos. De Fructuoso Rivera a Tabaré Vázquez” (2005); “El Latino. Vanguardia educativa desde los años ‘50” (2006); “La pasión laica. Una breve historia del fútbol uruguayo” (2007); y coautor del libro “Mi Historia, Uruguay” (1998).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38961, 'LAMAITA RODRIGUEZ, Alberto ', 'Nació en Florida el 26 de mayo de 1968. En 2001se graduó como Profesor de Historia en el Instituto de Profesores Artigas (I.P.A) y desde entonces ha ejercido la docencia en liceos del departamento de Florida. Integró el Taller Literario de la Profesora Carmen Roca y un cuento suyo integra la selección del primer libro que el taller editó: "Letras Floridenses". En el año 2005 comenzó a escribir una columna semanal de opinión en el diario "El Heraldo", a cuya plantilla de periodistas se incorporó en 2009, pasando a ser secretario de redacción en 2010.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (38971, 'MARIUS, Jorge Leonel ', 'Nombre completo: Jorge Leonel Marius Martínez. Forma no usada. Montevideano, casado, cuatro hijos. Investigador de temas históricos-políticos e históricos-electorales. Integra el Equipo de Investigadores de "Representa" del Centro Latinoamericano de Economía Humana (CLAEH). La Fundación Konrad Adenauer ha editado dos trabajos: "Elecciones 1925/1984 - Sistema Electoral Uruguayo" y "Elecciones Uruguayas 1980-2003". Publicó por Ediciones de la Proa: "Estoy muerto..." sobre la muerte del 13er. Presidente del Uruguay: Juan Idiarte Borda y coautor de "La Primera Elección del Siglo XXI". Fue premiado en el Concurso organizado por el Congreso de Intendentes y la Oficina de Planeamiento y Presupuesto sobre "100 años de la creación de la figura del Intendente Municipal". Es coautor de "Parlamentarios Uruguayos 1830-2010", que se encuentra en la web del Parlamento, y de los e-books: "Los años infames", "Crónica de dos desapariciones" y "Un humanista llamado Aparicio...". Actualmente se encuentra trabajando en la "Enciclopedia Uruguaya 1900-2010" junto a otros investigadores. Es autor de "Tiempo de Ácratas".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (39163, 'FERREIRO, Sylvia ', 'Escribana pública. Docente adjunta de Derecho Notarial. Dociente asistente de Derecho registral de la Faculta de Derecho, Udelar. Directora encargada del Departamento Notarial del CEP de la ANEP');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (39312, 'VALENTIN, Gabriel ', 'Abogado egresado de la Universidad de la República. Magíster en Derecho Procesal de la Facultad de Derecho de la Universidad Nacional de Rosario, Argentina. Profesor Adjunto Efectivo de Derecho Procesal en la Facultad de Derecho, Udelar, en cursos de grado, cursos para graduados y en posgrado. Miembro del Instituto Uruguayo de Derecho Procesal, del Instituto Iberoamericano de Derecho Procesal y de la Asociación de Derecho Procesal Eduardo J. Couture.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (39322, 'GUASCO, Daniel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (39432, 'DWORKIN, Ronald ', 'Nombre propio y forma no usada: DWORKIN, Ronald Myles. Nacido en Worcester, Massachusetts, Estados Unidos, el 11 de diciembre de 1931 y fallecido en Londres, Inglaterra, Reino Unido, el 14 de febrero de 2013. Filósofo del Derecho y catedrático de derecho constitucional. Estudió en la Harvard University y en el Magdalen College, de la University of Oxford. Profesor de Leyes y Filosofía en la New York University y Profesor Emérito de Jurisprudencia en la University College London. Fue nombrado Doctor Honoris Causa por la Universidad de Buenos Aires y galardonado con diferentes premios: el Premio Internacional de Investigación en Derecho Héctor Fix-Zamudio de la Universidad Autnónoma de México (2006), el Premio Holberg en Noruega (2007) y el Premio Balzan en Italia (2012), entre otros. Miembro de la British Academy y de la American Academy of Arts and Sciences.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (39933, 'URUGUAY. CODIGO PENAL', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (40003, 'PELLEGRINO, Guillermo ', 'Nacido en Montevideo, Uruguay, en 1968. En el año 2000 obtuvo, en la categoría Ensayo, el Premio Nacional de Literatura del Ministerio de Educación y Cultura (MEC), del Uruguay. Por sus dos primeros libros, y por su aporte a la cultura popular, recibió en 2002, en Argentina, el Premio TEA.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (40066, 'CARDOZO PERALTA, Silvia ', 'Nació en Montevideo, Uruguay en 1966. Ejerce como terapeuta cognitivo-conductual. Obtuvo su título de psicologa en 1999 en el Instituto Superior de Psicología (ISEP) y realizó dos años en especialización en sexología. Tiene un posgrado realizado en la Sociedad Uruguaya de Análisis y Terapia del Comportamiento (SUATEC), egresada en el año 2000. Es docente a cargo de las siguientes áreas de los trea años de posgrado: Trastornos depresivos y bipolares, Disfunciones sexuales, Historia del análisis y terapia del comportamiento y Autocontrol. Es columnista en la revista Cala, a cargo de la sección "Pareja y sexo", en Eva Magazine y en la revista Ser Familia del Diario El País.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (40102, 'JAVIER, Juvenal M. ', 'Doctor en Derecho y Ciencias Sociales egresado de la Facultad de Derecho de la Universidad de la República, Uruguay. Profesor Adscripto de Derecho Público II (UDELAR) y Profesor de Derecho Administrativo I y II en la Universidad de la Empresa, Uruguay. Postgraduado en Derecho Penal Económico en la Universidad de Montevideo. Juez Letrado en lo Penal.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (40123, 'GUERRA DANERI, Enrique ', 'Catedrático de Derecho Agrario de la Facultad de Derecho de la Universidad de la República. Fundador del Instituto Uruguayo de Derecho Agrario y su Director en diversos períodos. Vicepresidente de la Unión Mundial de Agraristas Universitarios (Pisa - Italia). Fundador, Director y actual Miembro de Honor del Comité Americano de Derecho Agrario. Miembro de Honor del Instituto Argentino de Derecho Agrario e integrante del Istituto di Diritto Agrario Internazionale e Comparato de Florencia (Italia). Es autor de diversos libros y múltiples monografías relativas a la materia agraria. Ha dictado conferencias en varias Facultades de Derecho de América y Europa. Fue Consultor nacional de la FAO y co-redactor de diversas leyes de nuestro país.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (40850, 'OLIVERA SILVA, Raúl ', 'Nacido en Conventos, Departamento de Cerro Largo, Uruguay. Maestro y director de enseñanza primaria en escuelas de Cerro Largo y de Maldonado. Profesor de Matemática y Didáctica en el instituto de Formación Docente en la ciudad de Maldonado. Usufructuó una beca en Francia sobre "La Enseñanza Moderna de la Matemática". Director de Actividades Culturales dependiente de la Intendencia Municipal de Maldonado entre los años 1990 y 2005.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41085, 'RAMOS, Rosa ', 'Profesora de Filosofía. Maestría en Ciencias de la Religión (Centro Superior de Teología Pastoral de la Facultad de Teología del Uruguay). Diploma en Formación Integral y Pastoral Educativa (Universidad Pontificia Bolivariana). Miembro del Equipo de Formación del Departamento de Laicos de la CEU y colaboradora con la revista “Un lugar en el mundo”. Miembro del Consejo de redacción de la revista “Misión”.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41202, 'ROCCA, Carmen', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41223, 'RECLUS, Elisée ', 'Nombre propio completo, forma no usada: RECLUS, Jacques Elisèe.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41246, 'IBAÑEZ, Ana ', 'Licenciada en Psicología. Psicoterapeuta y Supervisora Habilitarte de la Asociación de Psicoterapia Psicoanlítica. Certificada como Psicoterapeuta por la Federación Uruguaya de Psicoterapia y por la Federación Latinoamericana de Psicoterapia. Maestría en Psicología y Educación de la Facultad de Psicología de la Universidad de la República, Uruguay. Profesora Adjunta del Departamento de Educación de la Escuela de Nutrición de la Universidad de la República, Uruguay. Forma no usada: "Ana M. Ibáñez Costantino".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41247, 'SARAVIA, Luisa', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73283, 'FERNANDEZ FERNANDEZ, Gabriel Hernán ', 'Doctor en Derecho y Ciencias Sociales recibido en la Facultad de Derecho y Ciencias Sociales de la Universidad de la Repéblica y es profesor de Derecho Privado II (Obligaciones) y III (contratos) en la misma Facultad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110529, 'PEDEMONTE, Ana ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41270, 'SILVA BALERIO, Diego ', 'Educador social. Magíster en Psicología y Educación (Udelar), Especializado en Gestión de Instituciones Educativas. Investigador en temas de educación social, sistema de protección a la infancia y sistema penal juvenil. Profesor de Pedagogía Social y del Area de las Prácticas en la carrera de Educación Social del Consejo de Formación en Educación en Montevideo. Coordinador del Programa de Autonomía de La Barca, OSC  orientada al trabajo socioeducativo con adolescentes y jóvenes ex tutelados que se encuentran en proceso de transición a la vida adulta. Educador en el Programa Herramientas. Investigador en  DNI (Defensa de los Niños Internacional). Docente de la carrera de Educación Social CENFORES. Autor de diversas publicaciones sobre educación social, derechos de la infancia y sistema penal juvenil.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41349, 'FORT, Alejandra ', 'Cursó parte de la Licenciatura en Ciencias Biológicas. Estudió sobre energía solar y sus aplicaciones prácticas. Dirigió la construcción de un colector solar para calentar agua para un ranario. Ha trabajado con productores agropecuarios en el campo de la Lombricultura. Ha realizado exposiciones individuales y colectivas de dibujo. Técnica en creatividad infantil.\r\nEscritora e ilustradora uruguaya. Coordinadora de talleres en áreas integradas para preescolares y escolares. Autora de cuentos para niños: "El chanchito que aprendió a compartir", "El océano que deseaba brindar luz", "Jacinto y el camalote", "El viaje de Lombrinita". Nombre propio y forma no usada: FORT BRUGNINI, Alejandra.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41507, 'CERETTA, Sergio ', 'Ingeniero Agrónomo, M.Sc. Programa Nacional de Investigación Cultivos de Secano, INIA La Estanzuela.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (41607, 'TOURREILLES ECHEVERRIA, Ramiro José', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42165, 'VELANDO, Helen ', 'Nacida en Montevideo, Uruguay, el 3 de diciembre de 1961.  Escritora, actriz, directora teatral, dramaturga, titiritera, y compositora y vocalista de la banda de blues "La trapecista". Docente de teatro con niños. Ha recibido varios premios literarios. Publicó: "Detectives en el Parque Rodó", "Misterio en el Cabo Polonio". Recibió el Premio Bartolomé Hidalgo 2001 (Revelación).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42312, 'DIAZ, Juan Manuel ', 'Ilustrador');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42372, 'LARROCA, Oscar ', 'Artista visual y ensayista. Ha expuesto de forma individual en Nueva York, París, Barcelona, Viena y Buenos Aires. Fue premiado en varios concursos locales e internacionales. Representó a Uruguay en exposiciones en Francia y en Colombia, siendo elegido para esto por el Museo Nacional de Artes Visuales (MNAV) y por el Museo de Arte Contemporáneo (MAC). Recibió el "Premio Figari" (XVI) a la trayectoria artística (2011). Fue curador general de la X Bienal de Salto. Escribe para "El País Cultural", "Revista de Ensayos", "La Pupila", entre otras publicaciones.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42404, 'RIPA, Julio C.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42663, 'ABRAMOVICH, Víctor ', 'Abogado. Profesor de Derechos Humanos en la Facultad de Derecho de la Universidad de Buenos Aires (UBA). Secretario Ejecutivo del Instituto de Políticas Públicas en Derechos Humanos del MERCOSUR. Ex integrante de la Comisión Interamericana de Derechos Humanos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42780, 'LOPEZ GOMEZ, Alejandra ', 'Psicóloga (UDELAR) especializada en género y salud sexual y reproductiva. Investigadora Nivel I del Sistema Nacional de Investigadores. Profesora Adjunta de la Facultad de Psicología. Directora Ejecutiva de MYSU (Mujer y Salud en Uruguay). Integrante del Consejo de Global Forum for Health Research desde 2004. Miembro del Grupo Interdisciplinario Salud Sexual y Reproductiva, ciudadanía y ejercicio de derechos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42802, 'BIELLI, Andrea ', 'Licenciada en Psicología y licenciada en Ciencias Antropológicas, opción Antropologìa Social de la Udelar. Diplomada en Estudios Avanzados en Historia de la Ciencia y de la Medicina de la Universidad del País Vasco');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42864, 'RIVOIR, Ana Laura ', 'Doctora por la Universidad Oberta de Catalunya, España. Licenciada en Sociología, egresada de la Facultad de Ciencias Sociales de la UDELAR. Docente e investigadora de dicha Facultad. Coordinadora de ObservaTIC (Observatorio de Tecnologías de Información y Comunicación). Investigadora del Sistema Nacional de Investigadores Nivel I.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (42972, 'MACEDO, Beatriz ', 'Profesora de Química, egresada del Instituto de Profesores Artigas (IPA). Doctora en Didáctica de las Ciencias por la Universidad París VII. Asesora Académica del Consejo de Formación en Educación CFE-ANEP, y consultora en el ámbito privado. Fue investigadora en el Laboratorio de Investigación Didáctica y Formación Continua en Educación Científica en la Universidad París XI. Actuó en el sistema educativo uruguayo y, en 1995, ingresó a la UNESCO, donde trabajó en múltiples proyectos educativos en todos los países de la región. Coordinadora del programa Conjunto con Naciones Unidas "Aportes para la elaboración de políticas en Uruguay". Consultora de UNICEF y de OEI. Dirige tesis de posgrados, maestrías y doctorados en distintas universidades, a nivel internacional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43041, 'GAMARRA, Jorge Luis ', 'Egresó de la Facultad de Derecho de la Universidad de la República en el año 1981.\r\nProfesor de Derecho de las Obligaciones en la Facultad de Derecho de la Universidad de Montevideo.\r\nProfesor de Derecho de la Responsabilidad Civil en la Facultad de Derecho de la Universidad de Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43172, 'RIVERO SCARANI, Federico ', 'Nombre completo y forma no usada: RIVERO SCARANI, Federico Angel. Nacido en Montevideo, Uruguay, en 1969. Profesor de Literatura egresado de IPA. Escritor de poesía y ensayos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43227, 'MOURE DAVIES, Raquel ', 'Nacida en Montevideo (Uruguay) en 1940. Escritora de novelas y cuentos, ha publicado las novelas "Los jueves, Rosa" (2007), "Relatos desde el ascensor" (2002), "Andenes" (2004), "El cuarto de Van Gogh" (2010), y los cuentos en las antologías de "Narradores de las dos orillas" (2007, 2008, 2011), "La confesión de Johnny y otros cuentos" (1997) y el Tomo II de "El cuento uruguayo" (2003).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43259, 'LEYMONIE SAENZ, Julia ', 'Licenciada en Ciencias Bilógicas por la Facultad de Ciencias de la Universidad de la República. Magíster en Educación por la Universidad Católica del Uurguay. Especialista en Didáctica de las Ciencias, por la Universidad de Lovaina, Bélgica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43468, 'DOMINGUEZ, Ana ', 'Profesora de Geografía egresada del Instituto de Profesores Artigas (IPA). Licenciada en Geografía por la Facultad de Ciencias de la Universidad de la República (UDELAR). Máster en Estudios de América Latina. Doctora en Geografía por la Université de Toulouse Le Mirail, Francia. Posgraduada y con Especialización en Educación Ambiental de la Universidad del Comahue (Argentina). Posgrado en Ambiente, Economía y Sociedad de Flacso.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43470, 'URUGUAY. CONSTITUCION', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (46052, 'DIAZ GENIS, Andrea ', 'Uruguaya nacida en 1968. Doctora en Filosofía (UNAM); Profesora efectiva de tiempo completo y Directora del Departamento de Historia y Filosofía de la Educación (Facultad de Humanidades y Ciencias de la Educación - UDELAR). Forma parte del Sistema Nacional de Investigadores (ANII). Editora responsable de la revista "Fermentario", Revista del Departamento de Historia y Filosofía de la Educación. Bfía.: “La construcción de la identidad en América Latina : una aproximación hermenéutica”, "El eterno retorno de lo mismo o el terror de la historia".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (46079, 'FERNANDEZ VAL, Walter', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111102, 'PASSARELLI, Eddy ', 'Nació en Juan Lacaze en 1958. Ha escrito "Riopletensis uno : (doce cuentos)" en 2013.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43498, 'LIBERATI, Jorge ', 'Nació en Montevideo, Uruguay  en 1943. Egresado del Instituto de Profesores "Artigas" en Literatura. Autor de "Vaz Ferreira, filósofo del lenguaje" (1980), "Estudio preliminar a Lógica viva" (1980), "Lógica e incertidumbre" (1988), "Ensayos" (1996),"Fantasmas en la lógica" (2002), "Arturo Ardao, la pasión y el método" (2004), "El velo de la apariencia" (2008), " La huella de Rodó" (2012). Publicó en la Revista Relaciones, sus ensayos sobre temas sociales o históricos. como ser "Cambio de perspectiva en la filosofía social" (2011) , "Los valores y la educación" (2013), "La crisis actual de la razón" (2013), "Estiramiento y retrocesos en el arte y el pensamiento uruguayos del Siglo XX" (2014).\r\nDirigió para la Editorial Técnica de Montevideo las colecciones "Manuales de literatura" y "Clásicos Anotados"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43734, 'MORAES, Edith ', 'Magister en Educación. Directora General del Consejo de Educación Inicial y Primaria y Directora General del Consejo de Formación en Educación (Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43903, 'VIGIL, Mercedes ', 'Escritora nacida en Montevideo, Uruguay, en setiembre de 1957. Se ha especializado en novela histórica pero también ha publicado cuentos, crónicas, dramaturgia y literatura infantil. Ha recibido diversos reconocimientos por sus obras y por su trayectoria.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43904, 'PELAEZ BRUNO, Fernando ', 'Nacido en Montevideo, en 1958.  Escritor y matemático uruguayo. \r\nEs Profesor de enseñanza media y universitaria, Licenciado y Magister en matemática. Es profesor de "Historia del Rock" en Uruguay en la Escuela Universitaria de Música. De esta temática ha publicado los libros "De las cuevas al Solís" Tomos 1 y 2, "Rock que me hiciste mal" (en colaboración con Gabriel Peveroni). \r\nDesde diciembre de 2014 se desempeña como Pro Rector de Enseñanza en la Universidad de la República.\r\nForma no usada: PELAEZ, Fernando.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43977, 'DANGIOLILLO, Carmen ', 'Montevideo, 1962. Licenciada en Psicología, Magíster en Ciencias Humanas. Docente de la Facultad de Psicología, Instituto de Psicología Social. Activista en organizaciones sociales: de la enseñanza, del cooperativismo, de la ecología social, del movimiento de radios comunitarias y del pensamiento liberario.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (43981, 'PESCE, Fernando ', 'Nombre propio y forma no usada: PESCE GURNASCHELLI, Fernando. Profesor de Geografía egresado del IPA. Licenciado en Geografía. Máster en Ciencias Ambientales por la Facultad de Ciencias de la Universidad de la República (UDELAR). Posgraduado y con Especialización en Educación Ambiental por la Universidad del Comahue, Argentina. Docente de Didáctica del Instituto de Profesores Artigas. Docente e investigador del Laboratorio de Desarrollo Sustentable y Gestión Ambiental del Territorio de la Facultad de Ciencias de la Universidad de la República. Especialista en teledetección y análisis del territorio de la Escuela Superior de Topógrafos e Ingenieros Cartógrafos de la Universidad Politécnica de Madrid-Instituto Geográfico Nacional (España).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (44220, 'NAHOUM, Benjamín ', 'Uruguayo. Ingeniero civil. Integrante del Centro Cooperativista Uruguayo. Asesor en vivienda de la Intendencia de Montevideo y coordinador de la consultoría que implementó la Cartera Nacional de Inmuebles para Vivienda. Desde 2000 es el responsable técnico del Departamento de Apoyo Técnico de FUCVAM. Asesor en organizaciones sociales, en Uruguay y en la región, en autogestión, financiamiento, legislación y acceso al suelo. Coordinador de la Unidad de Vivienda del Frente Amplio y docente de las Facultades de Ingeniería y Arquitectura (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (44313, 'BRAGA, Patricia ', 'Neuróloga. Profesora Adjunta de la Sección Epilepsia del Instituto de Neurología de la Universidad de la República, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (44500, 'KAPLAN, Gabriela', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (44537, 'ALVARADO VELLOSO, Adolfo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45197, 'CASAS GORGAL, Alicia ', 'Doctora en Psiquiatría. Coordinadora pedagógica, Propuestas metodológicas, capacitación y consultorías en el Programa Claves, programa de la sociedad civil que consiste en identificar y promover capacidades fortalecedoras frente a la violencia y promotoras de buen trato hacia la infancia y la adolescencia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45243, 'NUÑEZ FERNANDEZ, Matías ', 'Nombre propio y forma no usada: NUÑEZ FERNANDEz, José Matías. Nacido en 1981. Máster en Literatura Española y Comparada (Universidad de León). Profesor de Expresión Oral y Escrita en la Facultad de Comunicación y Diseño, y Profesor de Literatura Española y Literatura Hispanoamericana en el Departamento de Educación Internacional (Universidad ORT, Uruguay). Ha publicado artículos relacionados con la literatura en revistas y periódicos. Ha participado en actividades de extensión universitaria, seminarios, talleres y congresos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45261, 'SCHLESINGER (H.), Arthur M. ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45276, 'BUZETTA, Victoria ', 'Contadora Pública Plan 90 recibida en la Facultad de Ciencias Económicas y de Administración de la Universidad de la República. Es Licenciada en Administración Plan 90 recibida en la Facultad de Ciencias Económicas y de Administración de la Universidad de la República. Es Diploma en Finanzas de la Universidad de la República y Diploma en Normas Internacionales de Información Financiera (CertIFIR), emitido porla Association of Chartered Certified Accountants, organismo de profesionales con sede en Londres, Reino Unido.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45499, 'GIANELLI, Carlos ', 'Doctor en Derecho por la Universidad de la República, Uruguay. Magíster en Estudios Sociales por la Fundación de Bariloche, Argentina. Diplomático del Instituto Artigas del Servicio Exterior. Embajador del Ministerio de Relaciones Exteriores de Uruguay. Embajador de Uruguay ante los Estados Unidos de América (2005-2011). Consejero de la Misión Permanente de Uruguay ante la ONU (1987-1990). Vicepresidente de la Segunda Comisión de la Asamblea General de la ONU.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45515, 'DOMINGUEZ, Pablo ', 'Nombre completo y forma no usada: DOMINGUEZ COLLETTE, Pablo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45640, 'HERNANDEZ VALENTINI, Moriana ', 'Socióloga. Miembro del Comité de América Latina y el Caribe para la Defensa de los Derechos de las Mujeres (CLADEM), Uruguay. Asesora de la Senadora M. Percovich en temas de género.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45703, 'AMENGUAL, Claudia ', 'Forma no usada: AMENGUAL PUCEIRO, Claudia. Nacida en Montevideo, Uruguay, en 1969. Traductora pública. Licenciada en Letras por la Facultad de Humanidades, Universidad de la República. Columnista de la revista semanal "Galería", del semanario "Búsqueda", ha colaborado con publicaciones como la revista "Luvina" de Guadalajara y el suplemento cultural de "El País" de Madrid, "Babelia", y "HojaporHoja" del diario Reforma de México, y las revistas "Dossier" de Uruguay y "El perro" de Guadalajara. Ha escrito cuentos, algunos de los cuales han sido publicados en antologías y otros premiados en concursos y traducidos. Forma parte del grupo Bogotá 39 integrado por 39 escritores latinoamericanos seleccionados por un jurado en el marco de Bogotá Capital Mundial del Libro 2007.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (45840, 'PASTORIZA, Javier', 'Jefe del Departamento de Información y Producción Rural  del Diario El País.\r\nForma no usada: PASTORIZA, Javier A.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (50621, 'QUEIROLO, Rosario ', 'Nombre propio completo: QUEIROLO, María del Rosario. Profesora en el Departamento de Ciencias Políticas y Sociales de la Universidad Católica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73339, 'SORIANO, Manuel ', 'Nacido en Buenos Aires, Argentina, en 1977. Vive en Montevideo desde 2005. Escritor. Obtuvo el Décimo octavo Premio Nacional de Narrativa “Narradores de la Banda Oriental”, 2010.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (46107, 'TISCORNIA, Ana ', 'Nacida en Montevideo (Uruguay) en 1951. Profesora emérita de State University of New York, Old Westbury College. Artista que ha exhibido sus obras en Uruguay, Estados Unidos, Italia, España, Costa Rica, Brasil, Argentina, Cuba y Perú. Editora de arte de "Point of Contact : The Journal of Verbal and Visual Arts", de la Universidad de Siracusa. Autora y colaboradora en varios libros relacionados con el arte. Curadora.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (46314, 'FERNANDEZ, Roberto ', 'Arquitecto argentino, nacido en 1946. Catedrático de Historia FADU-UBA.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (46543, 'UNTERMEYER, Louis', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (46684, 'CARRO, Sandra ', 'Psicóloga. Profesora agregada de la Facultad de Psicología y Coordinadora Académica de la Sede Treinta y Tres del Centro Universitario de la Región Este. Reponsable de los cursos Introducción a las Teorías Psicológicas y Corrientes Teórico Técnicas. Posgraduada en Gerencia Social (Claeh), en Mediación Educativa (UBA). Maestría en Atencióon Primaria de la Salud (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (46838, 'ALONSO, Elda ', 'Nació en Canelones, Uruguay. Escritora de poesías. Hizo cursos de dibujo y plástica en la Escuela de Artes y Oficios de Canelones, Uruguay. Realizó estudios de literatura en el Centro Cultural Figari de Atlántida, Canelones. Concurrió al taller de Raquel de León. Participó en encuentros literarios en Uruguay, Argentina, Chile, Perú, Italia y España.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (46927, 'GARCIA, Zully', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47044, 'AZPIROZ, Adrián B. ', 'Biólogo especializado en ecología y conservación de aves silvestres. Doctorado por la Universidad de Missouri en St. Louis (EE.UU.). Su trabajo de investigación se enfoca en la ecología de aves (especialmente aquellas en peligro de extinción) y el manejo y conservación de vida silvestre en contextos productivos, entre otros tópicos. Investigador y consultor para diversas organizaciones nacionales e internacionales vinculadas al estudio y conservación de la naturaleza.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47054, 'GEYMONAT, Giancarlo ', 'Nacido en Montevideo, Uruguay, el 23 de agosto de 1967. Licenciado en Ciencias Biológicas, orientación Entomología.Coordinador del Proyecto Restitución a la Vida de Casa Ambiental de Castillos, Rocha. Ha publicado trabajos sobre investigación en zoología, diversidad biológica, ornitología, entomología y liquenología. Coordinador y orientador de grupos juveniles ambientales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47070, 'LAZARO, Marila ', 'Nació en Chile en 1971. Reside en Uruguay desde 1973. Bióloga por Facultad de Ciencias de la UdelaR, Uruguay. Sección Etología-Cetáceos, Instituto de Biología, Facultad de Ciencias.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47462, 'ALFONSO, Alvaro ', 'Nacido en Villa Aguas Corrientes, departamento de Canelones, Uruguay, de donde es Alcalde, electo por voto popular en mayo de 2010. Periodista y escritor. Ha desempeñado su labor periodística en diferentes medios de comunicación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47497, 'RAMOS CABANELLAS, Beatriz ', 'Profesora de Derecho de Familia y Sucesiones en la Facultad de Derecho de la Universidad Católica del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47529, 'LOPEZ REILLY, Andrés ', 'Nacido en Montevideo, Uruguay, en 1973. Periodista del diario "El País" de Montevideo y productor de contenidos de la cadena internacional de noticias Telesiur. Músico y Técnico en Comunicación Social, egresdo de la Universidad del Trabajo del Uruguay (UTU). Autor de guiones para el ciclo televisivo "Los Viajes del 12" (Montevideo, Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47719, 'TOMASINA, Fernando ', 'Médico especializado en Salud Ocupacional. Administración de Servicios de Salud y Epidemiología. Profesor del Depto. de Salud Ocupacional de la Facultad de Medicina (UDELAR)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47732, 'CHANS, Luis E.', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (47955, 'FRANGELLA, Alfonso', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (48771, 'MARIÑO LOPEZ, Andrés ', 'Profesor Adjunto de la Facultad de Derecho de la Universidad de la República. Doctor en Derecho. Magíster en Derecho y Diploma de Estudios Especializados en Derecho por la Universidad Autónoma de Barcelona (España). Coordinador de las carreras Maestría en Derecho (orientación Derecho de Daños) y Especialización en Derecho de Daños, de la Escuela de Posgrados de la Facultad de Derecho de la Universidad de la República. Co-Director de la Revista Crítica de Derecho Privado.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (48836, 'LLAMBI DELLACASA, Silvia ', 'Doctora en Medicina y Tecnología Veterinaria, magíster en Genética animal por el Programa de Desarrollo de las Ciencias  Básicas (Pedeciba) de la Universidad de la República (UdelaR) y PhD por la Facultad de Veterinaria de la Universidad de Zaragoza. Docente de la Facultad de Veterinaria de la UdelaR desde 1984, y se desempeña actualmente en el Área Genética de esa misma facultad. Es investigadora nivel II del Sistema Nacional de Investigadores (SNI) de la Agencia Nacional de Investigación e Innovación (ANII).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49076, 'AGUERRE, Ana María', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49077, 'SANTOS, Omar de los', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49078, 'MORO, Gisella', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49279, 'LOPEZ GARIGLIO, Teresa ', 'Nacida en Rivera, Uruguay. En 1989 inició sus cursos en el "Taller Poético Marta de Arévalo". Como integrante del mismo comenzó a colaborar en "Lunita de Papel" Colección de Literatura Infantil y en la revista B.L.A.N.C.O. En el número 8 de esta última, se publicó su separata "Ama la Vida" y en el cuaderno coleccionable "Escritores Contemporáneos" apareció la selección poética "Luces y Sombras". En 2001, bajo el sello B.L.A.N.C.O. dio a conocer su poemario "Pájaro azul y otros poemas". Es colaboradora de la publicación argentina "Horizonte de Luz". Poemas suyos han sido leídos en programas de Radio Internacional de la ciudad de Rivera. Su poema "La Espina" fue incluido en una publicación de la "Fundación Eugenio De Andrade" en la ciudad de Oporto, Portugal. Y su poema "El árbol caído" apareció en una revista literaria de Noruega.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49329, 'ASTIGARRAGA, Laura ', 'Nombre propio y forma no usada: ASTIGARRAGA FERNANDEZ, María Laura.\r\nProfesora Agregada de Producción Lechera, Facultad de Agronomía (UdelaR, Uruguay). Obtuvo su doctorado de la Universidad de Rennes I (Francia) y su posdoctorado del INRE-Centre Theix (Francia).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49642, 'VAZ TOUREM, Susana ', 'Nacida en Salto, Uruguay. Docente. Autora de libros de cuentos y poesía. Su libro "Clarita y Julián" fue incorporado como libro de apoyo docente y usado en las aulas como material de apoyo de actividades establecidas en el programa de Enseñanda Primaria.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49757, 'HACKEMBRUCH, Graciela', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49850, 'BASSO, Eleonora ', 'Profesora de Literatura Española en la Facultad de Humanidades y Ciencias de la Educación (UdelaR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49897, 'CARDARELLO, Antonio ', 'Doctor en Ciencia Política por el Instituto de Filosofía y Ciencias Humanas, Universidade Federal do Río Grande do Sul. Docente e investigador del Departamento de Ciencia Política, Facultad de Ciencias Sociales, de la Universidad de la República (Uruguay). Integrante del Sistema Nacional de Investigadores (SNI) de la Agencia Nacional de Investigación e Innovación (ANII).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (49936, 'LOPEZ LAGE, Fernando ', 'Artista y curador. Director de la Fundación de Arte Contemporáneo (FAC).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (50268, 'TOMMASINO, Humberto ', 'Prorrector de Extensión de la Comisión Sectorial de Extensión y Actividades en el Medio de la Universidad de la República, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (50523, 'SIMONETTI TRIAS, Antonio ', 'Poeta y escritor nacido en Montevideo, Uruguay. Retirado universitario y docente.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (57060, 'FERNANDEZ LUZURIAGA, Wilson', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111423, 'CASTILLA GARCIA, Gabriel ', 'Abogado');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (50788, 'RIVERO, Eduardo ', 'Nació en Montevideo en 1952. Músico popular, ha trabajado con Jorge Galemire, Jaime Roos, Eduardo Darnauchans, entre otros. Editó un CD con canciones propias con su grupo Lavanda Elástica y cantó tangos junto con Locas Cuerdas trío, grabando un álbum y presentándose en el mundial de tango de Buenos Aires, 2010. Tiene una carrera como comunicador radial en emisoras como radio Sarandí, Setiembre FM, CX 26 Sodre y más recientemente El Espectador, donde conduce "El submarino amarillo" junto con Hugo Burel. Docente de Comunicación en la Universidad ORT y el Instituto BIOS. Es autor de los libros "Los Beatles en Uruguay" (coautoría con José Deco Nuñez) y "Memorias en mi"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (50850, 'BENITEZ TORRES, Walter ', 'Oriundo de San José de Mayo, maestro y bancario. Libros éditos: "Poesías de Taller", "Poesías de Jardín", "Poesías de atril". Ha participado en antologías y periódicos locales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51146, 'PETITTI CAPRILLE, María Eugenia ', 'Nacida en Salto, Uruguay, el 19 de noviembre de 1939. Profesora de francés en Tranqueras, Tomás Gomensoro y Baltasar Brum. Escritora de poemas. Utilizó su apodo "Maruja" como seudónimo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51296, 'LOPEZ, Sara ', 'Ex secretaria de Comunicación, imágen y propaganda del Partido Socialista. Ex senadora y dirigente del mismo partido');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51444, 'XAVIER, Mónica ', 'Senadora por el Frente Amplio.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51483, 'KARLEN CANZANI, Susana', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51484, 'YACOBAZZO, Marlene', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51580, 'RUIZ, Marisa ', 'Historiadora e investigadora, Vicepresidenta del Comité Ejecutivo de la sección Uruguay de Amnistía Internacional. Bibliografía: La piedra en el zapato; Amnistía y la dictadura uruguaya; La acción de Amnistía Internacional en los sucesos del 20 de mayo de 1976 en Buenos Aires, Argentina y Ciudadanas en tiempos de incertidumbre : solidaridad, resistencia y lucha contra la impunidad (1972-1989).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51581, 'PACHECO, Carlos ', 'Nacido en Montevideo (Uruguay) en 1964. Escritor y periodista. Coautor del libro: "No+palidas" con Enrique Baliño (2010). Editor y Gerente de Contenidos de Xn International Inc. Como editor trabajó en las revistas "Contraviento", "Tecno" ("El País") y "PC World Uruguay" ("El Observador"), entre otras extranjeras; y en las colecciones "Management práctico para empresarios sin tiempo" y "Casos prácticos para empresarios sin tiempo" de Xn Consultores ("El Observador"). Autor de la novela "Ensalada Rusa" (1995), de la novela juvenil "El caso Michael Jackson" (2012) y de los ensayos periodísticos "Inventos uruguayos" (2010) y "Héroes uruguayos" (2011).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51756, 'MUSE, Ignacio Miguel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (51900, 'FERNANDEZ MAS, Ricardo ', 'Nacido en Montevideo, Uruguay, el 19 de marzo de 1963. Título docente del "Conservatorio musical Strauss". Profesor de música de la Casa de la Cultura de "Ismael Cortinas", dependiente de la Intendencia Municipal de Flores. Docente en los diferentes niveles de enseñanza. Cantautor, con más de 350 títulos registrados en AGADU, y musicalizador. Participante en los más importantes festivales folklóricos del país. Representante del Ministerio de Educación y Cultura en diferentes eventos realizados. Recibió el premio "Mérito Oriental a la paz" en el año 2011.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (52113, 'ETCHANDY, Alfredo ', 'Nació en 1950.\r\nEgresó del curso de Periodismo Deportivo en 1970, ejerciendo la profesión durante cuatro décadas en el ámbito local e internacional.\r\nTrabajo en prensa en El Diario, El Día, El Deportivo y Tu. \r\nDoctor en Derecho y Ciencias Sociales.\r\n Docente del Instituto Profesional de Enseñanza Periodística (IPEP) y redactor de varios trabajos para la Asociación Interamericana de Radiofusión (AIR) Y UNESCO.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (52127, 'RONZONI, Raúl ', 'Periodista., entre otros medios ejerció en Hechos, Ahora, Sur, El Debate y El Día. En 1991 se incorporó a Búsqueda donde se dedicó al periodismo judicial. Fue corresponsal de la agencia de noticias Inter Press Service y de los diarios Clarín , Folha de Sao Paulo y la revista Mercosur.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (52368, 'ROMANO, Alvaro ', 'Nombre propio y forma no usada: ROMANO REGUEIRA, Alvaro. Contador Público egresado de la Facultad de Ciencias Económicas y de Administración de la Universidad de la República, Uruguay. Máster Internacional en Administración Tributaria y Hacienda Pública por la Universidad de Educación a Distancia (UNED) y el Instituto de Estudios Fiscales (IEF) de España. Postgrado en Derecho Tributario en la Universidad de Salamanca y Diplomado en Tributación por el Centro Interamericano de Administraciones Tributarias (CIAT). Docente y coordinador académico en la Facultad de Ciencias Económicas y de Administración de la UDELAR. Docente en la Maestría en Derecho y Técnica Tributaria de la Facultad de Derecho de la Universidad de Montevideo y docente en el Postgrado de Especialización en Tributación y Fiscalidad de la Facultad de Ciencias Empresariales de la Universidad de la Empresa. Sub Director Gereral de la Dirección General Impositiva. Integrante del consejo Directivo del Instituto Uruguayo de Estudios Tributarios (IUET).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (52584, 'PIAZZE, Alvaro', NULL);
