INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (54632, 'DIAZ MAGGIOLI, Gabriel ', 'Profesor de Inglés, y escritor. Coordinador nacional del Departamento de Lenguas Extranjeras (ANEP).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (55221, 'SIMEONE, Alvaro ', 'Ingeniero agrónomo. (MSc, PhD) - Consultor técnico de FUCREA para los proyectos CIPROCAR');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (55282, 'ABER, Ana ', 'Trabaja en el Departamento de Biodiversidad, Dirección Nacional de Medio Ambiente, MVOTMA.\r\nIntegrante de la Comisión Nacional de Experimentación Animal (CNEA).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (55287, 'ALVAREZ GOYOAGA, Laura ', 'Nacida en Montevideo. Abogada. Escribana. Cursó la Licenciatura en Letras y se ha desempeñado como docente.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (55332, 'OVEJERO, José', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (55371, 'GADOLA, Liliana ', 'Especialista en Nefrología, Investigadora ANII. Profesora Agregada de Depto. de Nefrología, Hospital de Clínicas. Profesora agregada de Depto. de Fisiopatología, Facultad de Medicina, UdelaR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (55630, 'STRASSER, Carlos', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (56276, 'OTERO MERA, Alicia B. ', 'Licenciada en Historia, egresada de la Universidad de la República, Uruguay. Asesora en Museología. Miembro del Departamento Técnico del Museo Nacional de Artes Decorativas (1985-91) y del Museo Nacional de Artes Visuales (1991-96). Investigadora de la División Historia del Departamento de Estudios Históricos del Estado Mayor del Ejército, a partir de 1966.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (56316, 'MARESCA, Adriana ', 'Escribana Pública. Docente asistente de Derecho Notarial. Docente asistente de Clínica, Asesoría y Consultoría Notarial de la Facultad de Derecho, Udelar. Mediadora integrante del Centro de Resolución de Conflictos de la Asociación de Escribanos del Uruguay');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (56526, 'LEUS, Ivana ', 'Licenciada en Psicología por la Universidad de la República. Diplomatura en Psicoterapia Psicoanalítica en Servicios de Salud de la Escuela de Graduados de Facultad de Medicina. Psicóloga Perinatal. Psicología Médica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (56593, 'GARDERES, Santiago ', 'Profesor adjunto Grado 3, Facultad de Derecho, UDELAR. Profesor adjunto Grado 3, Facultad de Derechom, Universidad Católica del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (57879, 'SFORZA, Carlo, Conde ', 'El Conde Carlo Sforza, nacido el 23 de septiembre de 1872 y fallecido el 4 de septiembre de 1952, fue un diplomático italiano y político antifascista. Hijo de Giovanni Sforza (1846-1922) di Montignoso di Lunigiana descendiente del Duque de Milán Francisco I Sforza (1401-1466), y su madre era Elisabetta Pierantoni. Al morir su hermano mayor heredó el título de conde, estudió leyes en Pisa y fue alumno de Enrico Ferri y de Lodovico Mortara.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (57954, 'MAÑAN, Oscar ', 'Doctor en Estudios del Desarrollo (Universidad Autónoma de Zacatecas, México), Master en Economía con Especialidad en Desarrollo Económico Latinoamericano. Licenciado en Sociología, Instituto de Ciencias Sociales de la Facultad de Derecho y ciencias Sociales (UdelaR),  Profesor e Investigador Agregado, Facultad de Ciencias Económicas y Administración, UDELAR. Docente del Programa de Formación de Actores locales para el Desarrollo Rural - SCEAM. Profesor del Centro Regional de Profesores del Centro.ANEP-CODICEN, Asesor del Departamento de Estado y Presupuesto  de la Confederación de Organizaciones de Funcionarios del Estado (COFE). Consultor del Proyecto " Hacia una política de Estado en privación de libertad: diálogo, recomendaciones y propuestas" en el marco del convenio de cooperación con la Comisión Europea, SERPAJ Y EL Observatorio del Sistema Judicial. Miembro de la Red de Estudios Críticos del Desarrollo; de la Red Internacional de Migración y Desarrollo y de la Red Eurolatinoamericana de Estudios del Desarrollo "Celso Furtado".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (58026, 'UMPIERREZ CABRERA, Alejo Alejandro ', 'Nacido en Lascano (Depto. Rocha - Uruguay) en 1965. Abogado y escribano. Militante del Partido Nacional, integrante de la Junta Departamental de Rocha y es primer suplente de la banca correspondiente en la Cámara de Representantes al Partido Nacional por Rocha.\r\nDesempeñó intensa actividad gremial en el Centro Estudiantes de Derecho y la FEUU.\r\nFundador y Director de la Revista Jurídica del Centro Estudiantes de Derecho en su segunda época y de la Revista Histórica Rochense. \r\nHa publicado poesía y narrativa junto a otros autores en "Entresiglos" (2001), "Cuentagotas" (2002), "Rocha: poetas y narradores" (2005), obteniendo premiaciones nacionales e internacionales.y por otro lado, Revista histórica rochense, Tomo I, Ediciones de la Plaza, 2008 y Revista histórica rochense, Tomo II, Ediciones de la Plaza, 2010.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (58033, 'CERRUTI, Florencia ', 'Nutricionista. Trabaja en el proyecto "Uruguay crece contigo".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (58139, 'GONÇALVEZ PEÑA, Sara', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (58211, 'D''OLIVEIRA, Nora', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (58426, 'RISSO FERNANDEZ, Mariana ', 'Psicóloga egresada de la Universidad de la República, Uruguay. Psicoterapeuta. Psicóloga clínica en las policlínicas Maracaná Sur y Norte de ASSE. Coordinadora y participante como consultora en diversos proyectos socio-educativos. Ejerció cargos docentes en Facultad de Psicología y en Educación Secundaria. Autora de ensayos e investigaciones independientes referidos a temas de psicología y derechos humanos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (58816, 'MARTINEZ, Sebastián ', 'Ingeniero Agrónomo, ha trabajado en INIA de Trainta y Tres (Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (59779, 'SANGUINETTI CANESSA, Emma ', 'Nació en 1964 en Montevideo, Uruguay. Abogada. Estudió Historia del Arte en la Universidad de Buenos Aires. Tiene una columna semanal sobre arte en Radio Sarandí y en el portal de Internet Montevideo.com. Crítica de arte del semanario "Búsqueda"; colaboradora de "El País Cultural" del diario "El País" de Montevideo, y de la revista "Dossier". Dicta cursos de Historia del Arte para adultos en la librería El Virrey y en el Museo Juan Zorrilla de San Martín.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (59780, 'TOCCO, Diego', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (60080, 'ONGAY, Elena ', 'Nombre completo y forma no usada: ONGAY, María Elena. Escuela de Nutrición de la Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (60184, 'BENITEZ PEZZOLANO, Hebert ', 'Nacido en Montevideo, Uruguay, en 1960. Docente, ensayista, crítico y poeta. Profesor de Teoría Literaria y de Literatura Uruguaya en el Instituto de Profesores Artigas (IPA). Ponente y conferencista en universidades de Argentina, Brasil, México, EE.UU., Canadá, Francia y España. Fundador y Director de la Revista "Hermes Criollo".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (60275, 'SARAVIA, Graciela', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (60276, 'SEGUROLA, Bernarda', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (60299, 'VARGAS ZUÑIGA, Fernando ', 'Especialista en Formación Profresional de la OIT/Cinterfor. Licenciado en Administación de Empresas de la Universidad Externado de Colombia, especialista en Evaluación Económica de Proyectos, diplomado en Gerencia Estratégica. Trabajó 19 años en el Servicio Nacional de Aprendizaje SENA de Colombia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (60302, 'FRANCO, Graciela', NULL);
