INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (60595, 'DOMINGUEZ, Teresita', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (60693, 'TERZANO, Paolo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (61155, 'FESSLER, Daniel ', 'Licenciado en Ciencias Históricas, Magíster en Ciencias Humanas opción Historia Rioplatense y Doctorando en humanidades opción Historia por la Facultad de Humanidades y Ciencias de la Educación de la UdelaR (Uruguay). Investigador del Sistema Nacional de Investigadores (SNI) de la Agencia Nacional de Investigación e Innovación (ANII). Integrante del Departamento de Historia del Uruguay de la Facultad de Humanidades y Ciencias Económicas de la UdelaR. Autor de "Derecho penal y castigo en Uruguay(1878-1907)".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (61161, 'NETO, José Francisco SIQUEIRA ', 'Abogado, Master en Derecho de la Pontificia Universidad Católica de San Pablo y Doctor en Derecho por la Facultad de Derecho de San Pablo');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (61193, 'PEREZ, Walter ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (61482, 'ABELLA, Francisco', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (62025, 'RODRIGUEZ ZIDAN, Eduardo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (62034, 'GALLO, Isabel ', 'Nacida en Montevideo (Uruguay) en 1961. Escritora, redactora de sitios de Internet, correctora de estilo. Ha participado en diversos talleres literarios.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (62280, 'SEÑORANS, Jorge ', 'Nacido en Montevideo, Uruguay, en 1969. Periodista deportivo, se desempeñó en Radio Imparcial, Sport y Sport 890. También en los periódicos "El Diario" (1990 a 1992) y "El Observador" (1992 a la acutalidad , 2013).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (62658, 'GONZALEZ PERRETT, Diana ', 'Doctora en Derecho y Ciencias Sociales (Facultad de Derecho-UdelaR). Integrante de IACi (Cooperativa de Abogadas Infancia y Adolescencia Ciudadana) y de CIRE (Ciudadanía en Red). Consultora en proyectos de investigación y estudio en materia de equidad de género y generaciones (derechos sexuales, violencia doméstica, niños/as y adolescentes privados del cuidado familiar). Forma no usada: GONZALEZ PERETT, Diana');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (62734, 'GRÜNBERG, Gustavo ', 'Profesor Adjunto, Cátedra de Anestesiología, Universidad de la República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (62786, 'ESTIGARRIBIA, Marta ', 'Nombre propio completo y forma no usada ESTIGARRIBIA ROMERO, Marta Nilda.\r\nNacida en Nuevo Berlín, departamento de Rio Negro, Uruguay. Coordinadora e integrante del Grupo de Teatro del Club Residentes de Río Negro. Ha obtenido varios premios y menciones literarias en concursos nacionales. Ha publicado en libros colectivos y en diferentes órganos de prensa del interior del país. Socia cofundadora del Ateneo Rioplatense filial Uruguay. Integrante de la Asociación Uruguaya de Escritores (AUDE).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (62956, 'COSTA SILVA, Lourdes', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63170, 'LANZA, Edison ', 'Abogado y periodista. Coordinador del Departamento de Periodismo de la Universidad Católica del Uruguay. Asesor legal de la Asociación de la Prensa del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63250, 'VARELA CETANI, Nedy Cristina ', 'Nació en Montevideo, Uruguay. Doctora en Medicina. Escritora y Coordinadora de Talleres Literarios, egresada del primer Centro de Formación de Talleres Literarios "Quipus". Dirige el Taller Literario de la Academia Artesanal de la Sagrada Familia. Ha publicado "La hora del señuelo" y "De cuentos somos". Participó en varios libros colectivos. Colabora en el proyecto cultural de la ciudad de La Paz.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63262, 'BARRERA, Julio ', 'Nacido en Montevideo (Uruguay) en 1955, reside en la Barra de Maldonado. Médico geriatra especialista en gerontología. Escritor, es coordinador del Taller Literario de Maldonado desde 2014. Asiste al Taller de Lauro Marauda. Participó en numerosas ediciones colectivas. Ha publicado en la editorial Rumbo "Juego de reinas" (2009) y "Todos alguna vez fuimos nosotros" (2012).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63290, 'ARROYO, Alvaro ', 'Pediatra responsable del área de Salud y Primera Infancia de Unicef Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63361, 'XAVIER, Juan ', 'Nombre propio y forma no usada: XAVIER, Juan Francisco.\r\nNacido en Rivera (Uruguay) en 1957. Profesor de Formación Docente en el área de Sociología (IFD de Rivera en Ciencias de la Educación y del Ce.R.P del Norte de Rivera) y docente de Educación social y cívica Sociología-Derecho, egresado del IPA (Instituto de Profesores Artigas). Diplomado en Derechos Humanos, especialización Educación Derechos Humanos, de la Universidad Católica del Uruguay. Especialista en política y gestión educativa por el CLAEH. Posgrado en Ciencia Política y Sociología por FLACSO de Buenos Aires (Argentina). Ha publicado artículos en las revistas "Quehacer educativo" y "Revista del Departamento de Derecho"; y en los libros "Teoría Sociológica" (compilado por José Escaraffuni), "El rol del conocimiento en los escenarios educativos en transformación" (Primer foro nacional de Ciencias de la Educación en Formación Docente, Montevideo, nov. 2010, tomo 2).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63362, 'TRIAS, Ivonne ', 'Montevideana. Fue al liceo Bauzá y a Facultad de Humanidades. Entre 1972 y 1985 fue presa política, la mayor parte del tiempo en el Establecimiento Militar de Reclusión nº2. A partir de la amnistía de marzo de 1985, integró la redacción del periódico "Compañero" y el colectivo editorial de Cotidiano Mujer. También fue responsable de la sección internacional y secretaria de redacción de la revista "Posdata". Desde 1997 forma parte de la redacción del semanario "Brecha". Por el período 2003-2006 fue electa Directora de ese semanario. Participó en la creación de diversos observatorios internacionales de medios de comunicación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63573, 'ALESINA LEZAMA, Lorena ', 'Socióloga');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63583, 'KEEGAN, John ', 'Nacido en Clapham, Inglaterra, en 1934. Historiador, escritor y profesor. Fue durante más de 25 años profesor en la academia militar británica de Sandhurst, y ha dado clase en las universidades de Cambridge, Harvard y Princeton. Editor de la sección de Defensa en "The Daily Telegraph".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63596, 'KETZOIAN, Carlos', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63627, 'SARAVIA DIAZ, Horacio ', 'Ing. Agr., Msc. Unidad de Comunicación y Transferencia de Tecnología, INIA Treinta y Tres.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63661, 'CASTRO, Matías ', 'Nacido en Montevideo en 1976. Periodista y escritor. Colaborador de "El País Cultural", "Factor S", "Brecha" y "El Estante". Publicó: "Las dos muertes de Dionisio Díaz" (2009), "Películas de superhéroes", "Películas de videojuegos". Guionista de "El ángel negro", "Noches blancas", "Los doce trabajos de Manfredi". Productor de "Montevideo Cómic".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63734, 'IVANIER, Federico ', 'Nacido en Montevideo, Uruguay, en 1972. Novelista, guionista, docente de inglés y sociólogo. Estudió guión cinematográfico en la UCLA y literatura creativa en la Escuela Tai de Madrid. Ha publicado varias novelas en Alfaguara Juvenil, entre ellas, "Martina Valiente" (Premio Nacional de Literatura MEC, Premio Bartolomé Hidalgo), "Lo que aprendí acerca de novias y fútbol", "El colegio de los chicos perfectos", "Nico Loppez", "Alas en los pies", "Música de vampyros", "Bonsái" y "Maruja Antibrujas". Como guionista ganó el Premio FONA por el guión Anina Yatay Salas. Fue columnista de radio El Espectador, en el programa Segunda Mañana; su espacio se tituló Ficciones.com.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63735, 'FERNANDEZ SANTOS, Gerardo ', 'Nacido en Montevideo, Uruguay, en 1964. Desde 1983 se ha desempeñado profesionalmente en el mundo de la ilustración y la historieta. Ha ilustrado cómics en Columba y libros para niños. Ilustrador de varios medios gráficos como "El Escolar", "El País Cultural", y de la tira cómica del diario "La República". Ilustrador publicitario.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63752, 'VILLELLA, José ', 'Doctor en Didáctica de la Matemática por la Universidad de Huelva, España. Licenciado en Ciencias de la Educación con especialidad en Educación Diferenciada. Profesor en Disciplinas Industriales con especialidad en Matemática y Matemática Aplicada. Profesor en Educación Primaria. Profesor y rector de enseñanza secundaria. Docente e investigador en la Universidad, donde también ocupó cargos de Secretario y Decano de unidad académica. Miembro del Consejo Directivo del Instituto Glaux de nivel inicial, primario y medio de la ciudad de Buenos Aires. Docente investigador de la Escuela de Humanidades (EHU) de la Universidad Nacional de San Martín (UNSAM), donde dirige tesis de licenciatura, maestría y doctorado sobre su especialidad. Director de la colección "Ideas para enseñar".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63810, 'GODOY, Lorena ', 'Nombre porpio completo : Lorena Godoy Catalán (forma no usada) Licenciada en Historia y magíster en Psicología Social-Comunitaria de la Pontificia Universidad Católica de Chile. Es investigadora del Centro de Estudios de la Mujer (CEM), Chile. Es profesora de la Escuela de Psicología de la Universidad Diego Portales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (63910, 'PEREYRA, Leonardo ', 'Montevideo, 1967. Periodista en: Búsqueda, Revista Tres, El Observador y La República');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (64048, 'MAESTROS ASCENDIDOS', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (64099, 'TANZI, Silvana ', 'Nacida en Montevideo, Uruguay, en 1964. Periodista en las páginas de cultura del semanario Búsqueda. Profesora de Literatura egresada del Instituto de Profesores Artigas (IPA). Máster en Literatura Latinoamericana por la Universidad de Cornell (Ithaca, Nueva York) y Diploma en Edición por el Centro Latinoamericano de Economía Humana (CLAEH). Dicta talleres de escritura en la Licenciatura de Comunicación Social de la Universidad Católica del Uruguay (UCUDAL) y en el CLAEH.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (64644, 'BETTI, Canónigo José ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (64838, 'TAGLIAFERRO GARRONE, Gerardo ', 'Nacido en Montevideo (Uruguay), el 16 de fegrero de 1962. Técnico en Comunicación Social, egresado de la UTU. Comenzó su trabajo como periodista en el semanario Crónicas en 1996, teniendo posteriormente sus propios espacios de entrevistas llamados "Las 40" y "Retrato hablado". También es funcionario de UTE, participando de la recontrucción del sindicato AUTE.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (64989, 'SALTO DE RODRIGUEZ, Carmen ', 'Profesora adjunta Grado 3 de Derecho Registral para la carrera de Notariado de Facultad de Derecho de la Universidad de la República Oriental del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65019, 'SARABI, Mario ', 'Nombre propio y forma no usada: SARABI SANTOS, Mario.\r\nNacido en Uruguay en 1981. Poeta, narrador y artista plástico. Editor de la revista literaria "Revista Hipoética". Entre sus obras publicadas destacan: "La Maga y otros Manisfiestos" (2007); "Desde el Jardín de Anubis" (2008, coautor Javier Dos Santos); "Príncipes del Talión" (colección de autores, 2009); "Matar a López" (2011); etc.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65179, 'BRIDA, Vera', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65306, 'COLLAZO IBAÑEZ, Marcia ', 'Nacida el 13 de marzo de 1959 en Cerro Largo. Abogada, profesora de Historia, docente de Historia de las Ideas en América (IPA) y de Filosofía del Derecho (UdelaR). Ha publicado las novelas "Amores cimarrones: las mujeres de Artigas" (EBO, 2011), y "La tierra alucinada: memorias de una china cuartelera" (EBO, 2012), y los libros de poemas "A caballo de un signo" (AEBU, 2004) y "Alguien mueve los ruidos" (Estuario, 2010), así como diversos ensayos históricos, jurídicos y filosóficos. Numerosos poemas y cuentos suyos figuran en antologías y revistas nacionales y extranjeras, entre ellos: "Ella" (Revista de Casa de las Américas, Cuba, 2013) y "Cuentos uruguayos contemporáneos" (Cámara del Libro del Uruguay, 2013), "La señorita White" (Narradores de las dos orillas, 2010), "Mburucuyá" (Poetas de loas dos orillas, 2009). Su novela "Amores cimarrones" fue publicada en el año 2013 en Entre Ríos, Argentina. Su obra poética y narrativa ha sido premiada en diversas oportunidades por la Universidad de la República, la Intendencia Municipal de Montevideo, el Ministerio de Educación y Cultura y la Casa de Escritores del Uruguay. En 2011 recibió el premio Bartolomé Hidalgo Revelación, y en los años 2011 y 2012 el Libro de Oro de la Cámara Uruguaya del Libro. Es uno de los diez autores nacionales que figuran en el "Boof from Uruguay 2012", destinado a las Ferias Internacionales del Libro de Frankfurt y Guadalajara.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65719, 'BARRIOS CAMPONOVO, Ana María ', 'Forma no usada: BARRIOS, Ana. Nacida en Montevideo, Uruguay, en 1961. Escritora e ilustradora. Formación en teatro, canto, danza, percusión y qi gong. Realizó estudios en medicina tradicional china. Integró la Asociación Inspiración Femenina, grupo que investiga sobre la identidad femenina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65773, 'URUGUAY. CODIGO DE LA NIÑEZ Y LA ADOLESCENCIA', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65805, 'LAFERT, Elena ', 'Buenos Aires, 1949, reside en Colonia desde 1991. Docente en inglés y castellano. Traductora. Miembro del Consejo Editorial de la revista U y del sello Ediciones U. Poeta.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (65861, 'ZURBRIGGEN, Cristina ', 'Doctora en Ciencias Políticas por la Universidad Eberhard-Karls de Tübingen, Alemania. Profesora de Historia y Licenciada en Sociología, egresada de la Facultad de Ciencias Sociales, Universidad de la República (Uruguay). Docente del área Estado y Políticas Públicas en el Instituto de Ciencia Política, Facultad de Ciencias Sociales, Universidad de la República (Uruguay). Directora del proyecto FLACSO (Facultad Latinoamericana de Ciencias Sociales) Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (66431, 'RIVERO, Adriana ', 'Forma completa del nombre: Ruth Adriana Rivero Paroli. Nacida en Carmelo. Profesora de Literatura.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (66469, 'DIAZ, Ariel ', 'Nombre completo y forma no usada: Ariel Díaz Díaz. Nacido en 1928 en el departamento de Florida, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (66574, 'ERMIDA FERNANDEZ, Martín ', 'Nacido en Montevideo, Uruguay, en 1978. Procurador y Doctor en Derecho y Ciencias Sociales egresado de la Facultad de Derecho de la Universidad de la República. Integrante de los Intitutos de Técnica Forense y de Derecho del Trabajo y de la Seguridad Social e integrante de la Asociación Uruguaya de Derecho del Trabajo y de la Seguridad Social (AUDTSS), así como del Centro de Investigaciones y Estudios Laborales y de la Seguridad Social ("Grupo de los Miércoles"). Autor de artículos en revistas y portales especializados, nacionales e internacionales, y de varios libros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (66610, 'MORDECKI, Daniel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (66732, 'TULBOVITZ, Ernesto ', 'Uruguayo nacido en 1967. Periodista, comenzó cumpliendo tareas de producción periodística en radio Centenario en 1991. Ha trabajado en: radio Panamericana y Emisora Cabildo FM. Ha escrito notas para: "El Día", "El Observador", "La Mañana", "Ultimas Noticias", semanario "Búsqueda" la revista "Tres". Como free lance ha publicado artículos en medios de España, Argentina y El Salvador. Dictó clases de periodismo en el Instituto Bios y en talleres en Salto, Río Negro y Durazno.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (67193, 'BALMELLI, Gustavo ', 'Ingeniero Agrónomo. M.Sc. Genética Vegetal y Fitomejoramiento, Programa Nacional de Investigación en Producción Forestal, INIA Tacuarembó.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (67208, 'GOMEZ TERRA, Jacqueline ', 'Ingeniera agronóma egresada de la Udelar. Master en Ciencias Ambientales. Especializada en desarrollo rural, media mbiente, gestión y economía agropecuaria.\r\nPresidenta del Instituto Nacional de Colonización');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (67335, 'LANFRANCO CRESPO, Bruno ', 'Ingeniero Agrónomo, MSc., PhD., Economía Aplicada y Proyectos INIA.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (67398, 'BAFICO, Jorge ', 'Nacido en Montevideo en 1969. Psicoanalista, ejerce su práctica desde 1993. Es docente invitado en Área de Psicopatología de la Facultad de Psicología de la Universidad de la República. Escribio en la revista "Anudar", en la publicación psicoanalítica "Erresei", fue columnista de la revista "El Estante" y actualmente escribe en a revista de Psicolibros-Waslala.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (67683, 'BUERO, Leonardo ', 'Nacido en Montevideo, Uruguay, en 1969. Psicólogo. Posee un post grado en Counceling y la Especialización en Análisis Existencial y Logoterapia. Doctor en Psicología por la Universidad de Flores, Buenos Aires.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (67759, 'NION, Soledad ', 'Nombre propio y forma no usada: NION CELIO, María Soledad. Licenciada y Magíster en Sociología egresada de la Facultad de Ciencias Sociales, UDELAR. Posgrado en Metodología de la Investigación por el Institutio Universitario CLAEH. Diploma en Investigación Social Aplicada. Docente del Departamento de Sociología de la Facultad de Ciencias Sociales y de la Licenciatura en Relaciones Laborales de la Facultad de Derecho. Entre abril del 2008 y diciembre del 2011 fue asistente de la Unidad de Sociología de la Salud en el Departamento de Medicina Preventiva y Social de la Facultad de Medicina, UDELAR. Trabaja en temas relacionados a la sociología del trabajo, la salud y el riesgo, tanto en investigación académica como aplicada, docencia y extensión.  Candidata a investigadora del SNI de la ANII.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (67940, 'MAARABI, Mordejai', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (68232, 'AGUERRE, Enrique ', 'Artista y curador. Director del Museo Nacional de Artes Visuales (MNAV). Integrante de la Comisión Nacional de Artes Visuales desde 2011 y de la Comisión del Patrimonio Cultural de la Nación, a partir de 2016. Como artista visual desarrolla sus actividades artísticas en el campo del video y entorno digitales. Publica artículos periodísticos y ensayos en catálogos especializados ya en medios nacionales y extranjeros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (68234, 'LIRA, Luciano', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (68677, 'CORDERY, Lindsey ', 'Profesora agregada de Lengua Inglesa y profesora adjunta de Literatura Inglesa de la Facultad de Humanidades y Ciencias de la Educación (UdelaR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (68722, 'LOAIZA KEEL, Carlos ', 'Nombre propio y forma no usada: LOAIZA KEEL, Carlos Alejandro. Doctor en Derecho, egresado de la Universidad de Montevideo, Uruguay. Becario de la Fundación Carolina del Reino de España en 2006, obtiene los títulos de Máster en Tributación del Centro Europeo de Estudios Garrigues, en 2007, y de Máster Executive en Derecho Empresarial, de Harvard Law School y Centro Europeo de Estudios Garriguex, en 2009. Miembro del Colegio de Abogados del Uruguay, del Instituto Latinoamericano de Estudios Tributarios, de la International Fiscal Association y de la International Bar Association. Docente de Derecho Financiero y de Tributación Internacional en la Facultad de Derecho de la Universidad de Montevideo y en la Facultad de Ciencias Económicas de la Universidad de la República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (68848, 'SOLARI, Ana ', 'Montevideo, 1957. Nombre propio, forma no usada: Ana C. Solari. Escritora, dramaturga, música,docente universitaria de la Facultad de Comunicación y Diseño, Universidad ORT, Montevideo.\r\nHa publicado, entre otros libros: Cuentos de diez minutos (1991), Zack Novela (1993), Zack Estaciones (1994), El sitio donde se ocultan los caballos (1996), Tarde de compras (1997, Tercer Premio del Ministerio de Educación y Cultura de Uruguay), Apuntes encontrados en una vieja Cray 3386 (1998), Scottia (Alfaguara, 2000), El collar de ámbar (2006), El hombre quieto (2007), El señor Fischer (2011, Primer Premio de narrativa inédita del Ministerio de Educación y Cultura de Uruguay, otorgado en 2010).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (68881, 'PEREZ SARTORI, Graciela', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (68991, 'BERGER, Fanny ', 'Nacida en Montevideo, Uruguay, en 1955. Egresada de la Facultad de Psicología de la UDELAR. Máster en Psicología Educacional y en Psicología Clínica de niños y adolescentes, ambos títulos obtenidos en Israel. Profesora de la Unidad de Formación Permanente de la Facultad de Psicología de la UDELAR. Docente de la Universidad Católica del Uruguay (UCUDAL) en diferentes seminarios.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69092, 'GRIGNOLA, Juan Carlos ', 'PhD, FESC. Profesor agregado de Fisiopatología.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69099, 'GONZALEZ ORTUYA, Pilar ', 'Lic. en Enfermería. Subdirectora del Centro de Postgrado de la Facultad de Enfermería de la UDELAR. Integra el Equipo de Dirección del Departamento de Programación Estratégica y coordina el Area de Pomoción de la Salud y Prevención en el MSP. Representa al ministerio en la Comisión Nacional Asesora de Enfermería.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69189, 'CONTERI, Carla', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69315, 'ABRACINSKAS, Lilián ', 'Coordinadora General de la Comisión Nacional de Seguimiento (CNS). Coordinadora de Mujer y Salud en Uruguay (MYSU).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69322, 'PAREDES, Gonzalo ', 'Nacido en Montevideo, Uruguay, en 1963. Licenciado en Psicología, terapeuta psicoanalítico individual y grupal y coordinador de talleres de escritura. Publicó artículos y ficciones en diversos medios. Es autor del libro de relatos "Un puente largo y antiguo" (2001).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69451, 'MIR, Juan Pedro ', 'Nacido en Montevideo, Uruguay, en 1972. Maestro de educación primaria. Profesor de Pedagogía en la Facultad de Humanidades y Ciencias de la Educación y en el Instituto Superior de Educación Física.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69454, 'SANTOS, Limber Elbio ', 'Maestro. Licenciado en Ciencias de la Educación (Facultad de Humanidades y Ciencias de la Educación - UdelaR). Diplomado en Didáctica para la enseñanza primaria (IPES, Consejo de Formación en Educación) y especializado en Educación Inicial. Docente e investigador en el Departamento de Historia y Filosofía de la Educación y en el Departamento de Enseñanza y Aprendizaje, Instituto de Educación, Facultad de Humanidades y Ciencias de la Educación, UdelaR. Director del Departamento de Educación para el Medio Rural, del Consejo de Educación Inicial y Primaria, ANEP. Maestrando de la Maestría en Educación y Extensión Rural, UdelaR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69461, 'FUSTES, Juan Manuel ', 'UDELAR. Facultad de Humanidades y Ciencias de la Educación. Departamento de Psico y Socio Lingüística (Instituto de Lingüística) y Departamento de Enseñanza y Aprendizaje (Instituto de Educación).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69470, 'AMARANTE, Verónica ', 'Economista. Investigadora del Instituto de Economía de la Facultad de Ciencias Económicas y Administración de la UdelaR (Universidad de la República). Maestría en Economía por la Universidad Pompeu Fabra y Doctora en Economía por la Universidad de Sussex. Su área de investigación abarca estudios de pobreza, desigualdad y mercado de trabajo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69658, 'SASSO, Rolando W. ', 'Escritor nacido el 8 de junio de 1954 en la ciudad de Dolores, departamento de Soriano, Uruguay. Militante frenteamplista, detenido desde 1972 hasta 1977. Exiliado en Suecia. Colaborador de distintas publicaciones periódicas de corte político. Incursionó en la fotografía de prensa, obteniendo algunos premios. Bibliografía:"La toma de Pando, la revolución joven", "Tupamaros : los comienzos". Forma no usada: SASSO MENDOZA, Rolando W.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69770, 'BRIVA, Arturo ', 'Prof. Adjunto Cátedra Medicina Intensiva. Hospital de Clínicas. Facultad de Medicina. Universidad de La República. Ex Presidente de la Sociedad Uruguaya de Medicina Intensiva (2010-2012).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69778, 'HURTADO, Francisco Javier ', 'Director del Departamento de Fisiopatología, Facultad de Medicina, Universidad de la República (Montevideo, Uruguay). Director de Unidad de Medicina Intensiva del Hospital Español (Montevideo, Uruguay). Forma no usada: HURTADO BREDDA, Francisco Javier.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69957, 'STAGNO, Rubens ', 'Nombre propio completo y forma no usada: STAGNO OBERTI, Rubens. Nacido en Paysandú, Uruguay, en 1941. Arquitecto, en 2002 crea la Red Patrimonio Paysandú. Asesor de la delegación uruguaya ante CODEFRO.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (69970, 'JARA HOLLIDAY, Oscar ', 'Educador popular y sociólogo peruano y costarricence. Director General del Centro de Estudios y Publicaciones ALFORJA en Costa Rica y Coordinador del Programa Latinoamericano de Apoyo a la Sistematización de Experiencias del CEAAL. Ha realizado actividades formativas en educación popular en Latinoamérica, Europa, Canadá y en el sudeste asiático, donde también ha sido conferencista en seminarios y congresos internacionales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (70062, 'VALDOMIR, Sebastián ', 'Licenciado en Sociología por la Universidad de la República. Se especializa en temas relacionados a acuerdos de comercio y en el seguimiento del comportamiento de empresas transnacionales e integración regional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (70118, 'SEVERO, Fabián ', 'Nacido en Artigas, Uruguay, en 1981. Poeta. Docente de Literatura y de Lengua. Publicó poemas en varios libros colectivos. Ha recibido varios premios literarios. Coordinador del Taller de escritura "El Rincón" en AGADU, junto al escritor Gustavo Esmoris.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (70134, 'CURBELO, Cecilia ', 'Nombre propio y forma no usada: CURBELO BERBERIAN, Cecilia. Nacida en Montevideo, Uruguay, el 23 de enero de 1975. Licenciada en Ciencias de la Comunicación por la Universidad Católica y guionista cinematográfica por la Escuela de Cine. Ha obtenido varios premios literarios, entre ellos, la Mención de Honor del Instituto Nacional del Libro y el Premio Cervantes 2011. Autora de obras teatrales para niños y adultos. Guionista de varios programas televisivos y editora de las revistas "El Escolar" "Padres e Hijos" y "Upss!"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (70154, 'BOGGIA, José ', 'Doctor en Ciencias Biomédicas, Pro.In.Bio. Investigador ANII. Investigador G3 PEDECIBA-Biología. Especialista en Medicina Intensiva y Nefrología. Profesor agregado Depto. de Fisiopatología, Facultad de Medicina, UdelaR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (70310, 'LANZA, Federico ', 'Nacido en 1969. Profesor de Historia egresado del Instituto de Profesores Artigas. Estudiante de la Maestría en Ciencia Política de la Facultad de Ciencias Sociales, UDELAR. Docente de Historia en Enseñanza Secundaria y de Didáctica de la Historia en el Centro Regional de Profesores del Centro. Forma no usada: LANZA WEISMANN, Federico.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73536, 'BENITEZ, Gustavo ', 'Doctor en Ciencias Veterinarias por Facultad de Vererinaria de la Udelar. Trabajó en el Departamento de Parasitología y Enfermedades Parasitarias de la Universidad de la República. Docente de Economía y Administración Agropecuaria de la Facultad de Veterinaria.\r\nForma no usada: Gustavo Daniel Benítez Castro.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73572, 'CORONEL, Patricia', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111424, 'GONZALEZ MOLINA, Laura ', 'Procurador');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (70508, 'PEREZ, Claudia ', 'Uruguaya, nacida en 1962. Doctora en Letras por la Universidad Nacional de la Plata (Argentina). Egresada de la EMAD (año 1982) en la Carrera de Actuación. Profesora Asistente del Departamento de Teoría y Metodología Literarias de la Facultad de Humanidades y Ciencias de la Educación (UdelaR), docente interina de Teoría Literaria III en el Centro Regional de Profesores del Sur y de Estética Literaria y Literatura General IV en el IPA. Dictó cursos de actuación en distintos departamentos del país por el Ministerio de Educación y Cultura. Forma parte del grupo de investigación teatral que dirige el Dr. Roger Mirza. Integra el Sistema Nacional de Investigadores de la ANII. Ha publicado artículos en numerosas publicaciones y presentado trabajos de investigación literaria y teatral en congresos en Uruguay y Argentina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (71037, 'SAVIOTTI, Débora', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (71254, 'CASTRO (1931- ), Teresa ', 'Nacida en Tacuarembó el 28 de junio de 1931.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (71258, 'RUITERS, Greg', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (71513, 'HERRAN, Blanquita ', 'Forma no usada Blanquita Herrán Muñoz.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (71624, 'RULFO ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (71682, 'PEÑA, Pedro ', 'Nombre completoy forma no usada: PEÑA GUELBENZU, Pedro. Nacido en San José de Mayo, Uruguay, en 1975. Escritor y docente de Literatura. Cofundador de la revista "La letra breve". En 2006 obtuvo el Premio Nacional de Narrativa de EBO (Ediciones Banda Oriental) y Fundación Lolita Rubial por el libro de ciencia ficción "Eldor". Ha publicado trabajos críticos y de ficción en "El País Cultural" y "La Diaria". Entre sus trabajos publicados se destacan: "Eldor","La noche que no se repite", "Ya nadie vive en ciertos lugares", "No siempre la carga el diablo", "Tampoco es el fin del mundo", "Mito", "A veces tarda, casi nunca llega". Participa en Ruido Blanco, antología de ciencia ficción uruguaya.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (71808, 'CUENCA, Alvaro ', 'Nacido en Montevideo, Uruguay, en 1954. Licenciado en Literatura Inglesa en la Universidad de Londres. Su interés por los temas históricos lo llevaron a abordar el tema de la influencia británica en el Uruguay. Una visita a Auschwitz despertó su interés por Polonia y el tema del exterminio judío.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (71914, 'GALIZZI, Silvio ', 'Nombre propio y forma no usada: GALIZZI FLORES, Silvio.\r\nNació en Montevideo y es Doctor en Derecho y Ciencias Sociales (UDELAR), periodista (El País Cultural), guionista de cine (La Balada de Vlad Tepes, Sin Cura, Plutón, ¡No pasa nada!) y cómic (La Liga Latina, Bandas Orientales, Las andanzas de Vlad Tepes).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72110, 'CATALDO, José ', 'Docente del IMFIA de la Facultad de Ingeniería, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72111, 'PIEDRA CUEVA, Ismael ', 'Uruguayo. Profesor grado 5, ex Decano de la Facultad de Ingeniería, autor de numerosas publicaciones.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72114, 'TERRA, Rafael ', 'Nombre propio y forma no usada: TERRA GALLINAL, Rafael.\r\nProfesor Agregado en la Facultad de Ingeniería (UdelaR). Doctor en Ciencias Atmosféricas, Universidad de California (Los Angeles, Estados Unidos). Ingeniero Civil.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72143, 'SANZ, Florencia ', 'Licenciada en Ciencia Política, egresada de la Facultad de Ciencias Sociales de la UDELAR. Investigadora y tutora de cursos virtuales en el Centro de Formación para la Integración Regional (CEFIR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72243, 'DALCIN, Mario ', 'Profesor de Matemática egresado del Instituto de Profesores Artigas (Montevideo, Uruguay). Maestro en Ciencias en Matemática Educativa por el Centro de Investigación Aplicada y Tecnología Avanzada del Instituto Politécnico Nacional de México. Docente de Geometría I y Didáctica II de la especialidad Matemática del Instituto de Profesores Artigas. Profesor de Matemática en Educación Secundaria.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72311, 'UNIVERSIDAD DE MONTEVIDEO (UM) ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72315, 'DAVYT, Amílcar ', 'Unidad de Ciencia y Desarrollo de la Facultad de Ciencias de la Universidad de la República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72321, 'BIANCHI, Sergio ', 'Doctor en Ciencias Biomédicas, Pro.In.Bio. Investigador ANII. Profesor adjunto del Depto. Básico de Medicina, Facultad de Medicina, UdelaR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72328, 'RODRIGUEZ CABALGANTE, María José ', 'Pediatra. Magister en Ciencias Biomédicas. Asistente de Pediatría y Asistente del Departamento de Fisiopatología en la Facultad de Medicina de la Universidad de la República (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72533, 'CORCHS, Alejandro ', 'Nombre propio y forma no usada: CORCHS LERENA, Alejandro\r\nNacido en Buenos Aires (Argentina) en 1976. Es autor de varios éxitos editoriales: "El regreso de los hijos de la tierra", capítulo I: "El camino del puma", capítulo II "La unión de la familia", y "Trece preguntas al amor". Líder Espiritual del Camino Rojo. Tanatólogo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72598, 'GONZALEZ MERLANO, José Gabriel ', 'Nacido en Florida, Uruguay, en 1966. Cursó estudios de filosofía en Córdoba y de Teología en la Facultad de Teología "Mons. Mariano Soler" de Montevideo, en la que obtuvo el bachillerato en Teología. Continuó sus estudios en la Universidad Pontificia de Salamanca graduándose como Licenciado en Derecho Canónico y cursó el posgrado de Doctor en Derecho Canónico de la Pontificia Universidad Católica Argentina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72649, 'MOTTA, Laura ', 'Licenciada en Educación. Profesora de inglés, egresada del IPA (Instituto de Profesores Artigas). Docente de educación media. Directora en el Consejo de Educación Secundaria. Directora del Centro Regional de Profesores del Sur e Inspectora de Inglés.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72670, 'CUADRO, Ariel ', 'Doctor en Psicología. Máster en Psicología Educacional. Especialista en dificultades de aprendizaje, Psicólogo. Profesor titular del departamento de Psicología del Desarrollo y Educación de la Universidad Católica del Uruguay. Miembro del Sistema Nacional de Investigadores. Decano de la Facultad de Psicología (2005/2009). Vicerrector académico de la UCUDAL (2009).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72766, 'BIZZOZERO, Federico', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72770, 'ALBISTUR, Gerardo ', 'Licenciado en Ciencias de la Comunicación, Udelar. Doctor en Ciencias Sociales de la Universidad de Buenos Aires. Magister en Ciencia Política. Docente grado 3 en régimen de Dedicación Total LICCOM-UdelaR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (72835, 'PIMIENTA GIORDANO, Verónica ', 'Forma no usada: PIMIENTA, Verónica');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73087, 'SANTULLO, Rodolfo ', 'Nacido en Mexico, D.F. en 1979. Es periodista, escritor, guionista y editor de historietas al frente de Grupo Belerofonte.\r\nEn narrativa publicó la novela "Las otras caras del verano" en colaboración con Martín Bentancor; el libro de cuentos "Perro como perro";  la novela "Cementerio Norte" y "Sobre papel Manila"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73090, 'BANDRYMER, Sonia ', 'Nacida en Montevideo, Uruguay, en 1958. Activista cultural. Profesora de Historia especializada en Historia del Arte y Museología, con experiencia en arte nacional, educación, museos y nuevos medios. Consultora e investigadora. Coordinadora General del Museo Juan Manuel Blanes (1980-1990) y del Museo de Arte Precolombino e Indígena MAPI (2006, 2007). Autora de numerosas publicaciones de Historia del Arte Nacional, curadora y docente. Miembro Académico de la Cátedra Libre María Luisa Bemberg de la Facultad de Filosofía y Letras de la Universidad Nacional de Cuyo, Mendoza I2005). Becaria de la Escuela Internacional de Yad Vashem en Jerusalem (2008).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73188, 'FRANCO, Dinorah ', 'Nacida el 19 de noviembre de 1934 en Montevideo, Uruguay. En 1970 obtiene el título universitario de Enfermería, trabajando en el Hospital de Clínicas y mutualistas. Forma no usada: FRANCO CARRACEDO, Dinorah');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73574, 'BROITMAN, Claudia ', 'Licenciada en Ciencias de la Educación de la Universidad de Buenos Aires. Profesora de Enseñanza Primaria, Profesorado Mariano Acosta. Profesora Adjunta de Didáctica de la Matemática en la carrera Ciencias de la Educación, Facultad de Humanidades, Universidad Nacional de La Plata. Es miembro del Equipo de Matemática de la EGB, Dirección de Curriculum, Area Planeamiento, Secretaría de Educación, Gobierno de la Ciudad Autónoma de Buenos Aires. Integra el equipo de Matemática de la Red Latinoamericana de Alfabetización, Argentina. Asesora y coordinadora del área Matemática de la Dirección de Educación Primaria, Ministerio de Cultura y Educación de la Provincia de Buenos Aires.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73684, 'BRUGNOLI, Ernesto ', 'Sección Oceanografía y Ecología Marina del Instituto de Ecología y Ciencias Ambientales de la Facultad de Ciencias de la Universidad de la República.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73685, 'DEFEO, Omar ', 'Universidad de la República, Facultad de Ciencias, Unidad del Mar (UNDECIMAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73751, 'RODRIGUEZ, Marcelo', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73766, 'MUNIZ, Pablo ', 'Director del Departamento de Oceanología de la Facultad de Ciencias de la UdelR, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73840, 'PACHECO CARVE, Luis ', 'Doctor en Derecho y Ciencias Sociales, egresado de la Facultad de Derecho de la Universidad de la República en 1992. Fiscal Letrado Inspector, con varios años de actuación en diversos cargos del Ministerio Público y Fiscal, habiéndose desempeñado como Fiscal Letrado Departamental en Bella Unión, Cerro Largo y Maldonado. Ha sido co-autor de: "El Proceso de Adolescentes Infractores - Y Temas de Derecho de Familia en el Código de la Niñez y la Adolescencia" (Amalio M. Fernández,  2006); ha publicado "El Fiscal en el Derecho Comparado" en "Estudios Jurídicos - Ministerio Fiscal - Tomo VI-2001" (Ministerio de Justicia de España y en las revistas "Revista de la Asociación de Magistrados del Ministerio Público y Fiscal", "Revista Judicatura" y en publicaciones del "Ministerio Público Fiscal". Ha sido expositor en jornadas y conferencias sobre el Ministerio Público, Abigeato, Código de la Niñez y la Adolescencia, Derechos Humanos, Violencia Doméstica, Reforma del Proceso Penal, Terrorismo, Aborto, etc.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73846, 'CESANO, José Daniel ', 'Profesor de posgrado de Derecho Penal en las Universidades de Córdoba y Buenos Aires.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73856, 'MILLER, Cecilia', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (73979, 'LAZARO IGOA, Rosario ', 'Nacida en Salto, Uruguay, en 1981. Licenciada en Ciencias de la Comunicación por la Universidad de la República, Uruguay. Reside en Brasil, donde cursa un Doctorado en Estudios de la Traducción (UFSC). Traductora e investigadora sobre poesía traducida. Maestría en Estudios de la Traducción y Diplomada en Traducción Literaria por la Universidad de la República (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74068, 'MACEDO, Martín ', 'Nacido en Montevideo, Uruguay, en 1964. Integrante de la Asociación Macrobiótica del Uruguay. Médico, especialista en nutrición. Practica medicina oriental y naturista y es promotor de la filosofía del "no temor".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74097, 'OLAZA, Mónica ', 'Magíster en Sociología por la Facultad de Ciencias Sociales (Universidad de la República). Profesora de Historia egresada del IPA. Docente de Grado y Posgrado en la Facultad de Psicología (Universidad de la República). Bfía.: "La cultura afro uruguaya : una expresión de multiculturalismo emergente de la relación global-local"; "Ayer y hoy : afrouruguayos y tradición oral"; en colaboración, uno de los capitulos del libro colectivo "Sociología Clínica (2) : reflexiones desde la Práctica"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74122, 'ROIG, Yaraví ', 'Nombre propio y forma no usada: ROIG CURBELO, Genoveva. Nacida en Piriápolis, departamento de Maldonado, Uruguay, el 6 de enero de 1948. Maestra con un posgrado en Educación Especial. En 1976 emigró e Venezuela. Viajó por Europa dictando conferencias y talleres en Barcelona, España, al igual que en Uruguay. Trabajó en escuelas de recuperación psíquica de Montevideo, Maldonado, Caracas (Venezuela), y Santo Domingo (República Dominicana).\r\nInvestigadora, estudiosa de la Cábala y la Alquimia. Maestra de Reiki. Autora de novelas y relatos breves.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74220, 'TRIAS, Daniel ', 'Magíster en Psicología Cognitiva y Aprendizaje. Psicólogo. Especialista en Psicología Educacional.Profesor Adjunto del Departamento de Psicología del Desarrollo y Educación de la Facultad de Psicología de la UCUDAL. Coordinador de la Maestría en Psicología Educacional. Integrante del Sistema Nacional de Investigación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74338, 'SILVETTI, Raquel ', 'Nació en Montevideo es 1959. Educadora inicial. Coordinadora del área infantil en la Biblioteca Nacional. Escritora y narradora de obras para niños.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74429, 'CORDERO PIAZZA, Ricardo ', 'Nacido en Montevideo, Uruguay, en 1967. Arquitecto, especialista en intervención en el patrimonio arquitectónico. Integrante de la Comisión de Gestión del Anglo desde 2008. Desde el año 2000, arquitecto asesor en la Comisión del Patrimonio Cultural de la Nación. Asistente académico de la Facultad de Arquitectura');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74514, 'MARQUEZ FERNANDEZ, Susana ', 'Nacida en Montevideo el 15 de abril de 1947. Desarrollo su carrera docente en los departamentos de Canelones y Montevideo. Realizó varios cursos, entre ellos, Curso de Directores en el I.M.S. y Curso de Actualización de Educación Inicial.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74525, 'FIORITO, Mariella ', 'Procuradora. Profesora Ayudante de Legislación Veterinaria. Asesora del Ministerio del Interior (Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74723, 'LAFLUF, Omar', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74789, 'LEV, Sandra', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74867, 'LOMBARDI, Raúl ', 'Nacido en Montevideo, Uruguay, el 1º de abril de 1969. Licenciado en Ciencias Biológicas. Trabaja en el área de conservación, biodiversidad, monitoreo ambiental y manejo de áreas naturales en Uruguay y Argentina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (74993, 'SANTIAGO, Beatriz', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75159, 'GONZALEZ, María del Carmen ', 'Profesora de Literatura Uruguaya y de Literatura Española en el IPA y magíster en Literatura Latinoamericana por la Facultad de Humanidades y Ciencias de la Educación de la Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75273, 'RAVA ZEFFERINO, Catalina ', 'Ingeniera Agrónoma en Opypa del Ministerio de Ganadería, Agricultura y Pesca. Máster en Agronegocios y Alimentos por la Universidad de Buenos Aires. Economía Aplicada INIA.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75341, 'NETTO MARTURET, Wilson ', 'Profesor. Director General del Consejo de Educación Técnico Profesional - CETP (Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75356, 'URUGUAY. FACULTAD DE CIENCIAS ECONOMICAS Y DE ADMINISTRACION. CATEDRA DE ECONOMIA DESCRIPTIVA I ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75373, 'DANI UMPI ', 'Nacido en Tacuarembó, Uruguay, en 1974. Músico, artista visual y escritor. Su estética y puestas en escena se relacionan con el arte pop o la tropicalia. Nombre propio: UMPIERREZ, Daniel.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75377, 'GARCIA CALVO, Aldo ', 'Nacido en Dolores, departamento de Soriano, Uruguay, en 1924. En 1939, gana la beca José Martí y se traslada a Cuba a estudiar por dos años. En 1942 es designado como auxiliar 5º de la Dirección de Aeronaútica Civil. Luego, hizo carrera dentro de la aeronaútica civil hasta jubilarse en el año 1975.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75442, 'PELUFFO, Gabriel', 'Pediatra. Músico integrante de “Los Buitres”');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75491, 'TRUJILLO, Valentín ', 'Nacido en Maldonado, Uruguay, en 1979. Docente de idioma español y literatura. En 2007 recibió el Premio Nacional de Narrativa Juan José Morosoli por su libro de cuentos "Jaula de costillas". Periodista en el diario "El Observador".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (75505, 'TERRA, Mercedes ', 'Montevideo, 1948. Profesora de Historia egresada del IPA. Master en Historia y Ciencias Sociales egresada de FLACSO (Buenos Aires). Fue durante siete años profesora en la UBA. Tiene publicaciones en revistas y diarios en Latinoamérica y Europa. En 1991, a su retorno a Uruguay, comenzó a trabajar nuevamente en la enseñanza media y entró a trabajr en la FHCE al Departamento de Historia Americana. Trabajó en periodismo en "Relaciones" y "El País cultural" en crítica historiográfica. En los últimos años publicó: "Montevideo durante la Guerra Grande. Formas de vida, convivencia y relacionamientos" en 2007 y "Lil Gonella de Chouhy: Una mujer del mañana" en 2008.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76052, 'LANDO, Juan Carlos', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76236, 'GARCIA FERREIRA, Roberto', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76267, 'GREPPI, Andrea', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76290, 'FERRER BELTRAN, Jordi ', 'Abogado español. Licenciado en Derecho. Universidad Autónoma de Barcelona. 1991.\r\nDoctor en Derecho. Universidad Pompeu Fabra. España. 1997.\r\nConsultor de Teoría y Filosofía del Derecho en la Universitat Oberta de Catalunya. 1998-2003.\r\nProfesor Asociado en la Universidad de Gerona. 2000-2002.\r\nProfesor Titular de Filosofía del Derecho en la Universidad de Gerona. 2002-.\r\nDirector de la cátedra de cultura jurídica en la Universidad de Gerona.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76300, 'CARBONELL, Miguel ', 'Investigador en el Instituto de Investigaciones Jurídicas de la UNAM (México). Ha sido investigador  invitado en las Universidades Pompeu Fabra de Barcelona y de Castilla-La Mancha. Autor de las obras: "Constitución , reforma constitucional y fuentes del derecho en México", "La Constitución en serio". Multiculturalismo, igualdad y derechos sociiales".  y "Elementos de derecho constitucional". Es editor de la colección : "Estructuras y procesos. Serie Derecho", ha editado "Neoconstitucionalismo(s), (2009)", "Teoría del neoconstitucionalismo, (2007)",  y "Democracia y garantismo de Luigi Ferrajoli, (2010)", y ha traducido "Historia y constitución de Gustavo Zagrebelsky (2005)" y "La exigencia de justicia del propio Zagrebelsky y Carlo María Martini, (2006)".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76334, 'RODRIGUEZ DE SANCTIS, Alvaro ', 'Nacido en Montevideo (Uruguay) en 1956. Dibujante, artísta plástico, diseñador gráfico y creativo publicitario. Autor del libro "Los desastres de la cana".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76401, 'URUGUAY. UNIVERSIDAD DE LA REPUBLICA. RECTORADO', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76431, 'MARTINEZ, Edgardo J. ', 'Arquitecto. Cursó estudios de posgrado en el Institute for Housing Studies de Róterdam. Analista y planificador urbano-territorial, habiendo desarrollado trabajo de investigación aplicada, proyectos experimentales y currícula de posgrados en temas de dinámica y transformaciones metropolitanas y de ciudades intermedias, gestión del acondicionamiento urbano, y programas habitacionales en contextos latinoamericanos y del sudeste asiático. Profesor Agregado con dedicación total en el Instituto de Teoría y Urbanismo (ITU) de la Facultad de Arquitectura de la Universidad de la República, Uruguay. Nombre propio y formas no usadas: MARTINEZ CAMAROTTE, Edgardo J. y MARTINEZ, Edgardo Jorge.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76443, 'FONTANA CABEZAS, Juan José ', 'Uruguayo, arquitecto y doctor con perfil en Diseño Estructural. Profesor Agregado de la Cátedra de Estabilidad de las Construcciones 4, Profesor Adjunto de la Cátedra de Estabilidad de las Construcciones 1 y 4, y Asesor de Estructuras en los talleres Danza y Ridao en la Facultad de Arquitectura, Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76454, 'RAMIREZ, Juan Andrés ', 'Nombre propio completo, forma no usada: RAMIREZ TURELL, Juan Andrés. Nacido en Montevideo en el año 1946. Abogado, profesor y político uruguayo perteneciente al Partido Nacional. Hijo de Elvira Turell y de José Antonio Ramírez \r\nGarcía. Nieto de Juan Andrés Ramírez Chain, político nacionalista de destacada actuación en la primera mitad del siglo XX.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76497, 'URUGUAY. FACULTAD DE MEDICINA', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (76800, 'MARTINEZ-LAGE, Miguel', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77001, 'CIGANDA, Juan Pedro ', 'Licenciado en Ciencias Históricas (FHCE/UdelaR). Dirigente de AEBU en varios períodos, ejerciendo la presidencia del sindicato entre 1976 y 1984. Fundador del PIT. Diputado por Montevideo (1985-1990). Integró el PCU entre 1977-1991.\r\nHa hecho periodismo, trabaja en investigación del pasado reciente de Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77042, 'CIAPESSONI, Fiorella ', 'Licenciada en Sociología, Udelar Asistente de Investigación del Departamento de Sociología (Facultad de Ciencias Sociales). Trabaja en temas vinculados con las sociología del trabajo, vivienda y marginalidad');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77217, 'PESCETTI, Luis María ', 'Nacido en San Jorge (Santa Fe, Argentina) en 1958. Escritor, actor y músico. Ha publicado obras para niños y adultos. Recibió el premio Casa de las Américas en 1997 por su novela "El ciudadano de mis zapatos", el premio The White Ravens en los años 1998, 2001 y 2005 (otorgado por la Internationale Jugendbibliothek) y tres premios Gardel. En 2005, recibió el premio Pregonero Radial de la Fundación El Libro por su programa El vampiro negro. En 2010 ganó el Grammy Latino al Mejor Álbum de música para niños y el Gran Premio ALIJA 2010 (IBBY Argentina) y el Premio Caniem por su libro "Cartas al Rey de la cabina".\r\nEn 2011, recibió un premio Konex por sus trabajos en el ámbito de la literatura y música infantil y juvenil. Además, fue declarado Personalidad Destacada de la Cultura de la Ciudad de Buenos Aires, Visitante Ilustre de la Ciudad de Córdoba y Embajador Cultural de la Ciudad de San Jorge. En 2016, fue nombrado Amigo de las Bibliotecas Populares por la CONABIP.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77222, 'ACEVEDO KANOPA, Agustín ', 'Nacido en Montevideo, Uruguay, en 1985. Psicólogo. Escribe sobre cine y música en diferentes medios de comunicación. Autor del poemario "Caja Negra". Sus primeros trabajos narrativos aparecen en el 2008 con la publicación de dos cuentos en la antología "De acá". Ganador de los Fondos Concursables del Ministerio de Educación y Cultura en 2009 por su novela "Antes del crepúsculo".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77246, 'SIMETO, Sofía ', 'Licenciada en Ciencias Biológicas. Fitopatología, Programa Nacional de Investigación en Producción Forestal, INIA Tacuarembó.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77289, 'AMADO, Fernando ', 'Nacido en Montevideo, Uruguay, el 11 de setiembre de 1982. Licenciado en Ciencia Política por la Universidad de la República (UDELAR). En 2009 fue electo Diputado por el Partido Colorado.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77310, 'PIÑEIRO, Claudia ', 'Nacida en Buenos Aires (Argentina) en 1960. Escritora, dramaturga, guionista de TV y colaboradora  de distintos medios gráficos. Ha obtenidos diversos premios nacionales e internacionales por su obra literaria, teatral y periodística. Es autora de las novelas: "Las viudas de los jueves" (2005), "Tuya" (2005; Alfaguara 2008), "Elena sabe" (2007), "Las grietas de Jara (2009), "Betibú" (2011), y los cuentos infantiles: "Un ladrón entre nosotros", "Serafín, el escritor y la bruja".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77326, 'CUARTEROLO, Andrea ', 'Doctora en Historia y Teoría de las Artes por la Universidad de Buenos Aires. Investigadora del Instituto de Historia del Arte Argentino y Latinoamericano (UBA) y miembro del comité ejecutivo de la Sociedad Iberoamericana de Historia de la Fotografía. Miembro del comité editorial de la revista "Imagofagia" y de la Comisión Directiva de la Asociación Argentina de Estudios de Cine y Audiovisual.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (82940, 'NOVICK, Aldo ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (82965, 'SAAVEDRA, Enrique ', 'Nombre completo (forma no usada): SAAVEDRA DELLE PIANE, Enrique');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77516, 'VAZQUEZ FERRANDO, Alberto ', 'Licenciado en Psicología. Coordinador del Programa Nacional de Buentrato, programa de la sociedad civil que consiste en identificar y promover capacidades fortalecedoras frente a la violencia y promotoras de buen trato hacia la infancia y la adolescencia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77605, 'CAMPANELLA, Hortensia', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77619, 'ALVES, Blanca ', 'Nombre propio completo: Blanca Azucena Alves Arévalo. Forma no usada. Durazno, 1942. Vive actualmente en La Paz, Canelones. Escribió tres libros para sus nietas: "Laura", "Enrique Erro, Babú y yo" y "Para Sara".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77730, 'BARBOZA PEREIRA, Mauro ', 'Nacido en Rivera, Uruguay. Naturalizado montevideano. Director de liceo, Profesor de Literatura, escritor, ajedrecista. Publicó: "Las trampas del tiempo", 2007; "El caballero, la dama y el arcipreste", 2010.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77754, 'ESTRADA, Marcos M. de', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (77814, 'MUTARELLI, Rossana', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78080, 'ESCOTO SCARAFFUNI, Laura', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78082, 'SUAREZ BERRIEL, Rosario', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78204, 'VERZI, Edgardo ', 'Nacido en Montevideo, Uruguay, en 1940. Ingeniero Civil graduado en 1963. Postgrados en Tecnología de Hormigones, Construcciones Prefabricadas y Análisis Estructural: Italia (1965 y 1970), Francia (1965), Argentina (1974). Artista formado en dibujo y pintura, talleres del Club de Grabado y cursos de escultura, video arte, collage, guión, edición y montaje cinematográficos y tratamiento digital de la imagen. Habitualmente se expresa mediante fotografía en un proceso que incluye pintura, macro fotografía y tratamiento digital de la imagen.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78233, 'APARICIO, Fernando ', 'Montevideo, 1955. Profesor de Historia egresado del IPA y tiene estudios en la Escuela Nacional de Antropología e Historia (México) sobre Historia Latinoamericana y Contemporánea. Es docente e investigador del Departamento de Historia Americana de la FHCE (Udelar), profesor de bachillerato en Educación Secundaria e instituciones privadas. Ha publicado "Basilio Muñóz, caudillo blanco entre dos siglos" en 1984, "La construcción del puerto de Montevideo: el definitivo regreso a la modernización" en 2010 y es coautor de "Amos y esclavos en el Río de la Plata" en 2006.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78423, 'ACOSTA CASCO, Natalia ', 'Uruguaya. Doctora en Derecho. Profesora Adjunta de Derecho Penal e Investigadora de la Facultad de Derecho, Udelar. Asesora Letrada de la Dirección General Impositiva, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78607, 'SANCHEZ PAPARIELLO, Ana Claudia ', 'Nacida en Montevideo, Uruguay, el 27 de diciembre de 1964. Maestra, fundamentalmente, en Escuelas de Práctica de Montevideo. Desde 2008 se ha desempeñado como Directora de Escuelas de Práctica y profesora en los cursos de Educación de Adultos del CODICEN. Profesora en el Instituto de Formación Docente María Stagnero de Munar, a cargo de las asignaturas Didáctica I y II, Seminarios de Lengua, Producción y Estilos de Comunicación, y Derechos Humanos. Aplicadora de evaluaciones UMRE, SERCE, TERCE y Ceibal y correctora de evaluaciones en la Unidad de Evaluación del CODICEN. Autora de varios libros dirigidos a docentes.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78671, 'VALDES, Rosario ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78780, 'FALCA, Susana ', 'Abogada con trayectoria en el ámbito de la reflexión de la teoría y la práctica del derecho penal juvenil. Asesora en materia de adecuación legal a los estándares internacionales de protección de los derechos humanos. Diplomada en Políticas Públicas y Derechos de Infancia por la Udelar. Docente en cursos nacionales e internacionales para posgrados.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78785, 'BONIFACINO, Maria Raquel ', 'Uruguaya, poetisa, modelo empresaria, conductora de TV y pintora. Ha recibido numerosos premios literarios, y participado en varias exposiciones de Pintura. Entre sus publicaciones impresas se destacan : "Amor Amor Amor" (2008), "Amor, amor, amor 2, nunca muere" (2013) y Amar así (2013).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (78846, 'MELOGNO, Pablo ', 'Nacido en Melo, Departamento de Cerro Largo, Uruguay, en 1979. Profesor de Filosofía, egresado del Instituto de Profesores Artigas. Licenciado en Psicología por la Facultad de Psicología de la UDELAR. Docente de Historia y Filosofía de la Ciencia en la Facultad de Humanidades y Ciencias de la Educación, y de Lógica en el Instituto de Profesores Artigas. Profesor Adjunto de Epistemología e Historia de la Ciencia en la Escuela Universitaria de Bibliotecología y Ciencias Afines de la UDELAR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79071, 'PEREZ DEL CASTILLO, Matías ', 'Nombre completo y forma no usada: PEREZ DEL CASTILLO RAQUET, Matías. Abogado uruguayo, nacido en Montevideo. Graduado en la Facultad de Derecho y Ciencias Sociales por la Universidad de la República (Doctor en Derecho y Ciencias Sociales, 2007). Cursos de postgrado sobre Actualización de Normas Laborales, y Funcionamiento práctico de Sociedades Comerciales en la UdelaR. Obtuvo el Cambridge International Legal English Certificate. Cursa Maestría en Derecho Comercial en la UdelaR desde 2009. Miembro del Grupo de Jurisprudencia del Instituto de Derecho Informático (Facultad de Derecho de la Universidad de la República), desde 2007 a 2009. Redactor de artículos sobre Derecho Laboral (publicados en CADE), Derecho Informático (publicados en "Derecho Informático", y de ponencia presentada en XII Congreso Iberoamericano de Derecho e Informática), y comercial (en La Ley).\r\nColaborador en la actualización del libro “Manual Práctico de Normas Laborales” de Santiago Pérez del Castillo (2010).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79124, 'ROVIRA, Pablo ', 'Ingeniero Agrónomo. MSc. Seguridad Alimentaria/Sistemas de Producción. Programa Nacional de Investigación Producción de Carne y Lana. INIA Treinta y Tres.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79263, 'CARDOSO, Jorge Emilio ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79377, 'MORENO, Inés ', 'Nombre propio completo, forma no usada: MORENO, María Inés. Magíster en Filosofía Contemporánea por la Facultad de Humanidades y Ciencias de la Educación (FHCE) de la Universidad de la República (Udelar). Es docente e investigadora de Estética en el Instituto de Filosofía de la FHCE de la Udelar y profesora de Estética en la carrera de Filosofía del Instituto de Profesores Artigas (IPA). Se desempeña como coordinadora académica del Departamento Nacional de Filosofía del Consejo de Formación en Educación de la Administración Nacional de Educación Pública (ANEP). Su área de investigación es la justificabilidad de la valoración del arte en la práctica y en la teoría contemporánea, con especial énfasis en el giro sociológico de la Estética desde la segunda mitad del siglo XX. Ejerció la crítica de artes visuales en diversos medios periodísticos y realizó numerosos textos para catálogos de exposiciones.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79550, 'SERRANO, Marcela ', 'Nacida en Santiago de Chile en 1951. Es Licenciada en Grabado en la Universidad Católica, desarrolló su carrera profesional entre 1976-1983 en diversos ámbitos de las artes visuales, entre ellas el body art. Entre sus novelas publicadas podemos encontrar "Nosotras que nos queremos tanto", la cual fuera ganadora del Premio Sor Juana Inés de la Cruz, "Para que no me olvides" que obtuvo el Premio Municipal de Literatura en Santiago de Chile, , "Antigua vida mía". y "El albergue de las mujeres tristes"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79562, 'LOCKHART, Guillermo ', 'Uruguayo. Técnico en Administración de Empresas por la Universidad Católica del Uruguay, y especializado en el área de marketing. Modelo y conductor televisivo. Conductor y director de los tres ciclos del programa de televisión "Voces anónimas" de Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79582, 'YOHAI, William ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111679, 'GRANDAL, Fernando ', 'Abogado, integrante de la firma Rueda Abadi Pereira.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79840, 'PERUZZO, Nicolás ', 'Montevideo, 1980. Guionista, dibujante y editor del sello Ninfa Comics. Estudió dibujo en la Continental School y cursó la carrera de animador 3D en Animation Campus. Participó en talleres de guión con Daniela Speranza y Diego Agrimbau.\r\nEscribió y dibujó la novela gráfica RANITAS: catarsis y Rock n Roll, co-editada con Grupo Belerofonte. También escribió y dibujó tres números de la serie Relatos de Ciudad Fructuoxia, la historieta Freedom Knights en Ciudad Fructuoxia (realizado junto a Dragón Comics) y el manga Hui Ke. Ganador del concurso de historietas Montevideo Comics 2008. Su historieta “el pelo largo a los 15” fue preseleccionada en el concurso de la revista argentina Fierro en 2010.\r\nRealizó las ilustraciones para la campaña de televisión de Montevideo Comics 2011. Ha publicado ilustraciones, historietas y guiones en El Observador, 180.com, la revista NEO, Freedom Knights, Tá, Cisplatino, Sidekick, G.A.S. y en el libro de ensayo La Sociedad del Olvido.\r\nEs dibujante estable del staff de la editorial norteamericana de libros infantiles Mirror Publishing donde lleva publicados 20 libros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79875, 'TROCHON RICCHIARDIELLO, Pablo ', 'Coordinador del Taller de Escritura en el Hospital Vilardebó.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (79970, 'STOLOVAS, Nurit ', NULL);
