INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (80513, 'RIVERO ILLA, Martín ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (80515, 'BONELLI, Florencia ', 'Argentina. Escritora, referente de la novela histórico romántica en su país. Comenzó a escribir en 1999.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (80520, 'YARZABAL, Luis ', 'Doctor en Medicina. Director fundador del Centro Amazónico de Investigación y Control de Enfermedades Tropicales, Venezuela. Ex Director del Instituto de Higiene de Montevideo. Ex Presidente de la Administración Nacional de Educación Pública (ANEP). Presidente de la Junta de Transparencia y Etica Pública, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (80530, 'MORESINO, Sandra ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (80678, 'ABAL, Gonzalo ', 'Docente del Instituto de Física de la Facultad de Ingeniería, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (80951, 'ZABALA, Mariana ', 'Nacida en Montevideo, Uruguay, en 1969. Editora y periodista. Trabajó en los diarios "El Observador" y "El País". Directora de revistas, suplementos coleccionables y anuarios, además de Secretaria de Redacción. Galardonada por el Instituto Iberoamericana del Niño por su investigación sobre la niñez y la televisión ("El Observador", 1998). Obtuvo el premio en periodismo "Sociedad para todos" (Bogotá, 2002).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81021, 'IRIBAR, Gabriela ', 'Médico Veterinaria egresada de la Universidad de la República. Máster en Administración de Empresas (MBA). Posgrado en Etología Clínica (comportamiento animal). Docente honoraria de la Facultad de Veterinaria y responsable de la policlínica de Comportamiento Animal en dicha casa de estudios. Comunicadora en diversos medios de prensa. Integrante del equipo de "Hola vecinos" de Canal 10 con un micro sobre mascotas y conductora del programa "Mascotas y compañía" en Radio Carve.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81271, 'RODRIGUEZ, Clarisa ', 'Integrante de Departamento Jurídico de la firma Rueda, Abadi, Pereira, Doctora en Derecho y Ciencias Sociales, egresada de la Facultad de Derecho de la UDELAR. Aspirante a Profesora Adscripta de Derecho Procesal en la Facultad de Derecho de la UDELAR. Maestrando en Derecho Procesal de la Universidad Nacional de Rosario.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81272, 'ALGORTA MORALES, Paula ', 'Nacida en Montevideo, Uruguay, en 1978. Doctora en Derecho y Ciencias Sociales, egresada de la Universidad de la República, Uruguay. Máster en Derecho de la Empresa, por la Universidad de Montevideo. Docente en las materias Privado IV y V (Derecho Comercial I y II) en la Facultad de Derecho de la Universidad de la República. Docente del Posgrado Derecho Cooperativo de la Facultad de Derecho de la Universidad de la República. Docente de Compraventa Internacional en la carrera de Perito en Comercio Exterior y Aduana.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81273, 'ORDIOZOLA PERRONE, José Miguel ', 'Doctor en Derecho y Ciencias Sociales, egresado de Udelar. Asesor de: Insitituciones de Asistencia Médica Colectiva (IAMCs). Seguros Privados Médicos y Odontológicos, y diversas instituciones de salud');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81275, 'COBAS, Francisco ', 'Nombre propio y forma no usada: COBAS ETCHEGOIMBERRY, Francisco. Abogado, trabaja en el estudio Rueda Abadi Pereira.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81276, 'GUTIERREZ, Adrián A. ', 'Abogado. Profesor Ayudante de Derecho Administrativo de la Facultad de Derecho, Udelar. Máster en Derecho Administrativo Económico de la Universidad de Montevideo. Diploma de Especialización en Derecho de la Empresa, Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81396, 'BALARINI TEJERA, Gonzalo ', 'Arquitecto uruguayo, nacido en 1959.  Docente de Anteproyecto V, Departamento de Proyecto y Anteproyecto de Arquitectura.\r\nIntegrante del grupo interdisciplinario de la Maestría en Manejo Costero Integrado del Cono Sur (MCISur) de la Universidad de la República (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81403, 'CORDOVA VIANELLO, Lorenzo ', 'Licenciado en Derecho por la UNAM y doctor de investigación en Teoría Política por la Universidad de Turín, Italia. Investigador del Instituto de Investigaciones Jurídicas de la UNAM, donde coordina el área de derecho electoral, así como profesor de la Facultad de Derecho de la misma Universidad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81411, 'SORIA, Valentina ', 'Arquitecta, docente asistente (grado 2) de Anteproyecto II y IV, Departamento de Proyecto y Antiproyecto de Arquitectura; candidata a magíster Maestría Ordenamiento Territorial, Facultad de Arquitectura, UDELAR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81412, 'ECHEVARRIA, Luciana ', 'Arquitecta, docente asistente (grado 2) de Anteproyecto I, Departamento de Proyecto y Anteproyecto de Arquitectura.\r\nIntegrante del grupo interdisciplinario de la Maestría en Manejo Costero Integrado del Cono Sur (MCISur) de la Universidad de la República (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81664, 'CAMPA, Juan Pablo ', 'Apicultura, DILAVE, MGAP.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81665, 'HARRIET, Jorge ', 'Apicultura, DILAVE, MGAP.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81841, 'INZAURRALDE, Luis Eduardo ', 'Nombre completo y forma no usada: INZAURRALDE LOMBARDO, Luis Eduardo. Nacido en Montevideo, Uruguay, el 17 de noviembre de 1971. Periodista, se desempeñó en El Diario (1987-1996) y El Observador (desde 1996). Desde 2005 es editor de deportes de El Observador.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (81971, 'MEYER, Stephenie ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (82212, 'RODRIGUEZ BARRETO, Patricia ', 'Integrante del equipo docente del Area Trabajo y Cuestión Agraria del Departamento de Trabajo Social de la Facultad de Ciencias Sociales (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (82216, 'LOPEZ DOURADO, Viviana ', 'Doctora en Derecho, egresada de UCUDAL. Especializada de Derecho Laboral y Seguridad Social. Integrante de la Asociación Uruguaya de Derecho del Trabajo y la Seguridad Social.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (82272, 'BUDA, Evaristo Ramón ', 'Nació en Maldonado en 1947. En el año 2005 participó en la publicación del libro "Sueños de Poeta". En el 2006 presentó su libro "Solo palabras" acompañado por el Taller Literario Siglo XXI. En el año 2008 participó en el libro "Palabras mayores".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (82396, 'ANGENSCHEIDT LORENTE, Carly ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (82714, 'MIGUEZ, Marina ', 'Nombre propio completo y forma no usada : MIGUEZ PALERMO, Marina.\r\nMagister en Estudios Biológicos, Universidad de León (Espraña), Doctora en Química, orientada a la educación, Facultad de Química, UdelaR (Uruguay). Diplomada en Enseñanza de las Ciencias, en Ciencias Sociales mención Constructivismo y Educación Facultad Latinoamericana de Cienicas Sociales (Argentina).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (82967, 'CAMPERO, Ruben ', 'Licenciado en Psicología (UdelaR), sexólogo y psicoterapeuta con formación en Psicoanálisis Focal y en Terapia Sistémica Estratégica. Es también terapeuta psico-corporal por el Sistema Río Abierto Internacional. Se ha especializado en género, formándose en Psicoanálisis y Género (en la Asociación de Psicólogos de Buenos Aires), además de participar en otros seminarios sobre el tema. Es doctorando en Psicología por la Universidad de Ciencias Empresariales y Sociales en Buenos Aires, con tesis en masculinidades, cuerpo y erotismo. Asimismo, es docente en cursos de formación para educadores sexuales y terapeutas sexuales en el Instituto de Formación Sexológica Integral SEXUR, y en los cursos Género, Diversidad Sexual y Derechos Humanos y Masculinidades en el Centro de Estudios de Género y Diversidad Sexual, en donde también es codirector. A su vez, ha sido docente en cursos y seminarios sobre sexualidad y género en diferentes instituciones, además de escribir artículos sobre el tema tanto en revistas nacionales como internacionales. Fue conocedor del programa "Sexualmente", emitido por Saeta TV Canal 10 durante el 2006, y del programa radial "Historias de piel", emitido semanalmente a través de FM Del Plata entre los años 1997 y 2004.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (83026, 'RODRIGUEZ, Carmen ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (83097, 'PERERA, Gonzalo ', 'Nació en 1966, en Rocha, Uruguay. Doctor en Matemática (especializado en Probabilidad y Estadística) en la Universidad de la República, Uruguay. Profesor Titular (grado 5) de Matemáticas en la Facultad de Ingeniería. Docente del Centro de Matemática de la Facultad de Ciencias. Dirigió el Laboratorio de Probabilidad y Estadística (conjunto de Ingeniería y Ciencias) y el Instituto de Matemáticas y Estadísticas "Rafael Laguardia" (Ingeniería). Ganó en 1998 el primer Premio Nacional de Veterinaria y en el 2000, el premio "Roberto Caldeyro-Barcia". Profesor investigador de la Université de Paris-Sud y del CNRS, Luminy, Marsaille. Ejerció la vicepresidencia de ANTEL (Uruguay), entre 2008-2009. Publicó: "Malditos números" (2009).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (83110, 'ECHEVERRIA, Valentina ', 'Nacida el 7 de febrero de 1986. Ilustradora, con especial interés en lo infantil. Diseñadora gráfica y realizadora de animación. Estudió artes plásticas y visuales en el Instituto Escuela Nacional de Bellas Artes. Ha realizado varios talleres de expresión artística y de cerámica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (83160, 'DIAZ, Javier ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (83694, 'BARREIRO, Pedro R. ', 'Periodista, columnista del semanario Jaque y de la revista Bon Jour de Montevideo. Colaborador con artículos de historia y urbanismo en numerosas publicaciones extranjeras. Investigador en temas de literatura e historia nacional, en particular sobre la evolución tecnológica y los transportes.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (83761, 'LTAIF, María Lila ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (83766, 'PARODI REBELLA, Aníbal ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (83880, 'IGLESIA CATOLICA. CONFERENCIA EPISCOPAL DEL URUGUAY ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84061, 'BENGOA, Juan Pablo ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84135, 'BERGARA, Matías ', 'Nacido en Montevideo, Uruguay en 1984. Dibujante de comics, videojuegos e ilustrador. Publica actualmente en medios nacionales e internacionales. La edición original de 2008 de "Los últimos días del Graf Spee" fue su primer publicación como autor y le valió el reconocimiento de prensa, colegas y eventos internacionales dedicados al comic y la narrativa de género. Ganó tres veces los Fondos Concursables del MEC y dos premios Sheldon por la novela gráfica "Dengue" con guión de Rodolfo Santullo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84212, 'GILLES, Mireille ', 'Directora Profesional de la ACJ de Montevideo. Integró el Staff del Consejo Mundial de Iglesias. Ejecutiva de Centros de Educación para el Desarrollo de la Confederación Latinoamericana de ACJs. Ejecutiva de la Alianza Mundial de YMCAs-ACJs. Integrante de la Comisión Directiva del IUACJ. Mienbro de la Iglesia Valdense.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84409, 'ISHA ', 'Nombre propio y forma no usada: Jennifer Lee Duprei. Nombres espirituales y formas no usadas: Heather Isobel Judd, Isha Judd. Nacida en Australia en 1962. Entre sus obras publicadas se encuentran: "Por qué caminar si puedes volar?" , "El diamante negro de Atlantis", "Vivir para volar" y "El amor sobre todas las cosas".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84581, 'PRADERA, Alejandro ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84652, 'VISCONTI, Silvia ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84671, 'PANIZZA, Silvina ', 'Economista. Desempeña funciones en el MIEM.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84699, 'CABRERA, Claudia ', 'Máster en Educación por la ORT Uruguay. Licenciada en Ciencias Biológicas por la Universidad de la República. Formación en Profesorado de Biología y Ayudante Preparador de Laboratorio de Biología en el Instituto de Formación Docente de Florida. Experiencia docente en el Consejo de Educación Secundaria y en el Consejo de Formación en Educación de la ANEP, con estudiantes y docentes. Docente del Centro Regional de Profesores del Centro, ANEP-CODICEN.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (84926, 'GARCIA MARTINEZ, Rafael ', 'Abogado. Socio de la firma Rueda, Abadí, Pereira. Miembro activo del Grupo de Derecho Procesal de la Universidad de Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (85222, 'INVERNIZZI, Ciro ', 'Sección Etología, Facultad de Ciencias de la Udelar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (85326, 'VELOSO GIRIBALDI, Natalia ', 'Doctora en Derecho y Máster en Derecho Administrativo Económico por la Universidad de Montevideo. Profesora Adjunta de la materia "Régimen Administrativo de la Propiedad Privada" y Secretaria Técnica de la Revista de Derecho de la mencionada Universidad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (85534, 'RIO, Fanny DEL ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (85654, 'COELHO, Paulo ', 'Nace en Río de Janeiro en 1947. Se inició en el mundo de las letras como autor teatral. Después de trabajar como letrista para los grandes nombres de la canción popular brasileña se dedicó al periodismo y a escribir guiones  para la televisión. Sus obras han sido publicadas en más de ciento setenta países. Ha recibido destacados premios y menciones internacionales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (85656, 'COSTAS, Ana Belén ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (85800, 'SANGUINETTI, Santiago ', 'Nacido en Montevideo, Uruguay, en 1985. Actor, Director, Dramaturgo y Docente. Egresado de la EMAD (Escuela Municipal de Arte Dramático) y del Instituto de Profesores Artigas. Ganador de varios premios, Premio Nacional de Literatura, el Premio Onetti, el Premio Florencio, el Premio Moliére y el Fondo para la Formación y la Creación Artística 2012-2014. Sus obras se han llevado a escena en Uruguay, Argentina, Brasil, Colombia, México, Estados Unidos, España, Inglaterra y Francia. Entre sus obras se destacan, "Dramaturgia imprecisa" (Estuario, 2009), "Sobre la teoría del eterno retorno aplicada a la revolución en el Caribe (Banda Oriental, 2013), y artículos en revistas especializadas de Madrid, La Habana y Santiago de Chile.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (85930, 'VENTOS, M. Dolors ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (86638, 'SANCHEZ ROSSEL, Astrid ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (86716, 'ROLON, Gabriel ', 'Nació en Buenos Aires (Argentina) en 1961. Graduado de la Facultad de Psicología de la Universidad de Buenos Aires, especializándose en psicoanálisis. Participa en varios programas de radio y televisión.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (86725, 'RIO, Pilar DEL ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (86727, 'SARAMAGO, José ', 'Nacido en Azinhaga, Santarém, Portugal, el 16 de noviembre de 1922 y fallecido en Tías, Lanzarote, provincia de Las Palmas, España, el 18 de junio de 2010. Escritor, novelista, poeta, periodista y dramaturgo portugués. En 1998 le fue concedido el Premio Nobel de Literatura.  Forma no usada: SARAMAGO, José DE SOUSA');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111680, 'LAGARRIGA, Romina ', 'Abogada, integrante de la firma Rueda Abadi Pereira.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (86875, 'VIANA MATTURRO, Federico ', 'Uruguayo, Licenciado en Ciencias Biológicas, de la Facultad de Ciencias, Universidad de la República. Magíster en Ciencias Biológicas con opción en Zoología, del Programa de Desarrollo de las Ciencias Básicas. Se desempeña como docente de enseñanza secundaria en el Instituto Crandon desde 1998, y es Consultor en el área de Ecología de Ecosistemas Acuáticos, participando en una multiplicidad de estudios de impacto ambiental, desde 2004.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (86961, 'PEREIRA, Gustavo ', 'Ingeniero Agrónomo. Programa INIA.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (87479, 'PALACIOS, René ', 'Nombre propio y forma no usada: PALACIOS MORE, René.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (87640, 'CHIAZZARO, Irma ', 'Nombre completo y forma no usada: CHIAZZARO LUZARDO, Irma. Oriunda de Trinidad, Flores. Escritora, plástica, periodista y locutora. Libros éditos: "Algo de mí" y "Desde el alma para tí". En el 2004 recibe distinción del MEC y Casa de la Cultura, distinción por su aporte al arte y la cultura.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (87943, 'CARRAU, Natalia ', 'Licenciada en Ciencia Política por la Universidad de la República. Especializa en temas vinculados a la integración regional, comercio internacional y actores regionales. Trabaja en el área de comercio y corporaciones de REDES-Amigos de la Tierra Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (87964, 'VALIÑAS, Francisco ', 'Nombre propio y forma no usada: VALIÑAS FREITAS, Francisco. Capitán de Navío, Licenciado en Sistemas Navales. Diplomado en Estado Mayor General y en Estrategia y Política en la Escuela Naval. Fundador y primer presidente del Centro de Estudios Navales de la Escuela de Guerra Naval. Miembro de la  Academia Uruguaya de Histora Marítima y Fluvial. Miembro correspondiente de la Academia de Historia Naval y Marítima de Chile.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (88087, 'CASTRO, Mara ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (88237, 'FORMENTO ARAMBURU, Pablo ', 'Doctor en Medicina y Tecnología Veterinaria, egresado de la Facultad de Veterinaria, Universidad de la República. Técnico de la Dirección de Contralor de Mercado Interno del Instituto Nacional de Carnes. Profesor Asistente del Departamento de Salud Ambiental y Legislación Veterinaria, del Instituto de Alimentos y Medio Ambiente de la Facultad de Veterinaria. Diplomado en Gestión de Calidad de las Empresas Alimentarias (UNIT). Docente del 1er Curso de Postgrado de Especialización en Industria Cárnica y de los Cursos de Capacitación de Operarios de la Industria Cárnica, dictados por el Instituto Nacional de Carnes y la Universidad de la República. Integrante del Comité Nacional de Irradiación. Miembro de las Mesas Consultivas de Cerdos y Aves del Instituto Nacional de Carnes. Autor de varias publicaciones técnicas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (88297, 'SORIA CHARBONNIER, Juvenal H. ', 'Nombre completo y forma no usada: SORIA CHARBONNIER, Juvenal Horacio. Uruguayo. Profesor de matemática, profesor de Óptica Teórica. Óptico Técnico y Optometrista. Libros editados: "Cristales y trigonometría", "La dióptrica", "Prismas oftálmicos".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (88314, 'URUGUAY. UNIVERSIDAD DE LA REPUBLICA. ASAMBLEA GENERAL DEL CLAUSTRO ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (88725, 'SCHIAPPAPIETRA SOBA, María Valeria ', 'Paysandú, 1989. Estudia Letras en la Facultad de Humanidades y Ciencias de la Educación. Cursó la Tecnicatura Universitaria de Corrección de Estilo (UdelaR). Trabajó en varias librerías en Montevideo y actualmente trabaja como correctora freelance. Ha participado en talleres literarios');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (88739, 'VISCARDI, Nilia ', 'Doctora en Sociología. Licenciada en Sociología por la Facultad de Ciencias Sociales de la Universidad de la República, Uruguay. Profesora Agregada del Departamento de Pedagogía, Política y Sociedad de la Facultad de Humanidades y Ciencias de la Educación. Investigadora del Sistema Nacional de Investigadores de la Agencia Nacional de Investigación e Innovación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89160, 'ROMANG COLOMINAS, Catherine ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89173, 'DUARTE CATTANI, Norma ', 'Nacida en Montevideo, Uruguay. Doctora en Derecho y Ciencias Sociales. Profesora de Derecho Laboral en la Universidad de la República y en Institutos privados. Ocupó, entre otros cargos de carrera, la Dirección de la División Jurídica y la Presidencia de la Sala de Abogados del Ministerio de Trabajo y Seguridad Social de Uruguay, durante diez años. Autora de libros sobre Derecho y Formación Profesional y de artículos periodísticos sobre diversos temas. Becada por OEA para estudiar Formación Profesional en España, Francia e Italia. Contratada por Cinterfor (OIT) como consultora externa para cumplir misiones en Paraguay, Costa Rica, Perú, Chile, Panamá, México, Honduras y Brasil.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89175, 'BADO CARDOZO, Virginia Susana ', 'Profesora adjunta de Derecho Comercial, Facultad de Derecho, Universidad de la República, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89217, 'LUZ, Ana Laura Da ', 'Coordinadora del Espacio Adolescente del INDA y docente del Dpto. de Educación de la Escuela de Nutrición de la UdelaR. Nombre completo (forma no usada): LUZ MARTINEZ, Ana Laura DA');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89307, 'LACKNER, Ricardo ', 'Fiscal departamental. Miembro alterno, en representación de la Fiscalía de Corte, de la Comisión de Reforma del Código Penal. Profesor Adjunto de Derecho Penal en la Facultad de Derecho (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89425, 'LAURINO, Pablo ', 'Uruguayo, arquitecto. Profesor Adjunto de la Cátedra de Estabilidad de las Construcciones 1 y Asistente de la Cátedra de Estabilidad de las Construcciones 4 en la Facultad de Arquitectura, Udelar. Maestrando en Construcción de Obras de Arquitectura.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89426, 'VILA, Virginia ', 'Uruguaya, arquitecta. Profesora Adjunta de la Cátedra de Estabilidad de las Contrucciones 1 en la Facultad de Arquitectura, Udelar. Es integrante del Registro de Trasadores de Obra del Banco de Previsión Social.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89546, 'UGARTEMENDIA ETCHEBARNE, María Ana ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (89847, 'BLAKE, Quentín ', NULL);
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (90150, 'RUCKS, Jorge ', 'Actual Director Nacional de Medio Ambiente (DINAMA) del Ministerio de Vivienda, Ordenamiento Territorial y Medio Ambiente. Arquitecto, egresado de la Facultad de Arquitectura de la Udelar. Trabajó como especialista principal en infraestructura y equipamiento rural del Departamento de Desarrollo Rural de la OEA en Honduras y como coordinador del Proyecto Geografía Energética del Ecuador, entre otras funciones. Entre 1992 y 2002 se desempeñó como jefe de la División de Recursos Hídricos del Departamento de Desarrollo Sostenible de la OEA con sede en Washington DC. Entre los años 2002 a 2009 fue jefe de la División Sostenible de la OEA con sede en Buenos Aires, Argentina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (90424, 'RAMOS, Guzman ', 'Nació el 2 de febrero de 1980. Periodista. Formado en Ciencia de la Comunicación por la Universidad ORT. Se desempeña en Calle Febrero, de Radiodifusión Nacional del Uruguay (RNU) y en el diario El País. Es docente en la cátedra Unesco de Carnaval y Patrimonio, que integra el Diploma de Gestión Cultural en la Universidad de la República, donde dirigió varias tesis de grado. También es investigador residente del Centro de Documentación y Archivo (CDA) del Museo del Carnaval. Trabajó en las radios CX 36, Sarandí 690 y Sport 890, entre otras y en el programa de Más Carnaval, de Antel.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91168, 'BAROFFIO, Alberto ', 'Abogado egresado de la UDELAR. Integrante de la Asociación Uruguaya de Derecho del Trabajo y la Seguridad Social.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108236, 'GARCEZ, Cristiane Magdalena D''AVILA ', 'Economista de la Secretaria de Arranjos Produtivos e Desenvolvimento Local. Asesora de la Presidência do Banco Nacional de Desenvolvimento Econômico e Social, BNDES, Brasil.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91196, 'PEREZ MIGUEL, Emilio ', 'Nació en Montevideo en 1979. Escritor. Traductor público de Inglés desde 2005. Ha concurrido a los talleres literarios de Carmen Galusso, Andrés Echevarría y Déborah Eguren. Ha publicado los poemarios "Once" (2009) y "Ten" (2010), ambos con Rumbo Editorial.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91231, 'CARVALHO, Carlos ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91314, 'DI GIORGIO MEDICI, Marosa ', 'Nacida en Salto, Uruguay, en 1932. Poeta y narradora. Escritora de prosa poética. En el año 1983, mereció el Premio de la Sociedad Petrarca de Francia por "La flor de Laura". En 1995, se presentó bajo el sello Ayuí, "Recital Diadema", un casete reuniendo relatos-poemas suyos. Falleció en el 2004.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91441, 'UMPIERREZ, Alejandra ', 'Licenciada en Filosofía, UdelaR. Es consultora del Programa de Derechos Humanos de la Fundación Fiedrich Ebert Stifung Uruguay en relación con el trabajo de la Fundación sobre Consejo de Seguridad de las Naciones Unidas y Examen Periódico Universal (EPU). Integrante de Amnistía Internacional.-Sección Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91621, 'MASTROIANNI FUENTES, Zulma ', 'Nacida en Pando el 1º de marzo de 1952. En el 2009 obtuvo dos premios en narrativa y poesía con dos obras publicadas en "Agrupando Sueños II". "La mariposa Julieta", un cuento infantil, ganó una mención de honor y fue representada por el grupo de teatro de la Casa de la Cultura de Pando. También obtuvo un premio con el poema "Pompas de ilusión". Integrante del taller literario de la Casa de la Cultura de Pando.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91626, 'SCHREIBER, Fernando ', 'Licenciado en Relaciones Internacionales con posgrado de Especialización en Derecho de la Integración por la Universidad de la República, Uruguay. Coordinador de la Unidad de Relaciones Internacionales y Comercio Exterior. Gerente Asesor para la Promoción del Comercio Industrial Exterior del Ministerio de Industria, Energía y Minería (Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91817, 'ANGELO, Rosita Inés ', 'Magíster en Educación por la Universidad ORT. Experto Universitario en Administración de la Educación 2007-2008 del Ministerio de Educación y Ciencia/OEI/UNED. Profesora de Educación Media en la especialidad Historia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (91831, 'FRANCIA, María Teresita ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (92391, 'MAGLIANO, Claudia ', 'Nace en Montevideo, Uruguay, en 1974. Profesora de Literatura egresada del Instituto de Profesores Artigas (IPA). Autora de "Nada", premio de poesia del concurso de AEBU y la Casa de los Escritores del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (92757, 'CARRETTO PEREIRA, Silvia ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (92899, 'DE GIORGI, Ana Laura ', 'Nacida en 1980. Licenciada y Magíster en Ciencia Política, egresada de la UDELAR. Cursa el Doctorado en Ciencias Sociales de la Universidad Nacional General Sarmiento y el Instituto de Desarrollo Económico y Social en Argentina. Docente en la Facultad de Ciencias Sociales, UDELAR. Integra el Sistema Nacional de Investigadores. Forma  no usada: Ana Laura DE GIORGI CARDONA.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (92975, 'LARSSON, Asa ', 'Nació en Kiruna en 1966. Eestudió derecho en Uppsala. Entre sus libros publicados se destacan:  "Aurora boreal" (2003) por la que le concedieron el Premio de la Asociación de Escritores Suecos de Novela Negra a la Mejor Primera Novela y fue llevada al cine, "Sangre derramada" (2004) recibió el Premio a la Mejor Novela Negra Sueca, "La senda oscura" (2006),  "Till dess din vrede upphör" (2008). Galardonada con la Pluma de Plata de la Feria del Libro de Bilbao.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (92977, 'GIMENEZ, Mayte ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (93134, 'GONZALEZ RITZEL, Andrés ', 'Nacido en 1969 en Montevideo, Uruguay. Doctor en Ecología Química. Laboratorio de Ecología Química, Facultad de Química, UdelaR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (93195, 'GILLMAN, Yamandú ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (93373, 'MONTENEGRO, Zaida ', 'Nombre propio completo: Zaida Montenegro Israel (forma no usada)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (93535, 'YAFFE, Carlos ', 'Nació en la ciudad de Montevideo el 29 de enero  de 1952.\r\nObrero de la industria de la vestimenta, fue militante de base del Sindicato Único de la Aguja y miembro de su dirección nacional.\r\nIntegró varias organizaciones barriales, y es militante frenteamplista desde su juventud.\r\nActualmente participa en el comité de base "Bonaudi - Olga Sierra" de la Coordinadora Ñ.\r\nSe afilió al PCU en 1984, donde cumplió y cumple diferentes responsabilidades en organismo de base, intermedios y centrales.\r\nDesde diciembre de 1998 hasta febrero de 2005 fue Secretario Nacional de Organización.\r\nEn la actualidad es miembro de su Comité Central, de la Comisión Nacional de Organización y Secretario General del seccional 22 "Liber Arce".\r\nEn el plano institucional, fue Secretario de la Junta Local 15 de la Intendencia Municipal de Montevideo en el período 1996-2001, y desde mayo de 2005 es Director de Protocolo y Relaciones Públicas del Poder Legislativo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (94186, 'BERNAL, Fray Luis Carlos ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (94618, 'SCHIAVI, Pablo ', 'Doctor en Derecho y Ciencias Sociales por la Universidad Mayor de la República Oriental del Uruguay. Master en Derecho Administrativo Económico por la Universidad de Montevideo');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (94620, 'GUARIGLIA, Germán ', 'Doctor en Derecho, egresado de la Facultad de Derecho, Ucudal. Especialista en Derecho Administrativo');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (94622, 'BERCHESI, Bruno ', 'Doctor en Derecho, egresado de la Facultad de Derecho de la Universidad Católica del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (94841, 'LAVANDEIRA, Sandra ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (95160, 'CANALE, Germán ', 'Licenciado en Lingüística (UDELAR). Magíster en Ciencias Humanas opción Lenguaje, Cultura y Sociedad (UDELAR). Doctorando  Second Lenguage Acquisition (Carnegie Mellon University). Asistente del Departamento de Psico y Sociolingüistica (Instituto de Lingüística - UDELAR). Docente de Lingüística y Fonética y Fonología de la especialidad Inglés (Departamento de Lenguas Extranjeras-ANEP (CODICEN). Docente de Lingüística en la carrera de Traductorado (UM).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (95227, 'HERNANDEZ, Melissa ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (95380, 'FERNÁNDEZ DURÁN, Ramón ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (95653, 'LOPE DE VEGA ', 'Félix Lope de Vega Carpio ó de Vega y Carpio (Madrid, 25 de noviembre de 1562 – 27 de agosto de 1635) fue uno de los más importantes poetas y dramaturgos del Siglo de Oro español y, por la extensión de su obra, uno de los más prolíficos autores de la literatura universal. Se le atribuyen unos 3.000 sonetos, 3 novelas, 4 novelas cortas, 9 epopeyas, 3 poemas didácticos, y varios centenares de comedias. Fue soldado, secretario de varios diplomáticos y, finalmente, sacerdote. Formas no usadas: VEGA CARPIO, Félix Lope de y VEGA Y CARPIO, Félix Lope de');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (95717, 'ROFMAN, Rafael ', 'Especialista líder en Protección Social en la Unidad de Protección Social, Departamento de Desarrollo Humano, Oficina Regional para América Latina del Banco Mundial.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (95786, 'FIGUEREDO, Marcello ', 'Nacido en Montevideo en 1966. Licenciado en Ciencias de la Comunicación. Ha trabajado como periodista en prensa, radio y televisión.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (95862, 'DONNER RYBAK, Anna ', 'Nacida en Montevideo, Uruguay, el 21 de setiembre de 1966. Analista de sistemas, docente, artista plástica y escritora. Ha hecho publicaciones en ediciones colectivas. Columnista de la revista "Mundo Latino", publicada en Israel.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (95928, 'BILLOROU ROVIRA, Nina ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104509, 'SENDIC RODRIGUEZ, Raúl Fernando ', 'Nacido en Paysandú, Uruguay, en 1962. Político uruguayo, hijo del dirigente tupamaro Raúl Sendic. Fue presidente de ANCAP, diputado por el Movimiento 26 de Marzo en el período 2000-2005 y vicepresidente de la República en el período 2015- 2020.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (96675, 'NAVASCUES, Hernán ', 'Nacido en Durazno, Uruguay, el 18 de octubre de 1939. Abogado. Especializado en derecho laboral. Estudioso de la legislación electoral comparada, ocupó el cargo de Ministro de la Corte Electoral entre 1991 y 1996. Profesor ayudante de Derecho Laboral en la Universidad de la República. Delegado del Club Nacional de Fútbol en la Asociación Uruguaya de Fútbol. Secretario Ejecutivo de la AUF y Secretario Técnico del mencionado club deportivo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (96756, 'SEBESTA, Lorenza ', 'Directora del Centro de Exelenxia Jean Monnet de la Universidad de Bologna, representación en Buenos Aires.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97129, 'IPU ASSEMBLY (123ª : 2010 OCT. 4-6 : GENEVA) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97210, 'GARINO, Daniela ', 'Nacida en Montevideo, Uruguay, en 1963. Profesora de Historia egresada del IPA (Instituto de Profesores Artigas). Licenciada en Historia, egresada de la UCUDAL (Universidad Católica del Uruguay "Dámaso Antonio Larrañaga"). Posgrado en Historia Contemporánea en el CLAEH (Centro Latinoamericano de Economía Humana). Docente de Historia en el IPA.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97212, 'ARRIETA, Stella ', 'Nacida en Montevideo, Uruguay. Profesora de Historia egresada del IPA (Instituto de Profesores Artigas). Licenciada en Historia, egresada de la UCUDAL (Universidad Católica del Uruguay "Dámaso Antonio Larrañaga"). Cursó estudios de su especialidad en la Universidad de Amherst (Massachusetts, USA), becada por la Embajada de los Estados Unidos de América. Directora de la Sección Secundaria del Colegio Richard Anderson y docente en el IPA.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97285, 'ZUASNABAR, Ignacio ', 'Lic. en Sociología por la Universidad Católica del Uruguay. Candidato a doctor en Ciencia Política por la Universidad de Deusto (España). Socio director de la empresa Equipos MORI, desempeñandose en el área de Opinión Pública. Ha participado en proyectos de investigación y procesos electorales en varios países de la región, trabajando para organismos internacionales, gobiernos, partidos políticos, empresas privadas y medios de comunicación. Coordinador académico de la maestría en Comunicación Política y Gestión de Campañas Electorales de la Universidad Católica del Uruguay, en conjunto con el Instituto Universitario Ortega y Gasset, de España.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97294, 'TORRES, Juvenal ', 'Nacido en 1938 en Salto, Uruguay, reside en Mercedes desde 1969. Contador Público, periodista en el Diario Crónicas, Semanario Entrega 2000 y Difusora Soriano. Comenzó su actividad literaria en 2005 en el taller Obrabierta dirigido por el profesor Daniel Quijano. Obras publicadas: "Obrevísimas" (2010), "Masobrevísimas" (2011), "Silencios de invierno" (2012), "Poema de la noche" (2013), "El escondido secreto de tu queja" (2014), "Crecen las azucenas" (2015), "Reflejos amarillos y opacos de un invierno" (2016), "Prolongaciones : [lo posible, lo baldío]" (2017).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97295, 'QUIJANO, Daniel ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97563, 'BELTRAN, Lucia ', 'Coordinadora del Taller de Música CIPRES.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97640, 'BARTESAGHI, Ignacio ', 'Licenciado en Relaciones Internacionales. Máster en Integración y Comercio internacional. Responsable del Departamento de Integración y Comercio Internacional de la Camara de Industrias del Uruguay. Docente de la Universidad de la República y de la Universidad Católica del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97646, 'FARACO, Raquel ', 'Forma no usada: FARACO ARZENO, Olga Raquel. Contadora pública. Licenciada en Administración. Profesora de las asignaturas "Elementos de Teoría y Práctica Contables" y "Preparación e interpretación de Estados Contables" del Ciclo Inicial Optativo, Opción Social, que se dicta en el Centro Universitario de la Regional Este (CURE). Profesora de la asignatura "Introducción a la Contabilidad" de la Facultad de Ciencias Económicas y de Administración (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97814, 'TORENA, Denisse ', 'Ilustradora nacida en Montevideo, Uruguay, en 1983. Licenciada en Artes Plásticas y Visuales. Docente de expresión plástica de niños y adultos. Ilustradora de: "El bosque de la condesa : dos cofres de plata y otros relatos", "Crónicas de la nada : Montevideo, el violinista y otras historias".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (97855, 'BOIDI, María Fernanda ', 'Doctora en Ciencias Políticas (Vanderbilt University) Licenciada en Ciencias Políticas (Universidad Católica del Uruguay). Profesora e Investigadora de la Facultad de Comunicación y de la Universidad de Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98006, 'POLAKOF, Ana Clara ', 'Licenciada en Lingüística de la Facultad de Humanidades y Ciencias de la Educación, magíster en Análisis gramatical y estilístico del español (Universidad Nacional de Educación a Distancia) y magíster en Ciencias Humanas opción Filosofía contemporánea de la FHCE (UDELAR). Doctoranda en Filosofía (Pontificia Universidad Católica de Río de Janeiro). Investigadora asociada del Sistema Nacional de Investigadoes (SNI) de la Agencia Nacional de Investigación e Innovación (ANII). Desde el año 2008 hasta el 2013 trabajó en el proyecto La vitivinicultura uruguaya en el marco regional (1870-2000).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98233, 'VAZQUEZ, Marcos ', 'Nacido en Montevideo, Uruguay, en 1965. Se ha dedicado al desarrollo de programas de computación en el área de comunicaciones. Ha escrito varias obras de teatro para niños y participó en su dirección, puesta en escena y actuación, así como en la composición de algunos temas musicales.\r\nHa escrito cuatro libros: Imaginarius (Trilce - 2010), La Leyenda de Laridia (Trilce - 2012), Imaginarius la invasión de los agentes (Trilce - 2013) y Emma al borde del abismo (Trilce - 2014)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98246, 'LARREA, Osvaldo ', 'Inspector. Integrante de la Mesa Permanente de la Asamblea Técnico Docente de Formación Docente. Montevideo, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98254, 'MACHADO LENS, Germán ', 'Forma no usada: Machado, German. Nacido en Montevideo, Uruguay, donde vive, en 1966. Ha publicado poemas y cuentos en distintas revistas y en internet. En 2005 obtuvo el primer premio en el IV Concurso de Poesía de la Facultad de Derecho de la Universidad de la República, con el título "Siluetas". En 2006 obtuvo el premio edición de la 45+1 Feria Nacional de Libros y Grabados con el libro de poemas "Artes adivinatorias". Trabaja como Gestor Cultural y se desempeña como Coordinador de Proyectos e Investigador en el Centro Cultural Dodecá.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98280, 'VIEYTES, Maritza ', 'Nacida en Uruguay. Es consultora internacional y docente universitaria');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98308, 'ROMANO, Graciela ', 'Licenciada en Nutrición. Profesora Agregada de Alimentos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98409, 'FUGUET, Alberto ', 'Nacido en Santiago de Chile en 1964. Periodista, escritor y cineasta. Entre sus libros publicados se destacan: "Sobredosis", "Mala onda", "Por favor rebobinar", "Tinta roja", "Las peliculas de mi vida","Cortos" y "Missing: una investigación". Entre sus libros de no ficción se destacan "Primera parte" y "Apuntes autistas". Coeditor de la antología de críticas de cine "Una vida crítica". Fue director y montajista de "Mi cuerpo en su celda" la autobiografía de Andrés Caicedo. Ha dirigido varios clips; los largometrajes "Se arrienda","Velódromo", y "Música campesina" y el corto "2 Horas".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98478, 'FUENTES, Juan Carlos ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98530, 'FERNANDEZ CEDRES, Makarena ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98600, 'TRIMBLE, Micaela ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104610, 'OSPITALETCHE, Virginia ', 'Nació en Montevideo en 1987. Estudia profesorado de literatura y es guitarrista de la banda de metal sinfónico Opus Gaia.\r\nEscribió los libros de poesía "Epitafios" (2011), "Las dos caras de la mariposa (2013).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104702, 'DI LEONI, María Gabriela ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (98882, 'FERNANDEZ, Roxana ', 'Nació en Montevideo en 1976. Socióloga y experta en drogodependencia por la Universidad Complutense de Madrid. Ha trabajado como socióloga y educadora en "El Abrojo" desde 1993. Responsable del diseño y montaje de la muestra artística "Un viaje" del proyecto Consumo cuidado (2008). Integrante del programa de recreación "La Jarana", ha coordinado cursos entre 2000-2010. Desde 2005 es parte del staff docente de "Homoludens", propuesta de formación en recreación. Ha publicado relatos de experiencia en la 2ª y 3ª Bienal de Juego de La Mancha.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99001, 'HUERTA, Martha ', 'Nombre completo y forma no usada: HUERTA FERRAZ, Martha Elena. Nacida en Rivera, Uruguay. Profesora de Filosofía y magíster en educación. Ha ejercido la docencia desde el año 1988 y en la formación docente desde el año 1994. Es autora de trabajos donde se desarrollan temáticas educativas.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99074, 'CELI FRUGONI, Alina C. ', 'Profesora e investigadora de la Universidad de Montevideo, Facultad de Derecho. Doctora en Derecho por la Universidad de Alicante (Programa Doctorado en Derecho Ambiental). Máster en Derecho Administrativo Económico por la Universidad de Montevideo. Especialista en Derecho Ambiental por la Universidad Austral de Buenos Aires. Doctora en Derecho y Ciencias Sociales por la Universidad de la República, UDELAR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99143, 'CLAVIJO ENRIQUE, Yolanda ', 'Forma no usada: CLAVIJO DE SILVERA, Yolanda. Nacida en Punta del Este, Uruguay, en 1932. Ha recibido varios premios literarios: Mención Especial y medalla en Colonia; Mención Especial en el Primer Certamen Literario Latinoamericano de Poesía; Mención Especial en el Concurso Nacional de Cuentos por "La llamada". Su poesía "Sueño Marino" fue seleccionado en el Certamen Iberoamericano de Cuento y Poesía Javiera Carrera de Chile (1987).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99340, 'SELIGSON, Mitchell A. ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99378, 'MARTINEZ, Federico ', 'Desde temprana edad militó en el Comité de Defensa de la Revolución Cubana, se integró al Frente Izquierda de Liberación del que ejerció la Secretaría del Comité Universitario; suscribió los docuemntos fundacionales del Frente Amplio por el FIdeL. En 1973 se integró al PCU. Durante su exilio en Buenos Aires tuvo a su cargo la coordinación de la presencia del PCU en la Mesa Política del FA en Uruguay. Integró el Comité Central partidario desde 1985-1992 y fue secretario de Unidad Política. Integró el Comité Ejecutivo del PCU en el periodo 1989-1992.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99389, 'OLIVARI, Fernando ', 'Constructor y artesano. Militante y miembro de la Unión de Juventudes Comunistas. Integró el Comité Central del PCU entre 1988 y 1990. Fue Secretario del Seccional Arte y del Regional 7 (Casa de la Cultura)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99447, 'URQUIZO DETASSIS, Martha Mabel ', 'Nació en Montevideo. Maestra. Ocupó cargos docentes, por concurso de méritos y oposición, durante 35 años. Fue maestra de Escuelas de Práctica, Directora, Inspectora de Zona de Inspección Departamental de Montevideo. Inspectora de educación privada. Profesora de metodología, Psicología del aprendizaje e Idioma Español. Actualmente se dedica a crear sus poemas, sus tapices y a una de sus grandes pasiones: viajar.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99471, 'FERRES, Mariana ', 'Nacida en Montevideo, Uruguay, el 16 de setiembre de 1955. Poeta y narradora. Relacionista pública e intérprete.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99580, 'GAGLIARDI BERENGUER, Rosa ', 'Doctora en Medicina y Tecnología Veterinaria y magíster en Genética en caninos de raza cimarrón uruguayo. Está haciendo su tesis de doctorado en caninos. Es docente del Área Genética de la Facultad de Veterinaria desde 1994. Es candidata a investigadora del SNI de la ANII.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99623, 'BAJTER, Ignacio ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99652, 'FERREIRA HUELMO, Pablo Ney ', 'Nacido en Montevideo el 5 de junio de 1967.  Politólogo y ensayista, es Licenciado en Ciencia Política por UdelaR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (99654, 'SALAZAR UGARTE, Pedro ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100035, 'LEGASPI, José W. ', 'Nació en Montevideo (Uruguay) en 1964. Escribe desde 1992. Desde 2010, egresado de Quipus, Centro de Formación de Coordinadores de Talleres Literarios y concurre al Taller de Escritura "El Rincón". Integró el grupo "El Disparate" y el colectivo "Despalabras".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100041, 'ABELLA PALACIO, María Inés ', 'Nació en Treinta y Tres en 1947. Maestra y escribana, integrante del Taller de Escritura El Rincón.\r\nEn 2012 publicó su primer libro en solitario "Cuentos sin domicilio"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100048, 'NAZABAY, Hamid ', 'Nombre propio: Hamid Theoossefv Nasabay Sisurqui. Nacido en Mercedes, Departamento de Soriano, Uruguay, el 18 de mayo de 1978. Psicólogo. Investigador y periodista cultural. Escribe poesía y prosa. Docente de UTU en Rosario, Departamento de Colonia, Uruguay. Conductor de un programa de música popular en una FM de la ciudad de Rosario. Escribe sobre canto popular y temáticas afines en el Semanario del Plata. Ha incursionado en la guitarra y la poesía, participando en concursos, audiciones radiales y peñas. Artículos periodísticos y ensayísticos suyos han sido publicados online en Letras-Uruguay (http://letras-uruguay.espaciolatino.com/).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100125, 'CHEDA ESPIGA, Raúl D. ', 'Posgrado Investigación en Historia Contemporánea (CLAEH, Montevideo).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100144, 'GARCIA MARICHAL, María ', 'Nació en Canelones en 1959. Se graduó como profesora de Geografía. Incursionó en la poesía para luego dedicarse a la narrativa breve. Es secretaria del Congreso de Literatura de Punta del Este. Publicó en 2011 "El poeta y otros cuentos" y "Cuentos de la siesta". En 2013 editó "El ciruelo del general". Ha participado en varias antologías de cuentos breves, tanto en Uruguay como en Argentina. Realiza actividades en medios de comunicación radiales y escritos relacionadas con la cultura y con la disciplina a la que se dedica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100163, 'GOMEZ MILLER, Raúl ', 'Ingeniero Agr. Unidad de Comunicación y Transferencia de Tecnología (INIA)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100234, 'MARTCHENKO, Stefan ', 'Magíster en Ciencias Humanas opción Literatura Latinoamericana por la Facultad de Humanidades y Ciencias de la Educación, Udelar. Profesor de Literatura egresado del IPA. Docente de Literatura en enseñanza secundaria. Profesor de Teoría Literaria y de Estilística en el CERP-Florida. Ayudante efectivo de Teoría Literaria, Departamento de Teoría y Metodología Literarias, Insituto de Letras, FHCE, Udelar.');
