INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100830, 'LESSA, Gustavo ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100831, 'MORTON, Kate ', 'Nacida en Queensland, Australia. Posee títulos de Arte Dramático y de Literatura Inglesa. Candidata doctoral en la Universidad de Queensland. De su obra se destacan : su primer novela "La casa de Riverton" ,  "El jardín olvidado", "Las horas distantes".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100898, 'SALOM, Andrés ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100945, 'ZUNINI, Alvaro ', 'Nació en 1977, Salto, Uruguay. Se formó artísticamente en el taller de Daniel Amaral. Se une al taller del pintor Clever Lara para realizar estudios de pintura e historia del arte. Se gradúa como diseñador gráfico en la Universidad ORT. Estudios de dirección de arte y diseño en República Dominicana. En 1995 reconocido con el Premio Nacional de Cómics y en 1996 con el premio Presidencia de la República en la VI Bienal de Primavera de Salto. Reconocido en México con el Premio Nacional de Arte Joven en el año 2006 y es seleccionado en dos binales de pintura del Museo Rufino Tamayo en Ciudad de México en el año 2004 y 2008. En 2005 expone en Uruguay en la Sociedad Italiana de Cultura de Salto y en el Subte de Montevideo. Docente universitario en la escuela de comunicación y diseño de la universidad ORT.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (100969, 'ASIAIN, Carmen ', 'Nombre completo y forma no usada: ASIAIN PEREIRA, Carmen. Doctora en Derecho y Ciencias Sociales por la UdelaR. Abogada por la Facultad de Derecho de la UdelaR. Profesora Titular de "Derecho y Religión", Programa de Posgrados y Maestrías, Universidad de Montevideo; y Facultad de Teología del Uruguay. Profesora Adjunta de Derecho Constitucional, Facultad de Derecho, Universidad de Montevideo. Presidenta y Fundadora del Instituto de Derecho Religioso del Estado. Moembro del Consorcio Latinoamericano de Libertad Religiosa.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (101075, 'TAIBO BASSANO, Federico ', 'Nacido en Montevideo, Uruguay, el 3 de julio de 1980. Dibujante, creador de cómics y diseñador gráfico. Miembro fundador del GAS (Grupo de Arte Secuencial). Forma no usada. Forma usada: TAIBOX.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (101463, 'PATRON, Margarita ', 'Profesora de Historia. Docente en San José, Uruguay, en el Instituto Normal, en el Liceo Dr. Alfonso Espínola, en el Liceo Nocturno y en el Instituto de Formación Docente. Ha colaborado con artículos en varias publicaciones. Integrante de la Comisión de Patrimonio de San José.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (101517, 'VERGARA, Marcos ', 'Nació en la provincia de Buenos Aires en 1973. Es historietista, diseñador gráfico recibido de la Escuela Superior de Diseño Gráfico de la provincia de Rosario y Bibliotecólogo recibido en el Instituto Fray Luis Beltrán. Desde 1990 compone el grupo Aquelarre junto a los que ha publicado en forma independiente diversos volúmenes de historieta y han presentado sus trabajos en su ciudad y en Capital federal, Rosario, La Plata, Tucumán, Montevideo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (101792, 'BONI, Agustina ', 'www.agustinaboni.blogspot.com');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (102049, 'DIAZ, Soledad ', 'Abogada. Máster en Derecho (Universidad de Alcalá, Madrid), Aspirante a Profesor Adscripto de Derecho Procesal en la UDELAR y en la Universidad Católica del Uruguay.');
