INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (102422, 'FIRPO, Gonzalo ', 'Creador Plástico egresado de la Facultad de Bellas Artes. Ilustrador y diseñador.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (102461, 'VILLAGRAN, Matías ', 'Doctor en Ciencias Veterinarias. Estudiante de Maestría y Ayudante del Departamento de Fisiología de la Facultad de Veterinaria de la Universidad de la República (UDELAR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (103046, 'HERRERA, Marisa ', 'Abogada. Especialista en Derecho de Familia. Investigadora del CONICET. Consultora UNICEF Argentina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (103141, 'BONET TELLECHEA, Juan Manuel ', 'Doctor en Derecho y Ciencias Sociales de la Facultad de Derecho (UdelaR). Profesor titular de Derecho Financiero e la Facultad de Derecho (UCUDAL). Master en Fiscalidad Internacional del Centro Europeo de Estudios Garrigues (Madrid, España). Master en Fiscalidad Internacional y Master en Fiscalidad Internacional y Europea de la Universidad de Castilla (Toledo, España).  Postgrado de Especialista en Tributaria de la Facultad de Ciencias Empresariales (UCUDAL).\r\nAsociado en el Area de Impuestos del Estudio Guyer & Regules. Autor de divesas obras y trabajos sobre Derecho Financiero y Tributario');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (103641, 'YANNI, Beatriz ', 'Nació en Fray Bentos, Uruguay, en 1955. Estudió teatro con Beatriz Massons y con Adolfo Carnevale. Concurre al Taller de Literatura de la Cátedra Alicia Goyena con el profesor Juan Carlos Fuentes y al Taller Literario de Carmen Galusso.\r\nForma no usada: Emma Beatriz Yanni.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (103832, 'GUIDALI, Pablo ', 'Nació en Montevideo (Uruguay) en 1976. Es diplomado por la Escuela Nacional Superior de la Fotografía de Arles (Francia). Ha trabajado como fotógrafo para la Revista Galería del semanario Búsqueda. se ha desempeñado como docente en el taller de fotografía del colegio Latinoamericano.\r\nEntre 2007-2008 recibe una beca del Gobierno de Francia para realizar estudios de fotografía en dicho país.\r\nHa realizado numerosas muestras colectivas e individuales, tanto en Uruguay como en Francia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (103912, 'LEVEDAD ', 'Nombre propio y forma no usada: CAMY BETARTE, Rodrigo. Uruguayo, nacido en 1983. Diseñador gráfico egresado de la Escuela Nacional de Bellas Artes de Montevideo, Uruguay. Ha realizado exposiciones individuales en Montevideo y publica sus dibujos mensualmente en la revista "Arte & Diseño".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104011, 'MADRUGA, Carla ', 'Nombre propio y forma no usada: MADRUGA MARTINEZ, Carla. Uruguaya. Licenciada en Administración y Contadora. Posee estudios de Posgrado en Costos y Gestión Empresarial realizados en la Universidad de Buenos Aires (UBA). Docente en la Facultad de Ciencias Económicas y de Administración de la Udelar.  Autora de trabajos en su especialidad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104012, 'NUÑEZ SANCHEZ, Martín ', 'Uruguayo. Contador Público. Posee un Posgrado de Tributaria por la Facultad de Ciencias Económicas y de Administración de la Udelar. Docente en la mencionada Facultad y en la Universidad Católica del Uruguay. Autor de trabajos en su especialidad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104021, 'ZAGAZETA ARZUBIALDE, Aydée ', 'Escritora peruana de poesías.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104286, 'RIBERO LAVIE, Gustavo ', 'Médico Cirujano .Ex docente Facultad de Medicina (UdelaR). Posgrado en Gestión de Servicios de Salud (Facultad de Economía y Administración de la UdelaR).Posgrado en Vigilancia Epidemiológica de Infecciones Hopitalarias Coordinador de la Unidad Servicios Clínicos Externos (Hospital Evangélico). Encargado de la Unidad de Planificación Estratégica Hospital Dptal de Rivera ASSE. Integrante de Comité de Infecciones (H. Español "Dr. Juan José Crottogini" y Hospital Dptal. de Rivera ASSE). Auditorías médicas privadas. Primer Premio Nacional de Gestión de Recursos Humanos, junio 2012.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104311, 'PEREIRA, Valentina ', 'Analista en Ciencias Sociales y estudiante avanzada de la Licenciatura de Sociología de la Universidad Católica del Uruguay (2011).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104372, 'PEDROZO, Sebastián ', 'Forma usada: PEDROZO, Sebastián. Nombre propio y forma no usada: Marcos Sebastián Pedrozo. Nacido en Montevideo, Uruguay, el 8 de noviembre de 1977. Maestro y bibliotecario. Bfía.: "Las moscas también tenemos sentimientos" (mención en el Concurso Anual de Literatura del MEC); "Cualquier niño del norte" (segundo Premio en el Concurso "Los niños del Mercosur"); "Terror en el campamento"; "Historia de un beso : (abejas y flores marchitas).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104387, 'FERRARO ALBERTONI, Bruno ', 'Cr., GPO. Economía aplicada.');
