INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (104497, 'CARVALHO, Horacio MARTINS DE ', 'Ingeniero Agrónomo , Universidad Rural do Brasil');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (105578, 'SANTESTEVAN, Laura ', 'Nombre propio completo y forma no usada: SANTESTEVAN BELLOMO, Laura. Nació en Montevideo (Uruguay), en 1963. Asistente Social (UdelaR), Postgrado Desarrollo Local y Especialización en Familia (UdelaR), Licenciada en Trabajo Social (UdelaR), Maestría en Trabajo Social (UdelaR), Cursó Licenciatura en Letras (UdelaR) y Profesorado de Literatura (IPA), Ejerció la docencia en diferentes niveles. Publicó  "Informe de la Revista La Batalla" en FHCE, y relatos en libros de autores varios. Participa del programa radial Talleres en pie, dentro de Ascensor al Paraíso, espacio dedicado a la literatura. Concurre al Taller Literario de Lauro Marauda e integrante del Taller de Escritura Creativa El Rincón.');
