INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (105672, 'ROMERO MAGLIOCCA, Julio César ', 'Nacido en Montevideo, Uruguay, en 1964. Desempeña tareas periodísticas. En el año 2000 funda la revista mensual cultural "Raíces" con el argumento central basado en historia nacional, nuestros indígenas, historia de nuestros barrios, Montevideo antiguo, entre otros temas.');
