INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (105940, 'CARVAJAL, Víctor ', 'Nacido en Santiago de Chile en 1944. Estudió publicidad y arte dramático e integró varias compañías de teatro nacional y extranjero. Se inició como dramaturgo durante su estadía en Alemania y Francia. En su publicaciones en narrativa y drama muestra la vida de los niños y jóvenes de América. Ha recibido varias distinciones, entre las que se destacan "The White Ravens" 2001 y Consejo Nacional del Libro y la Lectura 1995 y 1997.');
