INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (106101, 'ZUNINO, Pablo ', 'Médico veterinario, Master en Biología (Pedeciba). Doctor en la Universidad de Cambridge. Trabaja en el Departamento de Microbiología, Instituto de Investigaciones Biológicas Clemente Estable.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (106102, 'ANTUNEZ, Karina ', 'Licenciada en Biología, especializada en el área patógenos en las abejas. Trabaja en el Departamento de Microbiología, Instituto de Investigaciones Biológicas Clemente Estable.');
