INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (106830, 'RIVERA LETELIER, Hernán ', 'Nacido el Talca (Chile), en 1950. Entre sus principales publicaciones se encuentran: la novela "La reina Isabel cantaba rancheras"(1994) e "Himno del ángel parado en una pata"(1996). Entre sus libros de cuento se destacan "Donde mueren los valientes" (1999), "Los trenes se van al purgatorio"(2000),"Santa María de las flores negras" (2002), "Canción para caminar sobre las aguas"(2004),"Romance del duende que escribe las novelas"(2005), "El  fantasista" (2006), "Mi nombre es Malarrosa"(2008) y "La contadora de películas" (2009). En 2001 fue nombrado Caballero de la Orden de las Artes y Letras por el Ministerio de Cultura de Francia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (106945, 'SILVA, Nahuel ', 'Forma usada: NAHUS. Nombre propio y forma no usada: SILVA BARRIOS, Nahuel. Dibujante argentino, nacido en 1989. Caricaturista.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107168, 'FERNANDEZ, Alejandro J. ', 'Nombre propio completo y forma no usada: FERNANDEZ ZAPATA, Alejandro J. Con trayectoria en teatro, pintura, carnaval y proyectos culturales. Tallerista para Comuna Canaria, MIDES, MEC, INJU. Ha realizado diferentes puestas en escena. Cuenta con premios tanto a nivel plástico como teatral y fotográfico. Gestor cultural.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107269, 'CARIDE BARROS, Perfecto ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107283, 'SCAGLIOLA, Ricardo ', 'Nacido en Montevideo, Uruguay, en 1986. Periodista. Escribe en la sección Política del semanario "Brecha". Editor en la revista digital "Fósforo" y conductor del programa de entrevistas políticas "Primera Vuelta" de Tevé Ciudad. Encargado de Comunicación del Centro de Formación para la Integración Regional (CEFIR).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107292, 'TRIQUELL, Agustina ', 'Licenciada en Comunicación Social por la Universidad Nacional de Córdoba (Argentina) y becaria doctoral del Consejo Nacional de Investigaciones Científicas y Técnicas (CONICET). Coordinadora del Grupo de Estudios sobre Imágenes del IDES. Cursó fotografía en la Escuela Argentina de Fotografía. Ha trabajado en diversos proyectos sociales relacionados con la enseñanza del lenguaje fotográfico en diversos contextos. Su trabajo fotográfico ha sido exhibido de manera individual y colectiva.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107314, 'MARTINEZ, Enrique ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107489, 'CARBALLIDO, Darwin ', 'Profesor de Geografía. Magíster en Docencia de la Educación Media. Formador en Ciencias Sociales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107638, 'INTHAMOUSSU TELECHEA, Luis Angel ', 'Nacido el 2 de agosto de 1943 en Montevideo, Uruguay');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107703, 'MIRA, Monserrat ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107707, 'BELLATIN, Mario ', 'Nacido en Ciudad de México en 1960. Estudió Teología y Comunicación en Perú, donde vivió durante su infancia. Es autor de más de 30 libros. Creó la Escuela dinámica de escritores, un espacio alternativo de experimentación literaria. Dirigió la película "Bola Negra: El musical de Ciudad Juárez" en 2012, y trabajó en la versión cinematográfica de su célebre novela "Salón de Belleza" (1994).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107745, 'AROCENA ARREGIN, Pablo ', 'Fray Bentos, 1970. Casado, un hijo, integra el equipo de investigadores de Ediciones de la Proa desde el año 1998. Participó de la investigación y publicación de: "Parlamentarios uruguayos 1830-2010", que se encuentra en la web del Parlamento, y del libro "Tiempo de Árcatas"; también de los e-books: "Los años infames", "Crónica de dos desapariciones" y "Un humanista llamado Aparicio...". Actualmente se encuentra trabajando en "Enciclopedia Electoral Uruguaya 1900-2010" junto a otros investigadores.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107751, 'SUAREZ HERRERA, Mariluz ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107770, 'PINTO NERON, Ximena ', 'Doctora en Derecho y Ciencias Sociales egresada de la Facultad de Derecho de la Universidad de la República, Uruguay. Magíster en Derecho Administrativo por la Universidad de Montevideo. Máster en Derecho de la Contratación Pública, por la Universidad de Castilla la Mancha, España. Profesora ayudante de la materia Técnica Forense en Facultad de Derecho, Udelar. Aspirante a Profesor Adscripto de Derecho Administrativo');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107786, 'BELZARENA TESTA, Noeli ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107790, 'PEREZ, Marcelo ', 'Economista. Profesor Adjunto e Investigador de Principios de Economía y Econometría en la Universidad ORT del Uruguay. Máster en Econometría de la Universidad Torcuato Di Tella de Argentina. Gerente de Evaluación de Proyectos de la Corporación Nacional para el Desarrollo. Consultor del Banco Mundial; Banco Interamericano de Desarrollo, y de la Comisión Económica para América Latina y el Caribe.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107871, 'CERISOLA, Martín ', 'Nacido en Porto Alegre, Brasil, en 1979. Ha vivido en Argentina, Chile, Colombia, España, Italia, Albania y Uruguay. Docente de literatura e idioma español. Su libro "Inicio y después" obtuvo una mención de la IM en el concurso Juan Carlos Onetti/2011');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107875, 'BENECH, Javier ', 'Nacido en Uruguay en 1979. Licenciado en Comunicación Social. Ha trabajado en la producción de programas periodísticos en Canal 10 y Radio Sarandí. En prensa escrita se desempeñó en los diarios Ultimas Noticias y el Observador y en Semanario Búsqueda');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107876, 'INDECONA, Alfonso ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107878, 'INDARTE, Selene ', 'Médico Internista y Médico Intensivista (UdelaR). Gerente de Inromática Médica (SUAT).Presidente de SUEIIDISS. Posgrado en Administración de Servicios de Salud (UdE). Postgradp en Habilidades Gerenciales (UdE). Graduado en Gestión de Sistemas de Salud y Bioinformática (Hospital Italiano de Buenos Aires).Auditorías médicas privadas');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107879, 'ZAWADZKI, Saadia ', 'Licenciada en Registros Médicos. Prof adjunta de la carrera de Registros Médicos E.U.T.M., Facultad de Medicina (UdelaR). Docente Permanente en la Unidad de Capacitación del Hospital de Clínicas (UdelaR). Ex docente calificada del Dpto. medicina Legal (UdelaR). Jefe de Sección Dpto. REgistros Médicos - Hospital de Clínicas (UdelaR). Auditorias médicas privadas. Vicepresidente de la Sociedad Uruguaya de Informática en Salud (SUIS). Ex jefe de Departamento de Registros Médicos de Instituciones Médicas Colectivas.');
