INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107899, 'GORBAN, Marcos ', 'Productor argentino. Productor general de "Gran Hermano", de "Operación Triunfo" y de "Talento Argentino" para Telefé de Argentina, entre otros programas. Desarrolla formatos propios y realiza consultoría artística en Perú, Uruguay y México. Profesor de Televisión de la Universidad de San Andrés de Argentina y Profesor invitado en la Universidad ORT de Uruguay.');
