INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107943, 'SANTIS, Pablo DE ', 'Nacido en Buenos Aires, Argentina en el año 1963. Licenciado en Letras por la Universidad de Buenos Aires. Periodista y guionista de historietas. Autor de varias novelas para adolescentes, entre ellas encontramos " Desde el ojo del pez", "La sombra del dinosaurio", "Enciclopedia en la hogera", "Páginas mezcladas". Por medio de Alfaguara Juvenil publicó "Lucas Lenz y el Museo del Universo", "Lucas Lenz y la mano del emperador", "Las plantas carnívoras", "El inventor de juegos" y "El Último espía". Entre sus novelas para adultos encontramos "Filosofía y Letras", "La traducción", "El teatro de la memoria", "El calígrafo de Voltaire" y "El enigma de París".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107979, 'MARIOTTA, Adrián ', 'Nacido en Carmelo, Departamento de Colonia, Uruguay, en 1968. Participante en carreras de atletismo de calle a nivel local e internacional.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107980, 'DELGADO, Leandro ', 'Nacido en Montevideo, Uruguay, en 1967. Escritor profesional, autor y editor. Ha escrito cuentos fantásticos y de ciencia ficción para diversas revistas y sitios literarios.');
