INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107987, 'LECAROS, Alejandro ', 'Nacido en Chile en 1977. Periodista. Ha trabajado en varios medios, siendo editor de las revistas "Vive" y "Muy Interesante", edición chilena. Creador y responsable del website "Desenfocados" y guionista de las historietas "La Historia de Chile en Cómics" y "Campeones", ambas para "El Mercurio". Editor de medios digitales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107992, 'VERDUGO, Jorge ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (107994, 'ARIGON BACHINI, Dardo ', 'Contador público uruguayo, egresado de la Facultad de Ciencias Económicas y Administración de la Universidad de la República (UDELAR). Docente de Enseñanza Secundaria. Egresado de la Facultad Latinoamericana de Ciencias Ambientales (FLACAM) de La Plata, República Argentina. Columnista analista de temas económicos en programas radiales y televisivos de la ciudades de Mercedes y Montevideo, Uruguay.');
