INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108080, 'CARRASCOZA, Joao ANZANELLO ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108081, 'PALACIO GAMBOA, Martín ', 'Nacido en Montevideo, Uruguay, en 1977. Poeta, profesor de literatura y lengua española, traductor y músico. Publicó diversos artículos de crítica literaria y artes plásticas en periódicos de Brasil, Argentina y Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108084, 'PARRA, Marco Antonio de la ', 'Nacido en Santiago de Chile, en 1952. Es Psiquiatra, Escritor y Docente universitario. Entre sus obras publicadas se encuentran: " Novelas enanas" , "El año de la ballena",  título con el que se inició en la literatura juvenil y por el que obtuvo el premio The White Ravens 2002 y "El cuaderno de Mayra".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108094, 'REUNION DE MINISTRAS Y ALTAS AUTORIDADES DE LA MUJER DEL MERCOSUR (2012) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108099, 'AVONDET, Silvia ', 'Licenciada en Psicología por la Universidad de la República, Uruguay. Psicoterapeutaa especializada en Psicoanálisis Vincular. Psicología Médica. Diplomada en Psicoterapia en Servicios de Salaud de la Escuela de Graduados de la Facultad de Medicina. Integrante de las Areas de Salud Mental y Desvínculo/Adopción, Salud y Derechos de Iniciativas Sanitarias.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108100, 'POTRIE, Julieta ', 'Licenciada en Psicología por la Universidad de la República, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108101, 'ALONSO, Bernardo ', 'Médico Pediatra por la Universidad de la República, Uruguay. Intensivista. Profesor Adjunto en la Clínica Pediátrica, UDELAR. Cursa Maestría en Derechos de Infancia y Políticas Públicas');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108122, 'GIROUX, Henry ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108141, 'BARBIERI, Alejandro DE ', 'Nacido en Lascano, departamento de Rocha, Uruguay, el 20 de setiembre de 1971. Psicólogo clínico, egresado de la UCUDAL. Logoterapeuta, egresado de la Fundación Argentina de Logoterapia Viktor E. Frankl. Director del Centro de Logoterapia y Análisis Existencial (CELAE). Doctorando en Psicología por la Universidad de Flores, Buenos Aires, Argentina. Psicólogo en primaria y secundaria. Profesor de la Facultad de Psicología de la UCUDAL de las materias "Análisis Existencial" y "Fundamentos de Terapia Existencial". Docente del Diplomado de Orientación Educativa y del Posgrado de Drogodependencias de la UCUDAL. Columnista en diversas radios.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108143, 'TORRES IRURTIA, Pablo ', 'Docente de la Universidad de la Empresa de Montevideo, Uruguay. Maestría en Negocios Internacionales en la Universidad Pompeu Fabra de Barcelona, España. Consultor en el mercado financiero.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108237, 'BARBOSA, Eduardo KAPLAN ', 'Economista de la Secretaria de Arranjos Produtivos e Desenvolvimento Local. Asesor de la Presidência do Banco Nacional de Desenvolvimento Econômico e Social, BNDES, Brasil.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108150, 'BUCHTIK, Liliana ', 'Especialista en dirección de proyectos, enfocada especialmente en las áreas de riesgos, alcance, tiempos, y trabajo virtual. Conferencista internacional. Titular de la certificación internacional "Project Management Professional" (PMP), otorgada por el Project Management Institute (PMI) en Estados Unidos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108165, 'FAINSTAIN, Luciana ', 'Licenciada en Sociología y magíster en Género, Sociedad y Políticas Públicas por FLACSO-PRIGEPP, Buenos Aires, Argentina. Coordinadora académica del Diplomado Superior en Políticas de Igualdad y odcente y tutora de la Maestría en Políticas Públicas y Género de FLACSO Uruguay. Asesora de la dirección del Instituto Nacional de las Mujeres de Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108166, 'PERROTTA, Valentina ', 'Socióloga. Magíster en Género, Sociadad y Políticas (Facultad Latinoamericana de Ciencias Sociales, Argentina). Investigadora del Departamento de Sociología de la Facultad de Ciencias Sociales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108174, 'BLANCO, Sandra ', '');
