INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108192, 'MALBA TAHAN ', 'Nombre completo y forma usada: SOUZA, Julio César de MELLO E. Nacido en Río de Janeiro, Brasil en 1895. Célebre profesor de matemáticas. Como Juilo César de Mello e Souza, escribió algunos libros didácticos de matemática y el "Diccionario curioso y recreativo de matemática". Creó el seudónimo "Malba Tahan" con el que escribió innumerables obras entre las que se destaca "El Hombre que calculaba". Falleció en Recife, Brasil, en 1974.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108198, 'GUADALUPE, Olga ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108199, 'AGUERRE ALBANO, Pedro ', 'Nació en Artigas, Uruguay, 1927. General del Ejército, integrante del la corriente constitucionalista 1815');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108200, 'TAVERNINI, Quique ', 'Nacido en Montevideo, Uruguay, en 1963.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108201, 'PEREIRA DAS NEVES, Carmen ', 'Nacida en Melo (Cerro Largo/Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108202, 'GARAT, Guillermo ', '1975. Periodista. Con más de doce años ejerciendo el periodismo, ha escrito para el semanario Brecha, La Diaria, La República, No te olvides, Seisgrados, 180.com.uy, Montevideo Portal y la Agencia EFE (Berlín), entre otros medios. En sus primeros años de periodista, escribió sobre la política uruguaya e investigó sobre las violaciones a los derechos humanos. La detención de Alicia Castilla y de Mauricio Balitzki por la tenencia de plantines de cannabis en 2011 y la posterior visita que les hizo en la cárcel de Canelones, lo llevó a buscar argumentos que encuadraban las prohibiciones de las drogas en la región y en Uruguay, las que siempre buscaron la manera de condenar el consumo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108204, 'JORNADAS URUGUAYAS DE DERECHO DEL TRABAJO Y DE LA SEGURIDAD SOCIAL (23ª : 2012 NOV. 17 Y 18 : SALTO) ', '');
