INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108221, 'CORREA, Claudia ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108222, 'BENTANCOR, Elida ', 'Abogada. Activista social. Activista espiritual. Maestra del Sistema Usui Tibetano de Armonización Natural REIKI.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108223, 'BARRIOS, Miguel Angel ', 'Doctor en Ciencia Política, diplomado en Relaciones Internacionales y Director Académico de la Fundación Democracia del Círculo de Legisladores de la Nación, Argentina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108224, 'GUERRA, Flavia ', 'Profesora asistente de Relaciones Internacionales en la Universidad Federal de Río de Janeiro. Estudiante de Doctorado en el Instituto de Relaciones Internacionales de la Pontificia Universidad Católica de Río de Janeiro.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108225, 'BARROS, Pedro SILVA ', 'Titular de la misión del Instituto de Investigación Económica Aplicada de Brasil (IPEA) en Venezuela y profesor del departamento de Economía de la Pontificia Universidad Católica de Sao Paulo. Graduado en Economía y en Graduado en Derecho por la Universidad de Sao Paulo. Doctorado en el Programa de Posgrado de Integración de América Latina de la misma Universidad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108226, 'CALIXTRE, Andrés ', 'Posgrado en Ciencias Económicas y Maestría en Economía Social y del Trabajo, ambos por la Universidad Estadual de Campinhas (Unicamp). Técnico de Planeamiento e Investigación y Asesor Técnico de la Presidencia del Instituto de Investigación Económica Aplicada (IPEA-Brasil). Trabaja en investigaciones relacionadas a la integración en América Latina, con énfasis en América del Sur y en el estudio de las distintas interpretaciones sobre el desarrollo económico en la región.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108227, 'PAZ CASTAING, Mario ', 'Doctor en Ciencias Jurídicas. Rector de la Universidad de la Integración de las Américas - UNIDA. Coordinador General del Centro de Promoción del Estado de Derecho del MERCOSUR (CMPED). Asesor General de la Delegación Paraguaya del Parlamento del MERCOSUR.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108228, 'IBARRA, Guzmán ', 'Politólogo por la Universidad Católica Nuestra Señora de la Asunción. Maestría en Ciencias Sociales. Docente, investigador y analista político. Coordinador del Proyecto de Fortalecimiento de la Sociedad Civil, ejecutado por la Organización Semillas para la Democracia. Trabajó en el ámbito del MERCOSUR Social en la creación y gestión de varias instancias como la Secretaría Permanente del MERCOSUR Social, el Instituto Social del MERCOSUR, entre otros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108229, 'BOGADO, Laura ', 'Abogada. Licenciada en Relaciones Internacionales (UDELAR). Magíster en Relaciones Internacionales por la Universidad Nacional de La Plata, Argentina. Docente de Derecho Internacional Público, de la carrera de Abogacía de la Facultad de Ciencias Jurídicas y Sociales de la Universidad Nacional de La Plata. Docente en la Maestría de Relaciones Internacionales de la misma Universidad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108230, 'ALCARAZ, María Victoria ', 'Directora General del Centro Cultural San Martín, dependiente del Ministerio de Cultura del gpbierno de la Ciudad de Buenos Aires. Profesora de Historia. Especializada en política y gestión cultural. Docente en FLACSO- Buenos Aires y en las Facultades de Ciencias Económicas de la Universidad de Buenos Aires (posgrado Administración de Espectáculos)  y de Córdoba (posgrado Gestión Cultural).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108231, 'PADULA, Raphael ', 'Profesor de la Universidade Federal do Rio de Janeiro (UFRI), del Programa de Pós-Graduaçao em Economia Politica Internacional (PEPI).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108232, 'PEIRANO, Fernando ', 'Licenciado en Economía por la Universidad de Buenos Aires, con estudios de posgrado en Economía de la Innovación y en Desarrollo de América Latina por la Universidad Complutense Madrid y CEPAL, Santiago de Chile. Docente de grado en Economía Internacional y de posgrado en Economía e Innovación en la Universidad Nacional de Quilmes, en la Universidad de Buenos Aires y en la Universidad General Sarmiento.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108233, 'GONZALEZ LAGO, Mariana ', 'Licenciada en Sociología por la Universidad de la República, con estudios de especialización en ciencia, tecnología e innovación, y en investigación social aplicada. Ha realizado trabajos de consultoría para organismos como PNUD, UDM y AECID en proyectos vinculados al ámbito de las relaciones internacionales, cooperación internacional y género.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108234, 'LASTRES, Helena M. M. ', 'Economista de la Secretaria de Arranjos Produtivos e Desenvolvimento Local. Asesora de la Presidência do Banco Nacional de Desenvolvimento Econômico e Social, BNDES, Brasil.');
