INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108239, 'GENEYRO, Rubén ', 'Abogado y especialista en Integración Latinoamericana por la Universidad Nacional de La Plata, Argentina. Ha desempeñado diversos cargos relacionados con la integración regional y desarrollo local en organismos públicos nacionales, provinciales y municipales.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108241, 'CARDOZO BENITEZ, Líber Amaranto ', 'Nacido en Tacuarembó, Uruguay, el 19 de febrero de 1936. Arquitecto. Docente en la Cátedra de Construcción I de la Facultad de Arquitectura hasta el año 1985. Integrante del Cuerpo de Peritos Forenses de SAU (Sociedad de Arquitectos del Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108256, 'MUÑOZ MENENDEZ, María Belén ', 'Poeta, narradora y maestra universitaria ecuatoriana. Coordinadora Nacional del Grupo de Arte Internacional "Plaza XXI" - Capítulo Ecuador. Representante intinirante internacional de CADELPO en el mundo, Presidenta de la Casa de la Cultura núcleo: El Carmen. Es ingeniera agropecuaria y Máster  en Desarrollo Ambiental. Después de dejar el Departamento de Investigación, asume la Coordinación del Departamento de cultura de la Universidad Laica Eloy Alfaro, de Manabí, campus: El Carmen.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108264, 'COSSANI, Patricia ', 'Licenciada en Ciencia Política. Cursa Diploma de Psgrado en Polìticas Sociales. Desempeña funciones en la Dirección Nacional de Política Social del MIDES como coordinadora en diversas instancias del proceso de construcción del Sistema de Cuidados (2012). Coordinadora del proyecto "Hacia una Política Pública Integral de Cuidados a nivel nacional, en el Uruguay", con el apoyo de AECID.');
