INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108306, 'SIRI, Shirley ', 'Forma no usada: SIRI SANTOS, Shirley. Maestra, egresada del Instituto de Formación Docente de Minas, Lavalleja, Uruguay. Maestra de escuela rural y urbana en Canelones. Directora de escuela rural, urbana y de práctica. Coordinadora pedagógica del Plan Ceibal. Docente de Didáctica General, Lengua e Introducción al Pensamiento Científico en los Institutos de Formación Docente "Juan Pedro Tapié" de San Ramón y "Comenio", ambos de Canelones. Docente de informática educativa. Especializada en Educación a Distancia en el Instituto Magisterial Superior.');
