INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108318, 'SUAREZ BERTORA, Michelle ', 'Activista, conferencista, escritora y abogada uruguaya. Nació en Canelones.en 1983. Cursó sus estudios secundarios en el Liceo de Salinas. Es la primera transexual que logra un título universitario en Uruguay al graduarse como abogada de la Facultad de Derecho de la Universidad de la República en 2010.\r\n Realizó su carrera con otra identidad y se recibió con una entrega de diploma bajo la identidad femenina. Para cambiar su escolaridad, realizó un petitorio, no solo de cambiar la escolaridad, sino de cambiar el título con su actual nombre legal, generando así un precedente en la Universidad de la República.\r\n \r\nAdemás de trabajar independientemente, es integrante y asesora del área jurídica de la organización uruguaya Ovejas Negras, también es conferencista.4');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108319, 'BERVEJILLO, Juan ', 'Cantante, guitarrista, compositor.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108320, 'BOSCH, Mauricio ', 'Nacido en Durazno, Uruguay, en 1973. Estudió guitarra, composición y armonía. Autor de canciones. Desde la adolescencia estuvo cerca del periodismo musical; hizo radio y publicó todo tipo de notas y entrevistas para "El Acontecer Duraznense", revista "Pimba!", semanario "Brecha", "El País Cultural", "La República" y "La Diaria". Manager de bandas locales. Productor de videos y autor de crónicas. Tiene una columna radial titulada "Conexión VillaQuieta en La X".');
