INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108369, 'LIVNI, Pedro ', 'Nacido en 1973. Arquitecto egresado de la Facultad de Arquitectura, Udelar. Magíster de Arquitectura en Historia y Críticas Arquitectónicas por la Pontificia Universidad Católica de Chile. Profesor de los cursos de taller y del curso de Historia de la Arquitectura Contemporánea en la Udelar. Ha recibido diversos premios, destacando los obtenidos en la Bienal Internacional de Arquitectura de Miami (2005) y la Bienal Internacional de Arquitectura de Quito (2006). Forma no usada: LIVNI ALDABALDE, Pedro.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108370, 'CARRASCO, Gonzalo ', 'Nacido en 1976. Arquitecto egresado de la Pontificia Universidad Católica de Chile. Candidato a Doctor en Arquitectura y Estudios Urbanos PUC. Docente de historia y teoría de la arquitectura en las Escuelas de Arquitectura de la Universidad Nacional Andrés Bello y la Universidad Católica. Forma no usada: CARRASCO PURULL, Gonzalo.');
