INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108504, 'MICHOELSSON, Gabriela ', 'Licenciada en Psicología y Sexóloga (especialista en Educación Sexual y en Sexología Clínica). Integró la Comisión directiva de la Sociedad Uruguaya de Sexología.\r\nFue productora del programa "El sentido del sexo", (Canal 10) y conductora y productora del programa "Sexo sin tabúes" (TV libre). Desarrolló columnas semanales especializadas en sexología en diversos programas de televisión y radio. Se desempeña como columnista en la revista Caras y Caretas. Ha presentado trabajos de investigación en distintos congresos de psicología, medicina y sexología.');
