INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108583, 'GARCIA CATALDO, Gabriel A. ', 'Nacido en Durazno, Uruguay, en 1955. Mayor de la Fuerza Aérea Uruguaya. Instructor académico. Director de Seguridad de Vuelo, Presidente de la Comisión Investigadora de Accidentes de Aviación y editor del boletín de seguridad "Misión Cumplida". En el año 2009 se encarga de la edición del Diario Digital de Noticias del Grupo Simbólico de Transporte Aéreo 346. Técnico Prevencionista en Seguridad e Higiene Industrial egresado de la Universidad del Trabajo del Uruguay. Máster en Seguridad en el Trabajo. Asesor, consejero y docente en varias instituciones privadas. Integrante del grupo que escribió el libro "Escuela Militar de Aeronáutica : 1916-2016" bajo el seudónimo "LOS AERODINOS".');
