INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108737, 'TONAR, Ruben ', 'Nacido en Montevideo, Uruguay. Licenciado en Filosofía y Licenciado en Ciencias de la Educación por la Universidad de la República, Uruguay. Postgrado en el área de la Educación Especial Bilingüe en la Universidad de Nueva York, EE.UU. Como docente trabajó en el nivel primario y secundario en el sistema educativo público de New York. Realizó trabajos de investigación comparativa de la efectividad de diferentes programas educativos monolingües (inglés) y bilingües (español e inglés), implementados en Manhattan.');
