INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108739, 'DOBRININ, Pablo ', 'Nació en 1970 en Montevideo. Estudió literatura y periodismo. Publicó relatos en antologías de Argentina , España, Francia, Italia y Eslovenia entre los que se destacan: Dispar, Dias Extraños, Axxón, Cuásar, Sensación!, Próxima, Sinergia, Otro Cielo, Asimov, Catarsi, IF, Lunatique y Fiction. Publicó también ensayos sobre literatura fantástica y ciencia ficción uruguaya. En 2011 publicó la primera edición de Colores Peligrosos (cuentos) y en 2012 Artaud (poesía).');
