INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108866, 'MILLAN, Miguel ', 'Nombre completo y forma no usada: MILLAN SEQUEIRA, Miguel. Nacido en Mercedes, departamento de Río Negro, Uruguay. Licenciado en Letras por la Universidad de La Habana, título reconocido por la Universidad de la República de Uruguay. Docente de Enseñanza Secundaria y docente en los Programas Especiales - Contextos de Encierro (Cárceles). Cursa una Maestría en Ciencias Humanas - Literatura Latinoamericana, en la Facultad de Humanidades y Ciencias de la Educación de la Universidad de la República, Uruguay (2014). Integra el Consejo de Redacción del periódico "Pres y diario".');
