INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108890, 'CLAVELL, Elena ', 'Nacida en Montevideo, Uruguay, en 1985. Técnica en Administración de Empresas, egresada de la Facultad de Ciencias Económicas de la UDELAR. En el año 2008 fue designada por las autoridades ministeriales, Secretaria General de la Junta Nacional de Salud (JUNASA), organismo desconcentrado dependiente del Ministerio de Salud Pública creado en el marco de la Ley del Sistema Nacional Integrado de Salud (SNIS). Directora General del Sistema Nacional Integrado de Salud, Uruguay.');
