INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108927, 'FIELDEN, Christopher ', 'Nacido en Inglaterra. Dedicado al comercio del vino. Tiene un espacio radial sobre vino en una emisora de alcance nacional en Gran Bretaña y ha escrito para una serie de revistas relacionadas con el rubro. Autor de varios libros sobre vino, los cuales han sido traducidos a varios idiomas. Presidente de la Wine & Spirit Association of Great Britain. Presidente del Círculo de Escritores sobre el Vino e integrante del Wine & Spirit Education Trust.');
