INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108956, 'REVELLO, Magdalena ', 'Nacida en Montevideo, Uruguay, en 1985. Licenciatura en crítica y producción de cine en la University of Southern California (Los Angeles). Estudió actuación para cine y teatro en La Fémis de París. Programadora web. Directora periodística de la revista "Niu Book".');
