INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108971, 'CARDEMIL, Carmen ', 'Parvularia, pintora e ilustradora. Vivió en México durante muchos años dedicándose a la ilustración de libros de diversos sellos editoriales, entre ellos el Fondo de Cultura Económica. Ha ganado diversos premios internacionales por su trabajo, como en la Bienal de Ilustradores de México, el premio Antoniorrobles y el Ibby Internacional. Desde el año 2004 es miembro del colectivo de ilustradores Sieterayas. Desde el año 2000 que vive en Chile.');
