INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (108976, 'MAURO, Amalia ', 'Nombre propio completo: amalia Rosa Mauro Cardarelli (forma no usada). Socióloga, Máster en desarrollo urbano y regional del Colegio de México. Investigadora del Centro de Estudios de la Mujer (CEM), Chile, instituto que dirige actualmente.\r\nHa participado en numerosos proyectos de investigación sobre salud mental de trabajadores y trabajadoras en chile con una perspectiva de género.');
