INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109062, 'VENTURA, Luis ', 'Nombre completo (forma no usada): VENTURA, Luis Antonio. Nació el 14 de enero de 1956 en San Pablo, Brasil. Hijo de padres argentinos y descendiente de una familia de periodistas.');
