INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109064, 'BRENA, Valentina ', 'Nacida en Montevideo en 1985. Estudiante de Doctorado en Antropología, Magíster en Ciencias Humanas y Licenciada en Antropología Sociocultural por la FHCE-UdelaR. Desde el 2010 se dedica a los estudios afrouruguayos, relaciones inter étnicas y raciales. Trabaja el el campo de las políticas públicas y acciones afirmativas hacia afrodescendientes y en la inclusión de la dimensión étnico-racial al sistema educativo mediante asesorías, consultorías, formaciones y capacitaciones. Es coautora de la "Guía didáctica en etnia/raza para una educación inclusiva" y de los libros "Patrimonio vivo de Uruguay. Relevamiento de candombe" y "Trabajo infantil en niños, niñas y adolescentes afrodescendientes en Uruguay : descubriendo horizontes de integración". Ha desarrollado diversas investigaciones a partir de las que ha publicado artículos en revistas científicas de Uruguay y México. A nivel internacional en 2010, ha participado del Proyecto The Wake Cup de Waking Souls en Sudáfrica.');
