INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109177, 'DELGADO, Sabino ', 'Nombre propio y forma no usada: DELGADO MARINA, Sabino. Licenciado en Psicología por la Universidad Autónoma de Madrid (UAM), Psicólogo colegiado en el Ilustre Colegio Oficial de Psicólogos de Madrid. Perito forense y miembro de la Asociación Latinoamericana de Psicología Jurídica y Forense. Docente de la Escuela Iberoamericana de Psicología Jurídica y Forense. Técnico Superior en Prevención de Riesgos Laborales, especialidad en Ergonomía y Psicología Aplicada. Técnico prevencionista inscripto en el listado oficial de peritos de la Comunicad de Madrid. Desde el año 2003 es responsable de los servicios psicológicos de la "Plataforma de la Comunidad de Madrid para los Riesgos Psicosociales y la Discriminación Laboral" (PRIDICAM).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109178, 'GONZALEZ-TRIJUEQUE, David ', 'Doctor en Psicología por la Universidad Complutense de Madrid. Psicólogo forense del Tribunal Superior de Justicia de Madrid. Especialista Europeo en Psicología Clínica y de la Salud (EuroPsy). Máster en Psicología Clínica, Legal y Forense por la Universidad Complutense de Madrid. Máster en Prevención de Riesgos Laborales, Especialidad en Ergonomía y Psicosociología Aplicada, por la Universidad de Alcalá de Henares. Máster en Prevención de la Violencia de Género y Atención Integral a Víctimas por el Centro Universitario LaSalle.');
