INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (109745, 'ALVAREZ, Mario ', 'Nacido en Rosario (Colonia / Uruguay), en 1931. Decente egresado del IPA. En el año 1974 recibe el primer premio de la Academia Nacional de Letras y en 1975 obtuvo el Primer Premio en el Concurso Conmemorativo del Centenario del Natalicio de Julio Herrera y Reissig.Entre sus obras encontramos: "María Eugenia Vaz Ferreira", "Julio Herrera y Reissig". Ha publicado varios trabajos críticos-didácticos: "Homero", "Delmira Agustini", "Guiraldes","Liber Falco" entre otros. Nombre propio completo (forma no usada): ALVAREZ RODRIGUEZ, Mario Juan');
