INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110132, 'SAFI, Leandro K. ', 'Abgado, argentino. Docente de Derecho Porcesal Civil y Comercial de la Facultad de Ciencias Jurídicas y Sociales de la UNPL. Especialista en Derecho Procesal Profundizado de la UNA. Letrado de la Fiscalía del Estado de la Provincia de Buenos Aires');
