INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110137, 'RUBAJA, Nieve ', 'Abogada, argentina\r\nFecha de Nacimiento: 03/07/1974 Buenos Aires\r\nCarrera de Especialización en Derecho de Familia en la Facultad de Derecho y Ciencias Sociales de la\r\nUniversidad de Buenos Aires\r\nAdjunta interina a cargo del curso “Restitución Internacional de Menores”, Facultad de Derecho, Universidad de Buenos Aires, 2010 y 2012\r\nCarrera Docente en la Universidad de Buenos Aires – Facultad de Derecho y Ciencias Sociales, 2000 -2002.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110148, 'DELGROSSO, Mauro ', 'Nacido en Fray Bentos, departamento de Río Negro, Uruguay, en 1974. Arquitecto, especialista en intervención en el patrimonio arquitectónico. Director del Museo de la Revolución Industrial desde julio de 2011. Preside la Comisión de Gestión Anglo desde su creación en el año 2008.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110149, 'NAJURIETA, María Susana ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110159, 'MATTIUSSI, Walter Mario ', 'Nacido en Argentina en 1971. Graduado en Ciencias de la Comunicación y Periodismo en 1993. Máster en Administración de ONGs y en Didáctica. En 2002 se radicó en la región de Friuli Venecia Julia, Italia.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110160, 'ROSSI, Pablo ', 'Nació en Buenos Aires. Es licenciado en psicología, experto en el tema de drogas. Desde 1986 se dedica a la investigación y prevención del consumo de drogas y a la asistencia de adictos. Ha visitado centros de rehabilitación en Europa, EEUU y América Latina donde completó su formación, que incluye además: terapia familiar sistémica, Psicodrama, Gestalt, Análisis transaccional y terapia cognitivo-conductual. Dictó en la Universidad Católica Argentina (UCA). Ha sido distinguido con varios diplomas y/o premios. En 1997  fue elegido como Consejero en Filosofía y asesoró el Consejo Provincial del Menor de la Provincia de Buenos Aires. Ha dictado numerosas conferencias para informar y capacitar en el tema de prevención y tratamiento de adicciones a profesionales de la salud y docentes. Desde 1993 dirige la Fundación Manantiales (con sedes en Argentina, Uruguay, Brasil y España), orientada a la prevención y tratamiento de adicciones');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110161, 'GAILLE, Marie ', 'Doctora en Filosofía y encargada de investigación en el CERSES (París)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110163, 'FORTE MONGE, Juan Manuel ', 'Licenciado en Filosofía y Doctor en Ciencias Politicas y Sociales');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110189, 'ESQUIBEL, Jorge ', 'Nacido en Ombúes de Lavalle, departamento de Colonia, Uruguay, en 1944. Concurrió a talleres literarios con Hugo Fontana, Guillermo Álvarez Castro y Alberto Gallo. "El triste" es su primera novela.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110190, 'ALMIRA, Emmanuelle ', 'Dakar (Senegal), 1972. Hija de madre francesa y padre pied-noir de Argelia, su primer idioma fue el francés. En 1975 se muda a la capital de Irán, Teherán, para en 1979 emigrar a Francia. A fines de 1981 se traslada a Argentina, donde estudió español en el liceo franco-argentino, y pasó por las Facultades de Periodismo, Sociología y Antropología. Se dedicó por años a la producción freelance de radio y televisión. A principios de 2006 se instaló en Uruguay, donde reside actualmente y donde surge su primera novela: "Despertar en Teherán".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110191, 'ASSANGE, Julian ', 'Nacido en Townsville, Australia en 1971. Es programador, periodista, editor en jefe y portavoz del sitio web WikiLeaks.\r\nSu trabajo se orienta por el lema criptopunk "privacidad para los pobres, transparencia para los poderosos".  Fue uno de los primeros investigadores en seguridad informática y de redes. En los 90, fue activista y proveedor de servicios de internet en Australia. Autor de numerosos proyectos de software y coautor de "Underground", la historia del movimiento hacker internacional.\r\nEn 2010, WikiLeaks reveló el sistemático abuso del secreto por los militares y el gobierno estadounidense, pesando sobre Assange un proceso en curso donde penden acusaciones de espionaje y terrorismo, motivo que lo llevara a asilarse en la Embajada de Ecuador en Londres en espera de un salvoconducto que le permita evitar ser extraditado a los Estados Unidos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110192, 'LERNER, Nicolás ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110203, 'FISCHER, Rita ', 'Artista plástica uruguaya, nacida en Young en 1972. Entre 2001 y 2012 vivió en París y en Berlín. Egresada del Centro de Diseño Industrial. Estudió en la Escuela Nacional de Bellas Artes (Taller Invernizzi) y en el taller Clever Lara');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110204, 'AGUIAR, Manuel ', 'Pintor, profesor y ensayista uruguayo, nacido en Montevideo en 1927. Alumno de Joaquín Torres García. En 1955 se instaló en París, donde trabajó y asistió a cuersos en el Collêge de France y en los Museos Guimet y Cermuschi, sobre la filosofía y el simbolismo de las religiones orientales. A mediados de los años 80 regresó a Montevideo, donde reside y trabaja.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110214, 'PARDO, Lucía ', 'Ingeniera en Alimentos graduada de la Universidad de la República en 2007. Ha trabajado como: Gerente General de la Cooperativa "Delicias Criollas" de la Asociación de Mujeres Rurales del Uruguay (AMRU); Docente de Manipulación e Higiene de los Alimentos en el Instituto Kolping de Capasitación Profesional; Investigadora en Universidad Católica del Uruguay, Departamento de Ciencias de la Administración, Facultad de Ciencias Empresariales (vinculada con los negocios inclusivos); coordinadora del "Día del Futuro" y Gerencia de "Lento" (del periódico "La Diaria").');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110215, 'PIÑEYRO MASSAFERRO, Silvia Anabelle ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110216, 'RODRIGUES ALVES, Sérgio ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110217, 'ENCUENTRO NACIONAL DE MICROBIOLOGOS (10º : 2013 ABR. 15-16 : MONTEVIDEO) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110218, 'APPELBAUM, Jacob ', 'Programador de computación, fundador de Noisebridge en San Francisco y miembro del Chaos Computer Ckub de Berlín. Investigador y promotor del Proyecto Tor, un sistema de libre acceso en línea para que las personas resistan la vigilancia y eludan la censura en internet. Abierto defensor de la libertad de expresión y manifiesto partidario de WikiLeaks.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110219, 'MÜLLER-MAGUHN, Andy ', 'Miembro y vocero del Chaos Computer Club en Alemania. Uno de los fundadores de European Digital Rights (Derechos Digitales Europeos), ONG que vela por los derechos humanos en la era digital. Especialista en telecomunicaciones y vigilancia. Cocreador de Cryptophone, compañía que vende dispositivos de comunicaciones seguras a clientes privados y ofrece consultoría estratégica en el contexto de la arquitectura de redes.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110220, 'ZIMMERMANN, Jérémie ', 'Cofundador y vocero el grupo de defensa ciudadana La Quadrature du Net, la más importante organización europea defensora de los derechos del anonimato en línea y generadora de conciencia sobre los ataques contra las libertades en línea a través de regulaciones legales. Luego de participar de la discusión base del libro Criptopunks : libertad y el futuro de internet, fue detenido por el FBI e interrogado sobre WikiLeaks');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110221, 'LABRAGA, Juan Alfonso ', 'Forma usada: Labraga, Juan. Montevideo, 1977. Es economista con especialización en Economía Internacional y docente universitario desde 2001. Lector compulsivo y escritor autodidacta. Algunos cuentos suyos forman parte de una antología publicada en Buenos Aires en 2007. "La ficción no sirve para nada" es su primera novela.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110222, 'ELINGER, Eduardo ', 'Nacido en Maldonado, Uruguay, en 1972. Técnico en Turismo. Ha sido legislador departamental (2000-2005, 2010-2015). Entre 2005 y 2009 se desempeñó como Director Municipal.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110224, 'PINTO, Alberto ', 'Nombre propio y forma no usada: PINTO SRUR, Alberto Adrián. Escritor y teósofo, estudió sofismo en la Tarka, Kabala, Zen y Vedanta.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110226, 'CUITIÑO, Eduardo ', 'Nombre propio y forma no usada: CUITIÑO BOSIO, Eduardo.\r\nNacido en Montevideo (Uruguay) en 1974.\r\nLicenciado en Matemáticas opción Estadística por la Facultad de Ciencias, UdelaR, y diplomado en Educación por la Universidad ORT Uruguay. Docente de la Facultad de Ingeniería de la Universidad ORT. Profesional de la Unidad Ejecutiva del Plan de Movilidad Urbana de la Intendencia de Montevideo. Encargado del taller recreativo Desarrollo del Razonamiento en el Liceo Jubilar Juan Plablo II, de Grta de Lourdes.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110227, 'MARURI LONDOÑO, Enrique ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110229, 'BONSIEPE, Gui ', 'Diseñador, educador y autor alemán. Se graduó en sideño de información en la Escuela de Diseño HFG Um Alemania, donde también trabajó como investigador y docente. Fue asesor de instituciones gubernamentales latinoamericanas en el campo de la política industrial (Chile, Atgentina, Brasil). Se especializó en diseño de interfaces en Berkeley y fue catedrático en la Universidad de Ciencias Aplicadas de Colonia, Alemnia, en ese campo. Es autor de varias publicaciones sobre diseño editadas en distintos países. Actualmente vive y trabaja en Brasil y Argentina.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110230, 'RUBIN, Sergio ', 'Santa Fé, Argentina. Es periodista y actualmente responsable de los temas religiosos del diario Clarín y el editor de su suplemento Valores Religiosos. Realizó una decena de viajes con el Papa Juan Pablo II, la cobertura de sus funerales y la elección de Benedicto XVI. Entre otras personalidades del mundo religioso entrevistó a la Madre Teresa y al cardenal Antonio Samoré. Autor del libro "Secreto de confesión: cómo y porqué la Iglesia ocultó el cuerpo de Eva Perón durante 14 años" (reeditado por Vergara en 2011). Fue galardonado con el premio Santa Clara de Asís.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110231, 'AMBROGETTI, Francesca ', 'Roma, Italia. Es periodista y psicóloga social. Comenzó su carrera en la radio y la continuó en la agencia noticiosa Ansa. En 1982 presidió la Asociación de la Prensa Extranjera en la Argentina y del 2000 al 2003, la Asociación de Corresponsales Extranjeros, de la que es consejera. Colabora con diversos medios internacionales, entre ellos Radio Vaticana. Dictó clases y cursos de periodismo en varias instituciones educativas. Es autora del ensayo "El tango como terapia del encuentro".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110232, 'CANAVESE SIRE, Ruben ', 'Estudiante de la Licenciatura en Ciencias Biológicas, de la Facultad de Ciencias, Universidad de la República (2013). Especialista en Gestión Ambiental, norma UNIT-ISO 14001. Se desempeña desde el año 2004 como Asistente Técnico en consultorías ambientales.');
