INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110243, 'WOLP ', 'Nacido en Minas, departamento de Lavalleja, Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110287, 'PARERA, Aníbal ', 'Biólogo. Comenzó su carrera con los refugios de vida silvestre en la Fundación Vida Silvestre Argentina. Desarrolló el Programa Pastizales de la misma organización y coordinó la Alianza del Pastizal desde su inicio y por seis años.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110288, 'PAULLIER, Inés ', 'Nombre propio y forma no usada: PAULLIER STIRLING, Inés.\r\nPresidente de Aves Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110289, 'BOSSO, Andrés ', 'Mentor de la Alianza del Pastizal. Director de "Aves Argentinas" y miembro de BirdLife International.');
