INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110323, 'ROUFFET, Jean Guy ', 'Nacido en Francia en 1939. A los catorce años de edad se trasladó a Uruguay. Graduado en odontología.  Muchas de sus experiencias y actividades relacionadas con el canotaje y la navegación han sido publicadas por la revista "Uruguay Natural".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110366, 'REUNION PLENARIA DEL CIRCULO DE MONTEVIDEO (18ª : 2012 JUN. : MEXICO) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110411, 'SANTANA PEREZ, Ruben "Cepillo" ', 'Nacido en Colonia Palma, departamento de Artigas, Uruguay. Apodado "Cepillo", trabajador de la caña de azúcar. Es uno de los fundadores del sindicato UTAA (Unión de Trabajadores Azucareros de Artigas). Desde 1972 a 1977 estuvo preso en el Penal de Libertad, luego se exilia en Suecia, donde vive desde 1982.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110413, 'FERREIRA RESENDE, A. Federico ', 'Nació en Tacuarembó, Uruguay en 1980. Arquitecto egresado de la Facultad de Arquitectura de la Universidad ORT-Uruguay. En el año 2008, realiza un diplomado en Ergonomía en la Universidad de Concepción (Concepción, Chile). En el año 2009 inicia sus estudios en la Universidad de León (León, España) dentro del Programa de la Fundación Iberoamericana, Master de Prevención de Riesgos Laborales, orientación Ergonomía y Psicología Aplicada. Ejerce la docencia en la Universidad Ort-Uruguay, en el Instituto Uruguayo de Normas Técnicas (UNIT), en la Universidad  del Trabajo del Uruguay (UTU) y en la Universidad Católica del Uruguay Dámaso Antonio Larrañaga (UCUDAL).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110414, 'OROBITG I DELLA, María José ', 'Nació en Barcelona, España en 1962. Es arqueóloga, bibliotecaria, escritora y activista pro derechos humanos y en defensa de los animales. Ha publicado poemarios infantiles, relatos, poemas y artículos de investigación histórica y de biblioteconomía. Ha ganado premios de poesía y relatos y de documentación. Como directora de biblioteca pública ha desarrollado proyectos de dinamización de lectura para niños, adultos y colectivos (escuelas y otros centos de enseñanza, entidades del barrio, mujeres e inmigrantes).\r\nEntre sus obras se destaca : "Mi abuela no es la de antes"');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110415, 'BALLESTEROS ORIOL, Carles ', '(Ilustrador). Artista catalán diplomado de la Universitat de Barcelona y posgraduado en ilustración de la Escuela Eina, también en Barcelona. Vive en Chile y trabaja como ilustrador para Inglaterra, España y Chile, además de dar clases de ilustración en la Universidad del Pacífico y en el posgrado de ilustración de la Universidad Católica de Chile.');
