INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110419, 'CARDOSO, Renato ', 'Educador familiar y matrimonial certificado por National Marriage Centers de Nurva York. En el transcurso de veinte años, ha vivido en tres países y ofrecido conferencias en mas de treinta, siempre trabajando en  el acompañamiento y asesoramiento de parejas. Es conductor, junto a su esposa, del programa : " The love School - Escuela del amor", transmitida semanalmente por la cadena : Rede Record.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110420, 'CARDOSO , Cristiane ', 'Autora de los best sellers : "La mujer V" y "Mejor que comprar zapatos". En el transcurso de veinte años, ha vivido en tres países y ofrecido conferencias en mas de treinta, siempre trabajando en  el acompañamiento y asesoramiento de parejas. Es conductor, junto a su esposa, del programa : " The love School - Escuela del amor", transmitida semanalmente por la cadena : Rede Record.');
