INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110436, 'VIERA, Uberfil ', 'Nombre propio y forma no usada: VIERA ORONA, Uberfil Artigas. Nació en Mercedes, departamento de Soriano (Uruguay), en marzo de 1970. Funcionario de la policía de Soriano. Poeta, pintor, coreuta, agente cultural-social.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110466, 'EUGENIDES, Jeffrey ', 'Nacido en Detroit, Estados Unidos, en 1960. Estudió en las universidades de Brown y de Stanford. Ha publicado en "The Gettysburg Review" y en "The Paris Review". Su primera novela, "Las vírgenes suicidas", fue llevada al cine por Sofia Coppola. Su segunda novela, "Middlesex", obtuvo el Premio Pulitzer en 2003.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110480, 'CORDOBA R., Claudia L. ', 'Nació el 6 de marzo de 1992, en Montevideo - Uruguay. Escritora de novelas y cuentos. Obra publicada: "Vampyra" y "Cuentos de las tierras olvidadas".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110484, 'PEREZ PERERA, Macarena ', 'Nacida en Montevideo (Uruguay) en 1978. Diseñadora industrial y dibujante, con formación en arquitectura y pintura.');
