INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110490, 'ALEXANDRA, Reina de Dinamarca ', 'Reinado : 1901 - 1910\r\n Nacimiento: 1 de diciembre de 1844, Palacio Amarillo, Copenhague, Dinamarca\r\n Fallecimiento : 20 de noviembre de 1925\r\n Predecesor, Alberto de Sajonia-Coburgo-Gotha\r\n Sucesor María de Teck\r\nCasa Real : Casa de Sajonia-Coburgo-Gotha\r\n Casa de Glucksburg\r\n Padre: Cristián IX de Dinamarca\r\n Madre: Luisa de Hesse-Cassel\r\n Cónyuge: Eduardo VII del Reino Unido\r\n Descendencia: Alberto Víctor, Jorge, Luisa,  Victoria Alejandra y Maud. \r\n\r\nAlejandra de Dinamarca (Alexandra Carolina Marie Charlotte Louise Julia zu Schleswig-Holstein-Sonderburg-Glücksburg; fue reina consorte del Reino Unido y los dominios británicos y emperatriz de la India de 1901 a 1910, como esposa del rey Eduardo VII. \r\nSu familia era relativamente poco conocida, hasta que su padre, el príncipe Cristián de Schleswig-Holstein-Sonderburg-Glücksburg, fue designado para suceder en el trono danés a Federico VII, su primo lejano, con el consentimiento de las grandes potencias.3 4 A la edad de dieciséis años fue elegida como la futura esposa de Alberto Eduardo, príncipe de Gales, heredero de la reina Victoria;5 se casaron dieciocho meses más tarde. Como princesa de Gales de 1863 a 1901, el periodo más largo durante el cual alguien ha ostentado el título, se ganó el cariño del pueblo británico y se volvió sumamente popular, su porte y estilo de vestir eran copiados por las mujeres conscientes de la moda. A pesar de que fue excluida de esgrimir cualquier poder político, intentó sin éxito influir en la opinión de los ministros y su familia para favorecer a sus parientes que reinaban en Grecia y Dinamarca. Sus funciones públicas se limitaron a la poco controvertida actividad de participar en obras de caridad.\r\n \r\nA la muerte de la reina Victoria en 1901, Alberto Eduardo se convirtió en rey-emperador como Eduardo VII, con Alejandra como reina consorte. Desde 1910, año en que murió Eduardo, hasta su propia muerte, fue la reina madre, como reina consorte viuda y madre del monarca reinante, Jorge V, pero fue más conocida como Su Majestad la reina Alejandra. Desconfiaba enormemente de su sobrino, el emperador alemán Guillermo II y apoyó a su hijo durante la Primera Guerra Mundial, en la que Gran Bretaña y sus aliados derrotaron a Alemania. Murió el 20 de noviembre de 1925 en Sandringham, después de sufrir un ataque al corazón y fue enterrada junto a su marido en la capilla de St. George en el castillo de Windsor.');
