INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110542, 'FONT, Xavier Aníbal ', 'Nacido en Montevideo (Uruguay) en 1983. Director de coros, compositor y docente. Egresado del Instituto de Profesores Artigas (IPA) en la especialidad de Educación Musical. En 1999 fundó "Afines y Afines", grupo vocal dedicada a la difusión de obras propias. Profesor de Organizacón y Dirección de Coros en el Consejo de Formación en Educación.');
