INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110554, 'BRACHER, Beatriz ', 'Nació en Sao Paulo, en 1961. Se graduó en Letras, fue una de las editoras de la revista de literatura y filosofía "34 Letras", entre 1988 y 1991, así como una de las fundadoras de la Editora 34, donde trabajó de 1992 al 2000. En el 2002, publicó por la editorial 7 Letras, "Azul e dura" (Azul y dura), su primera novela (reeditada por la Editora 34 en 2010), seguida de "Nao falei" (No hablé) (2004), "Antonio" (2007) y el libro de cuentos "Meu amor" (Mi amor) (2009), todos por la Editora 34. Ha publicado textos en varias antologías y revistas culturales. En 1994 escribió, junto a Sérgio Bianchi, el argumento de la película "Cronicamente inviável" (Crónicamente inviable) (2000) y, más recientemente, con el mismo director, el guión del largometraje "Os inquilinos" (Los inquilinos) (2009), premio de mejor guión en el Festival  de Rio 2009. En el 2008, la novela "Antonio" obtuvo el Premio Jabuti (3er lugar), el Premio Portugal Telecom (2do lugar) y fue finalista del Premio Sao Paulo de Literatura. "Meu amor" recibió el Premio Clarice Lispector, de la Fundaçao Biblioteca Nacional, como mejor libro de cuentos de 2009.');
