INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110575, 'WARE, Bronnie ', 'Escritora, cantante, compositora y profesora australiana que dio su salto a la literatura con su libro de memorias "Los cinco mandamientos para tener una vida plena", un verdadero best seller cuyos derechos se han vendido a editoriales de todo el mundo. Gestiona, además, un curso online de crecimiento personal y de composición de canciones, y escribe habitualmente en su blog personal "Inspiration and Chai", que incluye artículos que han sido traducidos a distintos idiomas.');
