INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110655, 'GARCIA JARAMILLO, Leonardo ', 'Abogado con estudios de filosofía. Miembro del Instituto de Estudios Constitucionales "Carlos Restrepo Piedrahita" de la Universidad Externado de Colombia. Docente en la Universidad EAFIT-Departameneto de Humanidades, Colombia.  Editor y coautor de "John B. Rawls. El hombre y su legado intelectual (2004)", Ha publicado arrtículos y traducciones en revistas especializadas, así como capítulos de libros, sobre ciencia política, derecho constitucional y teoría jurídica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110661, 'HIMITIAN, Evangelina ', 'Periodista y escritora. Licenciada en periodismo por la Universidad de Ciencias Empresariales y Sociales, tuvo a su cargo durante seis años la cátedra de Periodismo Ambiental en esa casa de estudios. Desde 1999 trabaja en el diario La Nacion, en las secciones Información General y Sociedad, y se especializa en investigar temas vinculados a la pobreza, la familia y distintos fenómenos sociales en el ámbito de la Justicia civil. También conduce un programa radial que está en el aire desde el 2008.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110670, 'MACHADO, Igor ', 'Nacido en Río de Janeiro, Brasil. Dibujante e historietista, co-fundador del estudio de animación Mimo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110671, 'JOFFILY, Meton ', 'Brasileño. Realiza arte callejero y animaciones. Co-fundador del estudio de animación Mimo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110679, 'BONINO DOBAL, Oscar ', 'Nació en 1939 en el barrio la Aguada de Montevideo, Uruguay. Hincha del Club Atlético Aguada (Basketball). Fue bancario por 15 años, profesión que abandonó para dedicarse a la profesión de fotógrafo, la cual desarrolló por cuarenta años. En materia deportiva fue fotógrafo jefe de las revistas "Sport Ilustrado", "Podium", en las cuales tambiérn se atrevió a escribir algún artículo y fotógrafo corresponsal de "Goles" de la República Argentina. Jubilado.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110682, 'MAGALHAES, Carlos Eduardo DE ', 'Nacido en San Pablo, Brasil, en 1967. Se graduó en administración de empresas por la Fundaçao Getúlio Vargas y publicó su primer libro en 1994. Coordinó talleres de creación literaria de forma esporádica y, desde 2008, dirige la editorial Grua Livros. Ha publicado trabajos en los EEUU y en la India, países donde estuvo como escritor residente invitado. Escribe, asimismo, guiones cinematográficos.');
