INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110715, 'RIBEIRO RIANI, Lidio Néstor ', 'Nació en Uruguay, donde se desempezó como profesor de filosofía, director de la Experiencia Pedagógica de José Batlle y Ordoñez, Director del Liceo Piloto de Paysandú, presidente de la Federación Nacional de Profesores de Uruguay. Exiliado en México desde 1976, tras persecuciones de macartistas y paramilitares. En México fue profesor de filosofía en la Universidad Iberoamericana y asesor pedagógico de la Universidad de Chiapas y desde 1979 es profesor investigador en el Centro Interdisciplinario de Investigación y Docencia en Educación Técnica. Tiene también el título de Maestro en Ciencias de la Educación otorgado por la Universidad de Alabama (EUA). En 1994 adopta la nacionalidad mexicana.');
