INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110751, 'DI LORENZO, Eduardo Ruben ', 'Nació en Montevideo en 1955. Músico y compositor. Comenzó su actividad profesional en Carnaval en el año 1978. Como letrista obtuvo numerosos premios y menciones, incluido el Víctor Soliño. Fue director responsable de Murga "La Tito Pastrana" y del conjunto de Parodistas "Espantapájaros de Medianoche", que también funcionaba como banda de rock. Fue colaborador de la revista "BERP". Es autor de obras teatrales y musicales. Se desempeño como coordinador artístico de escenarios (IMM) en la Criolla de El Prado durante más de quince años. Es director de DAECPU desde el año 1992.');
