INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110755, 'TROLIO, Elsa ', 'Artista visual uruguaya. Egresada del Instituto de Formación Docente en 1975, asistió al Taller Nacional de las Artes de Formación Docente en la Dirección de Cultura del MEC : Montevideo 2001-04. Dirigió el Taller de las Artes del MEC entre los años 2002-2005. Ejerce la docencia en Artes visuales desde 1990 a actualmente dirige el taller IMS. Co-fundadora de APLAS, Asociación de Artistas Plásticos Salteños,1988.');
