INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110850, 'TROCHE, Pedro ', 'BA en Comunicaciones (UTS, Sydney, Australia) y Licenciado en Ciencias de la Comunicación (Udelar, Uruguay). Su interés por la historia y la aeronáutica lo llevó a publicar en 2002, "Molinos de viento".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110851, 'PEREZ GOMAR, Guillermo ', 'Sociólogo especialista en Centros Educativos y Doctor en Educación (Universitat de Valencia, España). Integra el Departamento de Educación de la Facultad de Ciencias Humanas de la Universidad Católica del Uruguay (UCU), donde coordina la Maestría en Evaluación de Sistemas Educativos y tiene a su cargo diferentes cursos a nivel posgrado. Profesor interino en Formación Docente magisterial en su país, además de tutor de tesis de maestría de estudiantes del CLAEH (Centro Latinoamericano de Economía Humana, Montevideo). Dirigió, coordinó y participó en numerosos proyectos de investigación en distintas instituciones públicas y privadas. Autor de artículos y ponencias en su área, que es la evaluación de políticas y programas educativos, el cambio educativo y los proyectos de transformación en organizaciones escolares.');
