INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110904, 'RODRIGUEZ, Víctor Hugo ', 'Nombre propio y forma no usada: RODRIGUEZ CUSTODIO, Víctor Hugo.\r\nProfesor de Educación Física, preparador físico y entrenador deportivo egresado del I.S.E.F.. Diplomado de Gestión de Políticas Sociales de la Universidad del Litoral (Buenos Aires, Argentina). Fue Subdirector del Instituto Dr. Miguel C. Rubino (2001-2009).');
