INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110907, 'SALABERRY, Martín ', 'Uruguayo, nacido en 1977. Incursiona en la poesía en 2010. Obtiene una Mención Especial en el Concurso Ecos Regionales (Trinidad, Flores) y en 2013 su poema "Aires de abril" fue seleccionado para integrar un poemario colectivo en Cabimas Corazón, Venezuela.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111103, 'LEON (?), Silvia DE ', 'Licenciada en Enfermería. Jefe de Servicio de Block Quirúrgico, Recuperación Post anestésica y Central de Esterilización, División Enfermería Hospital de Clínicas. Especialista en Cirugía, Block Quirúrgico, Intrahospitalarias, Administración de Servicios de Salud, Especialista UNIT en Gestión de Servicios de Salud y Gestión de RRHH.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110909, 'PAGOLA, Roberto ', 'Naciò el 7 de abril de 1951 en San Carlos, Maldonado, Uruguay. Cursó estudios de psicología entre 1970 y 1973. Ha participado de diversos concursos nacionales : Serafín J. García, Vergara y Treinta y Tres donde recibe mención por su cuento corto : "Imaginación" en 2008. Ha publicado en Libros en red (editorial digital) : "Cuatro destinos" (2007) y "El hombre que sentaban a la orilla (2011).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110914, 'DUCSA ', 'Distribuidora Uruguaya de Combustibles S.A.. Empresa creada en 2001, encargada de la distribución de combustibles, lubricantes, garrafas de gas en las estaciones de servicio ANCAP y Texaco en Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110915, 'ARIAS LAURINO, Daniela ', 'Arquitecta, egresada de la Facultad de Arquitectura de la Udelar (2003). Máster en Laboratorio de la Vivienda Sostenible del Siglo XXI por la Fundación Politécnica de Cataluña, Barcelona (2010), y Máster en Teoría e Historia de la Arquitectura, por la Escuela Técnica Superior de Arquitectura de Barcelona (2013). Docente de Taller de Anteproyecto en el Taller Schelotto de la Facultad de Arquitectura de la Udelar desde 2005 y ha trabajado en la Unidad Permanente de Vivienda de la misma facultad.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110928, 'UGALDE BARRANTES, Evelyn ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110931, 'MESTRE DE TOBON, Olga ', 'Profesora asociada, Facultad de Ciencias Humanas, Universidad Nacional de Medellín');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110933, 'BERRUEZO, Rafael ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110956, 'GONZALEZ, Mariano ', 'Nacido en Montevideo, Uruguay en 1972. Escritor. Escribe bajo el seudónimo "Atromulo".\r\nEntre sus libros se destacan: "Estados de la maceta" e "Instantáneas nómadas" y  "El elefante y la luna", éste último escrito bajo el seudónimo de Astromulo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110957, 'SALINAS, Luciana ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110959, 'DI NICOLA, Juan Carlos ', 'Nacido en Cardona, departamento de Soriano, Uruguay, en 1945. Estudiante de Historia argentina y uruguaya en la Fundación Vivian Trías con el profesor e historiador Carlos Machado.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110960, 'JOUBANOBA, Magdalena ', 'Doctora en Medicina, Sexóloga Clínica. Co Directora y Sexóloga de la Clínica Sexológica PsicoMed. Coordinadora Docente del Curso de Sexología Clínica IUCS (Instituto Uruguayo de Capacitación Sexológica Flores Colombino). ProSecretaria de la Sociedad Uruguaya de Sexología. Ex Consultora del BID (Banco Interamericano de Desarrollo) y del PNUD (Programa de Naciones Unidas para el Desarrollo). Columnista en "Radio Sarandí : Viva la Tarde", "Radio Metrópolis : Pisando Fuerte", revista "Eva Magazine".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110961, 'FERNANDEZ (?), Martín ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110962, 'OLMOS, Ramiro ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110963, 'ALONSO, Nicolás ', 'Maestro. Coordinador de gestión del proyecto "Promoción de una convivencia saludable".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110964, 'GONZALEZ, Solana ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110965, 'LEMOS, Carlos (?) ', 'Nació en Montevideo, Uruguay en 1981. Dibujante y estudiante de profesorado de Comunicación Visual en IPA. Caricaturista, pintor e ilustrador de libros infantiles. Es egresado de la Continental Art School y es co-editor de GAS comics.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110972, 'MILLER, Delfina ', 'Dra. en Psicología por la Universidad de Buenos Aires. Miembro del Consejo de Doctores, Coordinadora Académica de la Maestría en Psicología Clínica de Niños y Adolescentes, y Profesora Titular en las áreas de Psicopatología infantil, Diagnóstico e Intervenciones Terapéuticas, y Psicoaánlisis Contemporáneo, de la Universidad Católica del Uruguay. Evaluadora de proyectos de investigación para la Universidad de Buenos Aires y para la Universidad de la República. Psicoterapeuta psicoanalítica.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110977, 'BOTTI, Leticia ', 'Uruguaya, arquitecta y diplomada en la Especialización en Intervención en el Patrimonio Arquitectónico. Encargada de la División Mantenimiento y Obras Menores, del Consejo de Educación Inicial y Primaria.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (110989, 'PEREZ, Martín A. ', 'Nació en 1980 en New York, EEUU. Reside en Montevideo, Uruguay. Escribe artículos sobre juegos de rol, comics y ciencia ficción, además de tener un programa radial sobre "cosas nerd" (Perdidos en el éter). Actualmente (2013), se dedica a guionar y rotular comics (como coeditor del sello GAS Comics y para clientes particulares) y a escribir texto para videojuegos. Forma usada: MAGNUS.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111002, 'PACHECO, Martha ', 'Directora de OIT/Cinterfor, sede en Montevideo (Uruguay)');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111009, 'CARRETTO, Luis ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111010, 'CALDARELLI, Pablo "Pepino" ', 'Ex integrante del grupo musical "Monterrojo".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111011, 'PURPURA CHIOSSI, Stella ', 'Nacida en el departamento de Maldonado, Uruguay. Psicóloga y docente, jubilada.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111012, 'SANCHEZ, María ', 'Nacida en Montevideo, Uruguay en 1979. Profesora de idioma español egresada del Instituto de Profesores Artigas. Publicó en 2013 "Mariposas de ciudad".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111013, 'ZAS, Diego ', 'Nacido en Montevideo (Uruguay) en 1978. Licenciado en Ciencias de la Comunicación (UdelaR). Ha publicado artículos sobre música en la revista "Vayven" ("El Observador"). Fue conductor del programa "Videoparlante" de TNU y tiene una columna en el programa "La mañana". En radio trabajó "Urbana FM" y en el programa "Suena Tremendo" de radio "El Espectador".');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111014, 'JODOROWSKY, Alejandro ', 'Nacido en Tocopilla, Chile, en 1929. Tarólogo, terapeuta, escritor, actor, director de teatro y cine.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111015, 'BORDAGORRIA SANCHEZ, Lucas ', 'Nació en la ciudad de Tacuarembo el 12 de setiembre de 1969. Realizó estudios de Filosofía en el Instituto de Teología Mariano Soler en Montevideo. Ha hecho estudios terciarios en la Universidad Pontificia Bolivariana de Medellín Colombia. Dicta clases particulares de Química y Física. Ha publicado su libro "Pasos y recuerdos" en el año 2012, ha participado en el libro de "Autores colonienses Extra Muros" en el año 2011.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111081, 'GARCIA (?), Carlos ', '');
