INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111083, 'FRIEDMAN, Virginia ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111084, 'MONTOYA JUAREZ, Jesús ', 'Nació en Murcia, España. Profesor de Literatura Hispanoamericana en la Universidad de Murcia (España). Doctor por la Universidad de Granada, ha sido investigador visitante en Duke University, La Sorbona, Paul Valéry de Montpellier, Universidad de Buenos Aires y Universidad de la República, Uruguay. Ha escrito varios ensayos de literatura.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111085, 'D''ESTEBAN, María Cristina ', 'Licenciada en Enfermería. Directora Departamento de Áreas Especiales y Turnos. División enfermería Hospital de Clínicas. Subdirectora Hospital Pasteur. Especialista en Administración de Servicios de Salud, Cirugía, Cuidados Intermedios. Posgrado en Alta Dirección en Servicios de Salud. PDS, IEEM.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111086, 'FERNANDEZ CHAVES, Nancy ', 'Licenciada en Enfermería. Jefe de Servicio Áreas Médicas, Neurología y Neurocirugía. División Enfermería, Hospital de Clínicas. Especialista en Diabetología, Cuidados Intensivos, Cirugía Cardiaca, Administración de Servicios de Salud, Maestrando en Gestión de Servicios de Salud.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111088, 'DIAZ, Ana María ', 'Licenciada en Enfermería. Jefe de Servicio Centro de Tratamiento Intensivo, Centro de Nefrología y Unidad de Transplante, División Enfermería, Hospital de Clínicas. Especialista en Medicina Intensiva, Cuidaddos Intermedios, Neurología, Neurocirugía, Cirugía Cardiaca, Administración de Enfermería. Especialista UNIT en Gestión de Servicios de Salud.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111144, 'SALLABERRY SILVEIRA, Ignacio ', 'Nacido en el departamento de Durazno, Uruguay, en 1978. Poeta y diseñador gráfico, actividad por la que estuvo nominado a los premios Gardel en Argentina (2009) por diseño de mejor carátula de CD. Expuso en Uruguay unas obras en homenaje a Zitarrosa, por las cuales fue premiado por la Asociación de Artistas Plásticos Internacionales en España.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111189, 'CASTRO, Edgardo ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111200, 'RIOTORTO, Adriana ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111203, 'LOGOTETIS VILLALBA, Andrea ', 'Licenciada en Psicología y Máster Internacional en Neuropsicología Clínica (Instituto Altos Estudios Universitarios de España: Universidades de León, Alcalá, Granada, Europea Miguel de Cervantes). Se formó como Psicopedagoga en el Instituto Universitario CEDIIAP. Actualmente se desempeña como psicopedagoga institucional en el Sistema Educativo y como psicopedagoga clínica en el ámbito privado. Asimismo ha formado parte del Departamento de Desarrollo del Instituto CEDIIAP y ha obtenido cargos de docencia en el mismo.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111204, 'INSTITUTO UNIVERSITARIO CEDIIAP ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111214, 'INEED ', '');
