INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111238, 'LAGO, Rossina ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111243, 'BAPTISTA, Marcelo ', 'Nació en Montevideo, Uruguay en 1962, de padres brasileños. En su infancia frecuentó el Taller de Expresión Plástica de Montevideo de Eduardo Rubio y Beatriz Magliati, en su juventud relizó breves estudios con Félix Bernasconi y Nelson Ramos. Expuso sus dibujos y pinturas en forma individual a los 21 años. A los 24 ingresó en la Escuela Nacional de Bellas Artes, en Montevideo, completando su formación en los talleres de Javier Alonso. En 2002, obtuvo el Gran Premio del "Concurso GVT de Arte Mural" en Curitiba, Paraná.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111268, 'MARZORATTI, Daniel ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111271, 'UGARTE, David DE ', 'Español, economista. Fundador del Grupo Cooperativo de las Indias.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111282, 'KEMAYD ROTTA, Ana Iris ', 'Prf. Agda. Depto. de Medicina Familiar y Comunitaria, Facultad de Medicina - UdelaR. Coordinadora UDA APEX Cerro.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111298, 'LORENZO, Nedda ', 'Nombre propio completo y forma no usada: LORENZO CHAIN, Nedda. Productora rural, titular de la empresa Corrales Deal, de diseño y construcción de corrales para vacunos.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111300, 'AQUINO, Claudia ', 'Nacida en Treinta y Tres (Uruguay). Escritora de cuentos y de artículos periodísticos publicados en el seminario "El Cimarrón" y en la Faculta de Humanidades y Ciencias de la Educación (UdelaR, Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111304, 'ZAPATA, Alberto ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111305, 'TALICE, Silvia ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111308, 'LACOIUS PETRUCCELLI, Alberto ', 'Doctor en Medicina por la Facultad de Medicina de Montevideo, Uruguay. Estudió pediatría en el Hospital John Hopkins en Maryland, EEUU. Desde 1967 hasta la 2009 fue instructor clínico en pediatría y pediatra en el New York Presbyterian Hospital, Cornell Medical Center, y en otras instituciones médicas de New York.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111309, 'IPU ASSEMBLY (129ª : 2013 OCT. 3-9 : GENEVA) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111315, 'VITIER, José Adrián ', 'Traductor.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111316, 'BROGLIA, Enrique ', 'Nombre propio y forma no usada: FERNANDEZ BROGLIA, Enrique.\r\nNacido en Montevideo (Uruguay) en setiembre de 1942 y fallecido en setiembre de 2013. Artista plástico y escultor destacado. Realizó exposiciones y proyectos en diferentes partes del mundo: Uruguay, Brasil Estados Unidos, Argentina, España, Francia, Alemania, Japón, Suiza, Bélgica, etc. Fue esposo de la cantante Yalta González.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111318, 'LUNA (1974- ), Alvaro ', 'Nació en Montevideo en 1974. Residió 5 años en Argentina, y el resto de su vida en Montevideo. En el 2011 se integró a un taller de literatura "El Rincón", coordinado por Gustavo Esmoris y Fabián Severo. Ha participado en obras colectivas y "Algarabía" es su primer libro publicado (2013).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111329, 'FELD, Claudia ', 'Doctora en Ciencias de la Comunicación por la Universidad de París VIII e Investigadora Adjunta del CONICET (Argentina), con sede en el Instituto de Desarrollo Económico y Social (IDES) de Buenos Aires. Se ha especializado en el estudio de los vínculos entre memoria social, cultura visual y medios de comunicación. Ha publicado : Del estrado a la pantalla : las imágenes del juicio a los ex-comandantes en Argentina (2002) y es coeditora de El pasado que miramos : memoria e imagen ante la historia reciente (2009).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111338, 'BUERO, Franco ', 'Nacio en Montevideo, en el Barrio de Capurro en el 2001. Concurre a la escuela nº 136 de Salinas. Es jugador de Neptunia Country Club. Estudia inglés, teatro, guitarra y practica natación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111339, 'ALEXANDER, Eben ', 'Neurocirujano. Ha ejercido como neurocirujano en hospitales universitarios durante los últimos veinticinco años, quince de ellos en el hospital Brigham & Women''s, en los hospitales Children''s y en la Escuela Médica de Harvard.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111340, 'GOMEZ FONTOURA, Salvador Bibiano ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111341, 'BENIA, Isabel ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111342, 'SEBE, Susana ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111344, 'CHAVES, Fabricio ', 'Nacido en Montevideo (Uruguay) en 1989.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111361, 'AMETRANO, Lucia ', 'Galerista, editor y diseñador gráfico, estudia Magisterio y Filosofía y Letras en la Universidad Nacional de Cuyo (Mendoza, Argentina). Funda en 1977 la galería de arte lleva su nombre. En 1990 anexa la editorial, diseña y publica ediciones de gran formato y muy cuidada encuadernación. Inicia sus trabajos de investigación histórica e iconográfica colaborando con el Prof. Luis Bausero. A partir de 2011 colabora con Salgari Ediciones de Arte y comienza una investigación sobre la ilustración y diseño publicitario desde la Belle Epòque hasta los años 50s, y en paralelo, sobre las ilustraciones originales en las ediciones francesas para bibliófilos a fines del soglo XIX y principios del XX');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111390, 'TORRES GONÇALVES, Estela M. ', 'Motivadora. Terapeuta esencial graduada en Madrid. Profesora de música. Autora en varios géneros.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111406, 'BURGUEÑO, Mario ', 'Montevideo, 1948. Estudia en la Facultad de Arquitectura hasta su detención en 1973. Luego de liberado retoma sus estudios hasta su expulsión, con pérdida de la calidad de estudiante el 30 de octubre de 1981. Es socio fundador del Instituto del Tercer Mundo y la red Chasque. Ejerce como sub-director del Instituto, miembro del directorio y editor gráfico de la Guía del Mundo desde 1986 hasta 1997, fecha de su renuncia. Se desempeña como diseñador gráfico. Autor de la obra "La cicatriz: lo que contè, lo que no preguntaron", donde relata su historia desde que fue detenido como preso político, su pasaje por la psisión y su posterior liberación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111407, 'REVIRIEGO PICON, Fernando ', 'Profesor de la Universidad Nacional de Educación a Distancia (UNED).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111417, 'CONGRESO INTERNACIONAL DEL CLAD SOBRE LA REFORMA DEL ESTADO Y DE LA ADMINISTRACION PUBLICA (18ª : 2013 OCT. 29 - NOV. 1 : MONTEVIDEO) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111418, 'TAPIA, Patricio ', 'Forma no usada: TAPIA, Patricio A. Nacido en Chile en 1968. Periodista, escritor de guías y libros sobre vinos. Diplomado en Degustación y Enología de la Facultad de Enología de la Universidad de Burdeos (Francia). Trabaja para el periódico "El Mercurio", como columnista de la revista "Wikén". Editor general de la editoria Planetavino. Editor asociado de "Wine & Spirits Magazine" en Nueva York.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111421, 'PIRIZ REYES, Marcelo ', 'Doctor escribano');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111433, 'KANOVICH, Susana ', 'Coordinadora de la Unidad de Apoyo a la Enseñanza en Centro Universitario de Paysandú. Docente en el Instituto de Formanción Docente. Licenciada en Ciencias Biológicas, Facultad de Ciencias (UdelaR, Uruguay). Master en Educación, Universidad ORT (Uruguay).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111434, 'PEREYRA, Leticia ', 'Nombre propio y forma no usada: PEREYRA LANTERNA, María Leticia. Maestranda en Información y Comunicación Científica. Licenciada en Bibliotecología. Asistente de Dirección del Centro Universitario de Paysandú e integrante de la Comisión Departamental de Educación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111435, 'BARLA, Enrique ', 'Contador Público recibido en la Facultad de Ciencias Económicas de la Universidad de la República. Es Master en Administración y Dirección de Empresas en la Escuela de Negiocios EALDE-Business School de la Universidad Francisco de Vitoria, Madrid, España. Responsable Académico de las materias Contabilidad de Costos y Costos para la Toma de Decisiones desde su inicio en la Universidad de Montevideo, profesor del curso de Control de Gestión en EALDE, además impartió clase en la Cátedra de Costos de la Facultad de Ciencias Económicas por 16 años.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111436, 'CARTIER, Enrique ', 'Contador Público graduado de la Facultad de Ciencias Económicas de la Universidad de Buenos Aires, Argentina. Profesor Titular Regualr de la materia Gestión y Costos en la Facultad de Ciencias Económicas de la Universidad de Buenos Aires y de la materia Costos del Departamento de Ciencias Sociales de la Universidad Nacional de Luján de Argentina. Es docente en Carreras de Postgrado de Especialización en Costos y Gestión Empresarial que se dictan en las principales universidades de Argentina y en la Universidad de la República de Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111437, 'MARCHESANO, Patricia ', 'Contadora Pública recibida en la Facultad de Ciencias Económicas y Administración de la Universidad de la República. Docente de las materias Contabilidad de Costos y Costos para la Toma de Decisiones de la Universidad de Montevideo. Fue docente de la materia Contabilidad de Costos en la Facultad de Ciencias Económicas y Administración de la Universidad de la República por nueve años.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111438, 'PODMOGUILNYE, Marcelo ', 'Contador Público recibido en la Facultad de Ciencias Económicas de la Universidad Nacional de Lomas de Zamora. Especialista en Costo y Gestión en la carrera desarrollada por el Instituto Argentino de Profesores Universitarios de Costos y la Universidad Nacional de Lomas de Zamora. Es profesor titular de la materia Elementos de Costos y Costos y Actividades Especiales de la Facultad de Ciencias Económicas de la Universidad Nacional de Lomas de Zamora. Profesor titular de la materia Contabilidad Gerencial del Instituto Tecnológico de Buenos Aires (ITBA), y profesor Adjunto Ordinario de las masterias Gestión y Costos y Sistemas de Costos de la Universidad de Buenos Aires (UBA).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111448, 'CONGRESO DE LA ASOCIACION DE PROFESORES DE EDUCACION CIVICA, SOCIOLOGIA Y DERECHO DEL URUGUAY (14º : 2013 : MONTEVIDEO) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111474, 'CONGRESO INTERNACIONAL DE MUJERES DE NEGRO (16º : 2013 AGO. 19-24 : MONTEVIDEO) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111477, 'SEMINARIO EN_CLAVE INTER (2012 OCT. : MONTEVIDEO) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111510, 'DEMICHERI ILARIA, Patricia ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111525, 'MANUEL MAESTRO ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111528, 'GODOY, Ina ', 'Nacida en Concordia (Argentina) en 1977. Estudió Ciencias de la Comunicación en la Universidad de Buenos Aires. Fue redactora de "No" (suplemento para jóvenes) y "Radar" (suplemento cultural) del diario "Página/12", y del suplemento cultural del diario "El País". Realizó el guión del documental "Los caminos de Atahualpa" y del programa "Encuentro en el estudio" ("Canal Encuentro", Argentina).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111529, 'ANTUNEZ, Ricardo ', 'Nacido en Montevideo (Uruguay) en 1964. Licenciado en Sociología por la UdelaR y fotógrafo. Trabajó en la Diaria (2006-2010), donde, entre otras labores, realizó fotoreportajes. Enseña fotografía en la escuela TRIS.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111545, 'CABRERA, Oscar ', 'Cerro Largo. Maestro.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111549, 'GAMBINI, Marcelo ', 'Montevideo (1975- ). Miembro del Centro Félix Guattari. Docente, analista y esquizodramatista. Es docente de Química, Físicoquímica y Ciencias Físicas en el ámbito educativo. Trabaja como analista en el ámbito clínico y coordina esquizodramas en el Hospital Vilardebó y en la Casa INJU-MIDES. Ha participado en varios congresos de psicología en carácter de expositor.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111560, 'REUNION PLENARIA DEL CIRCULO DE MONTEVIDEO (19ª : 2013 JUN. : PERU) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111596, 'MUÑOZ, Diego ', 'Nacido en Montevideo, Uruguay, en 1975. Periodista, egresado de la Universidad Católica en la licenciatura de Comunicación. Responsable de deportes de www.180.com.uy, y corresponsal de los diarios "La Tercera" de Chile y "Marca" de España. Escribió artículos periodísticos en la revista "tres", en el suplemento "Qué Pasa" del diario "El País" y en la revista "Bocas" de Colombia.');
