INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111640, 'MAYER, Roberto F. ', 'Nacido en Paysandú, Uruguay en 1930. Ex militar de la Fuerza Aérea Uruguaya.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111645, 'INDART, Hugo ', 'Nacido en Rosario, departamento de Colonia, Uruguay, en 1945. Reside en Montevideo desde los 10 años de edad. Maestro. Escribe sobre la figura de Carlos Gardel. Es socio fundador de la Academia del Tango del Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111649, 'CONFERENCIA INTERNACIONAL "ASUMIENDO EL PASADO CONSTRUYENDO EL PRESENTE. APORTE DE EXPERIENCIAS EXTRANJERAS" (2011 SET. 27-28 : MALDONADO) ', '');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111669, 'GRASSI, Laura ', 'Maestra en educación común, ha trabajado en escuela y liceos de la periferia de Montevideo y Canelones. Licenciada en Trabajo Social, Magister en Educación.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111670, 'FERNANDEZ RUSSO, Sergio María ', 'Mercedes, Soriano, 1946. Autor de los libros "Reflexionemos" (1992) y "FUE" (2012).');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111671, 'DOBARRO, María Carolina ', 'Nació en Montevideo en 1975. Cursó estudios superiores, obteniendo el título de profesora de inglés, dedicandose a la docencia de dicho idioma desde 1992. Asimismo se ha desempeñado como coordinadora, teacher trainer y directora de diversos centros educativos hasta el presente. Se graduó como doctora en derecho (Universidad Católica del Uruguay) en el año 200, cursando estudios de posgrado en Derecho Anglosajón en la Universidad de Montevideo. Es empresaria y ejerce su profesión de abogada en forma liberal, siendo miembro de la Comisión Directiva del Colegio de Abogados de Rivera. Se ha abocado a la docencia de Derecho de Familia, Sociedad Conyugal, Sucesiones, Derecho Civil, Derecho Penal en la Universidad Católica, y en las facultades de Derecho y Economía IUPE. Ha publicado varios trabajos doctinarios y participado como ponente en el Centro Regional de Profesores.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111672, 'SERRANO BLANQUER, David ', 'Nacido en 1966. Doctor en Filología por la Universidad Autónoma de Barcelona. Profesor dela Universidad Ramon Llull en Comunicación, miembro de Conflicto, Infancia y Comunicación (CONINCOM). Fundador y director del Centro de Investigación de la Literatura Europera Concentracionaria. Ha publicado varios libros sobre la memoria democrática y testimonios de la represión nazi y franquista.');
