INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111681, 'MENESES PRATTES, Pablo ', 'Uruguayo. Doctor en Derecho y Ciencias Sociales egresado de la Facultad de Derecho de la Universidad de la República. Ha participado en eventos nacionales e internacionales relacionados a materias de su especialidad. Vinculado al estudio "Rueda Abadi Pereira" (2011-2014) y a la firma Ferrere Abogados.');
