INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111715, 'ESTRADET, Víctor ', 'Nacido en Uruguay el 14 de octubre de 1951. En 1969 se unió al MLN, integrando la columna de Ulpiano (José Mujica), posteriormente pasando a formar parte de la columna 70. Realizó trabajo liceal y barrial en el Liceo Nº 11 del Cerro, donde estudió. En agosto de 1972 se exilia radicándose en Cuba. Participa en la Revolución sandinista en junio de 1979. En 1985 retorna a Uruguay, donde colaboró con la reconstrucción del MLN. En noviembre de 1986 parte a combatir contra las tropas contrarrevolucionarias que atacaban el proceso sandinista. En 2005 retorna definitivamente a Uruguay, participando en la campaña de Ricardo Ehrlich y siendo asistente de la intendente Ana Olivera.');
