INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111727, 'REY, Oscar ', 'Nombre propio completo y forma no usada: REY DUPLECH, Oscar. Nacido en Rivera, Uruguay. Profesor de Historia. Ejerce la docencia desde 1985.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111734, 'BROWN, Danielle ', 'Nacida en la ciudad de Los Angeles, California, EE.UU. Licenciatura en literatura de Pitzer College. Ha escrito para periódicos afroamericanos y diarios independientes en California. En 2011 obtuvo una beca del programa Fullbright para realizar una investigación sobre mujeres escritoras en los periódicos afrouruguayos del S XIX y XX.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (111735, 'FALCO, Edward ', 'Autor de tres novelas, tres libros de cuentos y numerosas obras de teatro, poemas, ensayos y textos de crítica literaria. Entre sus premios y honores, obtuvo la beca NEA para autores de ficción y el premio Robert Penn Warren, otorgadi por The Southern Review. Enseña literatura en Virginia Tech, donde dirige un programa de escritura creativa. Autor de la novela "Los Corleone", surgida a partir del guión inconcluso de dicha obra de teatro, escrita por Mario Puzo.');
