INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (119035, 'ABALOS ZEL ', 'Nombre propio y forma no usada: VAZ ZEBALLOS, Yonatan. Nacido en Montevideo en 1981. Dibujante y guionista de comics. Autor de “Lila y los otros” y “Audrey”. Junto a Paulo Escalada dirige la editorial “Nueve Grullas” que desde el 2012 se dedica a la creación, edición y publicación de tiras y novelas gráficas en medios impresos y digitales.');
