INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (123891, 'LUJAN, Carlos ', 'Politólogo. Doctor en Ciencias Humanas por la Universidad Católica del Uruguay. Maestado en Ciencias Sociales, pción Relaciones Internacionales en la Facultad Latino Americana de Ciencias Sociales (FLACSO), Buenos Aires, Argentina. Docente-investigador en la UdelaR y en CEFIR. Director del Instituto Artigas de Servicio Exterior del Ministerio de Relaciones Exteriores de Uruguay.');
INSERT INTO public.autores (cod_autor, nombre_autor, notas) VALUES (127299, 'ECHEVARRIA VAZ FERREIRA, Cristina ', 'Arquitecta egresada de la Universidad de la República, Uruguay. Posgrado en "Planeamiento paisajista y medio ambiente" por la Universidad Nacional de La Plata. Presidente de la Fundación Vaz Ferreira-Raimondi desde 2008. Responsable de la coordinación de actividades culturales y de la redacción de proyectos, además de supervisora de la conservación.');
