INSERT INTO public.obras (cod_obra, titulo, ubicacion, edicion, pais, fecha, paginacion, serie, notas, isbn, cod_dewey, supervisada) VALUES (80857, 'Origen y primer centenario de las Conferencias de San Vicente de Paul en el Uruguay : 1858 - 21 de noviembre - 1958', '261.8 O69', '', 'URY', '1958      ', '123 p.              ', '', 'Conferencia San Vicente de Paul (Vicentinos)\r\nLa Sociedad de San Vicente de Paul  es una organización Católica Internacional de Laicos, con gran trayectoria en  la asistencia social y humana en el mundo, integrada por voluntarios, mujeres y  hombres, que se dedican a la ayuda personal de quienes tienen cualquier tipo de  carencia. Abrazar el mundo en una red  de caridad fue la ambición de un grupo de jóvenes que el 23 de abril de  1833 fundó la primera Conferencia de Caridad, liderado por Federico Ozanam, un joven estudiante de la Universidad de la Sorbona. En 1846 la SSVP llega a América y ya  en 1913 había 8000 Conferencias que agrupaban a 134.000 miembros en el mundo.\r\nHoy en día, la SSVP es una  verdadera multinacional de caridad, que combate la miseria con  sencillez y sin ruido; está ubicada en 146 países, con cerca de 720.000 los socios,  quienes conforman 45.440 Conferencias. Las dos terceras partes de las  Conferencias (equipos de trabajo) se encuentran en países en vías de  desarrollo, por lo que la Sociedad puede considerarse precursora en cuanto a la  ayuda fraterna en el tercer mundo.\r\nSus acciones solidarias van desde las visitas a  familias en situación de pobreza, hasta muchas otras actividades como la  entrega de alimentos, ropa, etc.', '                    ', '261.8                    ', 1);
